{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/9/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u56de\u907f\u3002", "discourse": ["\u2026\u2026\u2026\u2026", "\u2026\u2026\u2026\u2026", "\u30a2\u30f3\u30bf\u304c\u3001\u79c1\u306a\u3057\u3067\u3044\u3089\u308c\u308b\u3068\u601d\u3046\u306e!?\u79c1\u4ee5\u5916\u306e\u8ab0\u304c\u3001\u30a2\u30f3\u30bf\u306b\u75db\u307f\u3092\u4e0e\u3048\u3089\u308c\u308b\u306e\u3088\uff01\u666e\u901a\u306e\u5973\u3068\u4ed8\u304d\u5408\u3063\u3066\u3001\u6e80\u8db3\u51fa\u6765\u308b!?", "\u30af\u30e9\u30a6\u30b9\u2026\u2026\u3002\u8cb4\u65b9\u3001\u6c5a\u3089\u308f\u3057\u3044\u72ac\u3060\u3063\u305f\u306e\u306d", "\u30ed\u3001\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\u3063\u3001\u30aa\u30ec\u2026\u2026\u3001\u79c1\u306f\u3063\uff01", "\u9ed9\u308a\u306a\u3055\u3044\u3002\u72ac\u5982\u304d\u304c\u79c1\u306e\u540d\u3092\u53e3\u306b\u3059\u308b\u306a\u3069\u3001\u8a31\u3057\u307e\u305b\u3093", "\u3054\u4e3b\u4eba\u69d8\u3001\u3067\u3057\u3087\u3046\uff1f\u30ef\u30f3\u3061\u3083\u3093\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/8/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u885d\u6483\u3002(2)", "discourse": ["\u738b\u5973\u6bbf\u4e0b\u2026\u2026\uff1f\u5982\u4f55\u306a\u3055\u308c\u307e\u3057\u305f\u304b", "\u3044\u3001\u2026\u2026\u3044\u3048\u3002\u4f55\u3067\u3082\u3042\u308a\u307e\u305b\u3093", "\u59c9\u69d8\uff1f\u4f55\u51e6\u304b\u75db\u3044\u306e\u3067\u3059\u304b\u3063\uff1f", "\u304a\u898b\u82e6\u3057\u3044\u3068\u3053\u308d\u3092\u304a\u898b\u305b\u3057\u3066\u3057\u307e\u3044\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3002\u7b2c\u4e00\u738b\u5973\u3001\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u3067\u3054\u3056\u3044\u307e\u3059\u3002\u5144\u3001\u5f1f\u3068\u3082\u3069\u3082\u3001\u3069\u3046\u305e\u3088\u308d\u3057\u304f\u304a\u9858\u3044\u3044\u305f\u3057\u307e\u3059", "\u898b\u82e6\u3057\u3044\u2026\u2026\uff1f", "\u2026\u2026\u30aa\u30eb\u30bb\u30a4\u30f3\u69d8\uff1f", "\u5931\u793c\u3002\u2026\u2026\u3067\u3059\u304c\u305d\u308c\u306f\u3001\u5148\u7a0b\u306e\u52c7\u59ff\u306e\u4e8b\u3092\u4ef0\u3063\u3066\u304a\u3089\u308c\u308b\u306e\u3067\u3059\u304b\uff1f", "\u2026\u2026\u2026\u2026", "\u7533\u3057\u8a33\u3054\u3056\u3044\u307e\u305b\u3093\u3002\u30ec\u30c7\u30a3\u306b\u6065\u3092\u304b\u304b\u305b\u308b\u306a\u3069\u3001\u9a0e\u58eb\u306b\u3042\u308b\u307e\u3058\u304d\u884c\u70ba\u3002\u2026\u2026\u3067\u3059\u304c\u3001\u4e00\u3064\u3060\u3051\u3001\u5fa1\u7121\u793c\u3092\u627f\u77e5\u3067\u7533\u3057\u4e0a\u3052\u307e\u3059", "\u2026\u2026\uff1f", "\u5148\u7a0b\u306e\u8cb4\u65b9\u69d8\u3092\u898b\u3066\u3001\u81ea\u5206\u306f\u3053\u3046\u601d\u3044\u307e\u3057\u305f\u3002\u2015\u2015\u4f55\u3066\u683c\u597d\u826f\u3044\u59eb\u541b\u3060\u308d\u3046\u3001\u3068", "\u2026\u2026!!", "\u2026\u2026\u59c9\u69d8", "\u3063!!\u2026\u2026\u30e8\u30cf\u30f3", "\u2026\u2026\u2026\u2026\u4f55\u6545\u8d64\u304f\u306a\u308b\u306e\u3067\u3059\u304b\u3002\u59c9\u69d8", "\u305d\u3001\u308c\u306f\u2026\u2026", "\u30e8\u30cf\u30f3", "\u30ed\u30fc\u30bc\u3092\u82db\u3081\u308b\u306e\u306f\u6b62\u3081\u306a\u3055\u3044", "\u3067\u3059\u304c\u2026\u2026\u5144\u69d8\uff01", "\u6c17\u6301\u3061\u306f\u5206\u304b\u3089\u306a\u304f\u3082\u7121\u3044\u304c\u3001\u30ed\u30fc\u30bc\u3092\u8cac\u3081\u308b\u306e\u306f\u304a\u9580\u9055\u3044\u3060\u308d\u3046", "\u2026\u2026\u306f\u3044", "\u3053\u3053\u3067\u99c4\u3005\u3092\u3053\u306d\u3066\u30ed\u30fc\u30bc\u3092\u9589\u3058\u8fbc\u3081\u3066\u3082\u610f\u5473\u306f\u7121\u3044\u3068\u3001\u4eca\u306e\u304a\u524d\u306a\u3089\u5206\u304b\u308b\u306a\uff1f", "\u306f\u3044", "\u306a\u3089\u3070\u935b\u932c\u306b\u623b\u308b\u305e\u3002\u5b66\u3076\u4e8b\u306f\u3001\u6ca2\u5c71\u3042\u308b", "\u5f85\u305f\u305b\u3066\u3057\u307e\u3063\u3066\u3059\u307e\u306a\u304b\u3063\u305f\u306a\u3002\u623b\u308d\u3046\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8", "\u306f\u3063", "\u3067\u306f\u3001\u307e\u305f\u306a\u3002\u30ed\u30fc\u30bc\u3002\u9a12\u304c\u305b\u3066\u3059\u307e\u306a\u304b\u3063\u305f", "\u3042\u3001\u306f\u3044\u3002\u2026\u2026\u935b\u932c\u3001\u9811\u5f35\u3063\u3066\u4e0b\u3055\u3044\u306d", "\u2026\u2026\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/7/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u885d\u6483\u3002", "discourse": ["\u306d\u3048\u3055\u307e\u3063!!", "\u3075\u304e\u3083\u3063", "\u59c9\u69d8\u59c9\u69d8\u59c9\u69d8\u3063!!", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\u3001\u304a\u602a\u6211\u306f\uff1f", "\u5927\u4e08\u592b\u3088", "\u2026\u2026\u30e8\u30cf\u30f3", "\uff01", "\u935b\u932c\u306e\u9014\u4e2d\u3060\u3002\u623b\u308a\u306a\u3055\u3044", "\u3054\u304d\u3052\u3093\u3088\u3046\u3001\u30af\u30ea\u30b9\u5144\u69d8\u3002\u935b\u932c\u306e\u90aa\u9b54\u3092\u3057\u3066\u3057\u307e\u3063\u305f\u3088\u3046\u3067\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093", "\u304a\u524d\u306e\u305b\u3044\u3067\u306f\u306a\u3044\u3088\u3002\u30e8\u30cf\u30f3\u306f\u3001\u66ab\u304f\u304a\u524d\u306b\u4f1a\u3048\u306a\u304f\u3066\u5927\u5c64\u6c88\u3093\u3067\u3044\u305f\u304b\u3089\u306a", "\u30e8\u30cf\u30f3", "\u59c9\u69d8\u3063", "\u30e8\u30cf\u30f3\u3002\u304a\u5144\u69d8\u306b\u8b1d\u308a\u306a\u3055\u3044", "\u3048\u3063\u2026\u2026", "\u30af\u30ea\u30b9\u5144\u69d8\u306f\u3001\u304a\u5fd9\u3057\u3044\u4e2d\u3001\u6642\u9593\u3092\u5272\u3044\u3066\u8cb4\u65b9\u3068\u5171\u306b\u935b\u932c\u3057\u3066\u4e0b\u3055\u3063\u3066\u3044\u305f\u306e\u3002\u305d\u308c\u3092\u8cb4\u65b9\u306f\u6295\u3052\u51fa\u3057\u305f\u306e\u3088", "\u2026\u2026\u3054\u3001\u3081\u2026\u2026\u306a\u3055\u2026\u2026", "\u805e\u3053\u3048\u307e\u305b\u3093\u3002\u3061\u3083\u3093\u3068\u9854\u3092\u4e0a\u3052\u3066\u3001\u5144\u69d8\u306e\u65b9\u3092\u5411\u3044\u3066\u3001\u3082\u3046\u4e00\u5ea6", "\u3063\u2026\u2026", "\u3054\u3081\u3001\u306a\u3055\u2026\u2026", "\u3082\u3046\u4e00\u5ea6", "\u2026\u2026\u3054\u3081\u3093\u306a\u3055\u3044\u3063!!", "\u2026\u2026\u2026\uff1f\u2026\u2026!!!", "\u2026\u2026\u306b\u3044\u3001\u3055\u307e", "\uff1f\u2026\u2026\u3069\u3046\u3057\u305f\u3001\u30ed\u30fc\u30bc", "\u305d\u306e\u65b9\u3001\u306f\u2026\u2026", "\u3042\u3042\u3002\u5f7c\u306f\u3001\u79c1\u9054\u306e\u5263\u306e\u5e2b\u3067\u3001\u8fd1\u885b\u968a\u306b\u6240\u5c5e\u3057\u3066\u3044\u308b\u9a0e\u58eb\u3060", "\u3053\u306e\u3088\u3046\u306a\u59ff\u3067\u3054\u6328\u62f6\u3059\u308b\u3054\u7121\u793c\u3092\u304a\u8a31\u3057\u304f\u3060\u3055\u3044\u3002\u8fd1\u885b\u9a0e\u58eb\u56e3\u6240\u5c5e\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u30fb\u30d5\u30a9\u30f3\u30fb\u30aa\u30eb\u30bb\u30a4\u30f3\u3068\u7533\u3057\u307e\u3059\u3002\u5fa1\u5c0a\u9854\u3092\u62dd\u8b01\u3059\u308b\u6804\u8a89\u306b\u6d74\u3057\u307e\u3057\u305f\u308b\u4e8b\u3001\u8eab\u306b\u4f59\u308b\u5149\u6804\u306b\u5b58\u3058\u307e\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/6/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u596e\u95d8\u3002(2)", "discourse": ["\u6bcd\u69d8\u306e\u98df\u4e8b\u3001\u3067\u3059\u304b\uff1f", "\u305d\u3046\u3002\u91ce\u83dc\u4e2d\u5fc3\u306b\u3057\u3066\u6b32\u3057\u3044\u306e", "\u3067\u3082\u2026\u2026\u304a\u6bcd\u69d8\u306f\u91ce\u83dc\u304c\u2026\u2026", "\u3060\u304b\u3089\u3001\u91ce\u83dc\u5acc\u3044\u3067\u3082\u7f8e\u5473\u3057\u304f\u98df\u3079\u308c\u308b\u3088\u3046\u306a\u6599\u7406\u3092\u8003\u3048\u305f\u3044\u3068\u601d\u3063\u3066\u3044\u308b\u3093\u3060\u3051\u308c\u3069\u2026\u2026\u4f55\u304b\u826f\u3044\u6848\u306f\u3042\u308a\u307e\u305b\u3093\u304b\uff1f\u30e6\u30ea\u30a6\u30b9\u69d8", "\u5c0f\u98df\u306a\u65b9\u3060\u304b\u3089\u306d\u3002\u30b9\u30fc\u30d7\u304c\u4e00\u756a\u3068\u308a\u3084\u3059\u3044\u3068\u306f\u601d\u3046\u3093\u3060\u304c\u2026\u2026\u7fa9\u59c9\u4e0a\u306f\u305d\u308c\u3059\u3089\u3001\u3042\u307e\u308a\u597d\u307e\u308c\u306a\u3044\u3093\u3060\u3088", "\u5473\u4ed8\u3051\u306f\u3001\u3069\u3093\u306a\u3082\u306e\u3092\uff1f", "\u304a\u305d\u3089\u304f\u3001\u8584\u3044\u5869\u5473\u3060\u3051\u3060\u3068\u601d\u3044\u307e\u3059", "\u2026\u2026\u3042\uff01", "\u30e6\u30ea\u30a6\u30b9\u69d8\uff01", "\u4f55\u3067\u3057\u3087\u3046", "\u4ed6\u56fd\u306e\u8abf\u5473\u6599\u3092\u3001\u6271\u3063\u3066\u3044\u307e\u3059\u304b\uff1f", "\u52ff\u8ad6\u3067\u3059\u3002\u99b4\u67d3\u307f\u306e\u3042\u308b\u5869\u3084\u7802\u7cd6\u3082\u5404\u7a2e\u3001\u9162\u3084\u6cb9\u3082\u69d8\u3005\u306a\u7269\u3092\u53d6\u308a\u6271\u3063\u3066\u3044\u307e\u3059\u3002\u9b5a\u3092\u539f\u6599\u3068\u3057\u305f\u767a\u9175\u8abf\u5473\u6599\u3082\u6700\u8fd1\u53d6\u6271\u3044\u3092\u59cb\u3081\u307e\u3057\u305f", "\u3054\u89a7\u306b\u306a\u308a\u307e\u3059\u304b\uff1f", "\u662f\u975e\uff01", "\u305d\u308c\u3067\u30de\u30ea\u30fc\u69d8\u306f\u3001\u3044\u3064\u9803\u3001\u6211\u304c\u5bb6\u306e\u304a\u5ac1\u3055\u3093\u306b\u306a\u3063\u3066\u4e0b\u3055\u308b\u306e\u304b\u3057\u3089\uff1f", "\u2026\u2026\u2026\u2026\u3048\uff1f", "\u3061\u3087\u2026\u2026\u6bcd\u69d8\u3063!!", "\u53ef\u611b\u3044\u5a18\u304c\u51fa\u6765\u308b\u65e5\u304c\u5f85\u3061\u9060\u3057\u3044\u3063\u3066\u3001\u30e2\u30fc\u30ea\u30c3\u30c4\u3068\u826f\u304f\u8a71\u3059\u3093\u3067\u3059\u3002\u3042\u306e\u4eba\u3082\u30de\u30ea\u30fc\u69d8\u306e\u4e8b\u3092\u81ea\u5206\u306e\u5a18\u306e\u3088\u3046\u306b\u601d\u3063\u3066\u3044\u308b\u304b\u3089\u3001\u30de\u30ea\u30fc\u69d8\u306b\u4f3c\u5408\u3046\u7d20\u6674\u3089\u3057\u3044\u7537\u306b\u306a\u308b\u3088\u3046\u3001\u30b2\u30aa\u30eb\u30af\u3092\u935b\u3048\u76f4\u3055\u306a\u3051\u308c\u3070\u306a\u3089\u306a\u3044\u3063\u3066\u3001\u6700\u8fd1\u5f35\u308a\u5207\u3063\u3066\u3044\u308b\u3093\u3067\u3059\u3088", "\u6c17\u304c\u65e9\u3044\u3067\u3059\u3088\u3002\u7fa9\u59c9\u4e0a", "\u3042\u3089\u3001\u305d\u3046\u304b\u3057\u3089\uff1f", "\u305d\u3046\u3067\u3059\u3088\u3002\u738b\u5973\u6bbf\u4e0b\u306f\u8061\u660e\u3067\u3044\u3089\u3063\u3057\u3083\u308b\u304c\u3001\u307e\u3060\uff16\u6b73\u3002\u7d50\u5a5a\u306a\u3069\u3001\u305a\u3063\u3068\u5148\u306e\u8a71\u3092\u6301\u3061\u51fa\u3057\u3066\u3082\u3001\u56f0\u3089\u305b\u3066\u3057\u307e\u3046\u3060\u3051\u3067\u3057\u3087\u3046", "\u2026\u2026\u305d\u3046\u306d\u3002\u3054\u3081\u3093\u306a\u3055\u3044\u3001\u30de\u30ea\u30fc\u69d8\u3002\u56f0\u3089\u305b\u3066\u3057\u307e\u3046\u3064\u3082\u308a\u306f\u7121\u304b\u3063\u305f\u306e\u3060\u3051\u308c\u3069\u3001\u6025\u304e\u3059\u304e\u3066\u3057\u307e\u3044\u307e\u3057\u305f\u306d", "\u3044\u3044\u3048\u3002\u304a\u3070\u69d8\u306b\u5a18\u306e\u3088\u3046\u3068\u8a00\u3063\u3066\u3044\u305f\u3060\u3051\u3066\u3001\u51c4\u304f\u5b09\u3057\u3044\u3067\u3059", "\u305f\u3060\u3001\u79c1\u2026\u2026\u305d\u306e\u3001\u61a7\u308c\u3066\u3044\u308b\u65b9\u304c\u3001", "\u3048\u3063!?", "\u3048\u3063\uff01", "\u304a\u3084\u304a\u3084", "\u307e\u3041\uff01\u4e00\u4f53\u3069\u3093\u306a\u65b9\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/5/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u596e\u95d8\u3002", "discourse": ["\u7121\u4f5c\u6cd5\u3092\u304a\u8a31\u3057\u304f\u3060\u3055\u3044\u3002\u738b\u5973\u6bbf\u4e0b\u3002\u59bb\u306f\u4f53\u304c\u5f31\u304f\u3001\u5b63\u7bc0\u306e\u5909\u308f\u308a\u76ee\u306f\u4f53\u8abf\u3092\u5d29\u3057\u304c\u3061\u3067\u30d9\u30c3\u30c9\u304b\u3089\u51fa\u3089\u308c\u306a\u3044\u306e\u3067\u3059", "\u304a\u76ee\u306b\u304b\u304b\u308c\u3066\u5149\u6804\u3067\u3059\u3002\u30e2\u30fc\u30ea\u30c3\u30c4\u306e\u59bb\u3001\u30a8\u30de\u3068\u7533\u3057\u307e\u3059", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u3067\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/175/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u611f\u8b1d\u3002", "discourse": ["\u8fd1\u885b\u9a0e\u58eb\u56e3\u9577\u306e\u3068\u3053\u308d\u307e\u3067\u9001\u308b", "\u30aa\u30ec\u306f\uff1f", "\u305d\u306e\u5834\u3067\u300e\u5f85\u3066\u300f\u3060\u3002\u51fa\u6765\u306a\u3044\u306a\u3089\u6368\u3066\u3066\u304f\u304b\u3089", "\u2026\u2026\u79fb\u52d5\u3057\u3061\u3083\u3063\u305f\u306e\u304b\u3057\u3089\uff1f", "\u5165\u308c\u3070\uff1f", "\u3067\u3082\u3001\u8a71\u306e\u90aa\u9b54\u3092\u3057\u3061\u3083\u3046\u304b\u3082\u2026\u2026", "\u30a2\u30f3\u30bf\u306f\u805e\u304f\u6a29\u5229\u304c\u3042\u308b", "\u8cb4\u65b9\u306b\u306f\u5931\u671b\u3057\u307e\u3057\u305f", "\u5965\u69d8\u3092\u611b\u3057\u3066\u3089\u3063\u3057\u3083\u308b\u306e\u306f\u77e5\u3063\u3066\u304a\u308a\u307e\u3059\u3002\u5931\u3046\u304b\u3082\u3057\u308c\u306a\u3044\u3068\u3044\u3046\u6642\u306b\u60aa\u9b54\u306b\u56c1\u304b\u308c\u308c\u3070\u3001\u60d1\u3046\u6c17\u6301\u3061\u3082\u5206\u304b\u308b\u3002\u305d\u308c\u3067\u3082\u2026\u2026\u305d\u308c\u3067\u3082\u3001\u79c1\u306f\u8cb4\u65b9\u304c\u8a31\u305b\u306a\u3044\u3002\u8cb4\u65b9\u3092\u6155\u3046\u968a\u54e1\u9054\u3092\u8ff7\u3044\u306a\u304f\u5207\u308a\u6368\u3066\u3089\u308c\u308b\u306a\u3089\u3070\u3001\u4f55\u6545\u3001\u8cac\u4efb\u3042\u308b\u7acb\u5834\u306a\u3069\u53d7\u3051\u305f!?", "\u8cb4\u65b9\u306e\u7f6a\u306f\u3001\u8cb4\u65b9\u4e00\u4eba\u306e\u7f6a\u3067\u306f\u306a\u3044\u3002\u56fd\u738b\u965b\u4e0b\u306f\u516c\u6b63\u306a\u5224\u65ad\u3092\u3057\u3066\u304f\u3060\u3055\u308b\u3067\u3057\u3087\u3046\u3002\u3067\u3059\u304c\u3001\u5927\u591a\u6570\u306e\u4eba\u9593\u306f\u305d\u3046\u3067\u306f\u306a\u3044\u3002\u88cf\u5207\u308a\u8005\u306e\u7387\u3044\u3066\u3044\u305f\u968a\u304c\u3001\u4eca\u5f8c\u3001\u307e\u3068\u3082\u306a\u6271\u3044\u3092\u53d7\u3051\u3089\u308c\u308b\u3068\u672c\u6c17\u3067\u601d\u3063\u3066\u304a\u3089\u308c\u308b\u306e\u3067\u3059\u304b", "\uff01", "\u59eb\u541b", "\u6bbf\u4e0b\u2026\u2026", "\u3068\u308a\u3042\u3048\u305a\u3001\u3082\u3046\u5c11\u3057\u5c0f\u3055\u306a\u58f0\u3067\u306d\u3002\u8ab0\u304b\u306b\u805e\u3053\u3048\u3061\u3083\u307e\u305a\u3044\u3067\u3057\u3087", "\u30f4\u30a9\u30eb\u30bf\u30fc\u69d8\uff1f", "\u8cb4\u65b9\u69d8\u306e\u4fe1\u983c\u3092\u88cf\u5207\u308b\u5f62\u306b\u306a\u3063\u3066\u3057\u307e\u3063\u305f\u4e8b\u3001\u7533\u3057\u958b\u304d\u306e\u3057\u3088\u3046\u3082\u3054\u3056\u3044\u307e\u305b\u3093\u3002\u526f\u968a\u9577\u3068\u3044\u3046\u7acb\u5834\u306b\u3042\u308a\u306a\u304c\u3089\u3001\u7570\u5909\u306b\u6c17\u3065\u304b\u305a\u306b\u306e\u3046\u306e\u3046\u3068\u66ae\u3089\u3057\u3066\u3044\u305f\u81ea\u5206\u304c\u3001\u6065\u305a\u304b\u3057\u3044\u3002\u3053\u306e\u547d\u3092\u6367\u3052\u305f\u7a0b\u5ea6\u3067\u8d16\u3048\u308b\u7f6a\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u3069\u306e\u3088\u3046\u306a\u51e6\u5206\u3082\u559c\u3093\u3067\u304a\u53d7\u3051\u81f4\u3057\u307e\u3059", "\u8cb4\u65b9\u306e\u7f6a\u3067\u306f\u306a\u3044\u3067\u3057\u3087\u3046", "\u3044\u3044\u3048\u3002\u3059\u3050\u508d\u306b\u3044\u305f\u4e0a\u5b98\u306e\u88cf\u5207\u308a\u306b\u3055\u3048\u6c17\u4ed8\u304b\u306a\u3044\u306a\u3069\u3001\u8ecd\u4eba\u306b\u3042\u308b\u307e\u3058\u304d\u611a\u920d\u3055\u3002\u8cac\u4efb\u306f\u30a8\u30eb\u30f3\u30b9\u30c8\u30fb\u30d5\u30a9\u30f3\u30fb\u30ea\u30fc\u30d0\u30fc\u3068\u3001\u79c1\u3001\u30a4\u30b6\u30fc\u30af\u30fb\u30f4\u30a9\u30eb\u30bf\u30fc\u306b\u3042\u308a\u307e\u3059\u3002\u4eca\u3059\u3050\u306b\u3042\u306e\u7537\u306e\u9996\u3092\u65ac\u308a\u843d\u3068\u3057\u3001\u5df1\u306e\u9996\u3082\u63bb\u3063\u5207\u308c\u3068\u4ef0\u308b\u306a\u3089\u3070\u3001\u3059\u3050\u306b\u3067\u3082\u305d\u306e\u3088\u3046\u306b", "\u6b62\u3081\u3066\u304f\u3060\u3055\u3044\uff01", "\u30f4\u30a9\u30eb\u30bf\u30fc\u69d8\u3002\u3082\u3057\u8cb4\u65b9\u306b\u7f6a\u304c\u3042\u308b\u3068\u3044\u3046\u306e\u306a\u3089\u3001\u88c1\u304f\u306e\u306f\u79c1\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u305d\u3057\u3066\u540c\u3058\u304f\u3001\u30ea\u30fc\u30d0\u30fc\u69d8\u3092\u88c1\u304f\u306e\u3082\u8cb4\u65b9\u306e\u5f79\u76ee\u3067\u306f\u3042\u308a\u307e\u305b\u3093", "\u2026\u2026\u8cb4\u65b9\u69d8\u306e\u4ef0\u308b\u901a\u308a\u3067\u3059\u3002\u611f\u60c5\u7684\u306b\u306a\u3063\u3066\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f", "\u30ec\u30aa\u30f3\u69d8\u3001\u30ab\u30e9\u30b9", "\u60c5\u5831\u306f\u3001\u3069\u3053\u307e\u3067\u6d29\u308c\u3066\u3044\u308b\u3067\u3057\u3087\u3046\u304b\uff1f", "\u30a8\u30eb\u30f3\u30b9\u30c8\u306e\u5bb6\u4eba\u9054\u306b\u306f\u3001\u53e3\u5916\u3092\u7981\u3058\u3066\u304a\u304d\u307e\u3057\u305f\u3002\u30a8\u30eb\u30f3\u30b9\u30c8\u304c\u4fe1\u983c\u3057\u3066\u8a71\u3057\u305f\u4e8c\u4eba\u306f\u3001\u53e4\u304f\u304b\u3089\u30ea\u30fc\u30d0\u30fc\u5bb6\u306b\u4ed5\u3048\u3066\u3044\u308b\u8005\u9054\u3067\u3059\u306e\u3067\u3001\u8a00\u308f\u308c\u305a\u3068\u3082\u6d29\u3089\u3057\u305f\u308a\u306f\u3057\u306a\u3044\u3067\u3057\u3087\u3046\u304c", "\u30e9\u30d7\u30bf\u30fc\u306b\u3082\u60c5\u5831\u306f\u6d29\u308c\u3066\u306a\u3044\u306f\u305a\u3060\u3088\u3002\u30e9\u30fc\u30c6\u306f\u53e3\u5c01\u3058\u3082\u517c\u306d\u3066\u3001\u30e9\u30d7\u30bf\u30fc\u5074\u306e\u523a\u5ba2\u3092\u5168\u54e1\u6d88\u3057\u305f\u307f\u305f\u3044\u3060\u3057\u3001\u305d\u3082\u305d\u3082\u3042\u306e\u7537\u306f\u81ea\u5206\u3057\u304b\u4fe1\u7528\u3057\u3066\u3044\u306a\u3044\u304b\u3089\u3002\u7826\u5185\u3082\u3001\u57f7\u52d9\u5ba4\u5468\u8fba\u306b\u4eba\u5f71\u306f\u306a\u304b\u3063\u305f\u304b\u3089\u5927\u4e08\u592b\u3067\u3057\u3087", "\u3067\u3082\u3001\u63e1\u308a\u6f70\u305b\u306a\u3044\u3088", "\u2026\u2026\u5206\u304b\u3063\u3066\u3044\u308b\u308f", "\u304a\u305d\u3089\u304f\u3067\u3059\u304c\u3001\u30ea\u30fc\u30d0\u30fc\u69d8\u306e\u7f6a\u72b6\u306f\u56fd\u6c11\u306b\u767a\u8868\u3055\u308c\u307e\u305b\u3093", "\u3069\u306e\u3088\u3046\u306a\u51e6\u5206\u306b\u306a\u308b\u306b\u305b\u3088\u3001\u5225\u306e\u540d\u76ee\u3067\u516c\u8868\u3055\u308c\u308b\u306f\u305a\u3067\u3059", "\u3060\u3068\u3057\u305f\u3089\u3001\u968a\u54e1\u9054\u3092\u2026\u2026\u5b88\u308b\u3053\u3068\u304c\u51fa\u6765\u308b\u2026\u2026\uff1f", "\u30f4\u30a9\u30eb\u30bf\u30fc\u69d8\u306f\u5148\u7a0b\u3001\u79c1\u306e\u4fe1\u983c\u3092\u88cf\u5207\u3063\u305f\u3068\u304a\u3063\u3057\u3083\u3044\u307e\u3057\u305f\u3088\u306d\uff1f", "\u306f\u3044", "\u78ba\u304b\u306b\u3001\u30ea\u30fc\u30d0\u30fc\u69d8\u306f\u4e00\u5ea6\u3060\u3051\u63fa\u3089\u304e\u307e\u3057\u305f\u3002\u3067\u3059\u304c\u3001\u4e00\u5ea6\u3060\u3051\u3067\u3059", "\u4e00\u5ea6\u3067\u3082\u4e8c\u5ea6\u3067\u3082\u540c\u3058\u3053\u3068\u3067\u3059", "\u305d\u3046\u3001\u306a\u3093\u3067\u3057\u3087\u3046\u3051\u3069\u3002\u3067\u3082\u3001\u8cb4\u65b9\u9054\u306e\u5354\u529b\u306a\u304f\u3057\u3066\u306f\u3001\u79c1\u306f\u76ee\u7684\u3092\u6210\u3057\u9042\u3052\u3089\u308c\u306a\u304b\u3063\u305f\u306e\u3082\u4e8b\u5b9f\u306a\u3093\u3067\u3059", "\u305d\u308c\u306b\u3001\u56fd\u5883\u8b66\u5099\u968a\u306e\u7686\u3055\u3093\u304c\u5b88\u3063\u3066\u304f\u3060\u3055\u308b\u304b\u3089\u3001\u79c1\u9054\u306f\u5b89\u5fc3\u3057\u3066\u66ae\u3089\u3057\u3066\u3053\u3089\u308c\u305f\u306e\u3067\u3059", "\u4e00\u5ea6\u306e\u904e\u3061\u3067\u3082\u3001\u306a\u304b\u3063\u305f\u4e8b\u306b\u306f\u51fa\u6765\u307e\u305b\u3093\u3002\u3051\u308c\u3069\u540c\u3058\u3088\u3046\u306b\u3001\u8cb4\u65b9\u9054\u306e\u52a9\u529b\u3084\u529f\u7e3e\u3082\u3001\u306a\u304b\u3063\u305f\u4e8b\u306b\u306f\u306a\u3089\u306a\u3044", "\u5b88\u3063\u3066\u304f\u3060\u3055\u3063\u3066\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u2026\u2026\u3082\u3063\u305f\u3044\u306a\u3044\u3001\u304a\u8a00\u8449\u3067\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/174/", "subtitle": "\u6216\u308b\u5bc6\u5075\u306e\u907a\u61be\u3002", "discourse": ["\u305d\u308c\u3067\u3001\u30b3\u30a4\u30c4\u3068\u4e00\u7dd2\u306b\u3044\u305f\u8a33\u3060", "\u2026\u2026\u306f\u3044", "\u306a\u3041\u3001\u5a18\u3055\u3093", "\u2026\u2026\u306f\u3044", "\u30a2\u30f3\u30bf\u304c\u96c7\u7528\u3092\u53d7\u3051\u5165\u308c\u308b\u304b\u5426\u304b\u306e\u8fd4\u4e8b\u3092\u3001\u5373\u7b54\u3057\u306a\u304b\u3063\u305f\u3053\u3068\u306f\u8a55\u4fa1\u3059\u308b", "\u3048\uff1f", "\u5354\u529b\u3057\u3066\u304f\u308c\u305f\u306e\u306b\u3001\u653e\u308a\u6295\u3052\u308b\u4e8b\u306f\u51fa\u6765\u306a\u3044", "\u5143\u3044\u305f\u5834\u6240\u306b\u623b\u3057\u3066\u304d\u306a\u3055\u3044", "\u305d\u3093\u306a\uff01\u305d\u3093\u306a\u4e8b\u8a00\u308f\u306a\u3044\u3067\u3001\u304a\u6bcd\u3055\u2026\u2026\u30ab\u30e9\u30b9\uff01", "\u99c4\u76ee\u3060\u3002\u3069\u3046\u305b\u30aa\u30ec\u304c\u9762\u5012\u898b\u308b\u7fbd\u76ee\u306b\u306a\u308b\u3093\u3060\u304b\u3089", "\u7236\u69d8\u306b\u306f\u81ea\u5206\u3067\u8a00\u3046\u308f\u3002\u30ab\u30e9\u30b9\u306b\u9762\u5012\u306f\u304b\u3051\u306a\u3044\u304b\u3089\uff01", "\u308f\u3093", "\u30b3\u30a4\u30c4\u306f\u6614\u306e\u77e5\u308a\u5408\u3044\u3067\u306d\u3002\u305f\u3061\u306e\u60aa\u3055\u3082\u3088\u304f\u77e5\u3063\u3066\u3044\u308b\u3002\u3053\u3093\u306a\u5384\u4ecb\u306a\u5974\u3001\u30a2\u30f3\u30bf\u306e\u624b\u306b\u306f\u8ca0\u3048\u306a\u3044", "\u512a\u3057\u3052\u306a\u898b\u305f\u76ee\u306b\u9a19\u3055\u308c\u308b\u3068\u3001\u75db\u3044\u76ee\u306b\u3042\u3046\u306e\u304c\u30aa\u30c1\u3060", "\u2026\u2026\u898b\u305f\u76ee\u901a\u308a\u306e\u7d33\u58eb\u3060\u3068\u306f\u601d\u3063\u3066\u3044\u306a\u3044\u308f", "\u9177\u3044\u306a\u3041\u3001\u304a\u5b22\u3055\u3093\u3002\u30aa\u30ec\u306f\u541b\u306b\u5bfe\u3057\u3066\u306f\u3001\u8aa0\u5b9f\u306a\u7d33\u58eb\u306e\u3064\u3082\u308a\u3060\u3088", "\u8aa0\u5b9f\u306a\u7d33\u58eb\u306f\u4eba\u3092\u8a66\u3057\u305f\u308a\u3057\u307e\u305b\u3093", "\u3058\u3083\u3042\u3001\u8a02\u6b63\u3002\u3053\u308c\u304b\u3089\u5148\u306f\u541b\u306b\u3060\u3051\u306f\u8aa0\u5b9f\u3067\u3042\u308b\u3068\u8a93\u304a\u3046", "\uff01", "\u2026\u2026\u76f8\u5909\u308f\u3089\u305a\u3001\u6027\u683c\u60aa\u3044", "\u8912\u3081\u8a00\u8449\u3068\u3057\u3066\u53d7\u3051\u53d6\u3063\u3066\u304a\u304f\u306d", "\u3069\u3093\u3060\u3051\u524d\u5411\u304d\u306a\u3093\u3060\u3088", "\u2026\u2026\u5a18\u3055\u3093", "\u306f\u3044\uff1f", "\u30b3\u30a4\u30c4\u306f\u30aa\u30ec\u304c\u9810\u304b\u308b", "\u30a2\u30f3\u30bf\u306e\u624b\u5143\u306b\u8fd4\u305b\u308b\u304b\u3069\u3046\u304b\u306f\u3001\u30a2\u30f3\u30bf\u306e\u304a\u7236\u69d8\u6b21\u7b2c\u3060\u3068\u601d\u3063\u3066", "\u79c1\u306f\u3001\u5fc5\u305a\u8cb4\u65b9\u3092\u8fce\u3048\u306b\u884c\u304f\u3068\u306f\u8a00\u3048\u306a\u3044\u3002\u305d\u308c\u3067\u3082\u3044\u3044\uff1f", "\u3082\u3061\u308d\u3093\u3002\u304a\u8cb7\u3044\u5f97\u3060\u3063\u3066\u4e8b\u3092\u3001\u3061\u3083\u3093\u3068\u8a3c\u660e\u3057\u3066\u304f\u308b\u304b\u3089\u5f85\u3063\u3066\u3044\u3066", "\u3055\u3066\u3001\u3058\u3083\u3042\u5b9c\u3057\u304f\u304a\u9858\u3044\u3057\u307e\u3059\u306d\u3002\u5148\u8f29\uff1f", "\u305d\u308c\u306b\u3057\u3066\u3082\u3001\u4e45\u3057\u3076\u308a\u3060\u306d\u3001\u30ab\u30e9\u30b9\u3002\u307e\u3055\u304b\u751f\u304d\u3066\u3044\u308b\u3068\u306f\u601d\u308f\u306a\u304b\u3063\u305f", "\u304a\u9670\u69d8\u3067\u306a\u3093\u3068\u304b\u3002\u6bba\u3057\u3066\u3082\u6b7b\u306a\u306a\u305d\u3046\u306a\u30a2\u30f3\u30bf\u3068\u9055\u3063\u3066\u3001\u7e4a\u7d30\u3060\u304b\u3089\u306d", "\u3042\u306f\u306f\u3001\u9762\u767d\u30fc\u3044\u3002\u6614\u306e\u541b\u306a\u3089\u3068\u3082\u304b\u304f\u3001\u4eca\u306e\u541b\u306f\u30aa\u30ec\u3068\u5927\u5dee\u306a\u3044\u304f\u3089\u3044\u56f3\u592a\u304f\u306a\u3063\u3066\u3044\u308b\u3058\u3083\u306a\u3044\u304b", "\u6bba\u3055\u308c\u305f\u3044\u306e\uff1f", "\u307e\u3060\u541b\u306b\u306f\u6bba\u305b\u306a\u3044\u3068\u601d\u3046\u3088", "\u2026\u2026\u3055\u3063\u3055\u3068\u304f\u305f\u3070\u308c\u3001\u8001\u5bb3"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/173/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u4ef2\u88c1\u3002", "discourse": ["\u30ab\u30e9\u30b9!?\u8aa4\u89e3\u3060\u3063\u3066\u8a00\u3063\u3066\u3044\u308b\u3067\u3057\u3087\u3046\uff01", "\u5927\u4e08\u592b\u3001\u8aa4\u89e3\u3058\u3083\u306a\u3044\u304b\u3089", "\u4f55\u304c\u8aa4\u89e3\u3058\u3083\u306a\u3044\u306e!?", "\u305d\u308c\u306f\u81ea\u5206\u3067\u8003\u3048\u3066", "\u3048\u30fc\u3063\u3068\u3001\u3048\u30fc\u3063\u3068\u3001\u30e9\u30fc\u30c6\u306f\u6575\u3058\u3083\u306a\u3044\u2026\u2026\u305d\u3046\uff01\u6575\u3058\u3083\u306a\u3044\u306e\uff01", "\u5374\u4e0b", "\u3048\u3048\u3063!?", "\u76f8\u5909\u308f\u3089\u305a\u77ed\u6c17\u3060\u306d\u30fc\u3002\u3061\u3087\u3063\u3068\u306f\u304a\u5b22\u3055\u3093\u306e\u8a00\u3044\u5206\u3092\u805e\u3044\u3066\u3042\u3052\u306a", "\u805e\u304f\u5fc5\u8981\u306f\u306a\u3044\u3002\u3069\u3046\u305b\u3001\u304a\u524d\u304c\u8af8\u60aa\u306e\u6839\u6e90\u3060", "\u307e\u3041\u3001\u9593\u9055\u3063\u3066\u306f\u306a\u3044", "\u6bba\u3059", "\u2026\u2026\u6b62\u3081\u307e\u3059\u304b\uff1f", "\u826f\u3044\u306e\u3067\u3059\u304b\uff1f", "\u306a\u3093\u304b\u3001\u3058\u3083\u308c\u5408\u3063\u3066\u3044\u308b\u3088\u3046\u306b\u3057\u304b\u898b\u3048\u306a\u304f\u306a\u3063\u3066\u304d\u307e\u3057\u305f", "\u672c\u6c17\u3067\u6b62\u3081\u3066", "\u3058\u3083\u3042\u3001\u8cb4\u65b9\u3082\u6b62\u3081\u3066\u3002\u3061\u3083\u3093\u3068\u79c1\u306e\u8a71\u3092\u805e\u3044\u3066\u306d\uff1f", "\u2026\u2026\u2026\u2026", "\u3059\u3054\u3044\u306d\u3001\u304a\u5b22\u3055\u3093\u3002\u3061\u3083\u3093\u3068\u624b\u7db1\u3092\u63e1\u3063\u3066\u308b\u3093\u3060", "\u305d\u3046\u898b\u3048\u308b\u306e\u306a\u3089\u3001\u8cb4\u65b9\u306f\u304a\u533b\u8005\u69d8\u306b\u304b\u304b\u308b\u3079\u304d\u3060\u308f", "\u3055\u3059\u304c\u3001\u30aa\u30ec\u306e\u5fa1\u4e3b\u4eba\u69d8\u3060", "\u2026\u2026\u306f\uff1f", "\u306d\u3047\u3001\u305d\u3053\u306e\u5a18\u3055\u3093", "\u59eb\u3055\u3093", "\u3069\u3046\u3044\u3046\u8a33\u306a\u306e\u304b\u3001\u805e\u304b\u305b\u3066\u304f\u308c\u308b\uff1f", "\u2026\u2026\u306f\u3041\u3044"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/172/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u6df7\u6c8c\u3002", "discourse": ["\u304a\u5f85\u305f\u305b\u81f4\u3057\u307e\u3057\u305f", "\u884c\u304d\u307e\u3057\u3087\u3046", "\u2026\u2026\u3044\u3044\u306e\u3067\u3059\u304b", "\u5225\u308c\u306f\u6e08\u307e\u305b\u307e\u3057\u305f\u3002\u5f8c\u306f\u4fe1\u983c\u3067\u304d\u308b\u5bb6\u4eba\u306b\u4efb\u305b\u307e\u3059", "\u5bb6\u4eba\u306b\u306f\u8aac\u660e\u3092\u3057\u305f\u306e\u304b\uff1f", "\u4ee3\u8868\u3057\u3066\u4e8c\u4eba\u307b\u3069\u306b\u4f1d\u3048\u305f\u3002\u30c6\u30a3\u30a2\u30ca\u4ed8\u304d\u306e\u4f8d\u5973\u306b\u306f\u3001\u5f37\u70c8\u306a\u306e\u3092\u4e00\u767a\u8cb0\u3063\u305f\u3088", "\u3044\u3044\u6c17\u5473\u3060", "\u2026\u2026\u304a\u524d\u304c\u6368\u3066\u3088\u3046\u3068\u3057\u3066\u3044\u305f\u3082\u306e\u306e\u91cd\u307f\u3092\u3001\u3061\u3083\u3093\u3068\u565b\u307f\u7de0\u3081\u308d", "\u672c\u5f53\u306b\u306a", "\u6bbf\u4e0b", "\u3048\u2026\u2026", "\u6b62\u3081\u3066\u304f\u3060\u3055\u3063\u3066\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3057\u305f", "\uff01", "\u611a\u304b\u306a\u30aa\u30ec\u306f\u8272\u3093\u306a\u3082\u306e\u3092\u50b7\u3064\u3051\u307e\u3057\u305f\u304c\u3001\u8cb4\u65b9\u69d8\u306e\u304a\u9670\u3067\u6700\u5f8c\u306e\u4e00\u6b69\u3067\u8e0f\u307f\u6b62\u307e\u308b\u4e8b\u304c\u51fa\u6765\u307e\u3057\u305f\u3002\u5fc3\u3088\u308a\u3001\u611f\u8b1d\u81f4\u3057\u307e\u3059", "\u305d\u3001\u305d\u3093\u306a\u7acb\u6d3e\u306a\u4e8b\u306f\u3057\u3066\u3044\u307e\u305b\u3093", "\u3042\u306e\u6642\u306e\u6bbf\u4e0b\u306f\u3001\u5927\u5c64\u52c7\u307e\u3057\u304b\u3063\u305f\u3002\u75fa\u308c\u307e\u3057\u305f\u3088", "\u6bbf\u4e0b\u3068\u59bb\u306e\u304a\u9670\u3067\u76ee\u304c\u9192\u3081\u307e\u3057\u305f\u3002\u3082\u3046\u99ac\u9e7f\u306a\u771f\u4f3c\u306f\u3057\u306a\u3044\u3068\u3001\u304a\u7d04\u675f\u81f4\u3057\u307e\u3059", "\u30ea\u30fc\u30d0\u30fc\u69d8\u2026\u2026", "\u305d\u308c\u3068\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8", "\u2026\u2026\u306a\u3093\u3060", "\u4f55\u304c\u3042\u308d\u3046\u3068\u3082\u3001\u4eca\u5f8c\u3001\u30aa\u30ec\u306f\u6700\u671f\u307e\u3067\u751f\u304d\u629c\u304f\u3002\u81ea\u5206\u52dd\u624b\u306b\u547d\u3092\u7d76\u3063\u305f\u308a\u3057\u306a\u3044\u3002\u2026\u2026\u898b\u5c4a\u3051\u3066\u3082\u3089\u3048\u305f\u3089\u3001\u5b09\u3057\u3044", "\u30de\u30ea\u30fc\u69d8\u3063\uff01", "\u304a\u304b\u3057\u3044\u306a\u3002\u5168\u54e1\u59cb\u672b\u3057\u305f\u304b\u3089\u3001\u8ffd\u624b\u304c\u304b\u304b\u308b\u306b\u3057\u3066\u3082\u3001\u3082\u3046\u5c11\u3057\u9045\u3044\u3068\u601d\u3063\u305f\u3093\u3060\u3051\u3069", "\u3057\u304b\u3082\u3001\u306a\u3093\u304b\u61d0\u304b\u3057\u3044\u611f\u3058\u3059\u308b\u3093\u3060\u3051\u3069\u306a\u3002\u6c17\u306e\u6240\u70ba\uff1f", "\u6c17\u306e\u6240\u70ba\u3060\u3063\u305f\u3089\u3001\u826f\u304b\u3063\u305f\u306e\u306b\u306a\u3002\u3053\u3053\u3067\u3055\u3088\u306a\u3089\u3060\u3001\u30e9\u30fc\u30c6", "\u5f85\u3063\u3066\u3001\u30ab\u30e9\u30b9\uff01\u305d\u308c\u8aa4\u89e3\u3060\u3068\u601d\u3046!!"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/171/", "subtitle": "\u8b66\u5099\u968a\u9577\u306e\u615f\u54ed\u3002", "discourse": ["\u30c6\u30a3\u30a2\u30ca", "\u30c6\u30a3\u30a2\u30ca\u2026\u2026\u30c6\u30a3\u30cb\u30fc", "\u30c6\u30a3\u30cb\u30fc\u2026\u2026", "\u65e6\u90a3\u69d8", "\u3053\u3061\u3089\u3092\u3001\u5965\u69d8\u304b\u3089\u304a\u9810\u304b\u308a\u3057\u3066\u304a\u308a\u307e\u3057\u305f", "\u2026\u2026\u30c6\u30a3\u30cb\u30fc\u304b\u3089\uff1f", "\u2026\u2026\u300e\u6700\u611b\u306e\u65e6\u90a3\u69d8\u3001\u30a8\u30eb\u30f3\u30b9\u30c8\u3078\u300f", "\u2026\u2026\u300e\u3067\u3082\u5b9f\u306f\u3053\u306e\u624b\u7d19\u3092\u66f8\u3044\u305f\u306e\u304c\u3001\u4e8c\u5341\u901a\u76ee\u3060\u3068\u77e5\u3063\u305f\u3089\u8cb4\u65b9\u306f\u3069\u3093\u306a\u9854\u3092\u3059\u308b\u304b\u3057\u3089\uff1f\u300f", "\u300e\u3067\u3082\u79c1\u306f\u3001\u6562\u3048\u3066\u5b63\u7bc0\u306e\u8a71\u984c\u3092\u907f\u3051\u308b\u306e\u3092\u6b62\u3081\u307e\u3057\u305f\u3002\u5b8c\u74a7\u306a\u624b\u7d19\u3092\u66f8\u304d\u4e0a\u3052\u308b\u3088\u308a\u3082\u3001\u4f55\u901a\u7834\u308a\u6368\u3066\u3089\u308c\u308b\u304b\u3068\u3044\u3046\u65b9\u5411\u3078\u3068\u3001\u76ee\u6a19\u304c\u5909\u308f\u3063\u3066\u3057\u307e\u3063\u305f\u306e\u3067\u3059\u300f\u2026\u2026\uff1f\u30c6\u30a3\u30cb\u30fc\u306f\u76f8\u5909\u308f\u3089\u305a\u3001\u601d\u3044\u3082\u5bc4\u3089\u306a\u3044\u4e8b\u3092\u3084\u308a\u51fa\u3059\u306a\u3041", "\u300e\u6b21\u304b\u3089\u306f\u3001\u5225\u308c\u306e\u624b\u7d19\u3067\u306f\u306a\u304f\u8cb4\u65b9\u3078\u306e\u604b\u6587\u3092\u3057\u305f\u305f\u3081\u307e\u3057\u3087\u3046\u3002\u305d\u3057\u3066\u7834\u3089\u305a\u306b\u3068\u3063\u3066\u304a\u3044\u3066\u300f\u2026\u2026", "\u30c6\u30a3\u30cb\u30fc\u2026\u2026\u3063\uff01\u30c6\u30a3\u30a2\u30ca\u3001\u30c6\u30a3\u30a2\u30ca\u2026\u2026!!"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/170/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u54c0\u60c5\u3002", "discourse": ["\u3063\u3001\u3050", "\u59eb\u541b\u3001\u5927\u4e08\u592b\u3067\u3059\u304b", "\u5e73\u6c17\u3067\u3059", "\u30e9\u30fc\u30c6\u3001\u8cb4\u65b9\u306f\u2026\u2026", "\u30aa\u30ec\u306f\u7559\u5b88\u756a\u3057\u3068\u304f\u3088\u3002\u3053\u3053\u3067\u99ac\u3068\u5f85\u3063\u3066\u308b\u306d", "\u623b\u3063\u305f\u305e\uff01", "\u30b9\u30f4\u30a7\u30f3\u3001\u3044\u306a\u3044\u306e\u304b!?", "\u65e6\u90a3\u69d8\u2026\u2026\u3063", "\u30b9\u30f4\u30a7\u30f3\uff01\u30c6\u30a3\u30a2\u30ca\u306f!?", "\u5965\u69d8\u306f\u2026\u2026\u3063", "\u30de\u30ea\u30fc\u69d8\uff01", "\u3060\u3044\u3001\u3058\u3087\u3046\u3076\u3001\u3067\u3059", "\u2026\u2026\u305d\u3046\u304b", "\u59bb\u306b\u2026\u2026\u30c6\u30a3\u30cb\u30fc\u306b\u4f1a\u3063\u3066\u304f\u308b\u3088", "\u2026\u2026\u304a\u5ba2\u69d8\u3092\u3082\u3066\u306a\u3057\u3082\u305b\u305a\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3002\u304a\u98f2\u307f\u7269\u3092\u3054\u7528\u610f\u81f4\u3057\u307e\u3059\u306e\u3067\u3001\u3069\u3046\u305e\u3053\u3061\u3089\u3078", "\u3069\u3046\u304b\u3001\u304a\u6c17\u9063\u3044\u306a\u304f", "\u52d5\u3044\u3066\u3044\u305f\u65b9\u304c\u3001\u6c17\u304c\u7d1b\u308c\u308b\u306e\u3067\u3059", "\u59eb\u541b", "\u5ea7\u308a\u307e\u3057\u3087\u3046", "\u2026\u2026\u3063", "\u59eb\u541b", "\u8cb4\u65b9\u306f\u8cb4\u65b9\u306b\u51fa\u6765\u308b\u6700\u5584\u3092\u5c3d\u304f\u3057\u305f", "\u3063\u2026\u2026\uff01", "\u50b7\u3064\u304f\u5ea6\u306b\u3001\u81ea\u5206\u3092\u8cac\u3081\u308b\u306e\u306f\u6b62\u3081\u3066\u304f\u3060\u3055\u3044\u3002\u3082\u3063\u3068\u3001\u4f55\u304b\u51fa\u6765\u305f\u306f\u305a\u3060\u306a\u3093\u3066\u3001\u5168\u3066\u3092\u80cc\u8ca0\u308f\u306a\u304f\u3066\u3044\u3044\u3093\u3067\u3059\u3002\u8cb4\u65b9\u306f\u8cb4\u65b9\u81ea\u8eab\u306b\u3060\u3051\u53b3\u3057\u3059\u304e\u308b", "\u2026\u2026\u30a8\u30eb\u30f3\u30b9\u30c8\u306e\u75db\u307f\u3082\u82e6\u3057\u307f\u3082\u3001\u5965\u65b9\u306e\u601d\u3044\u3082\u3001\u30aa\u30ec\u9054\u306b\u306f\u5206\u304b\u308a\u307e\u305b\u3093\u3002\u4e8c\u4eba\u304c\u4e92\u3044\u306b\u5411\u3051\u305f\u601d\u3044\u306f\u3001\u4e8c\u4eba\u3060\u3051\u306e\u3082\u306e\u3060", "\u30aa\u30ec\u9054\u306b\u51fa\u6765\u308b\u4e8b\u306f\u3001\u9759\u304b\u306b\u5f85\u3064\u4e8b\u3002\u2026\u2026\u305d\u308c\u3060\u3051\u3067\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/169/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u6f14\u6280\u3002", "discourse": ["\u2026\u2026\u8ab0\u304b\u6765\u308b", "\u968a\u9577\u3063\u3001\u63a2\u3057\u307e\u3057\u305f!!", "\u7826\u306b\u9023\u7d61\u304c\u5165\u308a\u307e\u3057\u305f\uff01\u81f3\u6025\u3001\u3054\u81ea\u5b85\u306b\u304a\u623b\u308a\u304f\u3060\u3055\u3044\uff01\u5965\u69d8\u304c\u2026\u2026\u3063\uff01", "\u3063\u2026\u2026\uff01", "\u2026\u2026\u305d\u3046\u304b", "\u968a\u9577\uff1f", "\u30de\u30ea\u30fc\u69d8", "\u3053\u306e\u307e\u307e\u7826\u3078\u623b\u2026\u2026", "\u308f\u3001\u308f\u308f\u79c1\u3001\u75b2\u308c\u307e\u3057\u305f\u3063\uff01", "\u3048\u3063\u3068\u3001\u2026\u2026\u75b2\u308c\u305f\u306e\u3067\u3001\u3082\u3046\u52d5\u304d\u305f\u304f\u306a\u3044\u3067\u3059", "\u2026\u2026\u99ac\u4e0a\u3067\u306f\u81ea\u5206\u304c\u652f\u3048\u3066\u304a\u308a\u307e\u3059\u306e\u3067\u3001\u5bc4\u308a\u304b\u304b\u3063\u3066\u304a\u4f11\u307f\u304f\u3060\u3055\u3044\u3002\u7826\u307e\u3067\u306f\u6642\u9593\u304c\u304b\u304b\u308a\u307e\u3059\u304c\u3001\u306a\u308b\u3079\u304f\u9759\u304b\u306b\u9032\u307f\u307e\u3059\u306e\u3067\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u304c\u3054\u8f9b\u62b1\u3092", "\u3048\u3063\u3001\u672c\u5f53\u306b\u2026\u2026\u3067\u306f\u306a\u304f\uff01\u4e00\u523b\u3082\u65e9\u304f\u3001\u6a2a\u306b\u306a\u3063\u3066\u7720\u308a\u305f\u3044\u3093\u3067\u3059\uff01", "\u3067\u3082\u8fd1\u304f\u306e\u6751\u306e\u5bbf\u5c4b\u306f\u3001\u307e\u3060\u958b\u3044\u3066\u3044\u306a\u3044\u3067\u3057\u3087\u3046\u3057\u3002\u3069\u3046\u3057\u305f\u3089\u3044\u3044\u304b\u3057\u3089", "\u305d\u3046\u3044\u3048\u3070\u7826\u3088\u308a\u3082\u30ea\u30fc\u30d0\u30fc\u69d8\u306e\u3054\u81ea\u5b85\u306e\u65b9\u304c\u3001\u3053\u3053\u304b\u3089\u8fd1\u3044\u306e\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u304b\uff1f", "\u5c11\u3057\u3060\u3051\u3001\u4f11\u61a9\u3055\u305b\u3066\u3044\u305f\u3060\u3044\u3066\u3082\u5b9c\u3057\u3044\u3067\u3057\u3087\u3046\u304b\uff1f", "\u3042\u308a\u304c\u3068\u3046\u3001\u3054\u3056\u3044\u307e\u3059", "\u8cb4\u65b9\u306f\u3001\u512a\u3057\u3059\u304e\u308b", "\u306a\u3093\u306e\u4e8b\u3067\u3057\u3087\u3046\uff1f\u79c1\u306f\u3001\u4f11\u307f\u305f\u3044\u3068\u6211\u5118\u3092\u8a00\u3063\u305f\u3060\u3051\u3067\u3059\u3088\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/168/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u7948\u308a\u3002", "discourse": ["\u306a\u308b\u307b\u3069\u3002\u3069\u306e\u9053\u30aa\u30ec\u306f\u3001\u8a70\u3093\u3067\u3044\u305f\u3063\u3066\u8a33\u304b", "\u3093\u30fc\u2026\u2026\u6700\u521d\u306b\u968a\u9577\u3055\u3093\u3092\u52e7\u8a98\u3057\u306b\u884c\u3063\u305f\u6642\u3001\u8cb4\u65b9\u306f\u30aa\u30ec\u306e\u8a98\u3044\u3092\u65ad\u3063\u305f\u3067\u3057\u3087\u3046\uff1f\u3042\u306e\u6642\u306f\u30aa\u30ec\u3082\u307e\u3060\u3001\u30e9\u30d7\u30bf\u30fc\u3092\u88cf\u5207\u308b\u3068\u6c7a\u3081\u3066\u306f\u3044\u306a\u304b\u3063\u305f\u3088", "\u5584\u653f\u3092\u65bd\u3059\u56fd\u738b\u306b\u3001\u8aa0\u5b9f\u306a\u738b\u592a\u5b50\u3002\u8ce2\u3044\u7b2c\u4e8c\u738b\u5b50\u306b\u3001\u6c11\u3092\u611b\u3059\u308b\u5fc3\u512a\u3057\u3044\u738b\u5973\u3002\u305d\u3057\u3066\u5fe0\u5b9f\u306a\u9a0e\u58eb\u3068\u5e78\u305b\u305d\u3046\u306a\u56fd\u6c11\u9054\u3002\u30cd\u30fc\u30d9\u30eb\u306f\u30aa\u30ec\u306b\u3068\u3063\u3066\u7406\u60f3\u306e\u56fd\u3060\u3002\u968a\u9577\u3055\u3093\u304c\u30aa\u30ec\u306e\u8a98\u3044\u3092\u8df3\u306d\u9664\u3051\u305f\u306e\u3092\u898b\u3066\u3001\u307e\u3059\u307e\u3059\u601d\u3063\u305f\u3002\u3053\u306e\u7406\u60f3\u90f7\u304c\u58ca\u3055\u308c\u308b\u3053\u3068\u306f\u306a\u3044\u3002\u5fa1\u4f3d\u567a\u304c\u3081\u3067\u305f\u3057\u3001\u3081\u3067\u305f\u3057\u3067\u7d42\u308f\u308b\u307f\u305f\u3044\u306b", "\u306a\u306b\u304b\u8a00\u3044\u305f\u305d\u3046\u306a\u9854\u3060\u306d\u3001\u304a\u5b22\u3055\u3093", "\u8cb4\u65b9\u304c\u8a00\u3044\u305f\u3044\u3053\u3068\u306f\u3001\u306a\u3093\u3068\u306a\u304f\u5206\u304b\u308b\u3088\u3002\u7406\u60f3\u90f7\u306a\u3093\u3066\u5b58\u5728\u3057\u306a\u3044\u3063\u3066\u3001\u8a00\u3044\u305f\u3044\u3093\u3067\u3057\u3087\u3046\uff1f\u30aa\u30ec\u3082\u305d\u308c\u306f\u5206\u304b\u3063\u3066\u3044\u308b\u3088\u3002\u30cd\u30fc\u30d9\u30eb\u306b\u3082\u6697\u90e8\u306f\u3042\u308b\u3002\u305d\u308c\u3067\u3082\u30aa\u30ec\u306f\u3001\u30cd\u30fc\u30d9\u30eb\u3092\u7f8e\u3057\u3044\u3068\u601d\u3046\u3093\u3060", "\u3068\u3053\u308d\u304c\u3001\u968a\u9577\u3055\u3093\u304c\u88cf\u5207\u308b\u6c7a\u610f\u3092\u3057\u3066\u3057\u307e\u3063\u305f", "\u3053\u306e\u307e\u307e\u3058\u3083\u3001\u60aa\u306e\u738b\u56fd\u306b\u7406\u60f3\u90f7\u304c\u58ca\u3055\u308c\u308b\u3002\u3067\u3082\u3044\u304f\u3089\u7406\u60f3\u90f7\u306e\u5371\u6a5f\u3060\u304b\u3089\u3063\u3066\u3001\u8584\u6c5a\u308c\u305f\u6697\u6bba\u8005\u304c\u624b\u3092\u8cb8\u3059\u3068\u304b\u3001\u304a\u304b\u3057\u3044\u3067\u3057\u3087\u3002\u305d\u3093\u306a\u5fa1\u4f3d\u567a\u805e\u3044\u305f\u3053\u3068\u306a\u3044", "\u30aa\u30ec\u306b\u306f\u4f55\u3082\u51fa\u6765\u306a\u3044\u3002\u305f\u3060\u4e8b\u614b\u306e\u6210\u308a\u884c\u304d\u3092\u3001\u6700\u524d\u5217\u3067\u773a\u3081\u308b\u3060\u3051\u3002\u305d\u3046\u601d\u3063\u3066\u3044\u305f\u3002\u2026\u2026\u304a\u5b22\u3055\u3093\u306e\u6b63\u4f53\u3092\u3001\u77e5\u308b\u307e\u3067\u306f", "\u308f\u305f\u3057\u306e\u3001\u6b63\u4f53\uff1f", "\u9ed2\u7345\u5b50\u5c06\u8ecd\u3068\u4e00\u7dd2\u306b\u738b\u90fd\u304b\u3089\u304d\u305f\u5973\u306e\u5b50\u3002\u4e00\u77ac\u3001\u9ad8\u8cb4\u306a\u5b58\u5728\u3092\u601d\u3044\u6d6e\u304b\u3079\u305f\u3051\u308c\u3069\u3001\u3059\u3050\u306b\u6253\u3061\u6d88\u3057\u305f\u3002\u9aea\u306e\u8272\u304c\u9055\u3046\u3057\u3001\u306a\u306b\u3088\u308a\u738b\u5973\u69d8\u304c\u81ea\u3089\u5371\u967a\u306b\u98db\u3073\u8fbc\u3080\u308f\u3051\u304c\u306a\u3044\u3002\u304a\u59eb\u69d8\u306f\u5854\u306e\u4e0a\u304b\u57ce\u3067\u3001\u738b\u5b50\u306e\u8fce\u3048\u3092\u5f85\u3064\u3060\u3051\u306e\u5b58\u5728\u306e\u306f\u305a\u3060", "\u305d\u308c\u306a\u306e\u306b\u3001\u8cb4\u65b9\u306f\u307e\u3055\u304b\u306e\u738b\u5973\u69d8\u3060\u3063\u305f\u3002\u5bd2\u3044\u4e2d\u3001\u9f3b\u3092\u771f\u3063\u8d64\u306b\u3057\u3066\u3001\u4e57\u308a\u6163\u308c\u306a\u3044\u99ac\u306b\u63fa\u3089\u308c\u7d9a\u3051\u3066\u30d5\u30e9\u30d5\u30e9\u306b\u306a\u308a\u306a\u304c\u3089\u3001\u6ce3\u304d\u8a00\u4e00\u3064\u8a00\u308f\u305a\u306b\u5192\u967a\u3092\u7d9a\u3051\u305f\u3002\u305d\u3093\u306a\u5fa1\u4f3d\u567a\u3001\u805e\u3044\u305f\u3053\u3068\u304c\u306a\u3044", "\u3067\u3082\u3001\u305d\u3093\u306a\u898f\u683c\u5916\u306e\u738b\u5973\u69d8\u304c\u3044\u308b\u306a\u3089\u3001\u6b63\u7fa9\u5074\u306b\u624b\u3092\u8cb8\u3059\u6697\u6bba\u8005\u304c\u3044\u3066\u3082\u3044\u3044\u306f\u305a\u3060", "\u306a\u306b\u3088\u308a\u3001\u305d\u3093\u306a\u683c\u597d\u826f\u3044\u304a\u59eb\u69d8\u306e\u5192\u967a\u8b5a\u304c\u3001\u300e\u3081\u3067\u305f\u3057\u3001\u3081\u3067\u305f\u3057\u300f\u3067\u7d42\u308f\u3089\u306a\u304d\u3083\u3001\u5618\u3067\u3057\u3087", "\u2026\u2026\u3063", "\u2026\u2026\u2026\u2026\u6bbf\u4e0b", "\u2026\u2026\u3048\u3063\u3068", "\u2026\u2026\u3055\u3063\u304d\u306f\u9177\u3044\u3053\u3068\u3092\u8a00\u3063\u3066\u3057\u307e\u3063\u3066\u3001\u3054\u3081\u3093\u306a\u3055\u3044", "\u52e2\u3044\u3067\u8a00\u3063\u3066\u3057\u307e\u3063\u305f\u3051\u308c\u3069\u3001\u305d\u306e\u2026\u2026\u6b7b\u3093\u3067\u6b32\u3057\u304f\u3001\u306a\u3044\u3001\u3067\u3059", "\u751f\u304d\u3066\u3001\u304f\u3060\u3055\u3044", "\u2026\u2026\u3063", "\u30a8\u30eb\u30f3\u30b9\u30c8", "\u30aa\u30ec\u306f\u3001\u304a\u524d\u306e\u3053\u3068\u3092\u8a31\u305b\u306a\u3044\u3002\u304a\u305d\u3089\u304f\u3001\u4e00\u751f", "\u3060\u304c\u2026\u2026\u3044\u3084\u3001\u3060\u304b\u3089\u3053\u305d\u3001\u751f\u304d\u308d\u3002\u6700\u5f8c\u307e\u3067\u751f\u304d\u3066\u307f\u305b\u308d"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/167/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u53eb\u3073\u3002(3)", "discourse": ["\u8cb4\u65b9\u3092\u6bba\u3059\u306e\u304c\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u69d8\u306e\u5f79\u76ee!?\u305d\u3093\u306a\u99ac\u9e7f\u306a\u8a71\u304c\u3042\u3063\u3066\u305f\u307e\u308a\u307e\u3059\u304b\uff01", "\u53e4\u3044\u4ed8\u304d\u5408\u3044\u306a\u3089\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u69d8\u304c\u3068\u3066\u3082\u512a\u3057\u3044\u4eba\u3060\u3063\u3066\u3001\u8cb4\u65b9\u306f\u77e5\u3063\u3066\u3044\u308b\u7b48\u3067\u3059\u3002\u53cb\u3068\u3057\u3066\u3001\u5927\u5207\u306b\u3055\u308c\u3066\u3044\u308b\u4e8b\u3082\u5206\u304b\u3063\u3066\u3044\u308b\u3093\u3067\u3057\u3087\u3046\uff1f\u305d\u308c\u306a\u306e\u306b\u3001\u306a\u3093\u3067\u305d\u3093\u306a\u6b8b\u9177\u306a\u4e8b\u304c\u8a00\u3048\u308b\u3093\u3067\u3059\u304b\u2026\u2026\u3063\uff01", "\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u69d8\u3092\u88cf\u5207\u3063\u305f\u6319\u3052\u53e5\u306b\u3001\u6d88\u3048\u306a\u3044\u50b7\u3092\u3064\u3051\u3088\u3046\u306a\u3093\u3066\u4f55\u69d8\u306e\u3064\u3082\u308a\u3067\u3059\u304b!?\u7518\u3063\u305f\u308c\u306a\u3044\u3067\u304f\u3060\u3055\u3044!!\u305d\u3093\u306a\u306e\u8ab0\u304c\u8a31\u3057\u3066\u3082\u3001\u79c1\u304c\u8a31\u3057\u307e\u305b\u3093!!", "\u8cb4\u65b9\u306e\u72ec\u308a\u3088\u304c\u308a\u306a\u81ea\u6bba\u306b\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u69d8\u3092\u5229\u7528\u3057\u306a\u3044\u3067\uff01\u6b7b\u306b\u305f\u3044\u306a\u3089\u4e00\u4eba\u3067\u52dd\u624b\u306b\u6b7b\u306d\u3070\u3044\u3044!!", "\u304b\u3001\u52dd\u624b\u306b\u6b7b\u306d\u3063\u3066\u2026\u2026\u305d\u3093\u306a\u4e8b\u8a00\u3046\u304a\u59eb\u69d8\u3063\u3066\u3044\u308b\uff1f\u898f\u683c\u5916\u306b\u3082\u7a0b\u304c\u3042\u308b\u3067\u3057\u3087", "\u3084\u3063\u3071\u308a\u3001\u30cd\u30fc\u30d9\u30eb\u3063\u3066\u9762\u767d\u3044\u306a\u3042", "\u306f\u3044\u3001\u3069\u3046\u305e", "\u305d\u3053\u306e\u968a\u9577\u3055\u3093\u304c\u30cd\u30fc\u30d9\u30eb\u5074\u306e\u88cf\u5207\u308a\u8005\u306a\u3089\u3001\u30aa\u30ec\u306f\u9006", "\u306f\u2026\u2026\uff1f", "\u30e9\u30d7\u30bf\u30fc\u3092\u88cf\u5207\u3063\u305f\u8a3c\u3068\u3057\u3066\u3001\u9ed2\u7345\u5b50\u5c06\u8ecd\u304c\u59cb\u672b\u3057\u640d\u306d\u305f\u751f\u304d\u6b8b\u308a\u306e\u9593\u8005\u3092\u3001\u5168\u3066\u59cb\u672b\u3057\u3066\u304a\u304d\u307e\u3057\u305f", "\u306d\u3048\u3001\u7f8e\u3057\u3044\u56fd\u306e\u738b\u5973\u69d8\u3002\u3064\u304d\u307e\u3057\u3066\u306f\u3001\u30aa\u30ec\u306e\u3053\u3068\u96c7\u3063\u3066\u307f\u307e\u305b\u3093\u304b\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/166/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u53eb\u3073\u3002(2)", "discourse": ["\u3069\u3046\u3044\u3046\u3053\u3068\u3060\u3001\u30a8\u30eb\u30f3\u30b9\u30c8", "\u3069\u3046\u3044\u3046\u3001\u306d", "\u78ba\u304b\u306b\u304a\u9810\u304b\u308a\u3057\u307e\u3057\u305f", "\u3053\u3046\u3044\u3046\u4e8b\u3060", "\u738b\u56fd\u3092\u3001\u88cf\u5207\u308b\u3068\u3044\u3046\u306e\u304b", "\u88cf\u5207\u308b\uff1f", "\u4eca\u66f4\u3060\u3002\u3082\u3046\u3068\u3063\u304f\u306b\u3001\u58f2\u308a\u6e21\u3057\u3066\u3044\u308b", "\u30a8\u30eb\u30f3\u30b9\u30c8\u30a9\u30aa\u30aa\u30aa\u30aa\u30c3!!", "\u30ec\u30aa\u30f3\u69d8\u2026\u2026\u3063\uff01", "\u304a\u3063\u3068\u3001\u52d5\u304b\u306a\u3044\u3067\u306d", "\u4e0b\u624b\u306b\u8fd1\u5bc4\u308b\u3068\u3001\u602a\u6211\u3058\u3083\u6e08\u307e\u306a\u3044\u3068\u601d\u3046\u3088", "\u307e\u3055\u304b\u304a\u524d\u3068\u672c\u6c17\u3067\u6226\u3046\u3053\u3068\u306b\u306a\u308b\u3068\u306f\u306a\uff01\u3044\u3064\u3076\u308a\u3060\uff1f\u306a\u3042\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\uff01", "\u3075\u3056\u3051\u308b\u306a!!", "\u4f55\u6545\u3060!!\u4f55\u6545\u3001\u88cf\u5207\u3063\u305f!?", "\u7406\u7531\u306f\u5206\u304b\u3063\u3066\u3044\u308b\u3093\u3058\u3083\u306a\u3044\u304b\u3063\uff1f", "\u5bdf\u3057\u306e\u826f\u3044\u304a\u524d\u306a\u3089\u3001\u30aa\u30ec\u304c\u88cf\u5207\u308b\u53ef\u80fd\u6027\u306b\u6c17\u4ed8\u3044\u3066\u3044\u305f\u3093\u3060\u308d\u3046\u3002\u30e9\u30d7\u30bf\u30fc\u306b\u4f55\u5ea6\u3082\u5148\u56de\u308a\u3055\u308c\u3066\u3001\u300e\u3082\u3057\u3084\u300f\u3068\u601d\u3063\u305f\u306f\u305a\u3060\u3002\u3060\u304c\u3001\u53cb\u60c5\u3068\u3044\u3046\u4e0d\u78ba\u304b\u306a\u611f\u60c5\u304c\u3001\u304a\u524d\u306e\u76ee\u3092\u66c7\u3089\u305b\u305f\uff01\u9055\u3046\u304b!?", "\u304a\u524d\u304c\u305d\u308c\u3092\u8a00\u3046\u306e\u304b\u2026\u2026!!", "\u9a0e\u58eb\u69d8\u306e\u6226\u3044\u65b9\u3058\u3083\u306d\u3048\u306a\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\uff01", "\u6bba\u3059\u6c17\u3067\u3084\u3063\u3066\u308b\u304b\u3089\u306a\u3002\u304a\u4e0a\u54c1\u306b\u540d\u4e57\u308a\u3092\u4e0a\u3052\u305f\u304d\u3083\u3001\u3042\u306e\u4e16\u3067\u3084\u308c!!", "\u6016\u3044\u3001\u6016\u3044", "\u305d\u3093\u306a\u5fc5\u6b7b\u306a\u9854\u3092\u3057\u305f\u304a\u524d\u306f\u3001\u521d\u3081\u3066\u898b\u308b\u306a", "\u305d\u3046\u3060\u306a\u3002\u305d\u3057\u3066\u304a\u524d\u304c\u898b\u308b\u306e\u306f\u3053\u308c\u304c\u6700\u5f8c\u3060", "\u4eca\u306e\u304a\u524d\u306b\u306a\u3089\u3001\u5206\u304b\u308b\u3060\u308d\u3046\u3088\u3002\u30aa\u30ec\u304c\u4f55\u6545\u3001\u3053\u3093\u306a\u611a\u304b\u306a\u884c\u52d5\u306b\u51fa\u305f\u304b", "\u2026\u2026\u9ed9\u308c", "\u3084\u3063\u3071\u308a\u5206\u304b\u308b\u304b", "\u2026\u2026\u306a\u3042\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u3002\u304b\u3051\u304c\u3048\u306e\u306a\u3044\u5b58\u5728\u3092\u898b\u3064\u3051\u308b\u3068\u3044\u3046\u4e8b\u306f\u3001\u81f3\u4e0a\u306e\u5e78\u798f\u3060\u304c", "\u9ed9\u308c\uff01", "\u540c\u6642\u306b\u3001\u5931\u3046\u304b\u3082\u3057\u308c\u306a\u3044\u6050\u6016\u306b\u3001\u5e38\u306b\u4ed8\u304d\u307e\u3068\u308f\u308c\u308b\u3068\u3044\u3046\u3053\u3068\u3067\u3082\u3042\u308b", "\u9ed9\u308c\u3068\u8a00\u3063\u3066\u3044\u308b\u3060\u308d\u3046\u304c\u2026\u2026\u3063!!", "\u2026\u2026\u6bba\u3055\u306a\u3044\u306e\u304b\uff1f", "\u2026\u2026\u2026\u2026", "\u30ec\u30aa\u30f3\u69d8\u3001\u6b62\u3081\u3066\u304f\u3060\u3055\u3044", "\u30aa\u30ec\u306f\u738b\u56fd\u3092\u3001\u304a\u524d\u306e\u5927\u5207\u306a\u65b9\u3092\u88cf\u5207\u3063\u305f\u7537\u3060\u3002\u305d\u308c\u3067\u3082\u751f\u304b\u3057\u3066\u304a\u304f\u306e\u304b\uff1f", "\u30ea\u30fc\u30d0\u30fc\u69d8\u3063\uff01", "\u65e9\u304f\u30aa\u30ec\u3092\u7247\u4ed8\u3051\u3066\u3001\u6bbf\u4e0b\u3068\u4e00\u7dd2\u306b\u9003\u3052\u305f\u65b9\u304c\u3044\u3044\u3093\u3058\u3083\u306a\u3044\u304b\uff1f\u30e9\u30d7\u30bf\u30fc\u306e\u9593\u8005\u304c\u5468\u56f2\u3092\u53d6\u308a\u56f2\u3093\u3067\u3044\u308b\u305e", "\u2026\u2026\u305d\u3046\u3060\u306a", "\u6b62\u3081\u3066\u3001\u3084\u3081\u3066\u304f\u3060\u3055\u3044\u3063\uff01\u305d\u3093\u306a\u3053\u3068\u3001\u3057\u306a\u304f\u3066\u3044\u3044\u3067\u3059!!", "\u304a\u512a\u3057\u3044\u6bbf\u4e0b\u3001\u3069\u3046\u304b\u8cb4\u65b9\u306f\u76ee\u3092\u7791\u3063\u3066\u3044\u3066\u304f\u3060\u3055\u3044\u3002\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u304c\u5f79\u76ee\u3092\u679c\u305f\u3059\u307e\u3067", "\u2026\u2026\u3093\u306a", "\u3075\u3063\u3056\u3051\u3093\u306a\u3063!!\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u69d8\u306b\u3001\u305d\u3093\u306a\u4e8b\u3092\u3055\u305b\u306a\u3044\u3067!!"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/165/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u53eb\u3073\u3002", "discourse": ["\u6bbf\u4e0b", "\u3054\u3081\u3093\u306a\u3055\u3044\u3002\u2026\u2026\u306a\u3093\u304b\u3001\u3061\u3087\u3063\u3068\u304a\u304b\u3057\u306a\u4e8b\u3092\u601d\u3044\u3064\u3044\u3066\u3057\u307e\u3063\u3066\u3002\u305f\u3076\u3093\u52d8\u9055\u3044\u3057\u3066\u3044\u308b\u3068\u601d\u3046\u3093\u3067\u3059", "\u2026\u2026\u2026\u2026", "\u3057\u3066\u308b\u3063\u3066\u3001\u2026\u2026\u52d8\u9055\u3044\u3057\u3066\u3044\u308b\u3093\u3060\u3063\u3066\u3001\u8a00\u3063\u3066\u304f\u3060\u3055\u3044\u2026\u2026\u3063\uff01", "\u2026\u2026\u8cb4\u65b9\u306f\u3001\u8061\u3044\u65b9\u3060\u3002\u3082\u3046\u5206\u304b\u3063\u3066\u3044\u3089\u3063\u3057\u3083\u308b\u3093\u3067\u3057\u3087\u3046", "\u3069\u3046\u3057\u3066\u2026\u2026\u3063\uff01", "\u3069\u3046\u3057\u3066\u3001\u3067\u3059\u304b", "\u30a4\u30b6\u30fc\u30af\u306e\u8cc7\u6599\u3092\u3054\u89a7\u306b\u306a\u3063\u3066\u3044\u308b\u8cb4\u65b9\u306a\u3089\u3001\u7406\u7531\u3082\u3054\u5b58\u77e5\u306a\u306e\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304b\uff1f", "\u30f4\u30a9\u30eb\u30bf\u30fc\u69d8\u306e\u2026\u2026\uff1f", "\u30cd\u30fc\u30d9\u30eb\u738b\u56fd\u306e\u6c11\u8a71\u3060\u3051\u3067\u306f\u306a\u304f\u3001\u96a3\u56fd\u2026\u2026\u30e9\u30d7\u30bf\u30fc\u306e\u3082\u306e\u3082\u3042\u3063\u305f\u306f\u305a\u3067\u3059", "\u5965\u69d8\u306e\u3001\u305f\u3081\u2026\u2026\u3067\u3059\u304b\uff1f", "\u3063\u2026\u2026", "\u59bb\u306f\u751f\u307e\u308c\u3064\u304d\u5fc3\u81d3\u306b\u6b20\u9665\u3092\u62b1\u3048\u3066\u3044\u307e\u3059\u3002\u533b\u8005\u306b\u306f\u3001\u6210\u4eba\u3059\u308b\u307e\u3067\u4fdd\u305f\u306a\u3044\u3060\u308d\u3046\u3068\u8a00\u308f\u308c\u3066\u3044\u305f\u305d\u3046\u3067\u3059", "\u81ea\u5206\u306f\u9577\u304f\u751f\u304d\u3089\u308c\u306a\u3044\u304b\u3089\u3068\u3001\u4f55\u5ea6\u3082\u6c42\u5a5a\u3092\u8e74\u3089\u308c\u307e\u3057\u305f\u3002\u3067\u3059\u304c\u3001\u6839\u8ca0\u3051\u3057\u305f\u306e\u304b\u4e09\u5341\u56de\u76ee\u306e\u6c42\u5a5a\u3067\u9837\u3044\u3066\u304f\u308c\u305f\u3093\u3067\u3059\u3002\u8cb4\u65b9\u306e\u305f\u3081\u306b\u3001\u5c11\u3057\u3067\u3082\u3057\u3076\u3068\u304f\u751f\u304d\u3066\u307f\u305b\u308b\u304b\u3089\u7d50\u5a5a\u3057\u3066\u304f\u3060\u3055\u3044\u3063\u3066\u9006\u306b\u6c42\u5a5a\u3057\u3066\u304f\u308c\u305f", "\u4eca\u5e74\u306e\u8a95\u751f\u65e5\u3067\u3001\u4e8c\u5341\u6b73\u306b\u306a\u308a\u307e\u3059\u3002\u533b\u8005\u304c\u8a00\u3063\u305f\u3088\u308a\u3082\u3001\u4e94\u5e74\u3082\u9577\u304f\u9811\u5f35\u3063\u3066\u304f\u308c\u305f\u2026\u2026\u305d\u308c\u4ee5\u4e0a\u3092\u6c42\u3081\u308b\u306e\u306f\u3001\u9177\u3060\u3068\u5206\u304b\u3063\u3066\u3044\u308b\u3093\u3067\u3059", "\u3067\u3082\u3001\u99c4\u76ee\u306a\u3093\u3067\u3059\u3002\u30aa\u30ec\u306f\u59bb\u3068\u9055\u3063\u3066\u5f31\u3044\u304b\u3089\u3001\u5225\u308c\u3092\u53d7\u3051\u5165\u308c\u3089\u308c\u306a\u3044\u3002\u7f6a\u3060\u3068\u77e5\u3063\u3066\u3044\u306a\u304c\u3089\u3082\u6c38\u9060\u3092\u671b\u3093\u3067\u3057\u307e\u3046", "\u30aa\u30ec\u306f\u59bb\u3092\u751f\u304b\u3059\u305f\u3081\u306a\u3089\u3001\u60aa\u9b54\u306b\u9b42\u3092\u58f2\u3063\u3066\u3082\u69cb\u308f\u306a\u3044", "\u3060\u304b\u3089\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3002\u6bbf\u4e0b", "\u305d\u306e\u77f3\u3092\u30aa\u30ec\u306b\u6e21\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u8cb4\u65b9\u306b\u4e71\u66b4\u306f\u3057\u305f\u304f\u306a\u3044\u2026\u2026", "\u4f55\u6545\u2026\u2026\u4f55\u6545\u3001\u8cb4\u65b9\u304c\u6ce3\u304f\u306e\u3067\u3059\u304b", "\u8cb4\u65b9\u306f\u4f55\u6545\u3001\u6ce3\u304b\u306a\u3044\u306e\u3067\u3059\u304b\u2026\u2026\u3063", "\u8cb4\u65b9\u306f\u512a\u3057\u3044\u65b9\u3067\u3059\u306d\u3002\u305d\u3093\u306a\u306b\u3082\u5168\u3066\u306b\u5fc3\u3092\u7815\u3044\u3066\u3044\u305f\u3089\u3001\u82e6\u3057\u3044\u3060\u3051\u3067\u3057\u3087\u3046\u306b\u3002\u2026\u2026\u3067\u3082\u3001\u305d\u3093\u306a\u8cb4\u65b9\u3060\u304b\u3089\u3053\u305d\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u306e\u5fc3\u3092\u52d5\u304b\u305b\u308b\u306e\u3067\u3057\u3087\u3046", "\u3048\u2026\u2026\uff1f", "\u3053\u3093\u306a\u4e8b\u3092\u8a00\u3046\u6a29\u5229\u306f\u306a\u3044\u3068\u5206\u304b\u3063\u3066\u306f\u3044\u308b\u306e\u3067\u3059\u304c\u3001\u2026\u2026\u3069\u3046\u304b\u3001\u6211\u304c\u53cb\u3092\u5b9c\u3057\u304f\u304a\u9858\u3044\u81f4\u3057\u307e\u3059", "\u305d\u308d\u305d\u308d\u6642\u9593\u306e\u3088\u3046\u3067\u3059", "\u99c4\u76ee\u2026\u2026\u3063!!", "\u59eb\u541b\u3063!!"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/164/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u7591\u5ff5\u3002(2)", "discourse": ["\u8fd1\u304f\u306b\u6575\u306f\u3044\u306a\u3044\u3088\u3046\u3067\u3059\u306d", "\u2026\u2026\u3063", "\u884c\u304d\u3001\u307e\u3057\u3087\u3046", "\u2026\u2026\u306f\u3044", "\u6b62\u307e\u3063\u3066\uff01", "\u672c\u5f53\u306b\u3042\u3063\u305f\u2026\u2026", "\u3053\u3093\u306a\u68ee\u306e\u5965\u306b\u3042\u308b\u3068\u306f\u2026\u2026\u9a5a\u304d\u307e\u3057\u305f\u306d", "\u6bbf\u4e0b\u3001\u884c\u304d\u307e\u3057\u3087\u3046", "\u306f\u3001\u306f\u3044\u3063", "\u6bbf\u4e0b\u3001\u677e\u660e\u3092\u304a\u9858\u3044\u3057\u3066\u3082\uff1f", "\u306f\u3044", "\u5c11\u3057\u96e2\u308c\u3066\u3044\u3066\u304f\u3060\u3055\u3044\u306d", "\uff1f\u306f\u3044", "!!", "\u6bbf\u4e0b\u3001\u3042\u307e\u308a\u96e2\u308c\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u306f\u3044", "\u51c4\u3044\u2026\u2026", "\u58c1\u3084\u5e8a\u3092\u8abf\u3079\u3066\u307f\u307e\u3057\u3087\u3046", "\u306f\u3044", "\u3042\u308a\u307e\u305b\u3093\u306d\u2026\u2026", "\u3053\u306e\u7d75\u306b\u4f55\u304b\u3001\u624b\u304c\u304b\u308a\u304c\u3042\u3063\u305f\u308a\u3057\u307e\u305b\u3093\u304b\u306d\uff1f", "\u78ba\u304b\u306b\u3001\u4e00\u756a\u602a\u3057\u3044\u306e\u306f\u3053\u308c\u3067\u3059\u304c\u2026\u2026\u898b\u305f\u3060\u3051\u3067\u306f\u5206\u304b\u308a\u307e\u305b\u3093\u306d", "\u898b\u4e8b\u306a\u3082\u306e\u3060\u3002\u540d\u306e\u3042\u308b\u7d75\u5e2b\u306e\u4f5c\u3067\u3057\u3087\u3046", "\u5973\u795e\u3068\u2026\u2026\u3053\u306e\u708e\u306f\u3001\u9b54\u738b\u3067\u3057\u3087\u3046\u304b", "\u2026\u2026\u2026\u2026\u3082\u3057\u304b\u3057\u3066", "\u30ea\u30fc\u30d0\u30fc\u69d8", "\u4ee3\u308f\u308a\u307e\u3057\u3087\u3046", "\u53d6\u3063\u624b\u304c\u51fa\u3066\u304d\u307e\u3057\u305f\u3002\u5f15\u3051\u305d\u3046\u3067\u3059\u304c", "\u304a\u9858\u3044\u3057\u307e\u3059", "\u5f53\u305f\u308a\u3001\u3067\u3059\u306d", "\u3042\u3063\u305f\u2026\u2026", "\u3053\u308c\u304c\u9b54\u738b\u306e\u5c01\u3058\u3089\u308c\u305f\u77f3\u3067\u3059\u304b\u2026\u2026", "\u6bbf\u4e0b\u3001\u79c1\u304c\u53d6\u308a\u307e\u3057\u3087\u3046\u3002\u4f55\u304b\u8d77\u3053\u308b\u304b\u5206\u304b\u308a\u307e\u305b\u3093\u306e\u3067", "\u3044\u3044\u3048\u3001\u79c1\u304c\u3084\u308a\u307e\u3059", "\u2026\u2026\u3063", "\u5927\u4e08\u592b\u3067\u3059\u304b\u3001\u6bbf\u4e0b", "\u306f\u3044\u3002\u3082\u3046\u7528\u306f\u6e08\u307f\u307e\u3057\u305f\u306e\u3067\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u69d8\u3068\u5408\u6d41\u3057\u307e\u3057\u3087\u3046", "\u5b9c\u3057\u3051\u308c\u3070\u3001\u305d\u306e\u77f3\u306f\u304a\u9810\u304b\u308a\u3057\u307e\u3059\u3002\u843d\u3068\u3057\u3066\u3057\u307e\u3063\u3066\u306f\u5927\u5909\u3067\u3057\u3087\u3046", "\u3042\u3001\u5927\u4e08\u592b\u3067\u3059\u3002\u77f3\u3092\u3057\u307e\u3046\u305f\u3081\u306e\u7bb1\u304c\u2026\u2026", "\u3068\u308a\u3042\u3048\u305a\u3001\u3053\u3053\u3092\u51fa\u307e\u3057\u3087\u3046", "\u2026\u2026\u2026\u2026\uff1f", "\u3063\u2026\u2026!!", "\u5982\u4f55\u3055\u308c\u307e\u3057\u305f\u304b\u3001\u6bbf\u4e0b\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/163/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u7591\u5ff5\u3002", "discourse": ["\u5982\u4f55\u3055\u308c\u307e\u3057\u305f\u304b\uff1f", "\u601d\u3044\u3064\u3044\u305f\u4e8b\u304c\u3042\u3063\u3066\u3001\u304a\u8a71\u3057\u3057\u305f\u3044\u306e\u3067\u3059\u304c\u2026\u2026", "\u3072\u3068\u307e\u305a\u3001\u4e2d\u3078\u3069\u3046\u305e", "\u305d\u308c\u3067\u3001\u304a\u8a71\u3068\u3044\u3046\u306e\u306f\uff1f", "\u6700\u521d\u306e\u6751\u306b\u3082\u3046\u4e00\u5ea6\u884c\u304d\u305f\u3044\u3093\u3067\u3059", "\u6700\u521d\u306e\uff1f", "\u6700\u521d\u306e\u6751\u306e\u795e\u6bbf\u306f\u3001\u5efa\u3066\u66ff\u3048\u3089\u308c\u3066\u3044\u305f\u3068\u805e\u304d\u307e\u3057\u305f\u304c", "\u4ef0\u308b\u901a\u308a\u3001\u53e4\u3044\u795e\u6bbf\u306f\u53d6\u308a\u58ca\u3055\u308c\u3066\u65b0\u3057\u304f\u5efa\u7bc9\u4e2d\u3067\u3057\u305f\u3002\u305f\u3060\u3001\u305d\u306e\u795e\u6bbf\u306b\u306f\u5143\u3005\u3001\u4f55\u3082\u5165\u3063\u3066\u3044\u306a\u304b\u3063\u305f\u3068\u6751\u306e\u65b9\u304c\u6559\u3048\u3066\u304f\u3060\u3055\u3063\u305f\u3093\u3067\u3059", "\u79fb\u3057\u66ff\u3048\u308b\u4fa1\u5024\u306e\u3042\u308b\u3082\u306e\u304c\u3001\u6b8b\u3063\u3066\u306a\u304b\u3063\u305f\u3068\u3044\u3046\u610f\u5473\u3067\u3059\u304b\u306d\uff1f", "\u305d\u3046\u3068\u3082\u8003\u3048\u3089\u308c\u307e\u3059\u3002\u3067\u3059\u304c\u58ca\u308c\u3066\u3044\u305f\u5834\u5408\u3001\u5143\u304b\u3089\u4f55\u3082\u5165\u3063\u3066\u306a\u304b\u3063\u305f\u3001\u3068\u306f\u8a00\u308f\u306a\u3044\u3093\u3058\u3083\u306a\u3044\u304b\u3068\u3082\u601d\u3046\u3093\u3067\u3059\u3002\u76d7\u307e\u308c\u305f\u306b\u3057\u3066\u3082\u3001\u77f3\u50cf\u3068\u304b\u306f\u52d5\u304b\u3059\u306e\u3082\u7121\u7406\u3067\u3057\u3087\u3046\u3057", "\u306a\u308b\u307b\u3069", "\u305d\u308c\u3067\u3001\u5c11\u3057\u8003\u3048\u3066\u307f\u305f\u3093\u3067\u3059\u3002\u2026\u2026\u3042\u304f\u307e\u3067\u3001\u79c1\u306e\u63a8\u6e2c\u3067\u3042\u3063\u3066\u4f55\u306e\u6839\u62e0\u3082\u306a\u3044\u306e\u3067\u3059\u304c", "\u304a\u805e\u304b\u305b\u304f\u3060\u3055\u3044", "\u3082\u3057\u304b\u3057\u3066\u5efa\u3066\u66ff\u3048\u3089\u308c\u3066\u3044\u308b\u795e\u6bbf\u306e\u4ed6\u306b\u3001\u3082\u3046\u4e00\u3064\u795e\u6bbf\u304c\u3042\u3063\u3066\u3001\u4fe1\u4ef0\u306e\u5bfe\u8c61\u3068\u306a\u308b\u3082\u306e\u306f\u5168\u3066\u3001\u305d\u3061\u3089\u306b\u5165\u308c\u3066\u3042\u308b\u3093\u3058\u3083\u306a\u3044\u304b\u3063\u3066", "\u76ee\u7729\u307e\u3057\u306e\u305f\u3081\u306b\u5efa\u3066\u3089\u308c\u305f\u795e\u6bbf\u3060\u304b\u3089\u3001\u4f55\u3082\u5165\u3063\u3066\u3044\u306a\u304b\u3063\u305f\u3068", "\u306a\u3089\u3070\u8abf\u3079\u308b\u3079\u304d\u306f\u3001\u6751\u306e\u8fd1\u304f\u306b\u3042\u3063\u305f\u68ee\u3067\u3059\u306d", "\u306f\u3044\u3001\u51fa\u6765\u308b\u3060\u3051\u65e9\u304f\u5411\u304b\u3044\u305f\u3044\u3093\u3067\u3059", "\u3059\u3050\u306b\u652f\u5ea6\u81f4\u3057\u307e\u3059", "\u3044\u3084\u3001\u5f85\u3066\u5f85\u3066\uff01\u3053\u308c\u304b\u3089\u5411\u304b\u3063\u305f\u3089\u3001\u5230\u7740\u3059\u308b\u9803\u306b\u306f\u65e5\u304c\u66ae\u308c\u308b\u305e\uff1f\u660e\u65e5\u306b\u3057\u305f\u3089\u3069\u3046\u3060", "\u4e00\u523b\u3092\u4e89\u3046", "\u3042\u30fc\u2026\u2026\u3058\u3083\u3042\u3001\u3061\u3087\u3063\u3068\u5f85\u3063\u3068\u3051\uff01\u30aa\u30ec\u3082\u884c\u304f", "\u3048\u3063!?\u305d\u3001\u305d\u3093\u306a\u8a33\u306b\u306f", "\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u306e\u5b9f\u529b\u306f\u77e5\u3063\u3066\u3044\u307e\u3059\u304c\u3001\u6bbf\u4e0b\u306e\u8b77\u885b\u304c\u4e00\u4eba\u3067\u306f\u5fc3\u8a31\u306a\u3044\u3002\u5927\u52e2\u3067\u79fb\u52d5\u3059\u308b\u306e\u306f\u76ee\u7acb\u3064\u3067\u3057\u3087\u3046\u304b\u3089\u3001\u90e8\u4e0b\u306f\u9023\u308c\u3066\u3044\u304d\u307e\u305b\u3093", "\u5927\u4e08\u592b\u3067\u3059\u304b\u3001\u