{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/161/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u7126\u616e\u3002(3)", "discourse": ["\u4e00\u5ea6\u3001\u7826\u306b\u623b\u308a\u307e\u3057\u3087\u3046\u3002\u3082\u3046\u4e00\u5ea6\u3001\u8cc7\u6599\u3092\u898b\u76f4\u3057\u305f\u3044\u3067\u3059", "\u307e\u305f\u4f1a\u3063\u305f\u306d", "\u5076\u7136\u3060\u306a", "\u672c\u5f53\u3001\u3073\u3063\u304f\u308a\u3057\u305f\u3002\u3042\u3001\u3053\u3053\u5ea7\u308a\u306a\u3088", "\u3042\u3001\u304a\u59c9\u3055\u30fc\u3093\u3002\u6ce8\u6587\u3044\u3044\u304b\u306a\uff1f", "\u53e4\u3044\u5efa\u7269\u304c\u597d\u304d\u3063\u3066\u8a00\u3063\u3066\u305f\u304b\u3089\u3001\u3082\u3057\u304b\u3057\u3066\u3068\u306f\u601d\u3063\u305f\u3051\u3069\u3002\u3059\u308c\u9055\u3044\u306b\u306a\u3089\u306a\u304f\u3066\u3088\u304b\u3063\u305f\u3088", "\u305d\u3046\u3060\u306a\u3002\u305d\u3063\u3061\u306f\u4ed5\u5165\u308c\u304b\u4f55\u304b\u304b\uff1f", "\u3046\u3046\u3093\u3002\u4eca\u65e5\u306f\u4f11\u307f\u306a\u3093\u3060", "\u30aa\u30ec\u3082\u3061\u3087\u3063\u3068\u898b\u305f\u3044\u3082\u306e\u304c\u3042\u3063\u3066\u3001\u6765\u3066\u307f\u305f\u3093\u3060\u3051\u3069\u306d", "\u305d\u306e\u8a00\u3044\u65b9\u3060\u3068\u3001\u306a\u304b\u3063\u305f\u306e\u304b\uff1f", "\u3046\u30fc\u3093\u3002\u671f\u5f85\u3057\u3066\u3044\u305f\u306e\u3068\u306f\u3001\u3061\u3087\u3063\u3068\u9055\u3063\u305f\u307f\u305f\u3044", "\u304a\u5b22\u3055\u3093\u306f\uff1f", "\u3048\uff1f", "\u898b\u305f\u3044\u3082\u306e\u306f\u3001\u898b\u308c\u305f\uff1f", "\u2026\u2026\u3063", "\u6b8b\u5ff5\u306a\u304c\u3089\u3001\u79c1\u3082\u3002\u60f3\u50cf\u3057\u3066\u3044\u305f\u3082\u306e\u3068\u306f\u3001\u9055\u3063\u305f\u306e", "\u305d\u3063\u304b\u3002\u540c\u3058\u3060\u306d", "\u98df\u3079\u7d42\u308f\u3063\u305f\u306a\u3089\u3001\u305d\u308d\u305d\u308d\u884c\u3053\u3046", "\u3042\u3001\u3046\u3093\u3002\u305d\u3046\u306d\u3001\u5144\u3055\u3093", "\u307e\u305f\u306d", "\u4e09\u30f6\u6240\u5171\u3001\u76ee\u5f53\u3066\u306e\u5834\u6240\u3067\u306f\u306a\u304b\u3063\u305f\u3068\uff1f", "\u3042\u3042\u3001\u7a7a\u632f\u308a\u3060", "\u305d\u3093\u306a\u306f\u305a\u306a\u3044\u3093\u3060\u304c\u306a\u3041\u2026\u2026", "\u5b9f\u969b\u306b\u898b\u3066\u56de\u3063\u3066\u78ba\u8a8d\u3057\u305f\u3057\u3001\u30a4\u30b6\u30fc\u30af\u304c\u8da3\u5473\u3067\u96c6\u3081\u305f\u60c5\u5831\u3068\u3082\u5408\u81f4\u3057\u3066\u3044\u305f\u3002\u5916\u308c\u306b\u673d\u3061\u304b\u3051\u305f\u795e\u6bbf\u306e\u3042\u308b\u8fba\u5883\u306e\u6751\u306f\u3001\u305d\u306e\u4e09\u3064\u3060\u3051\u3060", "\u2026\u2026\u8fba\u5883\u3063\u3066\u5b9a\u7fa9\u3092\u898b\u76f4\u3059\u3079\u304d\u3067\u3057\u3087\u3046\u304b\uff1f", "\u3082\u3046\u5c11\u3057\u7bc4\u56f2\u3092\u5e83\u3052\u3066\u307f\u308b\u3068\u3044\u3046\u4e8b\u3067\u3059\u304b\u3002\u6709\u52b9\u306a\u624b\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u304c\u3001\u8abf\u3079\u76f4\u3059\u306b\u306f\u6642\u9593\u304c\u304b\u304b\u308a\u3059\u304e\u307e\u3059", "\u3058\u3083\u3042\u300e\u6751\u5916\u308c\u306b\u3042\u308b\u673d\u3061\u304b\u3051\u305f\u795e\u6bbf\u300f\u3063\u3066\u6761\u4ef6\u3092\u6b62\u3081\u3066\u3001\u795e\u6bbf\u304c\u3042\u308b\u6751\u3092\u5168\u90e8\u62fe\u3044\u51fa\u3057\u3066\u307f\u308b\u304b\uff1f", "\u51fa\u6765\u308b\u306e\u304b\uff1f", "\u51fa\u6765\u306a\u304f\u306f\u306a\u3044\u3001\u3068\u601d\u3046\u3002\u8a18\u61b6\u983c\u307f\u306b\u306a\u308b\u304b\u3089\u3001\u5b8c\u74a7\u3068\u306f\u3044\u304b\u306a\u3044\u304c\u306a", "\u304a\u9858\u3044\u81f4\u3057\u307e\u3059", "\u4efb\u3055\u308c\u307e\u3057\u305f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/160/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u7126\u616e\u3002(2)", "discourse": ["\u4e00\u4eba\u3067\u69d8\u5b50\u3092\u898b\u3066\u304d\u307e\u3059\u3002\u4e00\u6642\u9593\u7a0b\u3067\u4e00\u5ea6\u623b\u308a\u307e\u3059\u306e\u3067\u3001\u8cb4\u5973\u306f\u5bbf\u304b\u3089\u6c7a\u3057\u3066\u51fa\u306a\u3044\u3067\u304f\u3060\u3055\u3044\u3002\u3044\u3044\u3067\u3059\u306d\uff1f", "\u5fc3\u914d\u3057\u306a\u3044\u3067\u3002\u5371\u306a\u3044\u3053\u3068\u306f\u3057\u306a\u3044\u3068\u7d04\u675f\u3057\u307e\u3059", "\u2026\u2026\u306f\u3044", "\u6c17\u3092\u3064\u3051\u3066", "\u5f85\u3063\u3066\u3044\u308b\u9593\u3001\u4f53\u3092\u4f11\u3081\u3066\u304f\u3060\u3055\u3044\u306d\u3002\u5bdd\u3066\u3057\u307e\u3063\u3066\u3082\u69cb\u308f\u306a\u3044\u304b\u3089", "\u2026\u2026\u3063\uff1f", "\u843d\u3068\u3057\u7269\u3092\u3057\u305f", "\u2026\u2026\u3060\u3044\u3058\u3087\u3046\u3076\u3001\u3060\u3044\u3058\u3087\u3046\u3076", "\u5927\u4e08\u592b\u3001\u5927\u4e08\u592b", "\u2026\u2026\u3060", "\u304a\u304d", "\u2026\u2026\u30de\u30ea\u30fc\uff1f", "\u30de\u30ea\u30fc\u3063\uff01", "\u5b89\u5fc3\u3057\u3066\u3001\u529b\u304c\u629c\u3051\u305f\u3060\u3051", "\u2026\u2026\u3063", "\u3059\u307e\u306a\u3044\u3002\u5fc3\u914d\u3055\u305b\u3066\u3057\u307e\u3063\u305f\u3093\u3060\u306a", "\u3046\u3046\u3093\u3002\u3053\u3046\u3057\u3066\u7121\u4e8b\u306b\u5e30\u3063\u3066\u304d\u3066\u304f\u308c\u305f\u3093\u3060\u304b\u3089\u3001\u3082\u3046\u3044\u3044\u306e", "\u3068\u3053\u308d\u3067\u3001\u3069\u3046\u2026\u2026\u3060\u3063\u305f\u306e\uff1f", "\u3042\u3042", "\u7d50\u8ad6\u304b\u3089\u8a00\u3046\u3068\u3001\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f", "\u306a\u3044\u2026\u2026\u3068\u3044\u3046\u306e\u306f\u3001\u8ab0\u304b\u306b\u6301\u3061\u53bb\u3089\u308c\u305f\u3042\u3068\u3060\u3063\u305f\u3068\u3044\u3046\u4e8b\u3001\u3067\u3057\u3087\u3046\u304b", "\u3044\u3044\u3048", "\u305d\u3046\u3067\u306f\u3042\u308a\u307e\u305b\u3093", "\u2026\u2026\uff1f\u3067\u306f\u3001\u3069\u3046\u3044\u3046", "\u96a0\u3057\u90e8\u5c4b\u81ea\u4f53\u304c\u3001\u306a\u3044\u306e\u3067\u3059", "!\uff1f", "\u305d\u308c\u304b\u3089\u3001\u524d\u56de\u540c\u69d8\u3001\u8ab0\u304b\u304c\u63a2\u3063\u305f\u75d5\u8de1\u304c\u3042\u308a\u307e\u3057\u305f\u3002\u305d\u308c\u3082\u3064\u3044\u6700\u8fd1", "\u306a\u305c\u6700\u8fd1\u3060\u3068\u5206\u304b\u308b\u3093\u3067\u3059\uff1f", "\u795e\u6bbf\u306e\u5468\u8fba\u306b\u96ea\u304c\u6b8b\u3063\u3066\u3044\u305f\u306e\u3067\u3001\u8db3\u8de1\u304c\u3002\u3042\u3068\u306f\u4e2d\u3092\u63a2\u3059\u306e\u306b\u3001\u706b\u3092\u4f7f\u3063\u305f\u3093\u3067\u3057\u3087\u3046\u3002\u6cb9\u306e\u81ed\u3044\u304c\u5fae\u304b\u306b\u6b8b\u3063\u3066\u3044\u307e\u3057\u305f", "\u307e\u3055\u304b\u540c\u3058\u60c5\u5831\u3092\u6301\u3063\u3066\u3044\u308b\u306a\u3093\u3066\u2026\u2026\u30e9\u30d7\u30bf\u30fc\u306b\u306f\u3001\u9b54\u738b\u306e\u5c01\u5370\u5834\u6240\u306b\u95a2\u3059\u308b\u4f1d\u627f\u304c\u6b8b\u3063\u3066\u3044\u308b\u3093\u3067\u3057\u3087\u3046\u304b", "\u2026\u2026\u2026\u2026", "\u30ec\u30aa\u30f3\u69d8\uff1f", "\u3063\u3001\u3059\u307f\u307e\u305b\u3093\u3002\u5c11\u3057\u3001\u8003\u3048\u4e8b\u3092\u3057\u3066\u304a\u308a\u307e\u3057\u305f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/159/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u7126\u616e\u3002", "discourse": ["\u305d\u3046\u3044\u3048\u3070\u3001\u6c11\u8a71\u306b\u95a2\u3059\u308b\u8cc7\u6599\u3092\u8aad\u3093\u3067\u3044\u3066\u65b0\u305f\u306b\u6c17\u4ed8\u3044\u305f\u4e8b\u304c\u3042\u3063\u305f\u3093\u3067\u3059\u3002\u3068\u8a00\u3063\u3066\u3082\u3001\u4eca\u56de\u306e\u65c5\u306e\u76ee\u7684\u306b\u76f4\u63a5\u306f\u95a2\u4fc2\u306a\u3044\u304b\u3082\u3057\u308c\u306a\u3044\u3093\u3067\u3059\u304c", "\u805e\u304b\u305b\u3066\u304f\u3060\u3055\u3044", "\u30f4\u30a9\u30eb\u30bf\u30fc\u69d8\u306f\u3001\u30cd\u30fc\u30d9\u30eb\u306e\u6c11\u8a71\u3060\u3051\u3067\u306a\u304f\u96a3\u56fd\u306e\u6c11\u8a71\u3082\u8abf\u3079\u3066\u3044\u305f\u3088\u3046\u306a\u3093\u3067\u3059\u3002\u3082\u3061\u308d\u3093\u30cd\u30fc\u30d9\u30eb\u306e\u3082\u306e\u306b\u6bd4\u3079\u3066\u3001\u6570\u306f\u5727\u5012\u7684\u306b\u5c11\u306a\u3044\u3093\u3067\u3059\u304c\u3001\u7d50\u69cb\u8208\u5473\u6df1\u304f\u3066", "\u30cd\u30fc\u30d9\u30eb\u56fd\u5185\u306e\u3082\u306e\u3068\u5171\u901a\u70b9\u304c\u3042\u3063\u305f\u3093\u3067\u3059\u304c\u3001\u89e3\u91c8\u304c\u771f\u9006\u306a\u3093\u3067\u3059", "\u771f\u9006\uff1f", "\u306f\u3044\u3002\u4ee5\u524d\u3001\u60aa\u3044\u5996\u7cbe\u304c\u984c\u6750\u3068\u3057\u3066\u4f7f\u308f\u308c\u308b\u4e8b\u304c\u591a\u3044\u3068\u8a71\u3057\u307e\u3057\u305f\u3088\u306d\uff1f\u30cd\u30fc\u30d9\u30eb\u306e\u6c11\u8a71\u3067\u306f\u3001\u5996\u7cbe\u304c\u5b50\u4f9b\u306b\u9ed2\u3044\u708e\u306e\u3088\u3046\u306a\u3082\u306e\u3092\u98f2\u307e\u305b\u308b\u5834\u9762\u304c\u3001\u3044\u304f\u3064\u304b\u306e\u8a71\u3067\u51fa\u3066\u304d\u305f\u3093\u3067\u3059\u3002\u305d\u3057\u3066\u98f2\u307e\u3055\u308c\u305f\u5b50\u4f9b\u306f\u3001\u9b42\u3060\u3051\u3067\u68ee\u3092\u5f77\u5fa8\u3046\u3068\u304b\u3001\u9ec4\u6cc9\u306e\u56fd\u3078\u3068\u9023\u308c\u3066\u3044\u304b\u308c\u308b\u3068\u304b\u2026\u2026\u3068\u306b\u304b\u304f\u3001\u6b7b\u3092\u9023\u60f3\u3055\u305b\u308b\u6d41\u308c\u304c\u591a\u304b\u3063\u305f\u3093\u3067\u3059\u3088", "\u96a3\u56fd\u306f\u305d\u3046\u3067\u306f\u306a\u3044\u3001\u3068", "\u5927\u7b4b\u306f\u5168\u304f\u9055\u3063\u3066\u3001\u6c38\u9060\u306e\u547d\u3092\u5f97\u308b\u305f\u3081\u306b\u4e16\u754c\u4e2d\u3092\u5f77\u5fa8\u3063\u3066\u3044\u305f\u8001\u4eba\u304c\u6700\u679c\u3066\u306e\u5730\u3067\u898b\u3064\u3051\u308b\u3068\u304b\u3001\u5d16\u304b\u3089\u843d\u3061\u3066\u91cd\u50b7\u3092\u8ca0\u3063\u305f\u5b50\u4f9b\u304c\u7cbe\u970a\u304b\u3089\u4e0e\u3048\u3089\u308c\u308b\u3068\u304b\u3001\u30d0\u30e9\u30d0\u30e9\u306a\u3093\u3067\u3059\u3051\u3069\u3001\u708e\u3092\u98f2\u3080\u3068\u3044\u3046\u70b9\u3060\u3051\u5171\u901a\u3057\u3066\u3044\u308b\u3093\u3067\u3059\u3002\u3067\u3059\u304c\u3001\u305d\u306e\u708e\u3092\u98f2\u3093\u3060\u4eba\u9593\u306f\u3001\u6b7b\u306c\u306e\u3067\u306f\u306a\u304f\u9006\u306b\u5fa9\u6d3b\u3059\u308b\u3093\u3067\u3059", "\u5fa9\u6d3b\uff1f\u4e00\u5ea6\u6b7b\u3093\u3060\u4eba\u9593\u304c\u751f\u304d\u8fd4\u308b\u3093\u3067\u3059\u304b\uff1f", "\u3046\u30fc\u3093\u2026\u2026\u751f\u304d\u8fd4\u308b\u3060\u3068\u8a9e\u5f0a\u304c\u3042\u308a\u307e\u3059\u306d\u3002\u6b63\u78ba\u306b\u306f\u6b7b\u306b\u304b\u3051\u305f\u4eba\u9593\u304c\u3001\u751f\u304d\u5ef6\u3073\u308b\uff1f\u708e\u3092\u98f2\u3080\u4e8b\u306b\u3088\u3063\u3066\u3001\u602a\u6211\u304c\u6cbb\u308b\u3093\u3067\u3059", "\u78ba\u304b\u306b\u3001\u771f\u9006\u3067\u3059\u306d\u3002\u3044\u304f\u3089\u5225\u306e\u56fd\u3068\u306f\u3044\u3048\u96a3\u308a\u5408\u3063\u3066\u3044\u308b\u306e\u306b\u3001\u305d\u3046\u3082\u89e3\u91c8\u304c\u5909\u308f\u308b\u3082\u306e\u3067\u3057\u3087\u3046\u304b", "\u4e0d\u601d\u8b70\u3067\u3059\u3088\u306d\u3002\u305d\u308c\u3067\u3001\u3061\u3087\u3063\u3068\u8003\u3048\u3066\u307f\u305f\u3093\u3067\u3059\u3002\u3053\u3053\u304b\u3089\u306f\u4f55\u306e\u6839\u62e0\u3082\u306a\u3044\u79c1\u306e\u60f3\u50cf\u306b\u3057\u304b\u904e\u304e\u306a\u3044\u306e\u3067\u3001\u8a71\u534a\u5206\u3069\u3053\u308d\u304b\u3001\u5341\u5206\u306e\u4e00\u304f\u3089\u3044\u3067\u805e\u3044\u3066\u3044\u305f\u3060\u304d\u305f\u3044\u3093\u3067\u3059\u304c", "\u306f\u3044", "\u4f55\u6545\u3001\u707d\u5384\u3067\u3057\u304b\u306a\u3044\u3082\u306e\u306b\u30e9\u30d7\u30bf\u30fc\u304c\u56fa\u57f7\u3059\u308b\u306e\u304b\u3068\u3044\u3046\u7b54\u3048\u304c\u3001\u3053\u308c\u306a\u3093\u3058\u3083\u306a\u3044\u304b\u3068\u601d\u3063\u305f\u3093\u3067\u3059\u3002\u4f55\u3089\u304b\u306e\u65b9\u6cd5\u3067\u3001\u751f\u304d\u305f\u4eba\u9593\u306b\u5bbf\u3089\u305b\u308b\u3053\u3068\u304c\u51fa\u6765\u308c\u3070\u3001\u5236\u5fa1\u53ef\u80fd\u3060\u3068", "\u5b9f\u969b\u304c\u305d\u3046\u3060\u3068\u306f\u3001\u601d\u3044\u307e\u305b\u3093\u3002\u305f\u3060\u3001\u305d\u3046\u4fe1\u3058\u3066\u3044\u308b\u3093\u3058\u3083\u306a\u3044\u304b\u3063\u3066\u53ef\u80fd\u6027\u306e\u8a71\u3067\u3059", "\u8208\u5473\u6df1\u3044\u8a71\u3067\u3059\u304c\u3001\u3053\u3053\u3067\u8b70\u8ad6\u3057\u3066\u3082\u7d50\u8ad6\u306f\u3067\u306a\u305d\u3046\u3067\u3059\u306d\u3002\u738b\u90fd\u306b\u6301\u3061\u5e30\u3063\u3066\u3001\u691c\u8a0e\u3057\u307e\u3057\u3087\u3046", "\u30aa\u30ec\u304c\u5148\u306b\u5165\u308a\u307e\u3059\u306e\u3067\u3001\u8cb4\u65b9\u306f\u5f8c\u304b\u3089\u6765\u3066\u304f\u3060\u3055\u3044\u3002\u58c1\u306b\u306f\u8fd1\u4ed8\u304b\u306a\u3044\u3067\u304f\u3060\u3055\u3044\u306d", "\u2026\u2026\u8ab0\u304b\u304c\u6700\u8fd1\u3001\u5165\u3063\u305f\u5f62\u8de1\u304c\u3042\u308a\u307e\u3059", "\u3048\u3063\uff1f", "\u3057\u304b\u3082\u4f55\u304b\u3092\u63a2\u3057\u305f\u3088\u3046\u3060", "\u30aa\u30ec\u304b\u3089\u96e2\u308c\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u8ab0\u304c\u2026\u2026", "\u76d7\u8cca\u306e\u53ef\u80fd\u6027\u306f\u30bc\u30ed\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u3067\u3059\u304c\u3001\u9650\u308a\u306a\u304f\u4f4e\u3044", "\u4e00\u5fdc\u8abf\u3079\u307e\u3057\u3087\u3046", "\u30a2\u30f3\u30bf\u3001\u3053\u3053\u3067\u4f55\u3057\u3068\u308b\u3093\u3060\uff1f", "\u307e\u305f\u304a\u304b\u3057\u306a\u9023\u4e2d\u304c\u5f77\u5fa8\u3044\u3066\u3044\u308b\u306e\u304b\u3068\u601d\u3063\u3061\u307e\u3063\u305f\u3088\u3002\u3059\u307e\u306a\u304b\u3063\u305f\u306d", "\u2026\u2026\u76d7\u8cca\u304c\u51fa\u308b\u3093\u3067\u3059\u304b\uff1f", "\u3044\u3084\u3001\u3044\u3084\u3002\u5225\u306b\u4f55\u304b\u76d7\u307e\u308c\u305f\u3063\u3066\u308f\u3051\u3058\u3083\u306a\u3044\u3002\u6700\u8fd1\u3001\u3053\u306e\u8fba\u308a\u3067\u602a\u3057\u3052\u306a\u5974\u3092\u898b\u304b\u3051\u308b\u3063\u3066\u3060\u3051\u306e\u8a71\u3060\u3002\u5225\u306b\u8ab0\u3082\u88ab\u5bb3\u306b\u3042\u3063\u3061\u3083\u3044\u306a\u3044\u3093\u3060\u304c\u3001\u306a\u3093\u3060\u304b\u6c17\u5473\u60aa\u304f\u3066\u306a\u3041"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/158/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u4f11\u61a9\u3002", "discourse": ["\u304a\u306f\u3088\u3046\u3054\u3056\u3044\u307e\u3059", "\u6628\u65e5\u306f\u7559\u5b88\u306b\u3057\u3066\u3057\u307e\u3063\u3066\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3002\u4f55\u304b\u554f\u984c\u306f\u8d77\u3053\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u304b\uff1f", "\u5927\u4e08\u592b\u3067\u3059\u3002\u7686\u69d8\u3001\u3068\u3066\u3082\u826f\u304f\u3057\u3066\u304f\u3060\u3055\u3063\u305f\u306e\u3067\u3002\u305d\u308c\u3088\u308a\u3082\u3001\u5965\u69d8\u306e\u2026\u2026", "\u2026\u2026\u5b9f\u306f", "\u59bb\u304c\u611b\u3057\u3059\u304e\u3066\u96e2\u308c\u304c\u305f\u304f\u3001\u9045\u523b\u3092\u3057\u307e\u3057\u305f", "\u2026\u2026\u2026\u2026\u306f\uff1f", "\u3048\u3063\u3001\u3048\u3063\u2026\u2026\uff1f", "\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3002\u30de\u30ea\u30fc\u69d8\u304c\u53ef\u611b\u3089\u3057\u304b\u3063\u305f\u3082\u306e\u3067\u3001\u3064\u3044", "\u30a8\u30eb\u30f3\u30b9\u30c8\u2026\u2026", "\u3044\u3084\u3001\u30b9\u30de\u30f3\u3002\u8a31\u305b\u3002\u7a7a\u6c17\u304c\u8aad\u3081\u306a\u3044\u306e\u306f\u81ea\u899a\u3057\u3066\u3044\u308b\u304c\u60aa\u6c17\u306f\u306a\u304b\u3063\u305f\u3093\u3060", "\u304a\u6c17\u9063\u3044\u304f\u3060\u3055\u3063\u305f\u306e\u306b\u3001\u5931\u793c\u3092\u81f4\u3057\u307e\u3057\u305f\u3002\u3067\u3059\u304c\u3001\u3069\u3046\u304b\u305d\u3093\u306a\u306b\u5fc3\u914d\u306a\u3055\u3089\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u614c\u305f\u3060\u3057\u304f\u3066\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u66f8\u985e\u3092\u6e21\u3059\u305f\u3081\u306b\u5bb6\u4eba\u3092\u5f85\u305f\u305b\u3066\u3044\u308b\u306e\u3067\u3001\u3053\u308c\u3067\u5931\u793c\u81f4\u3057\u307e\u3059", "\u5f85\u3063\u3066\u304f\u3060\u3055\u3044\uff01", "\u30de\u30ea\u30fc\u69d8\uff1f", "\u79c1\u306e\u77e5\u4eba\u306b\u3001\u512a\u79c0\u306a\u85ac\u5e2b\u304c\u3044\u307e\u3059\u3002\u8fd1\u3005\u30cd\u30fc\u30d9\u30eb\u306b\u8d8a\u3057\u3066\u304f\u308b\u4e88\u5b9a\u306b\u306a\u3063\u3066\u304a\u308a\u307e\u3059\u306e\u3067\u3001\u305d\u3046\u3057\u305f\u3089\u4e00\u5ea6\u3001\u5965\u69d8\u306b\u304a\u4f1a\u3044\u3059\u308b\u4e8b\u306f\u53ef\u80fd\u3067\u3057\u3087\u3046\u304b", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3002\u305d\u306e\u304a\u6c17\u6301\u3061\u3060\u3051\u3067\u5341\u5206\u3067\u3059\u3088", "\u6bbf\u4e0b", "\u3072\u3083\u3044\u3063!\uff1f", "\u9a5a\u304b\u305b\u3066\u3057\u307e\u3044\u307e\u3057\u305f\u304b", "\u2026\u2026\u5c11\u3057\u3060\u3051", "\u5c11\u3057\u4f11\u61a9\u3057\u307e\u3059\u306e\u3067\u3001\u8a71\u3057\u76f8\u624b\u306b\u306a\u3063\u3066\u3044\u305f\u3060\u3044\u3066\u3082\uff1f", "\u3082\u3061\u308d\u3093\u3067\u3059\u304c\u3001\u304a\u4ed5\u4e8b\u306f\u5927\u4e08\u592b\u3067\u3059\u304b\uff1f", "\u512a\u79c0\u306a\u90e8\u4e0b\u304c\u6ca2\u5c71\u3044\u308b\u306e\u3067\u3001\u5c11\u3057\u304f\u3089\u3044\u30b5\u30dc\u3063\u3066\u3082\u554f\u984c\u3042\u308a\u307e\u305b\u3093\u3088\u3002\u8cb0\u3044\u7269\u306e\u7d05\u8336\u304c\u3042\u308b\u3093\u3067\u3059\u3002\u5c0f\u6d12\u843d\u305f\u83d3\u5b50\u306f\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u4ee3\u308f\u308a\u306b\u8336\u98f2\u307f\u8a71\u3068\u3057\u3066\u3001\u8150\u308c\u7e01\u306e\u7537\u306e\u6614\u8a71\u304f\u3089\u3044\u306f\u62ab\u9732\u51fa\u6765\u307e\u3059\u3088", "\u3044\u305f\u3060\u304d\u307e\u3059", "\u3059\u3054\u304f\u7f8e\u5473\u3057\u3044\u3067\u3059\u3002\u7d05\u8336\u6df9\u308c\u308b\u306e\u3001\u304a\u4e0a\u624b\u306a\u3093\u3067\u3059\u306d", "\u60c5\u3051\u306a\u3044\u7537\u3060\u3068\u601d\u308f\u306a\u3044\u3067\u304f\u3060\u3055\u3044\u306d\u3002\u5b9f\u306f\u59bb\u304c\u597d\u304d\u306a\u3082\u306e\u3067\u3001\u5fc5\u6b7b\u306b\u6df9\u308c\u65b9\u3092\u899a\u3048\u305f\u3093\u3067\u3059", "\u306a\u306b\u304c\u60c5\u3051\u306a\u3044\u3082\u306e\u3067\u3059\u304b\u3002\u5be7\u308d\u3001\u7d20\u6575\u3067\u3059", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3002\u3061\u306a\u307f\u306b\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u306f\u610f\u5916\u3068\u96d1\u306a\u306e\u3067\u3001\u3053\u3046\u3044\u3046\u306e\u306f\u82e6\u624b\u3067\u3059\u3088", "\u6599\u7406\u304c\u51fa\u6765\u306a\u3044\u8a33\u3067\u306f\u306a\u3044\u3093\u3067\u3059\u304c\u3001\u7d30\u3084\u304b\u306a\u51e6\u7406\u3084\u7d30\u5de5\u304c\u82e6\u624b\u306a\u306e\u304b\u3001\u5927\u5473\u306a\u3082\u306e\u304c\u51fa\u6765\u4e0a\u304c\u308a\u307e\u3059\u3002\u30a2\u30a4\u30c4\u304c\u4f5c\u3063\u305f\u30b9\u30fc\u30d7\u306f\u3001\u5177\u6750\u304c\u7570\u69d8\u306b\u30c7\u30ab\u304f\u3066\u3001\u5473\u304c\u6fc3\u304b\u3063\u305f\u3002\u4e0d\u5473\u304f\u306f\u306a\u3044\u3093\u3060\u3051\u3069\u7f8e\u5473\u304f\u3082\u306a\u3044\u306e\u3067\u3001\u611f\u60f3\u306b\u56f0\u308b\u3093\u3067\u3059\u3088\u3002\u3044\u3044\u3068\u3053\u306e\u574a\u3063\u3061\u3083\u3093\u306e\u304f\u305b\u306b\u3001\u98ef\u306a\u3093\u3066\u98df\u3048\u308c\u3070\u3044\u3044\u3060\u308d\u3063\u3066\u5e73\u6c17\u3067\u8a00\u3046\u3093\u3067\u3059", "\u5bb6\u67c4\u3082\u826f\u304f\u3066\u3001\u80fd\u529b\u3082\u9ad8\u3044\u3002\u304a\u307e\u3051\u306b\u7537\u524d\u3068\u304f\u308c\u3070\u30e2\u30c6\u306a\u3044\u306f\u305a\u3082\u306a\u304f\u3001\u540c\u5e74\u4ee3\u306e\u5973\u306e\u5b50\u306e\u95a2\u5fc3\u306f\u5168\u90e8\u30a2\u30a4\u30c4\u304c\u63bb\u3063\u652b\u3063\u3066\u3044\u307e\u3057\u305f\u304c\u3001\u305d\u308c\u3067\u3082\u540c\u6027\u306b\u3082\u597d\u304b\u308c\u3066\u3044\u305f\u306e\u306f\u3001\u305d\u3046\u3044\u3046\u6c17\u53d6\u3089\u306a\u3044\u90e8\u5206\u306e\u304a\u9670\u3067\u3057\u3087\u3046\u304b\u306d", "\u3084\u3063\u3071\u308a\u3001\u6614\u304b\u3089\u5973\u6027\u306b\u4eba\u6c17\u3060\u3063\u305f\u3093\u3067\u3059\u306d", "\u305d\u3046\u3067\u3059\u306d\u3002\u305f\u3060\u3001\u5f53\u6642\u306e\u30a2\u30a4\u30c4\u306f\u2026\u2026\u3042\u30fc", "\u300e\u82e5\u3044\u9803\u306f\u5272\u3068\u788c\u3067\u3082\u306a\u3044\u7537\u3067\u3057\u305f\u3088\u300f", "!?", "\u305d\u3046\u672c\u4eba\u304c\u6559\u3048\u3066\u304f\u3060\u3055\u3044\u307e\u3057\u305f", "\u30a2\u30a4\u30c4\u306f\u8cb4\u65b9\u306b\u305d\u3093\u306a\u8a71\u307e\u3067\u3059\u308b\u3093\u3067\u3059\u306d", "\u306a\u3089\u9060\u616e\u306a\u304f\u66b4\u9732\u3055\u305b\u3066\u3082\u3089\u3044\u307e\u3057\u3087\u3046\u3002\u78ba\u304b\u306b\u30a2\u30a4\u30c4\u306f\u5973\u6027\u9054\u306b\u3068\u3063\u3066\u3001\u826f\u304d\u604b\u4eba\u3067\u306f\u306a\u304b\u3063\u305f\u3002\u6d6e\u6c17\u3059\u308b\u3068\u304b\u3001\u66b4\u529b\u3092\u632f\u308b\u3046\u306a\u3093\u3066\u4e8b\u306f\u3082\u3061\u308d\u3093\u306a\u3044\u3002\u512a\u3057\u3044\u4e0a\u306b\u6c17\u304c\u5229\u304f\u3057\u3001\u4ed8\u304d\u5408\u3044\u59cb\u3081\u305f\u9803\u306e\u5f7c\u5973\u9054\u306f\u4e16\u754c\u3067\u4e00\u756a\u5e78\u305b\u3060\u3063\u3066\u9854\u3067\u7b11\u3063\u3066\u307e\u3057\u305f\u3002\u3067\u3082\u3001\u5973\u6027\u306f\u8061\u3044\u304b\u3089\u3001\u305d\u306e\u3046\u3061\u6c17\u4ed8\u304f\u3093\u3067\u3059\u3002\u71b1\u91cf\u304c\u5168\u304f\u9055\u3046\u3063\u3066\u3053\u3068\u306b", "\u30a2\u30a4\u30c4\u306e\u604b\u611b\u306b\u306f\u91cd\u3055\u3063\u3066\u3082\u306e\u304c\u5168\u304f\u306a\u3044\u3093\u3067\u3059\u3002\u57f7\u7740\u3068\u304b\u5ac9\u59ac\u3068\u304b\u3001\u604b\u611b\u306b\u306f\u3064\u304d\u3082\u306e\u306e\u30c9\u30ed\u30c9\u30ed\u3057\u305f\u611f\u60c5\u304c\u4e00\u5207\u306a\u3044\u3002\u3060\u304b\u3089\u5973\u6027\u304c\u6c17\u6301\u3061\u3092\u8a66\u305d\u3046\u3068\u5225\u308c\u3092\u5207\u308a\u51fa\u305b\u3070\u3001\u30a2\u30c3\u30b5\u30ea\u3068\u624b\u3092\u96e2\u3057\u3066\u3057\u307e\u3046\u3002\u30aa\u30ec\u306b\u8a00\u308f\u305b\u308c\u3070\u3001\u305d\u3093\u306a\u3082\u3093\u306f\u604b\u3067\u3082\u611b\u3067\u3082\u306a\u3044\u3002\u4e09\u5341\u8def\u306b\u306a\u308d\u3046\u3063\u3066\u7537\u304c\u521d\u604b\u3082\u307e\u3060\u3068\u304b\u3001\u7b11\u3044\u8a71\u3092\u901a\u308a\u8d8a\u3057\u3066\u602a\u8ac7\u3060", "\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u30fb\u30d5\u30a9\u30f3\u30fb\u30aa\u30eb\u30bb\u30a4\u30f3\u3068\u3044\u3046\u5974\u306f\u3001\u305d\u3046\u3044\u3046\u9762\u5012\u81ed\u3044\u7537\u3067\u3059\u3002\u305d\u308c\u3067\u3082\u30a2\u30a4\u30c4\u304c\u826f\u3044\u306e\u3067\u3059\u304b\uff1f", "\u3063!?", "\u8cb4\u65b9\u306f\u82e5\u304f\u7f8e\u3057\u3044\u4e0a\u306b\u3001\u3068\u3066\u3082\u8061\u660e\u306a\u65b9\u3060\u3002\u6c17\u7acb\u3066\u3082\u826f\u3044\u3002\u5fae\u7b11\u307f\u3092\u5411\u3051\u308b\u3060\u3051\u3067\u3001\u8cb4\u65b9\u306e\u611b\u3092\u4e5e\u3046\u7537\u306e\u884c\u5217\u304c\u51fa\u6765\u308b\u3067\u3057\u3087\u3046\u3002\u305d\u306e\u4e2d\u306b\u306f\u8eab\u5206\u3082\u76f8\u5fdc\u3067\u3001\u512a\u3057\u304f\u3001\u624d\u6c17\u6ea2\u308c\u308b\u7537\u3060\u3063\u3066\u304d\u3063\u3068\u3044\u308b\u3002\u308f\u3056\u308f\u3056\u3042\u3093\u306a\u4e8b\u6545\u7269\u4ef6\u306b\u62d8\u3089\u306a\u3044\u65b9\u304c\u3001\u304d\u3063\u3068\u5e78\u305b\u306b\u306a\u308c\u307e\u3059", "\u524d\u63d0\u304c\u9055\u3044\u307e\u3059", "\u3048\uff1f", "\u611b\u3057\u3066\u304f\u308c\u308b\u65e6\u90a3\u69d8\u304c\u6b32\u3057\u3044\u306e\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u611b\u3057\u3066\u3044\u308b\u65b9\u306e\u304a\u5ac1\u3055\u3093\u306b\u306a\u308a\u305f\u3044\u3093\u3067\u3059", "\u53c2\u3063\u305f", "\u8cb4\u65b9\u306f\u3044\u3044\u5973\u3060"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/157/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u8003\u67fb\u3002(3)", "discourse": ["\u5446\u308c\u3066\u307e\u3059\u2026\u2026\uff1f", "\u5fc3\u5f53\u305f\u308a\u304c\u304a\u3042\u308a\u3067\u3059\u304b\uff1f", "\u5446\u308c\u3066\u3044\u307e\u305b\u3093\u3088\u3002\u76f8\u8ac7\u306e\u5185\u5bb9\u3092\u8003\u3048\u308c\u3070\u3001\u8cb4\u65b9\u306e\u5224\u65ad\u306f\u6b63\u3057\u3044", "\u56f0\u3063\u3066\u3044\u308b\u3068\u601d\u3063\u305f\u304b\u3089\u3001\u624b\u4f1d\u3063\u305f\u3060\u3051\u3067\u3057\u3087\u3046\uff1f\u5446\u308c\u308b\u306f\u305a\u304c\u306a\u3044\u3002\u305f\u3060\u2026\u2026", "\u2026\u2026\u305f\u3060\uff1f", "\u2026\u2026\u306a\u3093\u3067\u3082\u3042\u308a\u307e\u305b\u3093", "\u306a\u308b\u307b\u3069\u3001\u9762\u767d\u3044\u8da3\u5473\u3060", "\u6c11\u8a71\u306e\u4e2d\u306b\u306f\u3001\u5371\u967a\u3084\u7981\u5fcc\u304b\u3089\u5b50\u4f9b\u3092\u9060\u3056\u3051\u308b\u610f\u56f3\u304c\u542b\u307e\u308c\u3066\u3044\u308b\u3082\u306e\u304c\u3042\u308b\u3068\u601d\u3046\u3093\u3067\u3059", "\u3053\u306e\u8fba\u308a\u306b\u9b54\u738b\u304c\u5c01\u5370\u3055\u308c\u3066\u3044\u308b\u306e\u3067\u3042\u308c\u3070\u3001\u6c11\u8a71\u306e\u4e2d\u306b\u3082\u9b54\u738b\u304c\u591a\u304f\u767b\u5834\u3059\u308b\u3093\u3058\u3083\u306a\u3044\u304b\u3068\u671f\u5f85\u3057\u305f\u3093\u3067\u3059\u304c\u2026\u2026", "\u305d\u306e\u8a00\u3044\u65b9\u3067\u3059\u3068\u3001\u671f\u5f85\u3057\u305f\u7a0b\u306f\u898b\u3064\u3051\u3089\u308c\u306a\u304b\u3063\u305f\u3068\u3044\u3046\u4e8b\u3067\u3057\u3087\u3046\u304b\uff1f", "\u3068\u3044\u3044\u307e\u3059\u304b\u3001\u6b86\u3069\u300e\u306a\u3044\u300f\u3068\u3044\u3046\u306e\u304c\u6b63\u3057\u3044\u3067\u3059", "\u305d\u308c\u306f\u2026\u2026\u304a\u304b\u3057\u306a\u8a71\u3067\u3059\u306d", "\u9b54\u738b\u3092\u984c\u6750\u306b\u3057\u305f\u5fa1\u4f3d\u567a\u306f\u3001\u30cd\u30fc\u30d9\u30eb\u3060\u3051\u306b\u9650\u3089\u305a\u4e16\u754c\u5404\u56fd\u306b\u591a\u304f\u5b58\u5728\u3057\u307e\u3059\u3002\u305d\u308c\u306a\u306e\u306b\u3001\u3069\u3046\u3057\u3066\u3053\u306e\u8fba\u308a\u3060\u3051\u306a\u3044\u306e\u304b\u3002\u79c1\u306e\u52dd\u624b\u306a\u63a8\u6e2c\u3067\u3057\u304b\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u300e\u9b54\u738b\u300f\u3068\u3044\u3046\u5b58\u5728\u3092\u306a\u308b\u3079\u304f\u4eba\u3005\u306e\u8a18\u61b6\u306b\u6b8b\u3057\u305f\u304f\u306a\u304b\u3063\u305f\u3093\u3058\u3083\u306a\u3044\u3067\u3057\u3087\u3046\u304b\uff1f", "\u305d\u306e\u4ee3\u308f\u308a\u306a\u306e\u304b\u306f\u5206\u304b\u308a\u307e\u305b\u3093\u304c\u3001\u300e\u60aa\u3044\u7cbe\u970a\u300f\u304c\u3088\u304f\u767b\u5834\u3057\u307e\u3059\u3002\u89aa\u306e\u8a00\u3044\u3064\u3051\u3092\u5b88\u3089\u306a\u304b\u3063\u305f\u5b50\u4f9b\u304c\u3001\u7cbe\u970a\u306b\u60d1\u308f\u3055\u308c\u3066\u5bb6\u306b\u5e30\u308c\u306a\u304f\u306a\u3063\u3066\u3057\u307e\u3046\u3093\u3067\u3059", "\u9b54\u738b\u3068\u3044\u3046\u5b58\u5728\u3092\u8a18\u61b6\u304b\u3089\u8584\u308c\u3055\u305b\u3001\u4e14\u3064\u3001\u5c01\u5370\u306e\u5730\u304b\u3089\u9060\u3056\u3051\u308b\u305f\u3081\u306b\u300e\u60aa\u3044\u7cbe\u970a\u300f\u3068\u3044\u3046\u5b58\u5728\u304c\u3064\u304f\u3089\u308c\u305f\u3068", "\u306f\u3044\u3002\u305f\u3060\u3001\u3053\u306e\u624b\u306e\u8a71\u304c\u591a\u3059\u304e\u3066\u3001\u5730\u57df\u307e\u3067\u306f\u7d5e\u308c\u306a\u304b\u3063\u305f\u3093\u3067\u3059", "\u3067\u3059\u304c\u3001\u68ee\u306e\u4e2d\u306b\u8ff7\u3044\u8fbc\u3080\u8a18\u8ff0\u304c\u591a\u304b\u3063\u305f\u306e\u3067\u3001\u3082\u3057\u304b\u3057\u305f\u3089\u795e\u6bbf\u3082\u2026\u2026", "\u68ee\u306e\u4e2d\u306b\u3042\u308b\u304b\u3082\u3001\u3068\u3044\u3046\u4e8b\u3067\u3059\u306d", "\u30f4\u30a9\u30eb\u30bf\u30fc\u69d8\u306b\u78ba\u8a8d\u3057\u305f\u3068\u3053\u308d\u3001\u3053\u3061\u3089\u306e\u6751\u2026\u2026\u4e09\u30f6\u6240\u306e\u5019\u88dc\u306e\u3046\u3061\u3001\u7826\u304b\u3089\u4e00\u756a\u9060\u3044\u6751\u306e\u795e\u6bbf\u306f\u3001\u8fd1\u304f\u306b\u68ee\u304c\u3042\u3063\u305f\u306f\u305a\u3060\u3068\u6559\u3048\u3066\u4e0b\u3055\u3044\u307e\u3057\u305f", "\u3067\u306f\u3001\u305d\u3061\u3089\u3092\u5148\u306b\u8abf\u67fb\u3057\u3066\u307f\u307e\u3057\u3087\u3046\u3002\u5929\u5019\u304c\u56de\u5fa9\u3059\u308c\u3070\u660e\u65e5\u306b\u3067\u3082\u51fa\u767a\u3057\u307e\u3059\u306e\u3067\u3001\u6e96\u5099\u3092\u3057\u3066\u304a\u3044\u3066\u304f\u3060\u3055\u3044", "\u5206\u304b\u308a\u307e\u3057\u305f", "\u3067\u306f\u3001\u307e\u305f\u660e\u65e5", "\u3042\uff01\u5f85\u3063\u3066\u304f\u3060\u3055\u3044\u3002\u307e\u3060\u304a\u8a71\u3057\u3057\u305f\u3044\u4e8b\u304c\u3042\u308b\u3093\u3067\u3059", "\u3048\u3063\u3068\u2026\u2026\u3053\u306a\u3044\u3060\u5bc4\u3063\u305f\u6751\u3067\u3001\u98df\u4e8b\u51e6\u306b\u5165\u3063\u305f\u6642\u306b\u77e5\u308a\u5408\u3063\u305f\u65b9\u306e\u4e8b\u306a\u3093\u3067\u3059\u304c", "\u30e9\u30fc\u30c6\u3068\u3044\u3046\u7537\u3067\u3059\u306d", "\u2026\u2026\u306f\u3044", "\u5b9f\u306f\u79c1\u3001\u5148\u65e5\u4f1a\u3046\u524d\u304b\u3089\u3042\u306e\u4eba\u306e\u4e8b\u3092\u77e5\u3063\u3066\u3044\u307e\u3057\u305f", "\u305d\u308c\u306f\u2026\u2026\u3069\u3046\u3044\u3046\u610f\u5473\u3067\u3059\u304b\uff1f\u3042\u306e\u7537\u306f\u8cb4\u65b9\u306e\u77e5\u308a\u5408\u3044\u3060\u3068\uff1f", "\u76f4\u63a5\u4f1a\u3063\u305f\u4e8b\u306f\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u3002\u79c1\u304c\u5f7c\u3092\u521d\u3081\u3066\u77e5\u3063\u305f\u306e\u306f\u3001\u5922\u306e\u4e2d\u3060\u3063\u305f\u3093\u3067\u3059", "\uff01", "\u2026\u2026\u4ee5\u4e0a\u304c\u3001\u5f7c\u306b\u3064\u3044\u3066\u79c1\u304c\u77e5\u3063\u3066\u3044\u308b\u5168\u3066\u3067\u3059", "\u306a\u308b\u307b\u3069", "\u4e00\u822c\u4eba\u306e\u52d5\u304d\u3067\u306f\u306a\u3044\u3068\u601d\u3063\u3066\u3044\u307e\u3057\u305f\u304c\u3001\u5143\u6697\u6bba\u8005\u3067\u3059\u304b\u3002\u2026\u2026\u3060\u304c\u3001\u305d\u308c\u3067\u4f59\u8a08\u306b\u5206\u304b\u3089\u306a\u304f\u306a\u3063\u305f\u306a", "\u4f55\u304c\u3067\u3057\u3087\u3046\u304b\uff1f", "\u8003\u3048\u904e\u304e\u306a\u306e\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u304c\u3001\u3042\u306e\u7537\u306f\u300e\u602a\u3057\u3059\u304e\u308b\u300f\u3068\u30aa\u30ec\u306f\u611f\u3058\u307e\u3057\u305f", "\u304a\u305d\u3089\u304f\u3042\u306e\u7537\u306f\u76f8\u5f53\u306e\u624b\u7df4\u308c\u3067\u3059\u3002\u30aa\u30ec\u9054\u3092\u63a2\u308d\u3046\u3068\u3057\u3066\u3044\u308b\u306a\u3089\u3001\u3082\u3063\u3068\u4e0a\u624b\u304f\u7acb\u3061\u56de\u308b\u3067\u3057\u3087\u3046", "\u3067\u3059\u304c\u3001\u305f\u3060\u306e\u6751\u4eba\u3060\u3068\u8003\u3048\u308b\u3068\u3001\u305d\u308c\u306f\u305d\u308c\u3067\u4e0d\u81ea\u7136\u3060", "\u4eca\u8003\u3048\u3066\u3082\u7b54\u3048\u306f\u51fa\u306a\u3044\u3067\u3057\u3087\u3046\u304b\u3089\u3001\u53d6\u308a\u6562\u3048\u305a\u3001\u4eca\u65e5\u306f\u3053\u3053\u307e\u3067\u306b\u3057\u307e\u3057\u3087\u3046", "\u8a71\u3057\u3066\u304f\u308c\u3066\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u3048\u2026\u2026\uff1f", "\u8cb4\u65b9\u306f\u306a\u3093\u3067\u3082\u4e00\u4eba\u3067\u62b1\u3048\u8fbc\u3080\u7656\u304c\u3042\u308b\u304b\u3089\u3001\u76f8\u8ac7\u3057\u3066\u3082\u3089\u3048\u3066\u5b09\u3057\u304b\u3063\u305f", "\u305d\u308c\u3060\u3051\u3067\u3059\u3002\u3067\u306f\u2026\u2026\u304a\u3084\u3059\u307f\u306a\u3055\u3044", "\u304a\u3084\u3059\u307f\u306a\u3055\u3044"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/156/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u8003\u67fb\u3002(2)", "discourse": ["\u30f4\u30a9\u30eb\u30bf\u30fc\u69d8", "\u306f\u3044", "\u3053\u3061\u3089\u306e\u8cc7\u6599\u3001\u4e00\u6669\u304a\u501f\u308a\u3057\u3066\u3082\u5b9c\u3057\u3044\u3067\u3057\u3087\u3046\u304b\uff1f", "\u69cb\u3044\u307e\u305b\u3093\u3002\u6570\u6642\u9593\u3067\u8aad\u307f\u7d42\u3048\u308b\u5185\u5bb9\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3057\u3001\u3053\u3061\u3089\u306b\u6ede\u5728\u3059\u308b\u9593\u306f\u304a\u597d\u304d\u306b\u8aad\u3093\u3067\u304f\u3060\u3055\u3044", "\u5f8c\u3067\u304a\u90e8\u5c4b\u307e\u3067\u904b\u3093\u3067\u304a\u304d\u307e\u3059", "\u3044\u3048\u3001\u305d\u3053\u307e\u3067\u3057\u3066\u9802\u304f\u8a33\u306b\u306f", "\u5927\u3057\u305f\u624b\u9593\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3057\u3001\u305d\u3082\u305d\u3082\u8cb4\u65b9\u306e\u7d30\u8155\u3067\u6301\u3066\u308b\u91cf\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3088\u3002\u7518\u3048\u3066\u304a\u304d\u306a\u3055\u3044\u3002\u305d\u308c\u3088\u308a\u2026\u2026", "\u305d\u308d\u305d\u308d\u663c\u98df\u306e\u6642\u9593\u3067\u3059\u3002\u98df\u5802\u3078\u53c2\u308a\u307e\u3057\u3087\u3046", "\u4f55\u4e8b\u3067\u3059\u304b", "\u3075\u3001\u526f\u968a\u9577\uff01", "\u304a\u9a12\u304c\u305b\u81f4\u3057\u307e\u3057\u305f\u3002\u7533\u3057\u8a33\u2026\u2026", "\u8b1d\u7f6a\u306f\u7d50\u69cb\u3067\u3059\u3002\u30d1\u30b9\u30ab\u30eb\u5c0f\u968a\u9577", "\u306f\u3063", "\u7c21\u6f54\u306b\u5831\u544a\u3092", "\u4f4f\u307f\u8fbc\u307f\u306e\u6599\u7406\u4eba\u304c\u8cb7\u3044\u51fa\u3057\u306b\u884c\u3063\u305f\u6751\u3067\u3001\u8db3\u6b62\u3081\u3055\u308c\u3066\u3044\u308b\u70ba\u3001\u968a\u306e\u4eba\u9593\u3067\u98df\u4e8b\u5f53\u756a\u3092\u56de\u3057\u3066\u3044\u305f\u306e\u3067\u3059\u304c\u2026\u2026", "\u8db3\u6b62\u3081\u306e\u4ef6\u306f\u5831\u544a\u3092\u53d7\u3051\u3066\u304a\u308a\u307e\u3059\u3002\u7c21\u6f54\u306b\u3068\u8a00\u3063\u305f\u306f\u305a\u3067\u3059\u304c", "\u5931\u793c\u81f4\u3057\u307e\u3057\u305f\uff01\u73fe\u5728\u624b\u304c\u3042\u3044\u3066\u3044\u308b\u8005\u304c\u6599\u7406\u4e0b\u624b\u3057\u304b\u3044\u306a\u304b\u3063\u305f\u70ba\u3001\u663c\u98df\u304c\u30af\u30bd\u4e0d\u5473\u2026\u2026\u304b\u306a\u308a\u500b\u6027\u7684\u306a\u4ed5\u4e0a\u304c\u308a\u306b\u306a\u3063\u3066\u3057\u307e\u3063\u305f\u6b21\u7b2c\u3067\u3042\u308a\u307e\u3059\uff01", "\u663c\u98ef\u3081\u3063\u3061\u3083\u4e0d\u5473\u3044\uff01", "\u5439\u96ea\u3067\u5916\u306b\u51fa\u308b\u4e8b\u3082\u5118\u306a\u3089\u306a\u3044\u72b6\u6cc1\u3067\u3001\u968f\u5206\u3068\u5fd9\u3057\u3044\u4eba\u9593\u304c\u591a\u304b\u3063\u305f\u3088\u3046\u3067\u3059\u306d", "\u2026\u2026\u30aa\u30eb\u30bb\u30a4\u30f3\u56e3\u9577\u306e\u3054\u6307\u5c0e\u3092\u53d7\u3051\u3088\u3046\u3068\u3001\u6bba\u5230\u3057\u305f\u7d50\u679c\u3067\u3059\u3002\u7533\u3057\u8a33\u3054\u3056\u3044\u307e\u305b\u3093\u3067\u3057\u305f\uff01", "\u3082\u3046\u3044\u3044\u3067\u3059\u3002\u3042\u306e\u65b9\u306e\u4eba\u6c17\u3092\u8210\u3081\u3066\u3044\u305f\u79c1\u306e\u305b\u3044\u3067\u3082\u3042\u308a\u307e\u3059\u304b\u3089\u3002\u305d\u308c\u3088\u308a\u3082\u3001\u3054\u4ee4\u5b22\u304c\u98df\u3079\u3089\u308c\u305d\u3046\u306a\u3082\u306e\u306f\u3042\u308a\u307e\u3059\u304b", "\u30d5\u30eb\u30fc\u30c4\u304c\u5c11\u3057\u3068\u3001\u30d1\u30f3\u306a\u3089\u3042\u308a\u307e\u3059\u304c", "\u30de\u30ea\u30fc\u69d8\u3002\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u304a\u6642\u9593\u3092\u9802\u3051\u307e\u3059\u304b\u3002\u4eca\u304b\u3089\u79c1\u304c\u4f5c\u308a\u307e\u3059\u306e\u3067", "\u526f\u968a\u9577\u304c!?", "\u6b62\u3081\u3066\u304f\u3060\u3055\u3044\u3063\uff01\u53ef\u6190\u306a\u3054\u4ee4\u5b22\u306e\u80c3\u8178\u3092\u3076\u3063\u58ca\u3059\u6c17\u3067\u3059\u304b\uff01", "\u305d\u308c\u4f4d\u306a\u3089\u3042\u306e\u30af\u30bd\u30de\u30ba\u6599\u7406\u98df\u3063\u305f\u65b9\u304c\u3001\u767e\u500d\u30de\u30b7\u3067\u3059\uff01", "\u3069\u3046\u3044\u3046\u610f\u5473\u3067\u3059", "\u3042\u306e", "\u826f\u304b\u3063\u305f\u3089\u3001\u79c1\u304c\u4f5c\u308a\u307e\u3057\u3087\u3046\u304b", "\u91ce\u83dc\u304c\u751f\u716e\u3048\u306a\u3093\u3067\u3059\u3088\u3002\u3042\u3068\u3001\u3057\u3087\u3063\u3071\u3044\u3093\u3067\u3059", "\u306a\u308b\u307b\u3069", "\u30d0\u30bf\u30fc\u3068\u5c0f\u9ea6\u7c89\u3068\u725b\u4e73\u3063\u3066\u3042\u308a\u307e\u3059\u304b\uff1f", "\u4f55\u3092\u4f5c\u3063\u3066\u3044\u308b\u3093\u3067\u3059\u304b\uff1f", "\u3048\u30fc\u3063\u3068\u3067\u3059\u306d\u2026\u2026", "\u2026\u2026\u5185\u7dd2\u3067\u3059", "\u3082\u3046\u4e00\u56de\u8a00\u3063\u3066\u304f\u3060\u3055\u3044\u3063\uff01", "\u7f8e\u5473\u3044\u2026\u2026!!", "\u738b\u90fd\u306e\u98df\u5802\u3067\u3082\u3053\u3093\u306a\u7f8e\u5473\u3044\u3082\u3093\u3001\u98df\u3063\u305f\u3053\u3068\u306d\u3048\uff01", "\u3082\u3046\u4e94\u676f\u304f\u3089\u3044\u98df\u3044\u305f\u3044", "\u3075\u3056\u3051\u3093\u306a\uff01\u4e00\u4eba\u4e00\u676f\u3063\u3066\u8a00\u308f\u308c\u3066\u305f\u3060\u308d\u3046\u304c!!\u30aa\u30ec\u3060\u3063\u3066\u6211\u6162\u3057\u3066\u3093\u306e\u306b", "\u9759\u304b\u306b\u3057\u306a\u3055\u3044\uff01\u307f\u3063\u3068\u3082\u306a\u3044!!", "\u5ba2\u4eba\u306b\u6599\u7406\u3092\u4f5c\u3089\u305b\u3066\u3057\u307e\u3063\u305f\u3070\u304b\u308a\u304b\u3001\u3053\u3093\u306a\u307f\u3063\u3068\u3082\u306a\u3044\u6709\u308a\u69d8\u3092\u898b\u305b\u3066\u3057\u307e\u3063\u3066\u3001\u8aa0\u306b\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093", "\u3044\u3044\u3048\u3002\u5927\u3057\u305f\u3082\u306e\u306f\u4f5c\u308c\u307e\u305b\u3093\u3067\u3057\u305f\u3057", "\u305d\u3093\u306a\u4e8b\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u79c1\u306f\u9b54\u6cd5\u3092\u898b\u3066\u3044\u308b\u306e\u304b\u3068\u601d\u3044\u307e\u3057\u305f\u3088\u3002\u4f5c\u308a\u76f4\u3059\u306e\u3067\u306f\u306a\u304f\u3001\u5931\u6557\u3057\u305f\u30b9\u30fc\u30d7\u3092\u3001\u7f8e\u5473\u3057\u3044\u6599\u7406\u306b\u5909\u3048\u3066\u304f\u308c\u305f\u306e\u3067\u3059\u304b\u3089"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/155/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u8003\u67fb\u3002", "discourse": ["\u8a00\u3046\u307e\u3067\u3082\u306a\u3044\u4e8b\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u304c\u3001\u672c\u65e5\u306f\u5916\u51fa\u7981\u6b62\u3067\u3059", "\u306f\u3044\u3002\u4eca\u65e5\u306f\u5927\u4eba\u3057\u304f\u904e\u3054\u3059\u3064\u3082\u308a\u3067\u3059", "\u306a\u3089\u3070\u3001\u7d50\u69cb\u3067\u3059", "\u968a\u9577\u306f\u660e\u65e5\u307e\u3067\u623b\u308a\u307e\u305b\u3093\u3002\u5fa1\u7528\u304c\u3054\u3056\u3044\u307e\u3057\u305f\u3089\u3001\u79c1\u306b\u304a\u7533\u3057\u4ed8\u3051\u304f\u3060\u3055\u3044", "\u968a\u9577\u69d8\u306f\u3001\u3044\u3089\u3063\u3057\u3083\u3089\u306a\u3044\u3093\u3067\u3059\u304b", "\u5965\u69d8\u306e\u4f53\u8abf\u304c\u512a\u308c\u306a\u3044\u305d\u3046\u3067\u3059", "\u3048\u3063!?", "\u5929\u5019\u304c\u8352\u308c\u308b\u6642\u306f\u4f53\u8abf\u3092\u5d29\u3057\u3084\u3059\u3044\u3068\u3001\u4ee5\u524d\u306b\u304a\u805e\u304d\u3057\u305f\u4e8b\u304c\u3042\u308a\u307e\u3059\u3002\u3044\u3064\u3082\u306e\u4e8b\u3067\u3059\u306e\u3067\u3001\u3042\u307e\u308a\u5fc3\u914d\u306a\u3055\u3089\u306a\u3044\u3067\u304f\u3060\u3055\u3044\u3068\u3001\u8a00\u4f1d\u3092\u9810\u304b\u3063\u3066\u304a\u308a\u307e\u3059", "\u305d\u3046\u2026\u2026\u3067\u3059\u304b", "\u843d\u3061\u7740\u3044\u305f\u3089\u3001\u304a\u898b\u821e\u3044\u306b\u4f3a\u3048\u306a\u3044\u304b\u805e\u3044\u3066\u307f\u307e\u3057\u3087\u3046", "\u7826\u5185\u306b\u7559\u307e\u3063\u3066\u3044\u305f\u3060\u3051\u308c\u3070\u3001\u3042\u3068\u306f\u81ea\u7531\u306b\u3057\u3066\u3044\u3066\u304f\u3060\u3055\u3063\u3066\u7d50\u69cb\u3067\u3059\u3002\u79c1\u306f\u57f7\u52d9\u5ba4\u306b\u304a\u308a\u307e\u3059\u306e\u3067\u3001\u4f55\u304b\u3042\u3063\u305f\u3089\u304a\u547c\u3073\u304f\u3060\u3055\u3044", "\u306a\u306b\u304b\u304a\u624b\u4f1d\u3044\u51fa\u6765\u308b\u3053\u3068\u304c\u3042\u308c\u3070\u2026\u2026", "\u7d50\u69cb\u3067\u3059", "\u30aa\u30eb\u30bb\u30a4\u30f3\u56e3\u9577\u3002\u3082\u3057\u304a\u624b\u3059\u304d\u3067\u3057\u305f\u3089\u3001\u90e8\u4e0b\u306e\u935b\u932c\u3092\u898b\u3066\u3084\u3063\u3066\u306f\u3044\u305f\u3060\u3051\u307e\u305b\u3093\u304b\u3002\u8cb4\u65b9\u306b\u61a7\u308c\u3066\u3044\u308b\u82e5\u3044\u9023\u4e2d\u304c\u3001\u3053\u3053\u6570\u65e5\u3001\u6d6e\u3064\u3044\u3066\u3044\u3066\u56f0\u3063\u3066\u304a\u308a\u307e\u3059\u3002\u53b3\u3057\u304f\u6307\u5c0e\u3057\u3001\u73fe\u5b9f\u3092\u6559\u3048\u3066\u3084\u3063\u3066\u3044\u305f\u3060\u304d\u305f\u3044", "\u305d\u308c\u306f\u69cb\u308f\u306a\u3044\u304c", "\u79c1\u3082\u898b\u5b66\u3057\u305f\u3044\u3067\u3059", "\u3044\u3051\u307e\u305b\u3093", "\u5203\u3092\u6f70\u3057\u305f\u6a21\u64ec\u6226\u7528\u306e\u5263\u3067\u3042\u3063\u3066\u3082\u3001\u3076\u3064\u304b\u308c\u3070\u8efd\u50b7\u3067\u306f\u6e08\u307f\u307e\u305b\u3093\u3002\u5371\u967a\u3060", "\u30aa\u30eb\u30bb\u30a4\u30f3\u56e3\u9577\u304c\u5e2d\u3092\u5916\u3055\u308c\u3066\u3044\u308b\u9593\u306f\u3001\u79c1\u304c\u6bbf\u4e0b\u306e\u508d\u306b\u304a\u308a\u307e\u3059", "\u2026\u2026\u30f4\u30a9\u30eb\u30bf\u30fc\u69d8\u304c\uff1f", "\u305f\u3060\u79c1\u306b\u3082\u81ea\u5206\u306e\u4ed5\u4e8b\u304c\u3054\u3056\u3044\u307e\u3059\u306e\u3067\u3001\u6bbf\u4e0b\u306b\u306f\u79c1\u306e\u57f7\u52d9\u5ba4\u3067\u904e\u3054\u3057\u3066\u3044\u305f\u3060\u304f\u4e8b\u306b\u306a\u308a\u307e\u3059\u304c\u3001\u5b9c\u3057\u3044\u3067\u3057\u3087\u3046\u304b", "\u3082\u3061\u308d\u3093\u3067\u3059", "\u81ea\u7531\u306b\u3057\u3066\u3044\u3066\u304f\u3060\u3055\u3044\u3002\u672c\u68da\u306e\u672c\u306f\u3001\u3069\u308c\u3082\u597d\u304d\u306b\u8aad\u3093\u3067\u304f\u3060\u3055\u3063\u3066\u69cb\u3044\u307e\u305b\u3093", "\u672c\u68da\u306b\u5165\u3063\u3066\u3044\u308b\u7269\u306f\u3001\u597d\u304d\u306b\u8aad\u3093\u3067\u826f\u3044\u3068\u8a00\u3044\u307e\u3057\u305f\u3088", "\u30cd\u30fc\u30d9\u30eb\u5317\u6771\u90e8\u306e\u6c11\u8a71\u3092\u96c6\u3081\u305f\u3082\u306e\u3067\u3059\u3002\u9000\u5c48\u3057\u306e\u304e\u306b\u306a\u308b\u304b\u5206\u304b\u308a\u307e\u305b\u3093\u304c\u3001\u5b9c\u3057\u304b\u3063\u305f\u3089\u3069\u3046\u305e", "\u6c11\u8a71\uff01", "\u662f\u975e\u8aad\u307e\u305b\u3066\u3044\u305f\u3060\u304d\u307e\u3059", "\u3060\u3001\u3081\u3001\u3067\u3057\u305f\uff1f", "\u5148\u7a0b\u3082\u8a00\u3063\u305f\u3088\u3046\u306b\u3001\u597d\u304d\u306b\u898b\u3066\u3044\u305f\u3060\u3044\u3066\u69cb\u3044\u307e\u305b\u3093\u3002\u2026\u2026\u305f\u3060\u5c11\u3057\u3001\u610f\u5916\u3060\u3063\u305f\u3060\u3051\u3067\u3059", "\u610f\u5916\uff1f", "\u7387\u76f4\u306b\u7533\u3057\u307e\u3059\u3068\u3001\u672c\u5f53\u306b\u8aad\u3080\u3068\u306f\u601d\u3044\u307e\u305b\u3093\u3067\u3057\u305f\u3002\u59eb\u541b\u304c\u8208\u5473\u3092\u793a\u3059\u5185\u5bb9\u3060\u3068\u306f\u3001\u6b20\u7247\u3082\u601d\u3063\u3066\u304a\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u306e\u3067", "\u500b\u4eba\u7684\u306b\u306f\u3001\u3068\u3066\u3082\u8208\u5473\u6df1\u3044\u3067\u3059", "\u2026\u2026\u6b74\u53f2\u66f8\u3068\u5730\u56f3\u306f\u3001\u3069\u3046\u3055\u308c\u308b\u304a\u3064\u3082\u308a\u3067\u3059\u304b\uff1f", "\u6c11\u8a71\u306b\u306f\u5730\u57df\u6027\u3084\u6b74\u53f2\u7684\u306a\u80cc\u666f\u304c\u3001\u6559\u8a13\u3068\u3044\u3046\u5f62\u3067\u53cd\u6620\u3055\u308c\u3066\u3044\u308b\u4e8b\u304c\u591a\u3044\u306e\u3067\u3001\u898b\u6bd4\u3079\u305f\u3089\u9762\u767d\u3044\u304b\u3068\u2026\u2026", "\u5c11\u3005\u304a\u5f85\u3061\u4e0b\u3055\u3044", "\u79c1\u304c\u623b\u308b\u307e\u3067\u3001\u7d76\u5bfe\u306b\u3053\u3053\u3092\u96e2\u308c\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u4eca\u3001\u304a\u624b\u5143\u306b\u3042\u308b\u306e\u306f\u3001\u7c21\u6613\u7248\u3068\u3057\u3066\u4f5c\u6210\u3057\u305f\u3082\u306e\u3002\u3053\u3061\u3089\u304c\u8a73\u7d30\u306b\u66f8\u304d\u5199\u3057\u305f\u3082\u306e\u3067\u3059\u3002\u3056\u3063\u3068\u3067\u3059\u304c\u5730\u57df\u5225\u306b\u7e8f\u3081\u3066\u3042\u308a\u307e\u3059\u3002\u305d\u308c\u304b\u3089\u53f3\u7aef\u306e\u6570\u5b57\u3067\u3059\u304c\u3001\u540c\u3058\u984c\u6750\u3092\u5143\u306b\u6d3e\u751f\u3057\u305f\u3067\u3042\u308d\u3046\u8a71\u3054\u3068\u306b\u5272\u308a\u632f\u3063\u305f\u3082\u306e\u3067\u3059\u3002\u3053\u3061\u3089\u306e\u7d19\u306b\u756a\u53f7\u3068\u984c\u6750\u3092\u660e\u8a18\u3057\u3066\u3042\u308a\u307e\u3059\u306e\u3067\u7167\u3089\u3057\u5408\u308f\u305b\u3066\u304f\u3060\u3055\u3044", "\u3053\u306e\u5730\u56f3\u306b\u306f\u3001\u3055\u304d\u307b\u3069\u306e\u984c\u6750\u3054\u3068\u306b\u5272\u308a\u632f\u3063\u305f\u6570\u5b57\u5225\u306b\u3001\u5206\u5e03\u56f3\u3092\u66f8\u304d\u8fbc\u3093\u3067\u3042\u308a\u307e\u3059\u3002\u7d30\u304b\u3044\u5730\u5f62\u304c\u77e5\u308a\u305f\u3051\u308c\u3070\u3001\u3053\u3061\u3089\u3092\u3054\u89a7\u304f\u3060\u3055\u3044\u3002\u79c1\u306e\u624b\u66f8\u304d\u3067\u3059\u306e\u3067\u53c2\u8003\u7a0b\u5ea6\u306b\u306a\u3063\u3066\u3057\u307e\u3044\u307e\u3059\u304c\u3001\u5b9c\u3057\u3051\u308c\u3070", "\u3042\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u2026\u2026\u5931\u793c\u3092\u81f4\u3057\u307e\u3057\u305f", "\u2026\u2026\u5927\u5207\u306b\u8aad\u307e\u305b\u3066\u3044\u305f\u3060\u304d\u307e\u3059\u306d"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/154/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u635c\u7d22\u3002(3)", "discourse": ["\u304a\u5b22\u3055\u3093\u3001\u3069\u3046\u304b\u3057\u305f\u304b\u306a\uff1f\u30aa\u30ec\u306e\u9854\u306b\u4f55\u304b\u3064\u3044\u3066\u308b\uff1f", "\u3044\u3001\u3044\u3048\uff01\u3061\u3087\u3063\u3068\u77e5\u308a\u5408\u3044\u306b\u4f3c\u3066\u3044\u305f\u6c17\u304c\u3057\u3066\u2026\u2026\u3054\u3081\u3093\u306a\u3055\u3044", "\u8b1d\u3089\u306a\u304f\u3066\u3044\u3044\u3088\u3002\u3080\u3057\u308d\u3001\u7dba\u9e97\u306a\u304a\u5b22\u3055\u3093\u3068\u8a71\u305b\u308b\u30ad\u30c3\u30ab\u30b1\u304c\u51fa\u6765\u3066\u5b09\u3057\u3044\u3057", "\u30e9\u30fc\u30c6\uff01\u3054\u3081\u3093\u3001\u3061\u3087\u3063\u3068\u624b\u4f1d\u3063\u3066\u30fc\uff01", "\u306f\u30fc\u3044", "\u30de\u30ea\u30fc\u3001\u3069\u3046\u304b\u3057\u305f\u304b\uff1f", "\u3054\u3061\u305d\u3046\u3055\u307e\u3067\u3057\u305f", "\u306f\u3044\u3001\u304a\u7c97\u672b\u69d8", "\u98df\u5f8c\u306e\u304a\u8336\u3092\u3069\u3046\u305e", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u3046\u3093\u3002\u3053\u3063\u3061\u306e\u683c\u597d\u826f\u3044\u5144\u3055\u3093\u3082\u3069\u3046\u305e\u3002\u672c\u5f53\u306f\u5973\u306e\u5b50\u306b\u3057\u304b\u51fa\u3055\u306a\u3044\u3093\u3060\u3051\u3069\u3001\u304a\u5b22\u3055\u3093\u306e\u304a\u9023\u308c\u3055\u3093\u3060\u304b\u3089\u7279\u5225\u306d", "\u305d\u308c\u306f\u6709\u308a\u96e3\u3044", "\u304a\u8336\u4ee3\u3063\u3066\u3053\u3068\u3067\u3001\u76f8\u5e2d\u3044\u3044\u304b\u306a\u3002\u3053\u308c\u304b\u3089\u663c\u98df\u306a\u3093\u3060", "\u304a\u5b22\u3055\u3093\u9054\u306f\u3069\u3053\u304b\u3089\u6765\u305f\u306e\uff1f", "\u738b\u90fd\u304b\u3089\u6765\u307e\u3057\u305f", "\u3042\u3042\u3001\u3084\u3063\u3071\u308a\u3002\u4e8c\u4eba\u5171\u306a\u3093\u304b\u57a2\u629c\u3051\u3066\u308b\u3063\u3066\u3044\u3046\u304b\u3001\u54c1\u304c\u3042\u308b\u304b\u3089\u3001\u305d\u3046\u304b\u306a\u3063\u3066\u601d\u3063\u305f\u3093\u3060", "\u541b\u306f\u2026\u2026", "\u541b\u3063\u3066\u547c\u3070\u308c\u308b\u306e\u306f\u64fd\u3063\u305f\u3044\u304b\u3089\u3001\u30e9\u30fc\u30c6\u3067\u826f\u3044\u3088", "\u305d\u3046\u304b\u3001\u5206\u304b\u3063\u305f\u3002\u30aa\u30ec\u306f\u30ec\u30aa\u30f3\u3068\u3044\u3046\u3002\u3053\u3063\u3061\u306f\u59b9\u306e\u30de\u30ea\u30fc\u3060", "\u30ec\u30aa\u30f3\u306b\u30de\u30ea\u30fc\u3061\u3083\u3093\u306d\u3002\u3046\u3093\u3001\u5b9c\u3057\u304f\u3002\u305d\u308c\u3067\u3001\u4f55\u306e\u8a71\u3060\u3063\u3051\uff1f", "\u3042\u3042\u3001\u30e9\u30fc\u30c6\u306f\u3053\u3053\u306e\u751f\u307e\u308c\u306a\u306e\u304b\uff1f", "\u30aa\u30ec\u306f\u4f59\u6240\u8005\u3060\u3088\u3002\u30cd\u30fc\u30d9\u30eb\u306e\u751f\u307e\u308c\u3058\u3083\u306a\u3044\u3002\u3053\u306e\u6751\u306b\u6765\u305f\u306e\u3082\u3001\u4e8c\u3001\u4e09\u30f6\u6708\u524d\u304f\u3089\u3044\u304b\u306a\u3002\u4f4f\u307f\u8fbc\u307f\u306e\u50cd\u304d\u53e3\u3092\u63a2\u3057\u3066\u3044\u3066\u3001\u904b\u826f\u304f\u3053\u3053\u3067\u96c7\u3063\u3066\u3082\u3089\u3048\u305f\u3093\u3060", "\u4e8c\u4eba\u306f\u738b\u90fd\u304b\u3089\u4f55\u3057\u306b\u304d\u305f\u306e\uff1f\u3053\u3093\u306a\u7530\u820e\u306b\u89b3\u5149\u3063\u3066\u3053\u3068\u306f\u306a\u3044\u3088\u306d\uff1f", "\u56fd\u5883\u306e\u7826\u306b\u3044\u308b\u77e5\u4eba\u3092\u8a2a\u306d\u3066\u304d\u305f\u3002\u305d\u306e\u3064\u3044\u3067\u306b\u3001\u3053\u306e\u8fba\u308a\u3092\u898b\u3066\u56de\u3063\u3066\u3044\u308b", "\u56fd\u5883\u8b66\u5099\u968a\u306b\u77e5\u308a\u5408\u3044\u304c\u3044\u308b\u306e\uff1f\u305d\u3046\u3044\u3084\u3001\u30ec\u30aa\u30f3\u3082\u9a0e\u58eb\u69d8\u3063\u307d\u3044\u306d", "\u30de\u30ea\u30fc\u3061\u3083\u3093\u3092\u6848\u5185\u3059\u308b\u306a\u3089\u3001\u3082\u3046\u3061\u3087\u3063\u3068\u826f\u3044\u3068\u3053\u306b\u9023\u308c\u3066\u3044\u3063\u3066\u3042\u3052\u308c\u3070\u3044\u3044\u306e\u306b", "\u3080\u3057\u308d\u79c1\u306e\u6211\u5118\u306a\u3093\u3067\u3059\u3002\u53e4\u3044\u5efa\u9020\u7269\u3092\u898b\u308b\u306e\u304c\u597d\u304d\u3067\u3001\u3053\u306e\u6751\u306b\u3082\u53e4\u3044\u795e\u6bbf\u304c\u3042\u308b\u3063\u3066\u805e\u3044\u305f\u3082\u306e\u3067\u3059\u304b\u3089\u3001\u7121\u7406\u8a00\u3063\u3066\u5144\u3055\u3093\u306b\u9023\u308c\u3066\u304d\u3066\u3082\u3089\u3063\u305f\u3093\u3067\u3059\u3088", "\u3078\u3047\u3001\u82e5\u3044\u5973\u306e\u5b50\u306b\u306f\u73cd\u3057\u3044\u8da3\u5473\u3060\u306d", "\u5909\u3067\u3059\u304b\u306d\uff1f", "\u3046\u3046\u3093\u3001\u30aa\u30ec\u3082\u597d\u304d\u3060\u304b\u3089\u89aa\u8fd1\u611f\u6e67\u304f\u3002\u3067\u3082\u3001\u305d\u308c\u306a\u3089\u6b8b\u5ff5\u3060\u3063\u305f\u306d\u3002\u3053\u306e\u6751\u306e\u795e\u6bbf\u306f\u3001\u65b0\u3057\u304f\u3055\u308c\u3061\u3083\u3063\u305f\u3067\u3057\u3087\u3046", "\u305d\u3046\u306a\u3093\u3067\u3059\u3002\u3060\u304b\u3089\u9055\u3046\u6751\u3067\u3082\u884c\u3063\u3066\u307f\u3088\u3046\u304b\u306a\u3063\u3066\u601d\u3063\u3066\u3066", "\u3044\u3044\u306d\u30fc\u3002\u3082\u3057\u898b\u3064\u3051\u305f\u3089\u3001\u30aa\u30ec\u306b\u3082\u6559\u3048\u3066\u3088\u3002\u4ed5\u4e8b\u304c\u4f11\u307f\u306e\u65e5\u306b\u3067\u3082\u898b\u7269\u306b\u884c\u304f\u304b\u3089\u3055", "\u2026\u2026\uff1f\u304a\u3063\u3068\u3001\u898b\u82e6\u3057\u3044\u3082\u306e\u898b\u305b\u3061\u3083\u3063\u305f\u306d", "\u3061\u3087\u3063\u3068\u5bdd\u307c\u3051\u3066\u3076\u3064\u3051\u305f\u3093\u3060\u3002\u5927\u3057\u305f\u3053\u3068\u306f\u306a\u3044\u3088", "\u305d\u3046\u306a\u3093\u3067\u3059\u304b\u2026\u2026\u3002\u6c17\u3092\u3064\u3051\u3066\u304f\u3060\u3055\u3044\u306d", "\u30e9\u30fc\u30c6", "\u3093\uff1f", "\u5fd8\u308c\u7269\u3060", "\u3042\u308a\u304c\u3068", "\u2026\u2026\u305d\u308d\u305d\u308d\u51fa\u3088\u3046\u304b", "\u2026\u2026\u3046\u3093"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/153/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u635c\u7d22\u3002(2)", "discourse": ["\u305d\u3093\u306a\u9854\u3092\u3059\u308b\u306a\u3002\u307e\u3060\u65c5\u306f\u59cb\u307e\u3063\u305f\u3070\u304b\u308a\u3060\u308d\u3046\uff1f", "\u30de\u30ea\u30fc\uff1f", "\u306a\u3093\u3067\u3082\u306a\u3044\u308f\u3001\u5144\u3055\u3093", "\u3053\u306e\u5e97\u306e\u30b9\u30fc\u30d7\u306f\u7f8e\u5473\u3044\u3068\u8a55\u5224\u3060\u305d\u3046\u3060\u3002\u4f53\u304c\u51b7\u3048\u3066\u3057\u307e\u3063\u305f\u304b\u3089\u3001\u5c11\u3057\u6e29\u307e\u308d\u3046", "\u2026\u2026\u3046\u3093", "\u30ec\u2026\u2026\u3001\u5144\u3055\u3093", "\u3093\uff1f", "\u30de\u30ea\u30fc\uff1f", "\u3048\u3063\u3068\u3001\u2026\u2026\u3053\u306e\u5f8c\u306f\u3069\u3046\u3059\u308b\u306e\uff1f", "\u98df\u4e8b\u3092\u3057\u305f\u3089\u3001\u5c11\u3057\u6751\u3092\u898b\u3066\u56de\u308d\u3046\u304b", "\u305d\u3046\u306d\u3002\u305d\u306e\u5f8c\u306f\uff1f", "\u305d\u3046\u3060\u306a\u2026\u2026\u3002\u4e00\u5ea6\u3001\u623b\u308d\u3046", "\u6b21\u306e\u6751\u3092\u76ee\u6307\u3059\u306e\u3067\u306f\u306a\u304f\u3066\uff1f", "\u4eca\u304b\u3089\u5411\u304b\u3063\u305f\u3089\u3001\u591c\u306b\u306a\u308b\u304b\u3089\u306a\u3002\u304a\u524d\u306e\u898b\u305f\u304c\u3063\u3066\u3044\u305f\u5efa\u7269\u3082\u3001\u6697\u304f\u3066\u306f\u30ed\u30af\u306b\u898b\u3048\u306a\u3044\u3060\u308d\u3046", "\u304a\u5f85\u305f\u305b\u3057\u307e\u3057\u305f", "\u7f8e\u5473\u3057\u3044", "\u305d\u3046\u304b", "\u30d1\u30f3\u3082\u30b9\u30fc\u30d7\u3082\u7f8e\u5473\u3057\u3044", "\u305d\u308c\u306f\u826f\u304b\u3063\u305f", "\u624b\u3001\u6c5a\u308c\u3061\u3083\u3046\u304b\u3089\u4f7f\u3063\u3066", "\u3048\u3002\u3042\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u3053\u3061\u3089\u3053\u305d\u3002\u7f8e\u5473\u3057\u3044\u3063\u3066\u98df\u3079\u3066\u3082\u3089\u3048\u308b\u306a\u3089\u3001\u4f5c\u308a\u7532\u6590\u304c\u3042\u308b\u3088", "\u3042\u3001\u304a\u304b\u308f\u308a\u6ca2\u5c71\u3042\u308b\u304b\u3089\u306d", "\u306f\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/152/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u635c\u7d22\u3002", "discourse": ["\u304a\u75b2\u308c\u69d8\u3067\u3059\u3002\u307e\u305a\u306f\u4f55\u51e6\u304b\u3067\u4f11\u61a9\u3057\u307e\u3057\u3087\u3046", "\u5927\u4e08\u592b\u2026\u2026", "\u59eb\u541b\uff1f", "\u4f11\u61a9\u3001\u3057\u307e\u3057\u3087\u3046\u306d\uff1f", "\u306f\u3044\u2026\u2026", "\u3053\u3093\u306b\u3061\u306f", "\u3042\u3042\u3001\u3053\u3093\u306b\u3061\u306f\u3002\u2026\u2026\u65c5\u306e\u65b9\u304b\u306d\uff1f", "\u306f\u3044\u3001\u56fd\u5883\u306e\u7826\u306b\u3044\u308b\u77e5\u4eba\u3092\u8a2a\u306d\u305f\u3068\u3053\u308d\u3067\u3059", "\u56fd\u5883\u8b66\u5099\u968a\u306e", "\u3082\u3057\u304b\u3057\u3066\u30a2\u30f3\u30bf\u3082\u9a0e\u58eb\u69d8\u304b\u3044", "\u307e\u3041\u3001\u4f3c\u305f\u3088\u3046\u306a\u3082\u306e\u3067\u3059", "\u78ba\u304b\u306b\u8eab\u306a\u308a\u3082\u7acb\u6d3e\u3060\u3057\u3001\u3053\u3093\u306a\u7530\u820e\u3067\u306f\u898b\u305f\u3053\u3068\u3082\u306a\u3044\u7537\u524d\u3060", "\u305d\u3063\u3061\u306e\u65b9\u306f\uff1f\u3048\u3089\u3044\u5225\u5b2a\u306a\u304a\u9023\u308c\u3055\u3093\u3060\u306d", "\u3042\u3041\u3001\u3053\u306e\u5b50\u306f\u2026\u2026", "\u3082\u3057\u304b\u3057\u3066\u3001\u5ac1\u3055\u3093\u304b\u3044\uff1f", "\u3088\u3063\u2026\u2026!?", "\u2026\u2026\u59b9\u3067\u3059", "\u3042\u3042\u3001\u306a\u308b\u307b\u3069\u3002\u3059\u307e\u3093\u306d\u3001\u3053\u3053\u3044\u3089\u3067\u306f\u30a2\u30f3\u30bf\u3089\u304f\u3089\u3044\u306e\u5e74\u9f62\u5dee\u306e\u592b\u5a66\u304c\u7d50\u69cb\u3044\u308b\u3082\u3093\u3067\u306a", "\u304a\u6c17\u306b\u306a\u3055\u3089\u305a\u3002\u4f3c\u3066\u3044\u307e\u305b\u3093\u3057\u3001\u5e74\u3082\u7d50\u69cb\u96e2\u308c\u3066\u3044\u308b\u306e\u3067\u3001\u5144\u59b9\u3068\u306f\u601d\u308f\u308c\u306a\u3044\u4e8b\u306e\u65b9\u304c\u591a\u3044\u3093\u3067\u3059", "\u5e74\u304c\u96e2\u308c\u305f\u59b9\u3067\u3001\u3057\u304b\u3082\u304b\u306a\u308a\u306e\u5668\u91cf\u826f\u3057\u3060\u3002\u53ef\u611b\u304f\u3066\u3057\u304b\u305f\u306a\u3044\u3060\u308d", "\u3048\u3048\u3001\u307e\u3041\u3002\u3069\u3046\u3057\u3066\u3082\u7518\u304f\u306a\u3063\u3066\u3057\u307e\u3046\u3093\u3067\u3059\u3088\u306d", "\u304a\u3044\u3067", "!!", "\u2026\u2026\u3042\u308a\u304c\u3068\u3046\u3001\u5144\u3055\u3093", "\u3053\u3093\u306b\u3061\u306f", "\u306f\u3044\u3001\u3053\u3093\u306b\u3061\u306f\u3002\u4eca\u65e5\u306f\u683c\u597d\u826f\u3044\u304a\u5144\u3055\u3093\u3068\u4e00\u7dd2\u306b\u304a\u51fa\u304b\u3051\u304b\u3044\uff1f", "\u306f\u3044\u3002\u5144\u3055\u3093\u304c\u304a\u53cb\u9054\u306b\u4f1a\u3044\u306b\u884c\u304f\u3063\u3066\u8a00\u3046\u304b\u3089\u3001\u7121\u7406\u3092\u8a00\u3063\u3066\u3064\u3044\u3066\u304d\u3066\u3057\u307e\u3063\u305f\u3093\u3067\u3059\u3002\u5144\u3055\u3093\u3001\u5fd9\u3057\u304f\u3066\u6ec5\u591a\u306b\u4f1a\u3048\u306a\u3044\u304b\u3089\u3001\u305f\u307e\u306b\u306f\u4e00\u7dd2\u306b\u306e\u3093\u3073\u308a\u3057\u305f\u304f\u3066", "\u3053\u3093\u306a\u4f55\u3082\u306a\u3044\u7530\u820e\u3067\u3088\u3051\u308c\u3070\u3001\u3086\u3063\u304f\u308a\u3057\u3066\u3044\u3063\u3066\u306a", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3001\u304a\u3058\u3055\u307e", "\u3068\u3053\u308d\u3067\u3001\u304a\u3058\u3055\u307e\u3002\u79c1\u3001\u53e4\u3044\u5efa\u9020\u7269\u3092\u898b\u308b\u306e\u304c\u597d\u304d\u306a\u3093\u3067\u3059\u3002\u2026\u2026\u3053\u306e\u8fba\u308a\u306b\u795e\u6bbf\u304c\u3042\u308b\u3068\u304a\u805e\u304d\u3057\u307e\u3057\u305f\u304c\u3001\u3069\u306e\u8fba\u3067\u3057\u3087\u3046\u304b\uff1f", "\u795e\u6bbf\u304b\u3044\uff1f", "\u3042\u3042\u3001\u3042\u308b\u306b\u306f\u3042\u308b\u304c\u306d\u2026\u2026", "\u78ba\u304b\u306b\u53e4\u3044\u795e\u6bbf\u304c\u3042\u3063\u305f\u3093\u3060\u304c\u3001\u5d29\u308c\u304b\u3051\u3066\u3066\u5371\u306a\u3044\u3063\u3066\u3093\u3067\u3001\u65b0\u3057\u304f\u5efa\u3066\u76f4\u3059\u4e8b\u306b\u306a\u3063\u305f\u3093\u3060\u3002\u6b8b\u5ff5\u3060\u3063\u305f\u306a\u3001\u304a\u5b22\u3061\u3083\u3093"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/151/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u5317\u4e0a\u3002(3)", "discourse": ["\u63d0\u793a\u3055\u308c\u305f\u6761\u4ef6\u306b\u8a72\u5f53\u3059\u308b\u6751\u306f\u4e09\u3064", "\u3046\u3061\u4e8c\u3064\u306f\u3001\u3053\u306e\u7826\u304b\u3089\u6bd4\u8f03\u7684\u8fd1\u3044\u4f4d\u7f6e\u306b\u3042\u308a\u307e\u3059", "\u8abf\u3079\u308b\u306e\u306b\u4e88\u60f3\u4ee5\u4e0a\u306b\u6642\u9593\u304c\u304b\u304b\u3063\u3066\u3057\u307e\u3044\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f", "\u3044\u3044\u3048\uff01", "\u3054\u5354\u529b\u3001\u611f\u8b1d\u81f4\u3057\u307e\u3059\u3002\u304a\u5fd9\u3057\u3044\u4e2d\u3067\u6642\u9593\u3092\u5272\u3044\u3066\u8abf\u3079\u3066\u304f\u3060\u3055\u3063\u3066\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3057\u305f", "\u52ff\u4f53\u7121\u3044\u304a\u8a00\u8449\u3067\u3059", "\u30f4\u30a9\u30eb\u30bf\u30fc\u3067\u3059\u3002\u304a\u547c\u3073\u306b\u3088\u308a\u3001\u53c2\u308a\u307e\u3057\u305f", "\u3053\u306e\u7826\u306b\u3044\u308b\u9593\u3001\u6bbf\u4e0b\u306e\u3054\u8eab\u5206\u306f\u4f0f\u305b\u3055\u305b\u3066\u9802\u304d\u307e\u3059\u306e\u3067\u3001\u90e8\u4e0b\u9054\u306b\u306f\u540d\u5bb6\u306e\u3054\u4ee4\u5b22\u3092\u304a\u9810\u304b\u308a\u3059\u308b\u3068\u3044\u3046\u65e8\u3092\u8aac\u660e\u3057\u3066\u3042\u308a\u307e\u3059\u3002\u3067\u3059\u304c\u8cb4\u65b9\u69d8\u306e\u7d20\u6027\u3092\u77e5\u308b\u306e\u304c\u79c1\u4e00\u4eba\u3067\u3059\u3068\u3001\u306a\u306b\u304b\u3068\u4e0d\u4fbf\u3082\u3054\u3056\u3044\u307e\u3057\u3087\u3046\u3002\u305d\u3053\u3067\u4e00\u4eba\u3001\u4fe1\u983c\u3067\u304d\u308b\u7537\u3092\u3054\u7528\u610f\u81f4\u3057\u307e\u3057\u305f", "\u5165\u308c", "\u5931\u793c\u81f4\u3057\u307e\u3059", "\u3053\u306e\u8005\u304c\u6211\u304c\u968a\u306e\u8a87\u308b\u3001\u512a\u79c0\u306a\u526f\u968a\u9577\u3067\u3059\u3002\u30a4\u30b6\u30fc\u30af\u3001\u6bbf\u4e0b\u306b\u3054\u6328\u62f6\u3092", "\u30a4\u30b6\u30fc\u30af\u30fb\u30f4\u30a9\u30eb\u30bf\u30fc\u3068\u7533\u3057\u307e\u3059", "\u2026\u2026\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u30fb\u30d5\u30a9\u30f3\u30fb\u30f4\u30a7\u30eb\u30d5\u30a1\u30eb\u30c8\u3067\u3059\u3002\u7686\u69d8\u306e\u304a\u4ed5\u4e8b\u306e\u90aa\u9b54\u306b\u306a\u3089\u306c\u3088\u3046\u6c17\u3092\u3064\u3051\u307e\u3059\u306e\u3067\u3001\u3069\u3046\u305e\u5b9c\u3057\u304f\u304a\u9858\u3044\u81f4\u3057\u307e\u3059", "\u30a4\u30b6\u30fc\u30af\u3001\u304a\u524d\u306a\u3041\u2026\u2026\u305d\u306e\u614b\u5ea6\u306f\u306a\u3044\u3060\u308d", "\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3001\u6bbf\u4e0b\u3002\u3069\u3046\u304b\u304a\u6c17\u3092\u60aa\u304f\u306a\u3055\u3089\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u3053\u3044\u3064\u306f\u3053\u306e\u901a\u308a\u7121\u611b\u60f3\u306a\u7537\u3067\u3059\u304c\u3001\u983c\u308a\u306b\u306a\u308b\u306e\u306f\u4fdd\u8a3c\u3057\u307e\u3059", "\u306f\u3044\u3002\u3069\u3046\u305e\u5b9c\u3057\u304f\u304a\u9858\u3044\u81f4\u3057\u307e\u3059", "\u2026\u2026\u30ec\u30aa\u30f3\u3055\u307e\uff1f", "\u5931\u793c\u3002\u5f37\u304f\u306a\u3089\u308c\u305f\u306a\u3001\u3068\u601d\u3044\u307e\u3057\u3066", "\uff01"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/150/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u5317\u4e0a\u3002(2)", "discourse": ["\u4e45\u3057\u3076\u308a\u3060\u306a\u3001\u8272\u7537\uff01", "\u738b\u5973\u6bbf\u4e0b\u306e\u5fa1\u524d\u3060", "\u5931\u793c", "\u738b\u5973\u6bbf\u4e0b\u306f\u3068\u3066\u3082\u5bdb\u5927\u306a\u5fa1\u65b9\u3060\u3068\u805e\u3044\u3066\u3044\u308b\u3002\u7530\u820e\u8005\u306e\u7121\u4f5c\u6cd5\u3092\u4e00\u3005\u548e\u3081\u308b\u3088\u3046\u306a\u4e8b\u306f\u306a\u3055\u3089\u306a\u3044\u3060\u308d\u3046\u3002\u3067\u3059\u3088\u306d\uff1f", "\u307b\u3089\u306a", "\u76f8\u5909\u308f\u3089\u305a\u3001\u30e0\u30ab\u3064\u304f\u304f\u3089\u3044\u306e\u7537\u524d\u3060\u306a\u30fc", "\u304a\u524d\u306b\u8a00\u308f\u308c\u3066\u3082\u306a", "\u305d\u308c\u306a\u306e\u306b\u672a\u3060\u72ec\u308a\u8eab\u3063\u3066\u306e\u306f\u3001\u3069\u3046\u3044\u3046\u4e8b\u3060\u3002\u3055\u3063\u3055\u3068\u304a\u524d\u304c\u7247\u4ed8\u304b\u306a\u3044\u3068\u3001\u7121\u99c4\u306b\u60d1\u308f\u3055\u308c\u308b\u53ef\u54c0\u60f3\u306a\u3054\u4ee4\u5b22\u304c\u5897\u3048\u308b\u3070\u304b\u308a\u3060\u308d", "\u4f59\u8a08\u306a\u304a\u4e16\u8a71\u3060", "\u4f59\u8a08\u306a\u3082\u306e\u304b\u3002\u611b\u3057\u3044\u5973\u304c\u3001\u304a\u304b\u3048\u308a\u306a\u3055\u3044\u3068\u51fa\u8fce\u3048\u3066\u304f\u308c\u308b\u5e78\u798f\u306b\u52dd\u308b\u3082\u306e\u306f\u306a\u3044\u305e\uff1f", "\u8cb4\u65b9\u3068\u96e2\u308c\u96e2\u308c\u306b\u306a\u308b\u306a\u3093\u3066\u5acc\u3067\u3059", "\u3055\u3063\u3055\u3068\u6240\u5e2f\u3092\u6301\u3066\u3068\u3001\u6bbf\u4e0b\u304b\u3089\u3082\u8a00\u3063\u3066\u3084\u3063\u3066\u304f\u3060\u3055\u3044\u3002\u30b3\u30a4\u30c4\u306e\u5b50\u4f9b\u306a\u3089\u304d\u3063\u3068\u3001\u606f\u5b50\u3067\u3082\u5a18\u3067\u3082\u3001\u738b\u56fd\u306b\u3068\u3063\u3066\u983c\u3082\u3057\u3044\u5b58\u5728\u3068\u306a\u308a\u307e\u3059\u3088", "\u3048\u3063", "\u30a8\u30eb\u30f3\u30b9\u30c8\u3002\u305d\u308c\u4ee5\u4e0a\u3001\u6bbf\u4e0b\u306b\u7121\u793c\u306a\u53e3\u3092\u5229\u304f\u3088\u3046\u306a\u3089\u30aa\u30ec\u304c\u8a31\u3055\u3093", "\u2026\u2026\u2026\u2026\u306a\u308b\u307b\u3069", "\u306a\u308b\u307b\u3069\u3001\u306a\u308b\u307b\u3069\uff01\u3053\u308c\u306f\u30aa\u30ec\u304c\u7121\u7c8b\u3060\u3063\u305f\u3088\u3046\u3060\uff01", "\u2026\u2026\u306a\u306b\u3092\u8a00\u3063\u3066\u3044\u308b\uff1f", "\u3044\u3084\u3044\u3084\u3002\u30aa\u30ec\u306f\u4f55\u304b\u3068\u6c17\u304c\u5229\u304b\u306a\u3044\u3060\u306e\u7121\u795e\u7d4c\u3060\u306e\u8a00\u308f\u308c\u308b\u304c\u3001\u5168\u304f\u305d\u306e\u901a\u308a\u3060\u306a\u3002\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u3001\u6bbf\u4e0b\u3002\u3054\u7121\u793c\u3092\u304a\u8a31\u3057\u304f\u3060\u3055\u3044", "\u304a\u6c17\u306b\u306a\u3055\u3089\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3002\u3084\u306f\u308a\u6bbf\u4e0b\u306f\u304a\u512a\u3057\u3044\u5fa1\u65b9\u3060\u3002\u306a\u3041\uff1f", "\u3060\u304b\u3089\u3068\u8a00\u3063\u3066\u3001\u304a\u524d\u304c\u4f55\u3092\u3057\u3066\u3082\u3044\u3044\u3068\u3044\u3046\u4e8b\u3067\u306f\u306a\u3044", "\u5206\u304b\u3063\u3066\u308b\u3002\u60aa\u304b\u3063\u305f\u3088", "\u4e8c\u5ea6\u76ee\u306f\u306a\u3044\u305e"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/149/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u5317\u4e0a\u3002", "discourse": ["\u2026\u2026\uff1f", "\u3069\u3046\u304b\u3057\u307e\u3057\u305f\u304b\uff1f", "\u306a\u3001\u306a\u3093\u3067\u3082\u3042\u308a\u307e\u305b\u3093", "\u5bd2\u304f\u306f\u3042\u308a\u307e\u305b\u3093\u304b\uff1f", "\u5927\u4e08\u592b\u3067\u3059", "\u56fd\u5883\u306b\u8fd1\u3065\u3051\u3070\u3001\u4eca\u3088\u308a\u66f4\u306b\u6c17\u6e29\u306f\u4e0b\u304c\u308a\u307e\u3059\u3002\u7121\u7406\u306f\u305b\u305a\u306b\u3001\u3061\u3083\u3093\u3068\u6559\u3048\u3066\u304f\u3060\u3055\u3044\u306d\uff1f", "\u306f\u3044", "\u304a\u304b\u3048\u308a\u306a\u3055\u3044", "\u305f\u3060\u3044\u307e", "\u59eb\u541b\uff1f", "\u3084\u306f\u308a\u5bd2\u3044\u306e\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304b\uff1f\u3082\u3057\u304f\u306f\u304a\u75b2\u308c\u3067\u3057\u3087\u3046\u304b", "\u3044\u3001\u3044\u3044\u3048\uff01\u5bd2\u304f\u3082\u3042\u308a\u307e\u305b\u3093\u3057\u3001\u5143\u6c17\u3067\u3059\uff01", "\u5c11\u3057\u4f11\u61a9\u3057\u307e\u3057\u3087\u3046", "\u3044\u3048\u3001\u3042\u306e\u3001\u5927\u4e08\u592b\u3067\u3059\u3088\u3002\u672c\u5f53\u306b", "\u3044\u3044\u3048\u3001\u99c4\u76ee\u3067\u3059\u3002\u6163\u308c\u306a\u3044\u99ac\u3067\u306e\u65c5\u306f\u3001\u8cb4\u65b9\u304c\u601d\u3063\u3066\u3044\u308b\u4ee5\u4e0a\u306b\u4f53\u306b\u8ca0\u62c5\u304c\u304b\u304b\u3063\u3066\u3044\u308b\u3093\u3067\u3059\u3088", "\u2026\u2026\u30ec\u30aa\u30f3\u69d8", "\u306f\u3044\uff1f", "\u5c11\u3057\u904e\u4fdd\u8b77\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304b\uff1f", "\u305d\u3046\u2026\u2026\u3067\u3059\u304b\uff1f", "\u3054\u8ff7\u60d1\u3067\u3057\u305f\u304b\uff1f", "\u3044\u3048\u3001\u305d\u3046\u3067\u306f\u3042\u308a\u307e\u305b\u3093\uff01\u305f\u3060\u3001\u7533\u3057\u8a33\u306a\u304f\u3066\u2026\u2026", "\u306a\u3089\u3001\u6c17\u306b\u306a\u3055\u3089\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u30aa\u30ec\u306f\u3069\u3046\u3084\u3089\u3001\u8cb4\u65b9\u306b\u69cb\u3046\u306e\u304c\u697d\u3057\u3044\u3089\u3057\u3044\u306e\u3067", "!?"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/148/", "subtitle": "\u6216\u308b\u5bc6\u5075\u306e\u72ec\u767d\u3002(3)", "discourse": ["\u3084\u3063\u3071\u308a\u306d", "\u4f55\u51e6\u306e\u30cd\u30ba\u30df\u3060", "\u8a00\u3046\u6c17\u306f\u306a\u3044\u304b\u3002\u307e\u3041\u3001\u898b\u5f53\u306f\u3064\u3044\u3066\u3044\u308b\u304c", "\u6211\u304c\u56fd\u306e\u57ce\u306b\u5fcd\u3073\u8fbc\u3081\u308b\u3060\u3051\u306e\u4eba\u6750\u3092\u4f7f\u3044\u6368\u3066\u306b\u3059\u308b\u3068\u306f\u2026\u2026\u304b\u306e\u56fd\u306e\u738b\u304c\u6d6a\u8cbb\u5bb6\u3060\u3068\u3044\u3046\u5642\u306f\u3001\u771f\u306e\u3088\u3046\u3060\u306a", "\u305d\u3082\u305d\u3082\u6697\u6bba\u304c\u6210\u529f\u3059\u308c\u3070\u3001\u81ea\u5206\u306e\u7f6e\u304b\u308c\u305f\u72b6\u6cc1\u304c\u597d\u8ee2\u3059\u308b\u3068\u8003\u3048\u3066\u3044\u308b\u8fba\u308a\u304c\u3001\u6551\u3044\u3088\u3046\u304c\u306a\u3044\u3002\u611a\u306e\u9aa8\u9802\u3060", "\u2026\u2026\u30a2\u30f3\u30bf\u304c\u5012\u308c\u308c\u3070\u3001\u56fd\u306f\u6df7\u4e71\u3059\u308b\u3060\u308d\u3046\u3002\u6226\u4e89\u3069\u3053\u308d\u3067\u306f\u306a\u304f\u306a\u308b\u306f\u305a\u3060", "\u78ba\u304b\u306b\u3001\u591a\u5c11\u306f\u6df7\u4e71\u3059\u308b\u3060\u308d\u3046\u306a\u3002\u3060\u304c\u3059\u3050\u306b\u7acb\u3066\u76f4\u3059\u3002\u305f\u3063\u305f\u4e00\u4eba\u306e\u6b7b\u3067\u74e6\u89e3\u3059\u308b\u307b\u3069\u67d4\u306b\u80b2\u3066\u3066\u306f\u3044\u306a\u3044\u3002\u56fd\u3082\u3001\u5f8c\u7d99\u8005\u3082\u306a", "\u3042\u3063\u3055\u308a\u3001\u5a18\u306b\u4e0b\u3052\u6e21\u3055\u308c\u305d\u3046\u306b\u306a\u3063\u305f\u3051\u3069\u306a", "\u4f55\u304b\u8a00\u3063\u305f\uff1f", "\u5973\u306a\u3093\u3066", "\u2026\u2026\u304a", "\u2026\u2026\u76f8\u5909\u308f\u3089\u305a\u3001\u601d\u3044\u3082\u3088\u3089\u306a\u3044\u4e8b\u3092\u3084\u3089\u304b\u3057\u3066\u304f\u308c\u308b\u3088\u306a\u3041", "\u4f55\uff1f\u307e\u3055\u304b\u30de\u30ea\u30fc\u306e\u8a71\uff1f", "\u304a\u305d\u3089\u304f\u723a\u3055\u3093\u9054\u306e\u8aac\u5f97\u6750\u6599\u306b\u306a\u308b", "\u2026\u2026\u3069\u3046\u3044\u3046\u4e8b\uff1f", "\u96a3\u56fd\u306e\u6d41\u884c\u308a\u75c5\u306e\u62e1\u5927\u3092\u9632\u3044\u3060\u8912\u7f8e\u3068\u3057\u3066\u3001\u59eb\u3055\u3093\u306f\u965b\u4e0b\u306b\u3001\u30a2\u30f3\u30bf\u9054\u306e\u5c45\u5834\u6240\u3092\u5f37\u8acb\u3063\u305f\u3089\u3057\u3044\u3002\u75c5\u6c17\u3084\u602a\u6211\u306e\u51e6\u7f6e\u3060\u3051\u3067\u306a\u304f\u3001\u85ac\u306e\u7814\u7a76\u3001\u305d\u308c\u304b\u3089\u533b\u7642\u306e\u6559\u80b2\u306a\u3093\u304b\u3082\u884c\u3048\u308b\u7dcf\u5408\u7684\u306a\u65bd\u8a2d\u3060", "\u306f\u3042\u3063!?\u305d\u3093\u306a\u306e\u3001\u898b\u305f\u3053\u3068\u3082\u805e\u3044\u305f\u3053\u3068\u3082\u306a\u3044\u308f\u3088!?", "\u3042\u3042\u3001\u524d\u4ee3\u672a\u805e\u3060\u3002\u304a\u305d\u3089\u304f\u4e00\u5e74\u4e8c\u5e74\u3067\u4ed5\u4e0a\u304c\u308b\u4ee3\u7269\u3058\u3083\u306a\u3044\u304c\u3001\u51fa\u6765\u4e0a\u304c\u3063\u305f\u3089\u30cd\u30fc\u30d9\u30eb\u306e\u533b\u7642\u6c34\u6e96\u306f\u683c\u6bb5\u306b\u4e0a\u304c\u308b\u3002\u6570\u5341\u5e74\u5f8c\u3001\u2026\u2026\u3044\u3084\u3001\u6570\u5e74\u5f8c\u306b\u306f\u533b\u7642\u3092\u5fd7\u3059\u82e5\u8005\u304c\u3001\u4e16\u754c\u5404\u5730\u304b\u3089\u30cd\u30fc\u30d9\u30eb\u3078\u3068\u62bc\u3057\u5bc4\u305b\u308b\u3060\u308d\u3046\u306a", "\u305d\u3093\u306a\u2026\u2026\u305d\u3093\u306a\u306e\u2026\u2026", "\u305d\u3093\u306a\u306e\u3001\u6ec5\u8336\u82e6\u8336\u9762\u767d\u305d\u3046\u3058\u3083\u306a\u3044!!", "\u6559\u80b2\u65bd\u8a2d\u304c\u4f75\u8a2d\u3055\u308c\u3066\u308b\u3063\u3066\u4e8b\u306f\u3001\u53e3\u982d\u3060\u3051\u3067\u306a\u304f\u5b9f\u5730\u3067\u3082\u6559\u3048\u3089\u308c\u308b\u3063\u3066\u4e8b\u3088\u306d\uff1f\u3057\u304b\u3082\u85ac\u306e\u958b\u767a\u3082\u3084\u3063\u3066\u308b\u306a\u3089\u3001\u60a3\u8005\u306e\u72b6\u614b\u3092\u898b\u306a\u304c\u3089\u3001\u85ac\u3092\u5909\u3048\u305f\u308a\u3001\u8a66\u3057\u305f\u308a\u3082\u51fa\u6765\u308b\u3002\u3042\u3001\u3082\u3057\u304b\u3057\u306a\u304f\u3066\u3082\u3001\u305d\u308c\u3060\u3051\u5927\u304d\u306a\u65bd\u8a2d\u306a\u3089\u60a3\u8005\u3092\u5927\u52e2\u6cca\u3081\u308b\u4e8b\u3082\u2026\u2026\uff1f", "\u3082\u3061\u308d\u3093\u51fa\u6765\u308b\u3060\u308d\u3046\u306a", "\u6700\u9ad8\uff01\u30de\u30ea\u30fc\u611b\u3057\u3066\u308b!!", "\u3082\u3046\u7d76\u5bfe\u306b\u884c\u304f\u308f\u3002\u79c1\u306f\u8ab0\u304c\u6b62\u3081\u3066\u3082\u884c\u304f\u308f\u3002\u3068\u3044\u3046\u304b\u3001\u6559\u80b2\u3084\u7814\u7a76\u306a\u3089\u723a\u69d8\u9054\u306e\u5f97\u610f\u5206\u91ce\u3067\u3057\u3087\u3002\u9996\u306b\u7e04\u3064\u3051\u3066\u3067\u3082\u5f15\u304d\u647a\u3063\u3066\u884c\u304b\u306a\u304d\u3083", "\u306a\u3093\u304b\u5102\u7b49\u306e\u6bba\u5bb3\u8a08\u753b\u3057\u3068\u308b\u305e!?"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/147/", "subtitle": "\u6216\u308b\u5bc6\u5075\u306e\u72ec\u767d\u3002(2)", "discourse": ["\u5b6b\u307f\u305f\u3044\u3067\u653e\u3063\u3066\u304a\u3051\u306a\u304b\u3063\u305f", "\u65b0\u5165\u308a\u541b\u3001\u540d\u524d\u306f\uff1f", "\u597d\u304d\u306b\u547c\u3093\u3067\u304f\u308c", "\u540d\u4e57\u308a\u305f\u304f\u306a\u3044\u3063\u3066\u4e8b\u304b\u306a\uff1f", "\u3044\u3084\u3002\u5358\u7d14\u306b\u540d\u524d\u304c\u306a\u3044\u3060\u3051\u3060", "\u305d\u3046", "\u305d\u3046\u3060\u306a\u3041\u2026\u2026\u3058\u3083\u3042\u3001\u30ab\u30e9\u30b9\u3063\u3066\u306e\u306f\u3069\u3046\uff1f", "\u5225\u306b\u4f55\u3067\u3082\u3044\u3044", "\u3058\u3083\u3042\u3001\u3053\u308c\u304b\u3089\u3088\u308d\u3057\u304f\u306d\u3002\u30ab\u30e9\u30b9", "\u304a\u3044", "\u305d\u3053\u306e\u9ed2\u3044\u306e", "\u4ed5\u4e8b\u3067\u7dba\u9e97\u306a\u304a\u59c9\u3055\u3093\u3068\u904a\u3079\u308b\u306a\u3093\u3066\u3001\u7fa8\u307e\u3057\u3044\u304f\u3089\u3044\u3060\u3051\u3069", "\u2026\u2026\u305d\u308c\u306a\u3089\u4ee3\u308f\u3063\u3066\u3084\u308b\u3088\u3002\u30a2\u30f3\u30bf\u306e\u65b9\u304c\u7dba\u9e97\u306a\u9854\u3057\u3066\u308b\u3057\u3001\u9069\u5f79\u3060\u308d", "\u3044\u3084\u30fc\u3002\u30ab\u30e9\u30b9\u306e\u305d\u306e\u8272\u6c17\u306f\u3001\u4e2d\u3005\u51fa\u305b\u308b\u3082\u3093\u3058\u3083\u306a\u3044\u3088", "\u5973\u306a\u3093\u3066\u788c\u306a\u3082\u3093\u3058\u3083\u306a\u3044", "\u30ab\u30e9\u30b9\u3001\u305d\u308c\u306f\u9055\u3046", "\u5973\u3060\u3051\u3058\u3083\u306a\u3044\u3088\u3002\u4eba\u9593\u3063\u3066\u751f\u304d\u7269\u304c\u3001\u788c\u3067\u3082\u306a\u3044\u3093\u3060", "\u2026\u2026\u305d\u308c\u306b\u30ab\u30e9\u30b9\u306e\u4ed5\u4e8b\u306f\u3001\u304b\u306a\u308a\u30de\u30b7\u306a\u65b9\u3060\u3088\uff1f", "\u4eca\u65e5\u306e\u5f79\u76ee\u306f\u898b\u5f35\u308a\u3060\u3088\u3002\u697d\u3067\u826f\u3044\u3088\u306d\u3047", "\u2026\u2026\u30ab\u30e9\u30b9\u306f\u3055\u3001\u3053\u306e\u4ed5\u4e8b\u3001\u3042\u3093\u307e\u308a\u5411\u3044\u3066\u306a\u3044\u306d", "\u2026\u2026", "\u5225\u306e\u4ed5\u4e8b\u63a2\u3057\u306a\u3088", "\u2026\u2026\u306f\uff1f", "\u30aa\u30ec\u3082\u91d1\u8caf\u307e\u3063\u305f\u3089\u3001\u5e97\u3067\u3082\u958b\u3053\u3046\u304b\u3068\u601d\u3046\u3093\u3060\u3002\u98f2\u98df\u5e97\u3068\u304b\u826f\u3044\u3088\u306d", "\u2026\u2026\u5143\u6697\u6bba\u8005\u304c\u5e97\u4e3b\u306e\u98f2\u98df\u5e97\u3068\u304b\u3001\u7d76\u5bfe\u5165\u308a\u305f\u304f\u306a\u3044", "\u666e\u901a\u306e\u5e97\u3067\u306f\u5473\u308f\u3048\u306a\u3044\u3001\u523a\u6fc0\u7684\u306a\u6599\u7406\u3092\u63d0\u4f9b\u51fa\u6765\u308b\u3088\uff1f", "\u7d76\u5bfe\u306b\u5165\u308a\u305f\u304f\u306a\u3044", "\u6696\u304b\u3044\u56fd\u304c\u3044\u3044\u306a\u3041\u3002\u30d5\u30e9\u30f3\u30e1\u2026\u2026\u306f\u6691\u3059\u304e\u308b\u3057\u3001\u30cd\u30fc\u30d9\u30eb\u3068\u304b\u3069\u3046\u304b\u306a", "\u3046\u3093\u3001\u30cd\u30fc\u30d9\u30eb\u304c\u826f\u3044\u306a\u3002\u3042\u306e\u7dba\u9e97\u306a\u56fd\u3067\u66ae\u3089\u305b\u305f\u3089\u3001\u3069\u308c\u3060\u3051\u5e78\u305b\u3060\u308d\u3046"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/146/", "subtitle": "\u6216\u308b\u5bc6\u5075\u306e\u72ec\u767d\u3002", "discourse": ["\u3044\u3044\u52a0\u6e1b\u306b\u3057\u3066!!", "\u3064\u307e\u3093\u306a\u3044\u610f\u5730\u306f\u3063\u3066\u306a\u3044\u3067\u3001\u7d20\u76f4\u306b\u306a\u308a\u306a\u3055\u3044\u3088\u3001\u7d20\u76f4\u306b\uff01", "\u5225\u306b\u610f\u5730\u306a\u3069\u5f35\u3063\u3066\u304a\u3089\u3093", "\u3053\u306e\u9811\u56fa\u89aa\u7236\u2026\u2026\uff01", "\u7236\u89aa\u306b\u5411\u304b\u3063\u3066\u3001\u305d\u306e\u53e3\u306e\u304d\u304d\u65b9\u306f\u4f55\u3060", "\u656c\u3063\u3066\u307b\u3057\u304b\u3063\u305f\u3089\u3001\u305d\u308c\u306a\u308a\u306e\u614b\u5ea6\u3092\u793a\u3057\u3066\u3088\uff01", "\u3044\u3064\u306b\u306a\u3063\u305f\u3089\u623b\u308c\u308b\u306e\u3084\u3089\u2026\u2026", "\u4ed6\u306e\u723a\u5171\u3082\uff01\u63c3\u3044\u3082\u63c3\u3063\u3066\u3001\u81ea\u5206\u306f\u3053\u306e\u6751\u306b\u9aa8\u3092\u57cb\u3081\u308b\u899a\u609f\u3060\u3068\u304b\u3001\u672c\u6c17\u3067\u8a00\u3063\u3066\u308b\u8a33!?", "\u672c\u6c17\u3067\u3059\u3068\u3082\u3002\u3082\u3046\u79c1\u3082\u7d50\u69cb\u306a\u5e74\u3067\u3059\u3057\u3001\u4eca\u66f4\u6751\u3092\u51fa\u308d\u3068\u8a00\u308f\u308c\u3066\u3082\u56f0\u308a\u307e\u3059", "\u305d\u3046\u305d\u3046\u3002\u5102\u7b49\u306e\u3088\u3046\u306a\u5e74\u5bc4\u308a\u304c\u3001\u5916\u56fd\u306b\u884c\u304f\u306a\u3093\u3066\u7121\u7406\u3067\u3059\u3088\u3002\u4f59\u751f\u306f\u6751\u3067\u9759\u304b\u306b\u3001\u3086\u3063\u304f\u308a\u3068\u66ae\u3089\u3059\u306e\u304c\u4e00\u756a\u3067\u3059", "\u79c1\u3082\u6700\u8fd1\u3001\u4f53\u306e\u8abf\u5b50\u304c\u60aa\u3046\u3066\u3001\u6b69\u304f\u306e\u304c\u3084\u3063\u3068\u3067\u3059\u308f\u3044", "\u3053\u306a\u3044\u3060\u306e\u75c5\u9a12\u52d5\u306e\u6642\u3001\u751f\u304d\u751f\u304d\u3068\u8d70\u308a\u56de\u3063\u3066\u85ac\u306e\u6750\u6599\u3092\u96c6\u3081\u3066\u3044\u305f\u306e\u306f\u8ab0\u3060\u3063\u305f\u3063\u3051", "\u6700\u8fd1\u3001\u8033\u3082\u9060\u304f\u3066\u306a\u30fc", "\u5206\u304b\u3063\u305f\u3060\u308d\u3046", "\u3053\u308c\u304c\u79c1\u9054\u306e\u7dcf\u610f\u3060", "\u2026\u2026\u305d\u308c\u304c\u30a2\u30f3\u30bf\u3089\u306e\u672c\u5fc3\u306a\u3089\u3001\u79c1\u3060\u3063\u3066\u30b0\u30c0\u30b0\u30c0\u3068\u98df\u3044\u4e0b\u304c\u3063\u305f\u308a\u3057\u306a\u3044\u308f\u3088", "\u672c\u5fc3\u3060\u3068\u8a00\u3063\u3066\u3044\u308b", "\u5618\u3088\u3001\u672c\u5f53\u306f\u884c\u304d\u305f\u3044\u304f\u305b\u306b\u3002\u30a2\u30f3\u30bf\u3089\u306f\u30de\u30ea\u30fc\u306e\u91cd\u8377\u306b\u306a\u308a\u305f\u304f\u306a\u3044\u3068\u304b\u3001\u3044\u3089\u306a\u3044\u6c17\u9063\u3044\u3057\u3066\u3044\u308b\u3060\u3051\u3067\u3057\u3087\u3046!?", "\u5102\u7b49\u304c\u305d\u3093\u306a\u6b8a\u52dd\u306a\u4eba\u9593\u306b\u898b\u3048\u308b\u304b\u306d\uff1f", "\u898b\u3048\u2026\u2026\u306a\u3044\u3001\u3051\u3069\u3063!!", "\u3042\u3042\u3001\u3082\u3046\u3063\uff01", "\u30ab\u30e9\u30b9", "\u2026\u2026\u9577\u304f\u5f85\u305f\u305b\u3061\u3083\u3063\u3066\u3001\u60aa\u3044\u308f\u306d", "\u5168\u304f\u3060", "\u3054\u3081\u3093\u306a\u3055\u3044\u3002\u65e9\u304f\u30a2\u30f3\u30bf\u3092\u5e30\u3057\u3066\u3042\u3052\u305f\u3044\u3093\u3060\u3051\u3069\u306d"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/145/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u518d\u8003\u3002", "discourse": ["\u3042\u3063\u305f\u304b\u30fc\u2026\u2026", "\u76f8\u5909\u308f\u3089\u305a\u3001\u75db\u3044\u3068\u3053\u308d\u3092\u7a81\u304f\u306e\u304c\u4e0a\u624b\u3044\u306a\u3041", "\u3046\u3075\u3075\u2026\u2026", "\u306f\u3044", "\u30af\u30e9\u30a6\u30b9\u2026\u2026", "\u9577\u3089\u304f\u4e0d\u5728\u306b\u3057\u3066\u3057\u307e\u3044\u3001\u8aa0\u306b\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3002\u660e\u65e5\u3088\u308a\u5fa9\u5e30\u81f4\u3057\u307e\u3059\u306e\u3067\u3001\u672c\u65e5\u306f\u3054\u6328\u62f6\u306b\u53c2\u308a\u307e\u3057\u305f", "\u602a\u6211\u306f\u3082\u3046\u826f\u3044\u306e\uff1f", "\u306f\u3044\u3001\u50b7\u306f\u3082\u3046\u5b8c\u5168\u306b\u585e\u304c\u308a\u307e\u3057\u305f\u3002\u5927\u304d\u304f\u8155\u3092\u52d5\u304b\u3059\u3068\u3001\u50c5\u304b\u306b\u5f15\u304d\u6523\u308b\u3088\u3046\u306a\u9055\u548c\u611f\u304c\u3042\u308a\u307e\u3059\u304c\u3001\u3042\u3068\u306f\u7279\u306b\u554f\u984c\u3042\u308a\u307e\u305b\u3093", "\u305d\u3046\u3001\u826f\u304b\u3063\u305f\u3002\u3067\u3082\u6cbb\u3063\u305f\u304b\u3089\u3068\u3044\u3063\u3066\u3001\u3042\u307e\u308a\u7121\u7406\u306f\u3057\u306a\u3044\u3067\u9802\u6234", "\u52ff\u4f53\u7121\u3044\u304a\u8a00\u8449\u3067\u3059", "\u30af\u30e9\u30a6\u30b9\u3001\u305d\u306e\u3001\u5b9f\u306f\u2026\u2026", "\u65e2\u306b\u805e\u304d\u53ca\u3093\u3067\u304a\u308a\u307e\u3059\u3002\u8996\u5bdf\u306b\u5411\u304b\u308f\u308c\u308b\u3053\u3068\u3082\u3067\u3059\u304c\u3001\u540c\u884c\u8005\u304c\u8ab0\u3067\u3042\u308b\u304b\u3082\u5b58\u3058\u3066\u304a\u308a\u307e\u3059", "\u79c1\u304c\u307e\u305f\u3001\u56e3\u9577\u306b\u7a81\u3063\u304b\u304b\u3063\u305f\u308a\u3057\u306a\u3044\u304b\u3068\u5fc3\u914d\u3055\u308c\u305f\u306e\u3067\u3059\u306d", "\u304a\u6c17\u9063\u3044\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3002\u3067\u3059\u304c\u3001\u3054\u5fc3\u914d\u306b\u306f\u53ca\u3073\u307e\u305b\u3093", "\u8cb4\u65b9\u69d8\u306e\u65c5\u306e\u540c\u884c\u8005\u304c\u56e3\u9577\u3060\u3068\u805e\u304d\u3001\u79c1\u306f\u5b89\u5fc3\u81f4\u3057\u307e\u3057\u305f\u3002\u56e3\u9577\u3067\u3057\u305f\u3089\u3001\u3069\u3093\u306a\u4e0d\u6e2c\u306e\u4e8b\u614b\u304c\u8d77\u3053\u308d\u3046\u3068\u3082\u3001\u5fa1\u8eab\u3092\u5b88\u3063\u3066\u304f\u3060\u3055\u308b", "\uff01", "\u3068\u3066\u3082\u610f\u5916\u3060\u3068\u3001\u304a\u9854\u306b\u304b\u3044\u3066\u3042\u308a\u307e\u3059\u3002\u507d\u7269\u3060\u3068\u7591\u3063\u3066\u304a\u3089\u308c\u307e\u3059\u304b\uff1f", "\u5931\u793c\u306a\u306e\u306f\u5206\u304b\u3063\u3066\u3044\u308b\u3051\u308c\u3069\u3001\u305d\u3046\u306d", "\u79c1\u306f\u524d\u56de\u306e\u65c5\u3067\u3001\u81ea\u5206\u306e\u5f31\u3055\u3092\u77e5\u308a\u307e\u3057\u305f\u3002\u79c1\u306e\u672a\u719f\u3055\u6545\u306b\u8cb4\u65b9\u69d8\u3092\u4f55\u5ea6\u3082\u5371\u967a\u306b\u6652\u3057\u305f\u3053\u3068\u306f\u3001\u4e00\u751f\u5fd8\u308c\u3089\u308c\u307e\u305b\u3093", "\u30af\u30e9\u30a6\u30b9\u2026\u2026", "\u5351\u5c48\u306b\u306a\u3063\u3066\u3044\u308b\u8a33\u3067\u306f\u306a\u304f\u3001\u4e8b\u5b9f\u3068\u3057\u3066\u79c1\u306f\u5f31\u3044\u306e\u3067\u3059\u3002\u307e\u3057\u3066\u3084\u4eca\u306f\u3001\u602a\u6211\u304c\u6cbb\u3063\u305f\u3070\u304b\u308a\u306e\u8eab\u3002\u935b\u932c\u3082\u308d\u304f\u306b\u51fa\u6765\u307e\u305b\u3093\u3067\u3057\u305f\u306e\u3067\u3001\u307e\u3068\u3082\u306b\u4f53\u304c\u52d5\u304f\u3068\u3082\u601d\u3048\u307e\u305b\u3093\u3002\u3067\u3059\u304b\u3089\u9a0e\u58eb\u56e3\u306b\u306f\u5fa9\u5e30\u3044\u305f\u3057\u307e\u3059\u304c\u3001\u66ab\u304f\u306e\u9593\u3001\u8b77\u885b\u306e\u4efb\u304b\u3089\u5916\u3057\u3066\u9802\u304d\u307e\u3059", "\u8cb4\u65b9\u69d8\u304c\u4e0d\u5728\u306e\u9593\u3001\u935b\u932c\u306b\u52b1\u307f\u3001\u5fc5\u305a\u5f37\u304f\u306a\u3063\u305f\u59ff\u3092\u3054\u89a7\u306b\u5165\u308c\u307e\u3059\u306e\u3067\u2026\u2026\u3069\u3046\u304b\u3001\u7121\u4e8b\u306b\u304a\u623b\u308a\u304f\u3060\u3055\u3044", "\u9854\u3092\u4e0a\u3052\u3066\u3001\u30af\u30e9\u30a6\u30b9\u3002\u8cb4\u65b9\u306e\u8aa0\u610f\u306f\u3001\u78ba\u304b\u306b\u53d7\u3051\u53d6\u308a\u307e\u3057\u305f", "\u79c1\u306f\u3001\u8cb4\u65b9\u306e\u3053\u3068\u3092\u8aa4\u89e3\u3057\u3066\u3044\u305f\u306e\u304b\u3082\u3057\u308c\u307e\u305b\u3093", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\uff1f", "\u305a\u3063\u3068\u3001\u5931\u793c\u306a\u614b\u5ea6\u3092\u3068\u3063\u3066\u3044\u3066\u3054\u3081\u3093\u306a\u3055\u3044\u3002\u3053\u308c\u304b\u3089\u306f\u6539\u3081\u308b\u308f", "\u3048\u3063", "\u4e01\u5be7\u306b\u63a5\u3059\u308b\u3068\u3044\u3046\u610f\u5473\u3088\uff1f", "\u3044\u3048\u3001\u305d\u308c\u306f\u2026\u2026", "\u8aa4\u89e3\u3067\u3059\uff01\u305d\u3001\u305d\u3046\u3067\u306f\u306a\u304f\uff01", "\u759a\u3057\u3044\u610f\u5473\u3067\u306f\u6c7a\u3057\u3066\u306a\u3044\u306e\u3067\u3059\uff01\u7815\u3051\u305f\u614b\u5ea6\u304c\u3001\u6c17\u3092\u8a31\u3057\u3066\u9802\u3051\u305f\u8a3c\u306e\u3088\u3046\u3067\u5b09\u3057\u3044\u3068\u3044\u3044\u307e\u3059\u304b\u3001\u51b7\u305f\u3044\u76ee\u3067\u898b\u3089\u308c\u308b\u306e\u3082\u3001\u30aa\u30ec\u3001\u3044\u3048\u79c1\u3060\u3051\u306a\u306e\u304b\u3068\u601d\u3046\u3068\u3001\u305d\u306e\u2026\u2026", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\u3063\uff01", "\u30af\u30e9\u30a6\u30b9", "\u306f\u3001\u306f\u3044\uff01", "\u3061\u3087\u3063\u3068\u96e2\u308c\u3066\u304f\u3060\u3055\u3044"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/144/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u8ac7\u5224\u3002(2)", "discourse": ["\u2026\u2026\u3044\u3044\u3060\u308d\u3046", "\u6848\u81ea\u4f53\u306f\u3001\u305d\u3046\u60aa\u3044\u3082\u306e\u3067\u3082\u306a\u3044\u304b\u3089\u306a", "\u3060\u304c\u3001\u307e\u3068\u3082\u306b\u4ed5\u4e0a\u3052\u308b\u307e\u3067\u306b\u306f\u76f8\u5f53\u306a\u6642\u9593\u304c\u304b\u304b\u308b\u305e\u3002\u7a81\u8cab\u5de5\u4e8b\u3067\u59cb\u3081\u308b\u306b\u3057\u3066\u3082\u3001\u4e94\u5e74\u7a0b\u5ea6\u306f\u304b\u304b\u308b\u3060\u308d\u3046\u3002\u7aef\u304b\u3089\u7aef\u307e\u3067\u5168\u3066\u304c\u6ede\u308a\u306a\u304f\u52d5\u304d\u59cb\u3081\u308b\u3088\u3046\u306b\u306a\u308b\u306b\u306f\u3001\u4f55\u5341\u5e74\u3082\u306e\u6642\u9593\u304c\u5fc5\u8981\u3060", "\u306f\u3044\u3002\u767e\u5e74\u304b\u3051\u308b\u4fa1\u5024\u304c\u3042\u308b\u3068\u3001\u79c1\u306f\u601d\u3063\u3066\u304a\u308a\u307e\u3059", "\u304a\u524d\u306f\u672c\u5f53\u306b\u3001\u304a\u304b\u3057\u306a\u5a18\u3060", "\u5341\u5e74\u3069\u3053\u308d\u304b\u4e94\u5e74\u5148\u3068\u8a00\u3063\u305f\u3060\u3051\u3067\u3082\u565b\u307f\u4ed8\u3044\u3066\u304f\u308b\u304b\u3068\u601d\u3063\u3066\u3044\u305f\u304c\u3001\u307e\u3055\u304b\u767e\u5e74\u5148\u306e\u8a71\u3092\u3059\u308b\u3068\u306f\u306a\u3002\u5c0f\u5a18\u3089\u3057\u304f\u9752\u81ed\u3044\u4e8b\u3070\u304b\u308a\u4e26\u3079\u7acb\u3066\u308b\u304f\u305b\u306b\u3001\u6642\u6298\u3001\u723a\u306e\u3088\u3046\u306b\u9054\u89b3\u3057\u3066\u3044\u308b\u3002\u524d\u4f8b\u304c\u306a\u304f\u3001\u307e\u3060\u5f62\u3055\u3048\u3042\u3084\u3075\u3084\u306a\u3082\u306e\u306b\u5bfe\u3057\u3001\u4fa1\u5024\u304c\u3042\u308b\u3068\u65ad\u8a00\u3067\u304d\u308b\u306e\u3082\u4e0d\u53ef\u89e3\u3060\u3002\u304a\u524d\u306e\u62d9\u3044\u8aac\u660e\u3082\u305d\u3046\u3060\u3002\u7d30\u304b\u3044\u90e8\u5206\u306f\u4f55\u4e00\u3064\u7406\u89e3\u3057\u3066\u3044\u306a\u3044\u306b\u3082\u62d8\u308f\u3089\u305a\u3001\u5b8c\u6210\u56f3\u306f\u982d\u306e\u4e2d\u306b\u63cf\u3051\u3066\u3044\u308b\u53e3\u3076\u308a\u3002\u307e\u308b\u3067\u3001\u65e2\u306b\u73fe\u7269\u3092\u898b\u3066\u304d\u305f\u304b\u306e\u3088\u3046\u306b\u306a", "\u4f55\u6545\u3060", "\u307e\u3041\u3001\u304a\u524d\u306e\u8a71\u306b\u6574\u5408\u6027\u304c\u306a\u3044\u306e\u306f\u4eca\u306b\u59cb\u307e\u3063\u305f\u3053\u3068\u3067\u306f\u306a\u3044\u304c", "\u3064\u3044\u3066\u6765\u3044", "\u9003\u3052\u3089\u308c\u308b\u3068\u601d\u3063\u3066\u3044\u308b\u306e\u304b", "\u9b54\u738b\u3092\u5c01\u5370\u3059\u308b\u305f\u3081\u306e\u9b54\u6cd5\u9663\u3067\u3059\u304b\uff1f", "\u3044\u3084\u3001\u9055\u3046\u3002\u5225\u306e\u7528\u9014\u304c\u3042\u308b\u3082\u306e\u3060\u3002\u8a66\u4f5c\u6bb5\u968e\u3060\u304c\u306a", "\u305d\u3093\u306a\u4e8b\u3088\u308a\u3082\u3001\u672c\u984c\u3060", "\uff01", "\u9b54\u738b\u306b\u3064\u3044\u3066\u3060\u304c", "\u73fe\u6642\u70b9\u3067\u5c01\u5370\u306f\u89e3\u304b\u308c\u3066\u3044\u306a\u3044\u304c\u3001\u305d\u308c\u304c\u3044\u3064\u307e\u3067\u7d9a\u304f\u304b\u306f\u8ab0\u3082\u5206\u304b\u3089\u306a\u3044\u3002\u4e8b\u6545\u304b\u3001\u6545\u610f\u304b\u3002\u3044\u305a\u308c\u306b\u305b\u3088\u3001\u3044\u3064\u304b\u5c01\u5370\u306f\u89e3\u304b\u308c\u308b\u3060\u308d\u3046", "\u3057\u304b\u3057\u3001\u5148\u738b\u3082\u5148\u3005\u4ee3\u306e\u738b\u3082\u9b54\u738b\u306e\u5b58\u5728\u304b\u3089\u76ee\u3092\u9038\u3089\u3057\u7d9a\u3051\u305f\u3002\u4e0b\u624b\u306b\u7a81\u3044\u3066\u3001\u5bdd\u305f\u5b50\u3092\u8d77\u3053\u3059\u3088\u3046\u306a\u771f\u4f3c\u3092\u3057\u305f\u304f\u306a\u304b\u3063\u305f\u306e\u3060\u308d\u3046\u306a\u3002\u3060\u304c\u3001\u305d\u3046\u60a0\u9577\u306a\u4e8b\u3082\u8a00\u3063\u3066\u3044\u3089\u308c\u306a\u304f\u306a\u3063\u305f", "\u2026\u2026\u305d\u308c\u306f\u3001\u3069\u3046\u3044\u3046\u610f\u5473\u3067\u3059\u304b", "\u30e9\u30d7\u30bf\u30fc\u306e\u9593\u8005\u304c\u3001\u6211\u304c\u56fd\u306e\u56fd\u5883\u4ed8\u8fd1\u3092\u5f77\u5fa8\u3044\u3066\u3044\u308b", "\u2026\u2026\u30e9\u30d7\u30bf\u30fc\u304c\uff1f", "\u4f55\u304b\u3092\u63a2\u3057\u3066\u3044\u308b\u3088\u3046\u3060", "\u4f55\u6545", "\u77e5\u3089\u3093", "\u611a\u304b\u306b\u3082\u5fa1\u305b\u308b\u3068\u601d\u3063\u3066\u3044\u308b\u306e\u304b\u3001\u305d\u308c\u3068\u3082\u5225\u306e\u4f7f\u3044\u9053\u304c\u3042\u308b\u306e\u304b\u3002\u898b\u5f53\u3082\u3064\u304b\u3093\u304c\u3001\u7406\u7531\u306a\u3069\u3069\u3046\u3067\u3082\u3044\u3044\u3002\u5927\u4e8b\u306a\u306e\u306f\u5974\u3089\u3088\u308a\u3082\u5148\u306b\u898b\u3064\u3051\u51fa\u3057\u3001\u76f8\u5fdc\u306e\u51e6\u7f6e\u3092\u3059\u308b\u4e8b\u3060", "\u306f\u3044", "\u3060\u304c\u3001\u809d\u5fc3\u306e\u9b54\u738b\u306e\u5834\u6240\u304c\u4e0d\u660e\u3060\u3002\u66f8\u7269\u3092\u7aef\u304b\u3089\u8abf\u3079\u4e0a\u3052\u3066\u3082\u3001\u4e00\u5207\u8a18\u3055\u308c\u3066\u3044\u306a\u3044", "\u2026\u2026\u4f55\u3067\u3057\u3087\u3046", "\u3044\u3084\u3002\u6211\u304c\u56fd\u306b\u3082\u3001\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8\u306e\u4f1d\u624b\u3092\u4f7f\u3063\u3066\u3001\u30b3\u30bd\u30b3\u30bd\u3068\u56fd\u5883\u4ed8\u8fd1\u3092\u63a2\u3063\u3066\u3044\u308b\u5a18\u304c\u3044\u305f\u3053\u3068\u3092\u601d\u3044\u51fa\u3057\u3066\u306a", "\u4f55\u6545\u3001\u3068\u306f\u554f\u308f\u306a\u3044\u3067\u3084\u308d\u3046", "\u4ee3\u308f\u308a\u306b\u3001\u305d\u306e\u635c\u3057\u7269\u3092\u898b\u3064\u3051\u51fa\u3057\u3066\u6301\u3061\u5e30\u308c"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/143/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u8ac7\u5224\u3002", "discourse": ["\u2015\u2015\u3055\u3066", "\u7121\u99c4\u8a71\u306f\u3053\u3053\u307e\u3067\u3060", "\u672c\u984c\u3092\u8a71\u305b\u3002\u6642\u9593\u3092\u7121\u99c4\u306b\u3059\u308b\u306a", "\u3067\u306f\u3001\u304a\u8a71\u3055\u305b\u3066\u9802\u304d\u307e\u3059\uff01", "\u8a71\u305b", "\u2026\u2026\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306e\u738b\u592a\u5b50\u3001\u30ea\u30d2\u30c8\u30fb\u30d5\u30a9\u30f3\u30fb\u30a8\u30eb\u30b9\u30bf\u30fc\u6bbf\u4e0b\u304c\u6210\u4eba\u3059\u308b\u307e\u3067\u306b\u3001\u529f\u7e3e\u3092\u6b8b\u305b\u3068\u306e\u304a\u8a71\u3067\u3057\u305f\u304c\u3001\u899a\u3048\u3066\u3044\u3089\u3063\u3057\u3083\u3044\u307e\u3059\u304b", "\u3042\u3042", "\u3067\u306f\u3001\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306e\u6d41\u884c\u308a\u75c5\u304c\u5e83\u304c\u308b\u3053\u3068\u3092\u9632\u3052\u305f\u4e8b\u306f\u3001\u529f\u7e3e\u3068\u6570\u3048\u3066\u9802\u3051\u307e\u3059\u304b", "\u304a\u524d\u306e\u4ea4\u6e09\u4e0b\u624b\u306f\u3001\u4e00\u751f\u6cbb\u308b\u4e8b\u306f\u306a\u3055\u305d\u3046\u3060\u306a", "\u4ea4\u6e09\u76f8\u624b\u306b\u4fa1\u5024\u3092\u6c7a\u3081\u3055\u305b\u308b\u306a\u3002\u8db3\u5143\u3092\u898b\u3089\u308c\u308b\u305e", "\u307e\u3041\u3001\u529f\u7e3e\u3068\u8a8d\u3081\u3066\u3084\u3089\u306a\u304f\u3082\u306a\u3044\u304c\u306a\u3002\u5c0f\u5a18\u306b\u3057\u3066\u306f\u3001\u826f\u304f\u3084\u3063\u305f\u306e\u3067\u306f\u306a\u3044\u304b\uff1f", "\u305d\u308c\u3060", "\u65e9\u901f\u3001\u8db3\u5143\u3092\u898b\u3089\u308c\u3066\u3044\u308b\u306e\u304c\u4f55\u6545\u5206\u304b\u3089\u306a\u3044\u3002\u3053\u3053\u306f\u3001\u304a\u524d\u304c\u6210\u3057\u9042\u3052\u305f\u4e8b\u306f\u3001\u305d\u306e\u7a0b\u5ea6\u306e\u3082\u306e\u3067\u306f\u306a\u3044\u3068\u4e3b\u5f35\u3059\u308b\u3079\u304d\u3068\u3053\u308d\u3060", "\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u3068\u306e\u7d46\u3092\u6df1\u3081\u308b\u3068\u3044\u3046\u610f\u5473\u3067\u306f\u3001\u304a\u524d\u306f\u3053\u308c\u4ee5\u4e0a\u306a\u3044\u6210\u679c\u3092\u53ce\u3081\u305f\u3002\u8cb8\u3057\u3092\u4f5c\u3063\u305f\u3068\u8a00\u3063\u3066\u3082\u904e\u8a00\u3067\u306f\u306a\u3044\u3002\u3060\u304c\u304a\u524d\u306e\u4e0b\u624b\u304f\u305d\u306a\u4ea4\u6e09\u306e\u7d50\u679c\u3001\u4e0e\u3048\u3089\u308c\u308b\u306e\u306f\u300e\u96a3\u56fd\u306e\u738b\u592a\u5b50\u3068\u306e\u5a5a\u59fb\u306e\u62d2\u5426\u300f\u3060\u3051\u3060\u3002\u6e80\u8db3\u304b\uff1f", "\u2026\u2026\u3044\u3044\u3048", "\u5225\u306e\u304a\u9858\u3044\u304c\u3001\u3054\u3056\u3044\u307e\u3059", "\u2026\u2026\u5225\u306e\uff1f", "\u307e\u3060\u3001\u96a3\u56fd\u306e\u738b\u592a\u5b50\u6bbf\u4e0b\u304c\u6210\u4eba\u3059\u308b\u307e\u3067\u3001\u534a\u5e74\u307b\u3069\u7336\u4e88\u304c\u6b8b\u3063\u3066\u304a\u308a\u307e\u3059\u3002\u305d\u308c\u307e\u3067\u306b\u3082\u3046\u4e00\u3064\u3001\u529f\u7e3e\u3092\u3042\u3052\u3066\u307f\u305b\u307e\u3059\u3002\u3067\u3059\u304b\u3089\u3001\u307e\u305a\u306f\u5225\u306e\u9858\u3044\u3092\u53f6\u3048\u3066\u9802\u304d\u305f\u3044\u306e\u3067\u3059", "\u3082\u3046\u4e00\u3064\u3068\u306f\u3001\u5927\u304d\u304f\u51fa\u305f\u306a", "\u9762\u767d\u3044\u3001\u8a00\u3063\u3066\u307f\u308d", "\u65bd\u8a2d\u3092\u3002\u533b\u8005\u3084\u85ac\u5e2b\u304c\u96c6\u307e\u308b\u65bd\u8a2d\u3092\u3001\u4f5c\u3063\u3066\u304f\u3060\u3055\u3044", "\u9014\u65b9\u3082\u306a\u3044\u8a71\u3092\u3001\u968f\u5206\u3068\u7c21\u5358\u306b\u8a00\u3063\u3066\u304f\u308c\u305f\u3082\u306e\u3060", "\u9014\u65b9\u3082\u306a\u3044\u304a\u9858\u3044\u3067\u3082\u3001\u4e00\u3064\u306f\u4e00\u3064\u3001\u3067\u3059\u3088\u306d\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/142/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u81ea\u7701\u3002", "discourse": ["\u2026\u2026\u3088\u3057", "\u2026\u2026\u2026\u2026", "\u968f\u5206\u3068\u3001\u6d3e\u624b\u306b\u3084\u3063\u305f\u306a", "\u6d77\u8cca\u306b\u8972\u308f\u308c\u305f\u304b\u3068\u601d\u3048\u3070\u3001\u6b21\u306f\u4ef2\u9593\u3060\u3068\u601d\u3063\u3066\u3044\u305f\u7537\u306b\u652b\u308f\u308c\u3066\u3001\u5c71\u5965\u306e\u6751\u3067\u85ac\u5e2b\u306e\u771f\u4f3c\u4e8b\u3002\u3084\u3051\u306b\u9069\u5fdc\u3057\u3066\u3044\u305f\u69d8\u5b50\u304b\u3089\u3001\u305d\u306e\u307e\u307e\u96a0\u9041\u751f\u6d3b\u3067\u3082\u59cb\u3081\u308b\u6c17\u304b\u3068\u601d\u3063\u305f\u304c\u3001\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u3067\u6d41\u884c\u75c5\u304c\u78ba\u8a8d\u3055\u308c\u305f\u3068\u77e5\u308b\u3084\u3044\u306a\u3084\u3001\u85ac\u5e2b\u9054\u3092\u8aac\u5f97\u3057\u3066\u4e0b\u5c71\u3002\u30a2\u30a4\u30b2\u30eb\u5bb6\u306e\u30b3\u30cd\u3092\u4f7f\u3063\u3066\u30f4\u30a3\u30f3\u30c8\u3078\u5165\u56fd\u3002\u75c5\u306e\u8513\u5ef6\u3057\u3066\u3044\u308b\u6751\u3078\u3068\u81ea\u3089\u5411\u304b\u3044\u3001\u898b\u4e8b\u3001\u75c5\u306e\u6c88\u9759\u5316\u306b\u6210\u529f\u3059\u308b", "\u3053\u308c\u304c\u3001\u738b\u5973\u306e\u884c\u52d5\u3092\u8a18\u3057\u305f\u5831\u544a\u66f8\u3060\u3068\u306f\u4fc4\u306b\u306f\u4fe1\u3058\u304c\u305f\u3044\u3002\u9154\u3044\u3064\u3076\u308c\u305f\u541f\u904a\u8a69\u4eba\u304c\u3001\u6df1\u591c\u306b\u66f8\u304d\u6bb4\u3063\u305f\u5922\u60f3\u306e\u985e\u3068\u53d6\u308a\u9055\u3048\u3089\u308c\u305f\u306e\u304b\u3068\u601d\u3063\u305f\u305e", "\u3055\u3066\u3002\u3053\u3053\u3067\u7591\u554f\u306a\u306e\u3060\u304c\u3001\u304a\u524d\u306f\u4e00\u4f53\u3001\u3069\u3053\u306b\u4f55\u3092\u3057\u306b\u884c\u3063\u305f\u306e\u3060\u3063\u305f\u304b\uff1f", "\u2026\u2026\u30d5\u30e9\u30f3\u30e1\u3078\u3001\u85ac\u3092\u63a2\u3057\u306b\u884c\u304d\u307e\u3057\u305f", "\u305d\u308c\u306b\u3057\u3066\u306f\u3001\u968f\u5206\u306a\u5927\u5192\u967a\u3060\u3063\u305f\u306a", "\u305d\u308c\u306f\u3001\u305d\u306e\u2026\u2026\u4e0d\u53ef\u6297\u529b\u3068\u3044\u3044\u307e\u3059\u304b", "\u4e0d\u53ef\u6297\u529b\u3002\u81ea\u3089\u9996\u3092\u7a81\u3063\u8fbc\u3093\u3067\u304a\u3044\u3066\u3001\u4e0d\u53ef\u6297\u529b\u3068\u306f\u3002\u3042\u307e\u308a\u7b11\u308f\u305b\u308b\u306a", "\u96a3\u56fd\u306e\u7aae\u5730\u306b\u99c6\u3051\u3064\u3051\u3001\u6551\u4e16\u4e3b\u306e\u771f\u4f3c\u4e8b\u307e\u3067\u3057\u3066\u307f\u305b\u305f\u7406\u7531\u306f\u306a\u3093\u3060\u3002\u4e00\u3064\u3057\u304b\u306a\u3044\u547d\u3092\u5f35\u3063\u3066\u307e\u3067\u3001\u5f97\u305f\u304b\u3063\u305f\u3082\u306e\u306f\uff1f", "\u2026\u2026\u2026\u2026", "\u6c17\u304c\u5909\u308f\u3063\u3066\u3001\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306b\u5ac1\u304e\u305f\u304f\u306a\u3063\u305f\u306e\u304b\uff1f", "\u305d\u308c\u306f\u3042\u308a\u307e\u305b\u3093\uff01", "\u306a\u3089\u4f55\u3060\u3002\u898b\u904e\u3054\u305b\u306a\u304b\u3063\u305f\u3068\u3067\u3082\u8a00\u3046\u6c17\u304b", "\u2026\u2026\u2026\u2026", "\u304a\u524d\u306e\u3088\u3046\u306a\u5c0f\u5a18\u304c\u3001\u70ba\u305b\u308b\u7bc4\u7587\u3092\u8d85\u3048\u3066\u3044\u308b\u3002\u672c\u6765\u306a\u3089\u3070\u3001\u5927\u5100\u3067\u3042\u3063\u305f\u3068\u52b4\u3046\u3079\u304d\u306a\u306e\u3060\u308d\u3046\u306a", "\u3060\u304c\u3001\u304a\u524d\u304c\u7121\u4e8b\u306b\u5e30\u3063\u3066\u3053\u3089\u308c\u305f\u306e\u306f\u904b\u304c\u826f\u304b\u3063\u305f\u304b\u3089\u3060\u3002\u4e00\u3064\u9593\u9055\u3048\u3070\u3001\u547d\u306f\u306a\u304b\u3063\u305f\u3002\u52dd\u7b97\u3082\u306a\u3057\u306b\u7a81\u3063\u8fbc\u3093\u3067\u3044\u304f\u732a\u306e\u3088\u3046\u306a\u99ac\u9e7f\u5a18\u3092\u3001\u305d\u306e\u307e\u307e\u306b\u3057\u3066\u304a\u3044\u3066\u306f\u56fd\u304c\u50be\u304f", "\u304a\u305d\u3089\u304f\u3060\u304c\u3001\u4eca\u3001\u304a\u524d\u304c\u8003\u3048\u3066\u3044\u308b\u3053\u3068\u3067\u306f\u306a\u3044", "\u307e\u3060\u4f55\u3082\u8a00\u3063\u3066\u307e\u305b\u3093", "\u9854\u306b\u66f8\u3044\u3066\u3042\u308b\u3002\u305d\u308c\u306f\u4e0d\u6b63\u89e3\u3060", "\u307e\u3060\u4f55\u3082\u8a00\u3063\u3066\u307e\u305b\u3093!!", "\u304a\u524d\u306f\u3001\u81ea\u5206\u306e\u547d\u3092\u5b89\u304f\u898b\u7a4d\u3082\u308a\u3059\u304e\u3060", "\u3048\u2026\u2026\uff1f", "\u304a\u524d\u304c\u6b7b\u3093\u3060\u3089\u3001\u4f7f\u3044\u7269\u306b\u306a\u3089\u306a\u304f\u306a\u308b\u4eba\u9593\u304c\u3044\u308b\u4e8b\u3092\u5fd8\u308c\u308b\u306a", "\u305d\u308c\u306f\u3001\u5144\u69d8\u306e\u3053\u3068\u3067\u3059\u304b\u2026\u2026\uff1f", "\u4e00\u4eba\u3060\u3051\u3067\u306f\u306a\u3044\u304c\u3001\u30a2\u30ec\u304c\u7b46\u982d\u3067\u3042\u308b\u4e8b\u306f\u78ba\u304b\u3060", "\u5144\u69d8\u306f\u78ba\u304b\u306b\u3001\u79c1\u3092\u5927\u5207\u306b\u3057\u3066\u304f\u3060\u3055\u3044\u307e\u3059\u3002\u3067\u3059\u304c\u3001\u516c\u79c1\u3092\u6df7\u540c\u3059\u308b\u3088\u3046\u306a\u65b9\u3067\u306f\u3042\u308a\u307e\u305b\u3093", "\u3060\u308d\u3046\u306a", "\u304a\u524d\u304c\u6b7b\u3093\u3067\u3082\u3001\u8868\u9762\u4e0a\u306f\u306a\u306b\u3082\u5909\u308f\u3089\u306a\u3044\u3060\u308d\u3046\u3002\u7fa9\u52d9\u7684\u306b\u653f\u52d9\u3092\u3053\u306a\u3057\u3001\u6d99\u4e00\u3064\u898b\u305b\u306c\u3060\u308d\u3046\u306a\u3002\u304a\u524d\u3068\u5f1f\u304c\u751f\u307e\u308c\u308b\u524d\u306e\u3001\u4eba\u5f62\u306e\u3088\u3046\u306a\u30a2\u30ec\u306b\u623b\u308b\u3060\u3051\u3060", "\u2026\u2026\u3063", "\u8ce2\u738b\u306b\u306a\u308a\u5f97\u305f\u7537\u304c\u3001\u305f\u3060\u306e\u5080\u5121\u306b\u306a\u308b\u3002\u305d\u3093\u306a\u6c7a\u65ad\u306f\u3001\u3055\u305b\u308b\u306a", "\u306f\u3044", "\u3054\u3081\u3093\u306a\u3055\u3044"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/141/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u5e30\u56fd\u3002(2)", "discourse": ["\u2026\u2026\u2026\u2026\u3048", "\u304a\u3044\u3001\u30eb\u30c3\u30c4\uff01\u9774\u6fe1\u308c\u3066\u308b\u305e", "\u306a\u306b\u3092\u30dc\u30fc\u30c3\u3068\u3057\u3066\u2026\u2026", "\u2026\u2026\u3072\u3081\u3001\u3055\u307e\uff1f", "\u305f\u3060\u3044\u307e", "\u3061\u3087\u3063\u2026\u2026", "\u2026\u2026\uff1f", "\u2026\u2026\u2026\u2026\u306a\u306b\u3092\u3057\u3066\u3044\u308b\u306e\uff1f", "\u3044\u3084\u2026\u2026\u3060\u3063\u3066\u3001\u306a\u3041\uff1f", "\u3046\u3093\u3001\u305d\u306e\u2026\u2026\u306d\u3047\uff1f", "\u2026\u2026\u306a\u3093\u304b\u3001\u59eb\u304c\u59eb\u3063\u307d\u304f\u306a\u3063\u3066\u308b\u304b\u3089", "\u79c1\u306f\u4e00\u5fdc\u3001\u305a\u3063\u3068\u524d\u304b\u3089\u59eb\u3060\u3063\u305f\u306f\u305a\u3067\u3059\u304c", "\u9055\u3063\u2026\u2026\u305d\u3001\u305d\u3046\u3058\u3083\u306a\u304f\u3066\u306d!?", "\u59eb\u69d8\u304c\u53ef\u611b\u3089\u3057\u3044\u306e\u306f\u6614\u304b\u3089\u3067\u3059\u304c\u3001\u51c4\u304f\u7dba\u9e97\u306b\u306a\u3063\u305f\u304b\u3089\u3002\u30aa\u30ec\u3082\u30eb\u30c3\u30c4\u3082\u9a5a\u3044\u3066\u3057\u307e\u3063\u305f\u3093\u3067\u3059", "\u3048\u2026\u2026", "\u3042\u308a\u3001\u304c\u3068\u3046\uff1f", "\u6e05\u3005\u3057\u3044\u304f\u3089\u3044\u306e\u7a7a\u632f\u308a\u3067\u3059\u306d\u3002\u5c11\u3057\u304f\u3089\u3044\u7167\u308c\u3066\u304f\u308c\u308b\u304b\u3068\u601d\u3063\u305f", "\u3060\u3063\u3066\u2026\u2026\u3073\u3063\u304f\u308a\u3057\u3061\u3083\u3063\u3066\u3002\u7dba\u9e97\u306b\u306a\u3063\u305f\u306a\u3093\u3066\u3001\u30b5\u30e9\u30ea\u3068\u8a00\u3046\u3093\u3067\u3059\u3082\u306e\u3002\u30c6\u30aa\u3063\u3066\u3001\u3082\u3057\u304b\u3057\u3066\u30e2\u30c6\u308b\u3067\u3057\u3087\u3046\uff1f", "\u8d64\u304f\u306a\u3063\u3066\u3082\u304f\u308c\u306a\u304b\u3063\u305f\u59eb\u69d8\u306b\u8a00\u308f\u308c\u3066\u3082\u306a\u3041\u2026\u2026", "\u3060\u304b\u3089\u3001\u9a5a\u304d\u3059\u304e\u3066\u53cd\u5fdc\u51fa\u6765\u306a\u304b\u3063\u305f\u3060\u3051\u306a\u306e\u3002\u30c6\u30aa\u304c\u60aa\u3044\u308f\u3051\u3058\u3083\u306a\u3044\u308f\u3002\u512a\u3057\u3044\u3057\u683c\u597d\u826f\u3044\u3057\u3001\u305d\u306e\u4e0a\u3001\u8a89\u3081\u4e0a\u624b\u3060\u306a\u3093\u3066\u3001\u5973\u306e\u5b50\u304c\u653e\u3063\u3066\u304a\u304b\u306a\u3044\u3068\u601d\u3046", "\u30aa\u30ec\u3060\u3063\u3066\u3001\u305d\u3053\u305d\u3053\u9854\u306f\u826f\u3044\u3068\u601d\u3046\u3093\u3060\u3051\u3069\uff1f", "\u30eb\u30c3\u30c4\u306f\u683c\u597d\u826f\u3044\u3063\u3066\u3044\u3046\u3088\u308a\u3001\u7dba\u9e97\u3063\u3066\u611f\u3058\u3088\u306d", "\u306a\u306b\u305d\u308c\u2026\u2026\u3042\u3093\u307e\u308a\u5b09\u3057\u304f\u306a\u3044\u3093\u3060\u3051\u3069\u3002\u30aa\u30ec\u3082\u683c\u597d\u826f\u3044\u3063\u3066\u8a00\u308f\u308c\u308b\u65b9\u304c\u3044\u3044", "\u3069\u306e\u307f\u3061\u59eb\u69d8\u306e\u773c\u4e2d\u306b\u306a\u3044\u4e8b\u306b\u5909\u308f\u308a\u306a\u3044\u304b\u3089\u306a", "\u3058\u3083\u3042\u59eb\u306f\u3001\u3069\u3093\u306a\u7537\u304c\u826f\u3044\u306e\u3055\uff1f", "\u3048\u3063\u3001\u79c1\u306f\u3069\u3061\u3089\u304b\u3068\u3044\u3046\u3068\u7537\u3089\u3057\u3044\u4eba\u2026\u2026\u3063\u3066\u3044\u3046\u304b\u3001\u4f55\u306e\u8a71\u3092\u3057\u3066\u3044\u308b\u306e\u304b\u3057\u3089", "\u78ba\u304b\u306b", "\u611f\u52d5\u306e\u518d\u4f1a\u3092\u4e2d\u65ad\u3057\u3066\u3001\u306a\u3093\u306e\u8a71\u3057\u3066\u3093\u3060\u3063\u3066\u611f\u3058\u3067\u3059\u306d", "\u5927\u4e8b\u306a\u4e8b\u3060\u3088\u2026\u2026\u307e\u3041\u3001\u5e30\u3063\u3066\u304d\u305f\u3070\u3063\u304b\u308a\u306e\u59eb\u306b\u554f\u3044\u8a70\u3081\u308b\u4e8b\u3067\u306f\u306a\u304b\u3063\u305f\u304b\u3082\u3057\u308c\u306a\u3044\u3051\u3069\u3055", "\u3044\u3084\u30fc\u3002\u3057\u307e\u3089\u306a\u3044\u3067\u3059\u306d\u3001\u30aa\u30ec\u3089\uff01", "\u6539\u3081\u3066\u3001\u304a\u5e30\u308a\u306a\u3055\u3044\u3002\u59eb\u69d8", "\u3042\u3001\u72e1\u3063\uff01\u304a\u304b\u3048\u308a\u3001\u59eb\uff01", "\u3046\u3093\u3002\u305f\u3060\u3044\u307e\u3001\u4e8c\u4eba\u5171"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/140/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u5e30\u56fd\u3002", "discourse": ["\u2026\u2026\u2026\u2026\uff1f", "\u306d\u308d\u30fc\u2026\u2026\u304a\u306f\u3088", "\u305d\u3046\u3060\u3001\u5e30\u3063\u3066\u304d\u305f\u3093\u3060\u3063\u305f\u2026\u2026", "\u5144\u69d8\u2026\u2026\uff1f", "\u3063\u2026\u2026", "\u304a\u3044\u3067", "\u5144\u69d8\u3001\u5c11\u3057\u75e9\u305b\u307e\u3057\u305f\uff1f", "\u30ed\u30fc\u30bc", "\u305f\u3060\u3044\u307e\u3001\u5144\u69d8", "\u3042\u3042\u3002\u304a\u304b\u3048\u308a\u3001\u79c1\u306e\u5927\u5207\u306a\u30ed\u30fc\u30bc", "\u521d\u3081\u3066\u306e\u65c5\u306f\u3069\u3046\u3060\u3063\u305f\uff1f", "\u5927\u5909\u3067\u3057\u305f\uff01\u79c1\u3001\u81ea\u5206\u3067\u601d\u3046\u3088\u308a\u305a\u3063\u3068\u4e0d\u5668\u7528\u3060\u3063\u305f\u307f\u305f\u3044\u3067\u3059\u3002\u7b11\u3063\u3061\u3083\u3046\u304f\u3089\u3044\u51fa\u6765\u306a\u3044\u4e8b\u3070\u304b\u308a\u3067\u3001\u4f55\u5ea6\u5fc3\u6298\u308c\u305f\u304b\u5206\u304b\u308a\u307e\u305b\u3093", "\u3046\u3093", "\u3067\u3082\u512a\u3057\u3044\u4eba\u9054\u304c\u52a9\u3051\u3066\u304f\u308c\u3066\u3001\u306a\u3093\u3068\u304b\u4e57\u308a\u8d8a\u3048\u3089\u308c\u307e\u3057\u305f", "\u305d\u308c\u306f\u826f\u304b\u3063\u305f\u306a", "\u306f\u3044\u3002\u5144\u69d8\u306b\u805e\u3044\u3066\u6b32\u3057\u3044\u8a71\u304c\u3001\u6ca2\u5c71\u3042\u308b\u3093\u3067\u3059", "\u79c1\u3082\u3060\u3002\u304a\u524d\u306e\u8a71\u3092\u3001\u6ca2\u5c71\u805e\u304d\u305f\u3044", "\u3067\u306f\u3001\u5144\u69d8\u306e\u304a\u4f11\u307f\u306e\u65e5\u306b\u3001\u307e\u305f\u4f1a\u3044\u306b\u6765\u307e\u3059\u306d", "\u2026\u2026\u4eca\u3067\u306f\u306a\u304f\u3001\u304b\uff1f", "\u306f\u3044\u3002\u304a\u4ed5\u4e8b\u9811\u5f35\u3063\u3066\u304f\u3060\u3055\u3044\u306d", "\u305d\u308d\u305d\u308d\u304a\u6642\u9593\u3067\u3059\u3068\u3001\u304a\u4f1d\u3048\u3057\u3088\u3046\u3068\u3057\u305f\u306e\u3067\u3059\u304c", "\u4e01\u5ea6\u3001\u59b9\u306b\u632f\u3089\u308c\u305f\u3068\u3053\u308d\u3060", "\u6d41\u77f3\u306f\u59eb\u541b\u3067\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/139/", "subtitle": "\u504f\u5c48\u738b\u5b50\u306e\u899a\u609f\u3002", "discourse": ["\u304a\u306f\u3088\u3046\u3001\u30ca\u30cf\u30c8\uff01", "\u2026\u2026\u304a\u306f\u3088\u3046\u3054\u3056\u3044\u307e\u3059\u3001\u5144\u4e0a", "\u4eca\u65e5\u3082\u826f\u3044\u5929\u6c17\u3060\u3002\u7d20\u6674\u3089\u3057\u3044\u4e00\u65e5\u306b\u306a\u308a\u305d\u3046\u3060\u306d\uff01", "\u2026\u2026\u306a\u3093\u3067\u671d\u304b\u3089\u3001\u305d\u3093\u306a\u306b\u7121\u99c4\u306b\u5143\u6c17\u306a\u3093\u3067\u3059\u304b\u3001\u8cb4\u65b9\u306f", "\u30ca\u30cf\u30c8\u304c\u623b\u3063\u3066\u304d\u3066\u304f\u308c\u305f\u304b\u3089\u3001\u5b09\u3057\u3044\u3093\u3060\u3088", "\u2026\u2026\u2026\u2026\u305d\u3046\u3067\u3059\u304b", "\u305d\u308c\u306b\u4eca\u65e5\u306f\u3001\u59eb\u541b\u306b\u4f1a\u3048\u308b\u306e\u3060\u308d\u3046\uff1f", "\u306f\u3044\u3002\u304f\u308c\u3050\u308c\u3082\u3001\u5931\u793c\u306e\u306a\u3044\u3088\u3046\u306b\u304a\u9858\u3044\u3057\u307e\u3059", "\u2026\u2026\u304a\u524d\u304c\u3001\u305d\u3093\u306a\u5fc5\u6b7b\u306a\u9854\u3092\u3059\u308b\u306e\u306f\u73cd\u3057\u3044\u306d\uff1f", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u6bbf\u4e0b\u306f\u3001\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306e\u6069\u4eba\u3068\u3044\u3046\u3060\u3051\u3067\u306a\u304f\u3001\u79c1\u500b\u4eba\u3068\u3057\u3066\u3082\u5927\u5207\u306a\u65b9\u3067\u3059\u304b\u3089", "\u3048\u3063\u3001\u3059\u3001\u597d\u304d\u306a\u306e!?", "\u99ac\u9e7f\u3067\u3059\u304b", "\u3048\u3001\u9055\u3046\u306e\uff1f\u3058\u3083\u3042\u3001\u3069\u3046\u3044\u3046\u611f\u60c5\uff1f", "\u306d\u3048\u306d\u3048\u3001\u30ca\u30cf\u30c8\uff01\u6559\u3048\u3066\u3088\u3001\u6c17\u306b\u306a\u308b\uff01", "\u305d\u3046\u3060\u3001\u5144\u4e0a\u3002\u52dd\u8ca0\u81f4\u3057\u307e\u305b\u3093\u304b\uff1f", "\u2026\u2026\u52dd\u8ca0\uff1f\u306a\u306b\u3067\uff1f\u3068\u3044\u3046\u304b\u3001\u4e00\u4f53\u306a\u3093\u3067\uff1f", "\u6b32\u3057\u3044\u3082\u306e\u304c\u3042\u308b\u306e\u3067\u3001\u305d\u308c\u3092\u304b\u3051\u3066\u3002\u7279\u306b\u62d8\u308a\u306f\u306a\u3044\u306e\u3067\u3001\u7a2e\u76ee\u306f\u306a\u3093\u3067\u3082", "\u3048\u30fc\u3063\u3068\u3001\u30ca\u30cf\u30c8\u306f\u3069\u3046\u3057\u3066\u3082\u6b32\u3057\u3044\u3082\u306e\u304c\u3042\u308b\u304b\u3089\u3001\u52dd\u3061\u305f\u3044\u3063\u3066\u3053\u3068\uff1f", "\u306f\u3044", "\u5225\u306b\u52dd\u8ca0\u3057\u306a\u304f\u3066\u3082\u3001\u79c1\u304c\u3042\u3052\u3089\u308c\u308b\u3082\u306e\u306a\u3089\u3042\u3052\u308b\u3051\u3069\uff1f", "\u52dd\u8ca0\u3057\u3066\u52dd\u3061\u53d6\u308b\u3053\u3068\u306b\u610f\u7fa9\u304c\u3042\u308a\u307e\u3059\u3002\u6c7a\u610f\u8868\u660e\u307f\u305f\u3044\u306a\u3082\u306e\u3067\u3059\u306d", "\u3068\u308a\u3042\u3048\u305a\u3001\u30ca\u30cf\u30c8\u304c\u52dd\u3064\u307e\u3067\u30b8\u30e3\u30f3\u30b1\u30f3\u3067\u3082\u3059\u308b\uff1f", "\u3067\u306f\u3001\u305d\u308c\u3067", "\u3058\u3083\u3042\u3001\u3044\u304d\u307e\u3059\u3088", "\u3058\u3083\u3093\u3051\u3093\u2015\u2015", "\u2015\u2015\u30cf\u30c8\u3001\u30ca\u30cf\u30c8", "\u2026\u2026\u3093\uff1f", "\u2026\u2026\u2026\u2026", "\u2026\u2026\u3042\u306e\uff1f", "\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3002\u2026\u2026\u3042\u307e\u308a\u306b\u7f8e\u3057\u3044\u65b9\u306a\u306e\u3067\u3001\u3064\u3044\u898b\u60da\u308c\u3066\u3057\u307e\u3044\u307e\u3057\u305f", "\u30ea\u30d2\u30c8\u69d8\u3001\u53ef\u611b\u3089\u3057\u3044\u65b9\u3092\u72ec\u308a\u5360\u3081\u3059\u308b\u306e\u306f\u72e1\u3044\u3067\u3059\u308f\u3002\u79c1(\u308f\u305f\u304f\u3057)\u306b\u3082\u7d39\u4ecb\u3057\u3066\u304f\u3060\u3055\u3044\u307e\u305b", "\u306a\u3093\u3068\u3082\u773c\u798f\u306a\u5149\u666f\u3060\u306d\u2026\u2026", "\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u3092\u6551\u3063\u305f\u52c7\u8005\u306f\u3069\u3093\u306a\u65b9\u306a\u3093\u3060\u308d\u3046\u3063\u3066\u3001\u305a\u3063\u3068\u304a\u4f1a\u3044\u3057\u305f\u304b\u3063\u305f\u3093\u3067\u3059\u306e", "\u52c7\u8005\u3060\u306a\u3093\u3066\u3001\u3068\u3093\u3067\u3082\u3042\u308a\u307e\u305b\u3093\u3002\u5468\u308a\u306e\u4eba\u9054\u306e\u52a9\u3051\u304c\u306a\u3051\u308c\u3070\u3001\u304d\u3063\u3068\u79c1\u500b\u4eba\u3067\u306f\u4f55\u3082\u51fa\u6765\u306a\u304b\u3063\u305f\u3068\u601d\u3044\u307e\u3059", "\u3044\u3044\u3048\u3002\u8cb4\u65b9\u3060\u304b\u3089\u3053\u305d\u5468\u56f2\u306e\u4eba\u9054\u3092\u52d5\u304b\u305b\u305f\u3093\u3067\u3059\u308f\u3002\u4eca\u307e\u3067\u8ab0\u306b\u3082\u5f93\u3063\u305f\u3053\u3068\u306e\u306a\u3044\u85ac\u5e2b\u306e\u4e00\u65cf\u3082\u3001\u8cb4\u65b9\u306b\u529b\u3092\u8cb8\u3057\u305f\u306e\u3067\u3057\u3087\u3046\uff1f\u5f7c\u7b49\u306b\u3082\u4e00\u5ea6\u304a\u4f1a\u3044\u3057\u305f\u3044\u308f", "\u751f\u618e\u3068\u3001\u5f7c\u7b49\u306f\u3053\u3053\u306b\u6765\u3066\u304a\u308a\u307e\u305b\u3093", "\u3042\u3089\u3001\u4f1a\u308f\u305b\u3066\u306f\u9802\u3051\u306a\u3044\u306e\uff1f", "\u898b\u4e16\u7269\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u305d\u308c\u306b\u5f7c\u7b49\u306f\u3001\u59c9\u4ee5\u5916\u306b\u306f\u5f93\u3044\u307e\u305b\u3093\u304b\u3089", "\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306b\u5354\u529b\u306f\u60dc\u3057\u307e\u306a\u3044\u3002\u3060\u304c\u3001\u3042\u304f\u307e\u3067\u81ea\u5206\u9054\u306e\u4e3b\u306f\u3001\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u738b\u5973\u6bbf\u4e0b\u3060\u3068\u3044\u3046\u4e8b\u3092\u5fd8\u308c\u306a\u3044\u3067\u6b32\u3057\u3044", "\u305d\u3046\u2026\u2026\u305d\u3046\u306d\u3002\u6b8b\u5ff5\u3060\u3051\u308c\u3069", "\u8ae6\u3081\u308b\u3057\u304b\u306a\u3055\u305d\u3046\u3060\u308f", "\u4e00\u756a\u4f1a\u3044\u305f\u304b\u3063\u305f\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\u306b\u306f\u304a\u4f1a\u3044\u51fa\u6765\u307e\u3057\u305f\u3057\u3002\u6bcd\u56fd\u3078\u306e\u304a\u307f\u3084\u3052\u8a71\u304c\u51fa\u6765\u307e\u3057\u305f", "\u30e6\u30ea\u30a2\u738b\u5973\uff1f\u3082\u3057\u304b\u3057\u3066\u30e9\u30d7\u30bf\u30fc\u306b\u5e30\u308b\u306e\u304b\u3044\uff1f", "\u306f\u3044\u3002\u307e\u3060\u304a\u8a71\u3057\u3066\u304a\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u304c\u3001\u5927\u4f2f\u6bcd\u69d8\u306e\u5177\u5408\u304c\u304a\u60aa\u3044\u3088\u3046\u3067\u3059\u306e\u3067\u3001\u56fd\u306b\u5e30\u308d\u3046\u3068\u601d\u3063\u3066\u304a\u308a\u307e\u3059", "\u7686\u69d8\u306b\u306f\u3001\u3044\u3064\u304b\u307e\u305f\u3001\u304a\u4f1a\u3044\u51fa\u6765\u305f\u3089\u5b09\u3057\u3044\u3067\u3059\u308f", "\u3048\u3048\u3001\u662f\u975e\u306b"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/138/", "subtitle": "\u504f\u5c48\u738b\u5b50\u306e\u9762\u4f1a\u3002(2)", "discourse": ["\u3072\u3081\u3055\u307e\u30fc\u3063\uff01", "\u30ca\u30cf\u30c8\u6bbf\u4e0b", "\u3063\u2026\u2026\u304a\u4e45\u3057\u3076\u308a\u3067\u3059\u3002\u30cf\u30a4\u30f3\u30c4\u69d8", "\u305a\u3044\u3076\u3093\u3068\u5927\u304d\u304f\u2026\u2026\u826f\u3044\u7537\u306b\u306a\u3089\u308c\u307e\u3057\u305f\u306a", "\u30cf\u30a4\u30f3\u30c4\u69d8\u3088\u308a\u3082\uff1f", "\u305d\u308c\u306f\u5341\u5e74\u65e9\u3044", "\u30e8\u30cf\u30f3\u6bbf\u4e0b\u3002\u305d\u3061\u3089\u306e\u53ef\u6190\u306a\u59eb\u541b\u306f\u3001\u3082\u3057\u3084\uff1f", "\u79c1\u306e\u59c9\u3067\u3059", "\u304a\u76ee\u306b\u304b\u304b\u308c\u3066\u5149\u6804\u3067\u3059\u3002\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u30fb\u30d5\u30a9\u30f3\u30fb\u30f4\u30a7\u30eb\u30d5\u30a1\u30eb\u30c8\u3068\u7533\u3057\u307e\u3059", "\u306f\u3058\u3081\u307e\u3057\u3066\u3001\u9e97\u3057\u304d\u738b\u5973\u6bbf\u4e0b\u3002\u30cf\u30a4\u30f3\u30c4\u30fb\u30d5\u30a9\u30f3\u30fb\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u3068\u7533\u3057\u307e\u3059\u3002\u304a\u5642\u306f\u304b\u306d\u304c\u306d\u3001\u30e8\u30cf\u30f3\u6bbf\u4e0b\u304b\u3089\u4f3a\u3063\u3066\u304a\u308a\u307e\u3059", "\u3042\u307e\u308a\u672c\u6c17\u306b\u306a\u3055\u3089\u306a\u3044\u3067\u304f\u3060\u3055\u3044\u306d\uff1f\u30e8\u30cf\u30f3\u306f\u59c9\u3067\u3042\u308b\u79c1\u3092\u7acb\u3066\u3088\u3046\u3068\u3057\u3066\u304f\u308c\u308b\u306e\u3067\u3001\u5c11\u3057\u5927\u8888\u88df\u306b\u8a71\u3057\u3066\u3044\u308b\u3068\u601d\u3046\u3093\u3067\u3059", "\u5927\u8888\u88df\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u59c9\u69d8\u306f\u7d20\u6674\u3089\u3057\u3044\u65b9\u3067\u3059", "\u307b\u3089\u3001\u3053\u3093\u306a\u611f\u3058\u306b", "\u82e6\u75db\u3092\u5c11\u3057\u3060\u3051\u548c\u3089\u3052\u308b\u4e8b\u306f\u51fa\u6765\u308b\u3002\u3051\u308c\u3069\u6cbb\u3059\u4e8b\u306f\u2015\u2015\u7121\u7406\u3088", "\u5fc3\u81d3\u306e\u75c5\u306f\u3001\u304b\u306a\u308a\u91cd\u75c7\u306d\u3002\u65e2\u306b\u3001\u85ac\u3084\u98df\u4e8b\u7642\u6cd5\u3067\u3069\u3046\u306b\u304b\u306a\u308b\u6bb5\u968e\u3067\u306f\u306a\u3044\u308f\u3002\u305d\u308c\u306b\u4ed6\u306e\u81d3\u5668\u306b\u3082\u7570\u5e38\u304c\u51fa\u3066\u3044\u308b\u3002\u5e74\u9f62\u7684\u306b\u898b\u3066\u3082\u3001\u56de\u5fa9\u306f\u96e3\u3057\u3044\u3067\u3057\u3087\u3046\u306d", "\u3063\u2026\u2026", "\u6cbb\u305b\u306a\u3044", "\u2026\u2026\u3082\u3057\u2026\u2026\u3082\u3057\u3082\u3001\u30cf\u30a4\u30f3\u30c4\u69d8\u304c\u671b\u3093\u3067\u304f\u3060\u3055\u308b\u306e\u306a\u3089\u3001\u75db\u307f\u3092\u548c\u3089\u3052\u3066\u3042\u3052\u3066\u6b32\u3057\u3044\u3002\u50d5\u306e\u52dd\u624b\u306a\u671b\u307f\u3067\u3059\u304c\u3001\u6700\u671f\u306e\u6642\u9593\u306f\u7a4f\u3084\u304b\u306b\u904e\u3054\u3057\u3066\u9802\u304d\u305f\u3044\u3093\u3067\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/137/", "subtitle": "\u504f\u5c48\u738b\u5b50\u306e\u9762\u4f1a\u3002", "discourse": ["\u304a\u4e45\u3057\u3085\u3046\u3054\u3056\u3044\u307e\u3059\u3001\u30ca\u30cf\u30c8\u6bbf\u4e0b", "\u2026\u2026\u304a\u4e45\u3057\u3076\u308a\u3067\u3059\u3002\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u537f", "\u898b\u82e6\u3057\u3044\u59ff\u3092\u5fa1\u524d\u306b\u6652\u3059\u7121\u793c\u3092\u3001\u3069\u3046\u304b\u304a\u8a31\u3057\u304f\u3060\u3055\u3044", "\u3044\u3084\u2026\u2026\u3002\u3053\u3061\u3089\u3053\u305d\u3001\u5931\u793c\u3092\u3057\u305f", "\u82e5\u3044\u8005\u306b\u306f\u307e\u3060\u307e\u3060\u8ca0\u3051\u306c\u3064\u3082\u308a\u3067\u3057\u305f\u304c\u3001\u8fd1\u9803\u306f\u3001\u4f53\u3092\u8d77\u3053\u3059\u4e8b\u3082\u5118\u306a\u3089\u306a\u304f\u306a\u3063\u3066\u304d\u307e\u3057\u3066\u306a\u3002\u5e74\u306f\u3068\u308a\u305f\u304f\u306a\u3044\u3082\u306e\u3067\u3059", "\u3067\u3059\u304c\u3001\u81ea\u5206\u304c\u3053\u3046\u306a\u3063\u3066\u3001\u521d\u3081\u3066\u898b\u3048\u308b\u3082\u306e\u3082\u3042\u308a\u307e\u3057\u305f\u3002\u79c1\u306f\u606f\u5b50\u306e\u2026\u2026\u30d5\u30a3\u30ea\u30c3\u30d7\u306e\u4e8b\u3092\u3001\u4f55\u4e00\u3064\u5206\u304b\u3063\u3066\u3044\u306a\u304b\u3063\u305f", "\u537f\u3001\u3054\u5b50\u606f\u306b\u3064\u3044\u3066\u306e\u304a\u8a71\u306f\u2026\u2026", "\u65e2\u306b\u805e\u304d\u53ca\u3093\u3067\u304a\u308a\u307e\u3059\u3002\u6211\u304c\u606f\u5b50\u306e\u611a\u884c\u3067\u3001\u3069\u308c\u307b\u3069\u591a\u304f\u306e\u9818\u6c11\u3092\u82e6\u3057\u3081\u305f\u4e8b\u304b\u3002\u7533\u3057\u958b\u304d\u306e\u3057\u3088\u3046\u3082\u3054\u3056\u3044\u307e\u305b\u3093\u3002\u30d5\u30a3\u30ea\u30c3\u30d7\u30fb\u30d5\u30a9\u30f3\u30fb\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u306e\u7f6a\u306f\u3001\u89aa\u3067\u3042\u308a\u3001\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u5bb6\u5f53\u4e3b\u3067\u3042\u308b\u79c1\u306e\u7f6a\u3067\u3082\u3042\u308a\u307e\u3059\u3002\u3044\u304b\u306a\u308b\u51e6\u5206\u3082\u53d7\u3051\u5165\u308c\u308b\u6240\u5b58\u3067\u3054\u3056\u3044\u307e\u3059", "\u2026\u2026\u51e6\u5206\u306f\u307e\u3060\u4fdd\u7559\u3067\u3059\u3002\u8ffd\u3063\u3066\u6c99\u6c70\u304c\u3042\u308b\u3067\u3057\u3087\u3046", "\u5fa1\u610f\u306b", "\u6642\u306b\u3001\u6bbf\u4e0b\u3002\u304a\u8a31\u3057\u9802\u3051\u308b\u306e\u3067\u3042\u308c\u3070\u3001\u6d41\u884c\u75c5\u306e\u73fe\u72b6\u306b\u3064\u3044\u3066\u304a\u805e\u304b\u305b\u9858\u3044\u305f\u3044\u306e\u3067\u3059\u304c", "\u73fe\u5728\u3001\u767a\u75c7\u8005\u306f\u5357\u897f\u306e\u68ee\u306e\u4e2d\u306b\u3042\u308b\u6751\u3078\u3068\u9694\u96e2\u3055\u308c\u3066\u304a\u308a\u307e\u3059\u3002\u79c1\u304c\u738b\u90fd\u3078\u85ac\u3084\u98df\u6599\u3092\u542b\u3081\u305f\u7269\u8cc7\u3092\u53d6\u308a\u306b\u623b\u308b\u9593\u3001\u30e8\u30cf\u30f3\u304c\u68ee\u306b\u6b8b\u308a\u3001\u770b\u75c5\u306b\u3042\u305f\u3063\u3066\u304f\u308c\u308b\u3053\u3068\u306b\u306a\u308a\u307e\u3057\u305f", "\u2026\u2026\u30e8\u30cf\u30f3\u6bbf\u4e0b", "\u3067\u3059\u304c\u75c5\u306f\u65b0\u7a2e\u3067\u3001\u65e2\u5b58\u306e\u85ac\u3092\u6301\u3063\u3066\u304d\u305f\u3068\u3053\u308d\u3067\u52b9\u679c\u306f\u671f\u5f85\u51fa\u6765\u307e\u305b\u3093\u3002\u305d\u3093\u306a\u516b\u65b9\u585e\u304c\u308a\u306e\u72b6\u6cc1\u3067\u3057\u305f\u304c\u3001\u96a3\u56fd\u306e\u738b\u5973\u6bbf\u4e0b\u306e\u3054\u52a9\u529b\u304c\u3042\u308a\u3001\u306a\u3093\u3068\u304b\u5149\u660e\u304c\u898b\u3048\u3066\u304d\u305f\u3068\u3053\u308d\u3067\u3059", "\u2026\u2026\u96a3\u56fd\u306e\u738b\u5973\u6bbf\u4e0b\u3068\u3044\u3044\u307e\u3059\u3068\u3001\u30e8\u30cf\u30f3\u6bbf\u4e0b\u306e\u59c9\u541b\u3067\u3057\u3087\u3046\u304b\uff1f", "\u306f\u3044\u3002\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u738b\u5973\u6bbf\u4e0b\u306f\u3001\u7279\u52b9\u85ac\u3092\u5c4a\u3051\u3066\u304f\u3060\u3055\u3063\u305f\u3060\u3051\u3067\u306a\u304f\u3001\u512a\u79c0\u306a\u85ac\u5e2b\u3092\u6ca2\u5c71\u9023\u308c\u3066\u304d\u3066\u304f\u3060\u3055\u3063\u305f\u3002\u305d\u306e\u4e0a\u3001\u5fa1\u672c\u4eba\u3082\u6751\u3067\u75c5\u4eba\u306e\u6cbb\u7642\u3092\u624b\u4f1d\u3063\u3066\u304f\u3060\u3055\u3063\u3066\u304a\u308a\u307e\u3059", "\u738b\u5973\u6bbf\u4e0b\u304c\u3001\u81ea\u3089\u75c5\u4eba\u306e\u6cbb\u7642\u3092!?", "\u5927\u4eba\u3073\u305f\u30e8\u30cf\u30f3\u6bbf\u4e0b\u304c\u3001\u59c9\u541b\u306e\u4e8b\u3068\u306a\u308b\u3068\u5e74\u76f8\u5fdc\u306e\u5c11\u5e74\u306e\u9854\u306b\u623b\u308b\u306e\u3092\u5fae\u7b11\u307e\u3057\u304f\u601d\u3063\u3066\u304a\u308a\u307e\u3057\u305f\u3002\u59c9\u541b\u306f\u5fc3\u512a\u3057\u304f\u7f8e\u3057\u3044\u65b9\u3060\u3068\u3001\u78ba\u304b\u306b\u805e\u3044\u3066\u304a\u308a\u307e\u3057\u305f\u304c\u2026\u2026\u79c1\u306e\u60f3\u50cf\u4ee5\u4e0a\u306e\u5fa1\u65b9\u306e\u3088\u3046\u3067\u3059\u306d", "\u512a\u79c0\u306a\u85ac\u5e2b\u3068\u3044\u3046\u306e\u306f\u3001\u30cd\u30fc\u30d9\u30eb\u738b\u5bb6\u304a\u62b1\u3048\u306e\u3001\u3068\u3044\u3046\u4e8b\u3067\u3057\u3087\u3046\u304b\uff1f", "\u3044\u3044\u3048\u3002\u79c1\u3082\u307e\u3060\u8a73\u3057\u304f\u306f\u805e\u3044\u3066\u3044\u306a\u3044\u306e\u3067\u3059\u304c\u3001\u304a\u305d\u3089\u304f\u9055\u3044\u307e\u3059\u3002\u30e8\u30cf\u30f3\u3082\u7279\u52b9\u85ac\u306e\u4e8b\u3092\u77e5\u3089\u306a\u304b\u3063\u305f\u306e\u3067\u3001\u4e88\u60f3\u3067\u3059\u304c\u3001\u4ed6\u56fd\u306e\u85ac\u5e2b\u3092\u96c7\u3063\u305f\u306e\u3067\u306f\u306a\u3044\u304b\u3068\u601d\u308f\u308c\u307e\u3059", "\u4ed6\u56fd\u306e\u2026\u2026\u3001\u3082\u3057\u3084\u3001\u30d5\u30e9\u30f3\u30e1\u304b\u3089\uff1f", "\u2026\u2026\u3042\u3042\u3001\u78ba\u304b\u306b\u3001\u30d5\u30e9\u30f3\u30e1\u306e\u65b9\u89d2\u304b\u3089\u3084\u3063\u3066\u6765\u305f\u3088\u3046\u3067\u3057\u305f", "\u537f\uff1f", "\u5931\u793c\u3092\u81f4\u3057\u307e\u3057\u305f\u3002\u5e74\u7532\u6590\u3082\u306a\u304f\u3001\u5c11\u3057\u306f\u3057\u3083\u3044\u3067\u3057\u307e\u3063\u305f\u3088\u3046\u3067\u3059", "\u304a\u4f3d\u567a\u306e\u8056\u5973\u69d8\u3060\u3068\u601d\u3063\u3066\u3044\u305f\u65b9\u304c\u3001\u307e\u3055\u304b\u5192\u967a\u8b5a\u306e\u82f1\u96c4\u3060\u3068\u306f\u601d\u3044\u3082\u3057\u306a\u304b\u3063\u305f\u3082\u306e\u3067", "\u738b\u5973\u6bbf\u4e0b\u304c\u3001\u82f1\u96c4\u3067\u3059\u304b\uff1f", "\u30d5\u30e9\u30f3\u30e1\u306e\u5c71\u6df1\u304f\u306b\u3001\u85ac\u5e2b\u306e\u4e00\u65cf\u304c\u4f4f\u3093\u3067\u3044\u308b\u3068\u805e\u3044\u305f\u4e8b\u304c\u3042\u308a\u307e\u3059\u3002\u738b\u5bb6\u304a\u62b1\u3048\u306e\u533b\u8005\u3084\u85ac\u5e2b\u3082\u6575\u308f\u306a\u3044\u3001\u81a8\u5927\u306a\u77e5\u8b58\u91cf\u3068\u512a\u308c\u305f\u6280\u8853\u3092\u6301\u3061\u306a\u304c\u3089\u3082\u3001\u8ab0\u306b\u3082\u819d\u3092\u6298\u3089\u306a\u3044\u5b64\u9ad8\u306e\u4e00\u65cf\u3060\u3068\u3002\u76ee\u6483\u4f8b\u306e\u5c11\u306a\u3055\u304b\u3089\u3001\u305d\u306e\u5b58\u5728\u81ea\u4f53\u304c\u4f5c\u308a\u8a71\u3067\u306f\u306a\u3044\u304b\u3068\u3055\u3048\u601d\u308f\u308c\u3066\u3044\u305f\u306e\u3067\u3059\u304c\u3001\u3082\u3057\u5f7c\u7b49\u304c\u738b\u5973\u6bbf\u4e0b\u3092\u4e3b\u4eba\u3060\u3068\u8a8d\u3081\u305f\u306e\u3067\u3057\u305f\u3089\u2026\u2026", "\u2026\u2026\u3068\u3093\u3067\u3082\u306a\u3044\u8a71\u3060", "\u306f\u3044\u3002\u3067\u3059\u304b\u3089\u3001\u82f1\u96c4\u3060\u3068"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/136/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u591a\u5e78\u3002(3)", "discourse": ["\u30ec\u30aa\u30f3\u69d8\u2026\u2026\uff1f", "\u59eb\u541b\u3001\u30aa\u30ec\u306f\u2026\u2026", "\u5927\u4e08\u592b\u3067\u3059\u3002\u5b9f\u306f\u3001\u3042\u307e\u308a\u6c17\u306b\u3057\u3066\u3044\u306a\u3044\u306e\u3067\u2026\u2026\u3063\u3066\u3001\u6c17\u306b\u3057\u306a\u3044\u304b\u3089\u3001\u3053\u3093\u306a\u6b8b\u5ff5\u306a\u611f\u3058\u306b\u306a\u3063\u3066\u3057\u307e\u3063\u305f\u3093\u3067\u3059\u3051\u3069\u306d", "\u305d\u3046\u3058\u3083\u306a\u3044\uff01", "\u2026\u2026\u3063\uff1f", "\u3063\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3002\u2026\u2026\u8cb4\u65b9\u3092\u602f\u3048\u3055\u305b\u305f\u3044\u308f\u3051\u3058\u3083\u306a\u3044\u3093\u3060", "\u2026\u2026\u2026\u2026", "\u30aa\u30ec\u306f\u60c5\u3051\u306a\u3044\u7537\u3067\u3059\u3002\u8cb4\u65b9\u3092\u50b7\u3064\u3051\u3066\u3057\u307e\u3046\u4e8b\u306b\u602f\u3048\u308b\u3042\u307e\u308a\u3001\u3046\u3060\u3046\u3060\u3068\u60a9\u3093\u3067\u3001\u7d50\u5c40\u306f\u8cb4\u65b9\u3092\u4e0d\u5b89\u306b\u3055\u305b\u305f\u3002\u305d\u308c\u304f\u3089\u3044\u306a\u3089\u3001\u521d\u3081\u304b\u3089\u7d20\u76f4\u306b\u8a00\u3063\u3066\u3057\u307e\u3048\u3070\u3088\u304b\u3063\u305f\u3093\u3060\u3002\u2026\u2026\u59eb\u541b", "\u306f\u3044", "\u3082\u3057\u30aa\u30ec\u306e\u8a00\u8449\u306b\u3001\u5c11\u3057\u3067\u3082\u50b7\u3064\u3044\u305f\u3068\u611f\u3058\u305f\u3089\u6559\u3048\u3066\u304f\u3060\u3055\u3044\u307e\u3059\u304b\uff1f", "\u306f\u3044", "\u2026\u2026\u65b0\u3057\u3044\u50b7\u8de1\u3067\u3059\u306d", "\u3048\u3063\u3068\u3002\u305d\u308c\u306f\u6599\u7406\u4e2d\u2026\u2026\u91ce\u83dc\u306e\u76ae\u3080\u304d\u4e2d\u306b\u3001\u4f59\u6240\u898b\u3092\u3057\u3066\u3057\u307e\u3044\u307e\u3057\u3066", "\u3053\u3061\u3089\u306f\uff1f", "\u3042\u3042\u3001\u305d\u308c\u306f\u30af\u30fc\u30a2\u65cf\u306e\u6751\u3067\u3001\u85ac\u306e\u6750\u6599\u3092\u96c6\u3081\u3066\u3044\u308b\u6642\u306b\u3002\u8449\u3063\u3071\u304c\u92ed\u304b\u3063\u305f\u3093\u3067\u3059", "\u3053\u308c\u306f\u2026\u2026\u706b\u50b7\uff1f", "\u85ac\u6e6f\u3092\u304b\u304d\u6df7\u305c\u3066\u3044\u308b\u6642\u306b\u3001\u5c11\u3057\u8df3\u306d\u305f\u3093\u3067\u3059\u3002\u3067\u3082\u3001\u307b\u3093\u306e\u3061\u3087\u3063\u3068\u3067\u3059\u3088", "\u59eb\u541b\u3002\u30aa\u30ec\u306f\u3001\u8cb4\u65b9\u306b\u50b7\u3064\u3044\u3066\u6b32\u3057\u304f\u306a\u3044", "\u30ec\u30aa\u30f3\u69d8\u2026\u2026", "\u3067\u3059\u304c\u3001\u30aa\u30ec\u304c\u508d\u306b\u3044\u305f\u3089\u602a\u6211\u306a\u3093\u3066\u3055\u305b\u306a\u304b\u3063\u305f\u3068\u306f\u8a00\u3048\u306a\u3044\u3093\u3067\u3059", "\u8cb4\u65b9\u306f\u304d\u3063\u3068\u3001\u8ab0\u304c\u508d\u306b\u3044\u3066\u3082\u540c\u3058\u3053\u3068\u3092\u3059\u308b\u3060\u308d\u3046\u304b\u3089", "\u8ab0\u304b\u3092\u52a9\u3051\u308b\u305f\u3081\u306b\u5954\u8d70\u3059\u308b\u8cb4\u65b9\u3092\u3001\u30aa\u30ec\u306f\u6b62\u3081\u3089\u308c\u306a\u3044\u3057\u3001\u6b62\u3081\u305f\u304f\u3082\u306a\u3044\u3002\u2026\u2026\u3060\u304b\u3089\u59eb\u541b\u3002\u30aa\u30ec\u304c\u8cb4\u65b9\u306b\u4f1d\u3048\u305f\u3044\u8a00\u8449\u306f\u3001\u3053\u308c\u3060\u3051\u3067\u3059", "\u2026\u2026\u2026\u2026", "\u3088\u304f\u3001\u9811\u5f35\u308a\u307e\u3057\u305f\u306d", "\u2026\u2026\u2026\u2026\u3048\uff1f", "\u8cb4\u65b9\u306e\u65c5\u8def\u3092\u3001\u30aa\u30ec\u306f\u8a73\u3057\u304f\u77e5\u308a\u307e\u305b\u3093\u3002\u3067\u3059\u304c\u3001\u3053\u306e\u624b\u3092\u898b\u308c\u3070\u5206\u304b\u308b", "\u5973\u6027\u306b\u50b7\u3092\u8a87\u308c\u3068\u3044\u3046\u306e\u306f\u3001\u3042\u307e\u308a\u306b\u7121\u795e\u7d4c\u3060\u3068\u5206\u304b\u3063\u3066\u3044\u308b\u3093\u3067\u3059\u304c\u2026\u2026\u3069\u3046\u304b\u3001\u3053\u306e\u624b\u3092\u6065\u3058\u306a\u3044\u3067\u6b32\u3057\u3044", "\u2026\u2026\u307c\u308d\u307c\u308d\u3001\u3067\u3082\uff1f", "\u2026\u2026\u30dc\u30ed\u30dc\u30ed\u3067\u3082", "\u30aa\u30ec\u306b\u306f\u4f55\u3088\u308a\u5c0a\u304f\u3001\u7f8e\u3057\u3044\u624b\u3060", "\u2026\u2026\u2026\u2026\u3063", "\u59eb\u541b\u2026\u2026\u3063\u3001\u7533\u3057\u8a33", "\u3061\u304c\u3001\u2026\u2026\u3061\u304c\u3046\u306e", "\u5b09\u3057\u3044\u3093\u3067\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/135/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u591a\u5e78\u3002(2)", "discourse": ["\u2026\u2026\u2026\u2026", "\u2026\u2026\u59eb\u541b\uff1f", "\u3072\u3083\u3044!?", "\u306a\u3001\u306a\u306a\u306a\u306a\u3093\u3067\u3057\u3087\u3046\u3063\uff1f", "\u3044\u3048\u3001\u305d\u306e\u2026\u2026\u30aa\u30ec\u306b\u3082\u3001\u4f55\u304b\u304a\u624b\u4f1d\u3044\u51fa\u6765\u308b\u3053\u3068\u306f\u3042\u308a\u307e\u3059\u304b\uff1f", "\u5927\u4e08\u592b\u3067\u3059\uff01\u30ec\u30aa\u30f3\u69d8\u306f\u3001\u5ea7\u3063\u3066\u3044\u3066\u304f\u3060\u3055\u3044", "\u3063\u2026\u2026!!", "\u2026\u2026\u3042\u3063!!", "\u3042\u3042\u3042\u2026\u2026", "\u3053\u308c\u306f\u3001\u306a\u3093\u3068\u3044\u3046\u6599\u7406\u3067\u3059\u304b\uff1f", "\u3048\u30fc\u3063\u3068\u3001\u3053\u308c\u306f\u30ab\u30ec\u30fc\u3068\u3044\u3044\u307e\u3059\u3002\u30c8\u30de\u30c8\u30ab\u30ec\u30fc", "\u30c8\u30de\u30c8\u30ab\u30ec\u30fc", "\u2026\u2026\u3046\u307e\u3044", "\u3046\u307e\u3044", "\u304a\u304b\u308f\u308a\u3042\u308a\u307e\u3059\u304c\u2026\u2026", "\u3044\u305f\u3060\u304d\u307e\u3059", "\u3054\u99b3\u8d70\u69d8\u3067\u3057\u305f", "\u30ab\u30ec\u30fc\u3068\u3044\u3046\u306e\u306f\u4e0d\u601d\u8b70\u306a\u6599\u7406\u3067\u3059\u306d", "\u3048\u3063\u3068\u3001\u305d\u3046\u3067\u3059\u306d", "\u4e0d\u601d\u8b70\u306a\u9999\u308a\u3068\u8f9b\u3055\u306a\u3093\u3067\u3059\u304c\u3001\u305d\u308c\u304c\u307e\u305f\u306a\u3093\u3068\u3082\u98df\u6b32\u3092\u523a\u6fc0\u3059\u308b\u3002\u3042\u306e\u5e73\u3079\u3063\u305f\u3044\u30d1\u30f3\u3068\u3082\u826f\u304f\u5408\u3063\u3066\u3001\u51c4\u304f\u65e8\u304b\u3063\u305f\u3067\u3059", "\u304a\u53e3\u306b\u3042\u3063\u3066\u826f\u304b\u3063\u305f\u3067\u3059", "\u8cb4\u65b9\u306f\u83d3\u5b50\u3060\u3051\u3067\u306a\u304f\u3001\u6599\u7406\u3082\u4e0a\u624b\u306a\u3093\u3067\u3059\u306d", "\u3042\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/134/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u591a\u5e78\u3002", "discourse": ["\u3051\u3082\u306e\u306f\u8a00\u3044\u307e\u3057\u305f\u3002\u300e\u308f\u305f\u3057\u306b\u3061\u304b\u3088\u3063\u3066\u306f\u3044\u3051\u307e\u305b\u3093\u3002\u3059\u308b\u3069\u3044\u30c4\u30e1\u3068\u30ad\u30d0\u304c\u3001\u3042\u306a\u305f\u3092\u304d\u305a\u3064\u3051\u3066\u3057\u307e\u3046\u304b\u3089\u300f\u3059\u308b\u3069\u3044\u30c4\u30e1\u306e\u3064\u3044\u305f\u624b\u3092\u80cc\u4e2d\u306b\u304b\u304f\u3057\u3066\u3001\u3051\u3082\u306e\u306f\u308f\u3089\u3044\u307e\u3057\u305f\u3002\u3067\u3082\u304a\u59eb\u3055\u307e\u306b\u306f\u3001\u305d\u306e\u304b\u304a\u304c\u6ce3\u3044\u3066\u3044\u308b\u3088\u3046\u306b\u898b\u3048\u305f\u306e\u3067\u3057\u305f", "\u304a\u3084\u3059\u307f\u306a\u3055\u3044\u3002\u826f\u3044\u5922\u3092", "\u6e80\u6708\u3060\u2026\u2026", "\uff01\uff1f", "\u2026\u2026\u3063\uff01", "\u2026\u2026\u59eb\u541b\uff1f", "\u2026\u2026\u308c\u304a\u3093\u3001\u3055\u307e\u2026\u2026\uff1f", "\u3042\u3042\u2026\u2026\u826f\u304b\u3063\u305f\u3002\u3054\u7121\u4e8b\u3067\u3059\u306d", "\u3063\uff01", "\u308c\u304a\u3001\u30ec\u30aa\u30f3\u69d8\u3001\u3082\u2026\u2026", "\u30ec\u30aa\u30f3\u69d8\u3082\u3001\u3054\u7121\u4e8b\u3067\u826f\u304b\u3063\u305f\u2026\u2026\u304a\u304b\u3048\u308a\u306a\u3055\u3044", "\u306f\u3044\u3001\u305f\u3060\u3044\u307e\u5e30\u308a\u307e\u3057\u305f", "\u59eb\u541b\u2026\u2026\u80cc\u304c\u4f38\u3073\u307e\u3057\u305f\u304b\uff1f", "\u3048\u3063\u3002\u305d\u3046\u3001\u3067\u3059\u304b\u2026\u2026\uff1f", "\u306f\u3044\u3001\u2026\u2026\u3044\u3084", "\u3048\u3063\u3068\u2026\u2026\u3001\u30ec\u30aa\u30f3\u69d8\uff01", "\u306f\u3044\uff1f", "\u304a\u8179\uff01\u304a\u8179\u6e1b\u308a\u307e\u305b\u3093\u304b\uff1f", "\uff01", "\u2026\u2026\uff1f", "\u2026\u2026\u304a\u6065\u305a\u304b\u3057\u3044", "\u3063\u2026\u2026!!"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/133/", "subtitle": "\u504f\u5c48\u738b\u5b50\u306e\u5e30\u9084\u3002", "discourse": ["\u2026\u2026\u306f\u3068\u3001\u30ca\u30cf\u30c8\u2026\u2026\u3063\uff01\u3088\u304b\u3063\u305f\u3041\u2026\u2026", "\u305f\u3060\u3044\u307e\u5e30\u308a\u307e\u3057\u305f\u3002\u5fc3\u914d\u3092\u304a\u304b\u3051\u3057\u3066\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093", "\u7121\u4e8b\u306b\u5e30\u3063\u3066\u304d\u3066\u304f\u308c\u305f\u306a\u3089\u3044\u3044\u3088\uff01", "\u304a\u524d\u306f\u76f8\u5909\u308f\u3089\u305a\u5f1f\u96e2\u308c\u304c\u51fa\u6765\u306a\u3044\u306d\u3048\u3001\u30ea\u30d2\u30c8", "\u3063\u3001\u7236\u4e0a\u3002\u304a\u4f11\u307f\u306e\u3068\u3053\u308d\u3092\u8d77\u3053\u3057\u3066\u3057\u307e\u3063\u305f\u3070\u304b\u308a\u304b\u3001\u51fa\u5411\u304b\u305b\u3066\u3057\u307e\u3044\u3001\u7533\u3057\u8a33\u2026\u2026", "\u3042\u3042\u3001\u3084\u3081\u306a\u3055\u3044\u3002\u3084\u3063\u3068\u5e30\u3063\u3066\u304d\u3066\u304f\u308c\u305f\u606f\u5b50\u306b\u4f1a\u3044\u306b\u6765\u305f\u3093\u3060\u3002\u307e\u305a\u306f\u62b1\u304d\u3057\u3081\u3055\u305b\u3066\u304a\u304f\u308c", "\u7121\u4e8b\u3067\u826f\u304b\u3063\u305f\u3002\u541b\u306b\u306a\u306b\u304b\u3042\u3063\u305f\u3089\u3001\u79c1\u306f\u5929\u56fd\u306e\u30a2\u30e1\u30ea\u30fc\u306b\u9854\u5411\u3051\u3067\u304d\u306a\u3044\u3088", "\u2026\u2026\u306a\u308b\u307b\u3069", "\u79c1\u306e\u5224\u65ad\u304c\u9045\u3044\u3070\u304b\u308a\u306b\u3001\u591a\u304f\u306e\u6c11\u3092\u82e6\u3057\u3081\u3066\u3057\u307e\u3063\u305f\u3088\u3046\u3060", "\u7236\u4e0a\u2026\u2026", "\u3060\u304c\u3001\u4eca\u306f\u5f8c\u6094\u3084\u53cd\u7701\u3092\u3057\u3066\u3044\u308b\u5834\u5408\u3067\u306f\u306a\u3044\u306d\u3002\u65e9\u6025\u306b\u5bfe\u5fdc\u3057\u3088\u3046", "\u307e\u305a\u306f\u98df\u6599\u3068\u7269\u8cc7\u3092\u624b\u914d\u3002\u3042\u3001\u533b\u8005\u3001\u85ac\u5e2b\u3092\u542b\u3081\u533b\u7642\u306b\u8a73\u3057\u3044\u4eba\u9593\u3082\u3060\u306d\u3002\u305d\u308c\u304b\u3089\u3001\u30b0\u30ec\u30f3\u30c4\u30a7\u3092\u542b\u3081\u3001\u897f\u65b9\u306e\u8857\u306e\u6c11\u3092\u4e0d\u5b89\u306b\u3055\u305b\u306a\u3044\u305f\u3081\u306b\u3082\u3001\u66ab\u304f\u306e\u9593\u3001\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u5bb6\u306b\u4ee3\u308f\u308a\u3001\u897f\u65b9\u4e00\u5e2f\u3092\u4efb\u305b\u308b\u4e8b\u306e\u51fa\u6765\u308b\u4eba\u3092\u63a2\u3055\u306a\u304f\u3066\u306f\u3002\u30d5\u30a3\u30ea\u30c3\u30d7\u30fb\u30d5\u30a9\u30f3\u30fb\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u306e\u51e6\u9047\u3084\u8abf\u67fb\u306f\u3001\u3072\u3068\u307e\u305a\u4fdd\u7559\u306b\u2026\u2026", "\u7236\u4e0a\u3002\u79c1\u306f\u5148\u306b\u3001\u30b0\u30ec\u30f3\u30c4\u30a7\u306b\u5411\u304b\u3044\u307e\u3059", "\u30ca\u30cf\u30c8\uff1f", "\u53cb\u3068\u3001\u6069\u4eba\u3092\u8fce\u3048\u306b\u623b\u3089\u306a\u304f\u3066\u306f", "\u2026\u2026\u3067\u3082\u3001\u30ca\u30cf\u30c8\u3063\uff01", "\u30ea\u30d2\u30c8\u3001\u3084\u3081\u306a\u3055\u3044", "\u3067\u3059\u304c\u3001\u7236\u4e0a\u3002\u68ee\u306b\u8fd1\u3065\u3044\u3066\u3001\u3082\u3057\u75c5\u306b\u7f79\u3063\u305f\u3089\u2026\u2026", "\u305d\u306e\u5371\u967a\u306a\u68ee\u306b\u3001\u96a3\u56fd\u306e\u738b\u5b50\u3068\u738b\u5973\u304c\u3044\u308b\u3093\u3060\u3088\uff1f", "\u3063\u2026\u2026\u3001\u305d\u308c\u306f", "\u81ea\u56fd\u306e\u6c11\u306e\u305f\u3081\u3060\u3063\u3066\u3001\u4e2d\u3005\u51fa\u6765\u308b\u4e8b\u3067\u306f\u306a\u3044\u306e\u306b\u2026\u2026\u5f7c\u7b49\u306f\u96a3\u56fd\u3067\u3042\u308b\u30f4\u30a3\u30f3\u30c8\u306e\u6c11\u3092\u3001\u547d\u3092\u304b\u3051\u3066\u6551\u304a\u3046\u3068\u3057\u3066\u304f\u308c\u3066\u3044\u308b\u3002\u305d\u308c\u304c\u3001\u3069\u308c\u3060\u3051\u5c0a\u304f\u7a00\u6709\u306a\u4e8b\u304b", "\u305d\u3093\u306a\u5927\u6069\u3042\u308b\u4eba\u9054\u3092\u3001\u88cf\u5207\u3063\u3066\u306f\u3044\u3051\u306a\u3044\u3002\u306d\u3001\u30ea\u30d2\u30c8\u3002\u7d20\u76f4\u3067\u771f\u3063\u76f4\u3050\u306a\u541b\u306a\u3089\u3001\u5206\u304b\u308b\u306d\uff1f", "\u2026\u2026\u306f\u3044", "\u306d\u3048\u3001\u30ca\u30cf\u30c8\u3002\u3061\u3087\u3063\u3068\u6c17\u306b\u306a\u3063\u3066\u3044\u308b\u4e8b\u304c\u3042\u308b\u3093\u3060\u3051\u3069\u3001\u805e\u3044\u3066\u3082\u3044\u3044\u304b\u3044\uff1f", "\u2026\u2026\uff1f\u306a\u3093\u3067\u3057\u3087\u3046\u304b", "\u3053\u3093\u306a\u6642\u306b\u4f55\u3092\u8003\u3048\u3066\u3044\u308b\u3093\u3060\u3063\u3066\u6012\u3089\u306a\u3044\u3067\u6b32\u3057\u3044\u3093\u3060\u3051\u3069\u3001\u306d\uff1f", "\u30cd\u30fc\u30d9\u30eb\u306e\u738b\u5973\u6bbf\u4e0b\u306b\u3001\u3082\u3057\u304b\u3057\u3066\u604b\u3057\u305f\u306e\u304b\u3044\uff1f", "\u2026\u2026\u306f\u3042\u3063!?", "\u3060\u3063\u3066\u541b\u304c\u3001\u3042\u307e\u308a\u306b\u3082\u77b3\u3092\u8f1d\u304b\u305b\u3066\u738b\u5973\u6bbf\u4e0b\u306e\u4e8b\u3092\u8a9e\u308b\u3082\u306e\u3060\u304b\u3089\u3002\u305d\u308c\u306b\u4eca\u3060\u3063\u3066\u3001\u9854\u3001\u8d64\u3044\u3088\uff1f", "\u3053\u308c\u306f\u8cb4\u65b9\u304c\u3042\u307e\u308a\u306b\u3082\u7a81\u62cd\u5b50\u3082\u306a\u3044\u4e8b\u3092\u8a00\u3046\u304b\u3089\u3001\u5c11\u3057\u9a5a\u3044\u305f\u3060\u3051\u3067\u3059\u3002\u2026\u2026\u305d\u308c\u306b\u3001\u672c\u5f53\u306b\u305d\u3046\u3044\u3046\u306e\u3058\u3083\u306a\u3044", "\u305d\u3046\u304b\u3044\uff1f\u541b\u3068\u738b\u5973\u6bbf\u4e0b\u304c\u7d50\u3070\u308c\u305f\u3089\u3001\u4e21\u56fd\u306b\u3068\u3063\u3066\u3082\u79c1\u9054\u306b\u3068\u3063\u3066\u3082\u3001\u559c\u3070\u3057\u3044\u4e8b\u3060\u3068\u601d\u3046\u306e\u3060\u3051\u3069", "\u79c1\u306e\u3088\u3046\u306a\u77ee\u5c0f\u306a\u7537\u304c\u3001\u3042\u306e\u65b9\u306e\u304a\u76f8\u624b\u306a\u3069\u2026\u2026\u304a\u3053\u304c\u307e\u3057\u3044\u3002\u305d\u308c\u306b\u3001\u2026\u2026", "\u305d\u308c\u306b\uff1f", "\u3044\u3048\u3001\u306a\u3093\u3067\u3082\u3042\u308a\u307e\u305b\u3093", "\u30aa\u30ec\u306e\u5e0c\u671b\u306e\u5149"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/132/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u89aa\u7766\u3002(2)", "discourse": ["\u5931\u793c\u3057\u307e\u3059", "\u3046\u3063\u308f\u3001\u6691\uff01", "\u30de\u30ea\u30fc\u69d8\u3001\u304a\u624b\u4f1d\u3044\u3057\u307e\u3059", "\u3042\u308a\u304c\u3068\u3046\u3002\u3058\u3083\u3042\u3001\u934b\u3092\u898b\u3066\u3044\u3066\u3082\u3089\u3048\u307e\u3059\u304b", "\u30aa\u30ec\u306f\uff1f", "\u305d\u3053\u306b\u7528\u610f\u3057\u3066\u3042\u308b\u751f\u5730\u3092\u4f38\u3070\u3057\u3066\u6b32\u3057\u3044\u308f", "\u308a\u3087\u3046\u304b\u30fc\u3044", "\u2026\u2026\u2026\u2026", "\u304a\u3044\u3001\u306a\u306b\u30dc\u30fc\u30c3\u3068\u3057\u3066\u3093\u3060", "\u751f\u5730\u306e\u91cf\u304b\u3089\u3057\u3066\u3001\u5927\u91cf\u306b\u713c\u304f\u3064\u3082\u308a\u3060\u308d\uff1f\u3055\u3063\u3055\u3068\u713c\u304d\u59cb\u3081\u306a\u3044\u3068\u3001\u9593\u306b\u5408\u308f\u306a\u3044\u305c", "\u3042\u308a\u304c\u3068\u3046", "\u2026\u2026\u706b\u306e\u524d\u3067\u307c\u30fc\u3063\u3068\u3059\u3093\u3058\u3083\u306d\u3048\u3088\u3001\u30d6\u30b9", "\u30d6\u30b9!?\u541b\u306f\u76ee\u304c\u8150\u3063\u3066\u3044\u308b\u306e\u304b!?", "\u2026\u2026\u2026\u2026\u8ab0\uff1f", "\u3048\u30fc\u3063\u3068\u3001\u30e8\u30cf\u30f3\u2026\u2026\uff1f", "\u59c9\u69d8\u306e\u4f55\u51e6\u3092\u3069\u306e\u89d2\u5ea6\u304b\u3089\u898b\u3066\u3001\u30d6\u30b9\u306a\u3093\u3066\u8a00\u3063\u3066\u3044\u308b\u3093\u3060!?\u9854\u306e\u9020\u4f5c\u3069\u3053\u308d\u304b\u9aea\u306e\u4e00\u7b4b\u3001\u722a\u306e\u5148\u2026\u2026\u3044\u3084\u3001\u5fc3\u6839\u307e\u3067\u7f8e\u3057\u3044\u65b9\u3092\u6355\u307e\u3048\u3066\u30d6\u30b9\u3060\u3068!?\u76ee\u304c\u60aa\u3044\u306e\u304b\u3001\u305d\u308c\u3068\u3082\u611f\u6027\u304c\u304a\u304b\u3057\u3044\u306e\u304b\u3001\u3069\u3061\u3089\u306a\u3093\u3060\uff01", "\u306d\u3048\u3055\u307e\u2026\u2026\uff1f", "\u3