{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/131/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u89aa\u7766\u3002", "discourse": ["\u3042\u3064\u2026\u2026", "\u30de\u30ea\u30fc\u69d8", "\u7121\u7406\u306f\u306a\u3055\u3089\u306a\u3044\u3067\u3001\u5c11\u3057\u4f11\u61a9\u3057\u3066\u304f\u3060\u3055\u3044", "\u3042\u308a\u304c\u3068\u3046\u3002\u3082\u3046\u5c11\u3057\u3067\u914d\u308a\u7d42\u308f\u308b\u304b\u3089\u3001\u305d\u3046\u3057\u305f\u3089\u5c11\u3057\u4f11\u61a9\u3055\u305b\u3066\u3082\u3089\u3046\u306d", "\u3061\u3083\u3093\u3068\u4f11\u61a9\u3057\u3066\u4e0b\u3055\u3044\u306d\u3002\u7d04\u675f\u3067\u3059\u3088\u3002\u6c57\u3092\u304b\u3044\u305f\u3067\u3057\u3087\u3046\u304b\u3089\u3001\u307e\u305f\u6cb9\u5857\u308a\u76f4\u3057\u307e\u3059\u304b\u3089", "\u5931\u793c\u3057\u307e\u3059", "\u75b2\u308c\u305f\u2026\u2026", "\u304a\u75b2\u308c\u69d8", "\u2026\u2026\u304a\u3001\u738b\u5973\u69d8\u3063!?", "\u3057\u30fc\u3063", "\u9a5a\u304b\u305b\u3066\u3054\u3081\u3093\u306d", "\u3053\u306e\u5b50\u3092\u3001\u6cbb\u3057\u3066\u3042\u3052\u3066\u3044\u305f\u306e\uff1f", "\u30aa\u30ec\u306b\u75c5\u6c17\u306f\u6cbb\u305b\u307e\u305b\u3093\u3002\u5c11\u3057\u85ac\u306e\u624b\u52a9\u3051\u3092\u3057\u305f\u7a0b\u5ea6\u3067\u3059", "\u30a2\u30f3\u30bf\u2026\u2026\u3044\u3048\u3001\u8cb4\u65b9\u306e\u305d\u306e\u529b\u306f\u4f55\u3067\u3059\u304b", "\u3048\u3063\u3068\u2026\u2026", "\u602a\u3057\u3044\u8853\u3068\u304b\u3067\u306f\u306a\u3044\u3093\u3060\u3051\u3069\u2026\u2026\u305d\u306e\u3001\u6c17\u6301\u3061\u60aa\u3044\u3088\u306d", "\u306f\uff1f\u4f55\u8a00\u3063\u3066\u308b\u3093\u3067\u3059\u304b\u3002\u6c17\u6301\u3061\u60aa\u3044\u308f\u3051\u306a\u3044", "\u547c\u5438\u306e\u5b89\u5b9a\u306b\u89e3\u71b1\u3002\u85ac\u304c\u52b9\u304f\u307e\u3067\u306b\u304b\u304b\u308b\u6642\u9593\u3092\u77ed\u7e2e\u2026\u2026\u305d\u308c\u3060\u3051\u3058\u3083\u306a\u304f\u3066\u3001\u52b9\u679c