{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/130/", "subtitle": "\u6b21\u671f\u65cf\u9577\u306e\u545f\u304d\u3002", "discourse": ["\u30f4\u30a9\u30eb\u30d5\u69d8\u3001\u8ffd\u52a0\u306e\u85ac\u306f\u3053\u3053\u306b\u7f6e\u3044\u3066\u3044\u304d\u307e\u3059\u306d", "\u3042\u308a\u304c\u3068", "\u2026\u2026\u307e\u305a\u3001\u3044", "\u5473\u899a\u304c\u6b63\u5e38\u3067\u826f\u304b\u3063\u305f\u308f\u306d", "\u3046\u3048\u3047\u2026\u2026", "\u30cf\u30a4\u7d42\u308f\u308a", "\u3042\u3068\u306f\u3086\u3063\u304f\u308a\u4f11\u307f\u306a\u3055\u3044", "\u3046\u3093", "\u306d\u3047\u3001\u304a\u306b\u30fc\u3055\u3093\u2026\u2026", "\u3093\uff1f", "\u307c\u304f\u3001\u306a\u304a\u308b\u306e\uff1f", "\u2026\u2026\u5f53\u305f\u308a\u524d\u3088\u3002\u3044\u3064\u307e\u3067\u3082\u30b0\u30a6\u30bf\u30e9\u5bdd\u3066\u3044\u3089\u308c\u308b\u3068\u601d\u3063\u305f\u3089\u3001\u5927\u9593\u9055\u3044\u306a\u3093\u3060\u304b\u3089\u3002\u3055\u3063\u3055\u3068\u6cbb\u3057\u3066\u3001\u30ac\u30ad\u306f\u5916\u3067\u5143\u6c17\u306b\u904a\u3073\u306a\u3055\u3044", "\u2026\u2026\u305d\u3063\u304b\u3042", "\u30a2\u30f3\u30bf\u3089\u306f\u3001\u4f55\u8005\u306a\u3093\u3060\u3044\uff1f", "\u305f\u3060\u306e\u85ac\u5e2b\u3088", "\u8cb4\u65cf\u306e\u304a\u62b1\u3048\u306e\u85ac\u5e2b\u3067\u3059\u3089\u3001\u624b\u306e\u65bd\u3057\u3088\u3046\u304c\u306a\u3044\u3068\u4ffa\u9054\u3092\u898b\u6368\u3066\u305f\u3002\u305d\u3053\u3044\u3089\u306e\u533b\u8005\u3084\u85ac\u5e2b\u306b\u3001\u6cbb\u305b\u308b\u306f\u305a\u304c\u306a\u3044", "\u30a2\u30f3\u30bf\u9054\u306f\u6cbb\u308b\u308f\u3002\u3044\u3044\u3048\u3001\u6cbb\u3059\u308f", "\u3042\u3042\u3001\u4fe1\u3058\u308b\u3055\u3002\u2026\u2026\u3060\u304b\u3089\u3053\u305d\u3001\u4e0d\u601d\u8b70\u306a\u3093\u3060\u3002\u30a2\u30f3\u30bf\u3089\u306f\u4e00\u4f53\u3001\u4f55\u8005\u3067\u3069\u3053\u304b\u3089\u6765\u305f\u3093\u3060\uff1f", "\u3060\u304b\u3089\u305f\u3060\u306e\u85ac\u5e2b\u3060\u3063\u3066\u8a00\u3063\u3066\u308b\u3067\u3057\u3087\u3046\u304c\u3002\u7121\u7406\u306b\u8a71\u3059\u3068\u71b1\u304c\u4e0a\u304c\u308b\u308f\u3088\u3002\u5927\u4eba\u3057\u304f\u5bdd\u3066\u306a\u3055\u3044", "\u3044\u3044\u5302\u3044\u304c\u3059\u308b\u306a", "\u304a\u9999\u3092\u711a\u3044\u3066\u3044\u308b\u304b\u3089\u306d\u3002\u866b\u9664\u3051\u3060\u3051\u3069\u3001\u597d\u304d\u306a\u5302\u3044\u306a\u3089\u826f\u304b\u3063\u305f\u308f", "\u8c4a\u5bcc\u306a\u77e5\u8b58\u3092\u6301\u3061\u3001\u6b7b\u306b\u304b\u3051\u306e\u75c5\u4eba\u3059\u3089\u3082\u6cbb\u3059\u5947\u8de1\u306e\u4e00\u65cf\u304c\u3001\u3069\u3053\u304b\u306e\u5c71\u5965\u306b\u4f4f\u3093\u3067\u3044\u308b\u3068\u805e\u3044\u305f\u4e8b\u304c\u3042\u308b\u304c\u2026\u2026\u5fa1\u4f3d\u567a\u306e\u305f\u3050\u3044\u304b\u3068\u601d\u3063\u3066\u3044\u305f\u3088", "\u2026\u2026\u305d\u308c\u306f\u5fa1\u4f3d\u567a\u306d\u3002\u79c1\u9054\u306f\u5947\u8de1\u306a\u3093\u3066\u8d77\u3053\u305b\u306a\u3044\u308f", "\u79c1\u9054\u304c\u6301\u3063\u3066\u3044\u308b\u306e\u306f\u3001\u5148\u7956\u304c\u6b8b\u3057\u3066\u304f\u308c\u305f\u77e5\u8b58\u3068\u6280\u8853\u3060\u3051\u3002\u3042\u3068\u306f\u7279\u306b\u7279\u5fb4\u3082\u7279\u6280\u3082\u306a\u3044\u9811\u56fa\u8005\u306e\u96c6\u56e3\u3088\u3002\u2026\u2026\u3067\u3082\u3001\u305d\u3093\u306a\u79c1\u9054\u3092\u5fc5\u8981\u3060\u3063\u3066\u982d\u3092\u4e0b\u3052\u3066\u304f\u308c\u305f\u5b50\u304c\u3044\u305f\u304b\u3089\u3001\u3053\u3053\u306b\u3044\u308b\u3002\u305d\u308c\u3060\u3051\u306e\u4e8b", "\u305d\u308c\u306f\u3001\u3082\u3057\u304b\u3057\u3066\u30ca\u30cf\u30c8\u69d8\u306e\u3053\u3068\u304b\uff1f", "\u306f\u3041\uff1f\u8ab0\u3088\u3002\u305d\u308c", "\u504f\u5c48\u738b\u5b50\u3092\u77e5\u3089\u3093\u306e\u304b\u3002\u3042\u3093\u306a\u7d20\u6674\u3089\u3057\u3044\u65b9\u3092", "\u656c\u3063\u3066\u3044\u308b\u3068\u306f\u601d\u3048\u306a\u3044\u901a\u308a\u540d\u306d", "\u3057\u3088\u3046\u304c\u306a\u3044\u3060\u308d\u3046\u3001\u672c\u5f53\u306b\u504f\u5c48\u306a\u3093\u3060\u3002\u3067\u3082\u3001\u512a\u3057\u3044\u5fa1\u65b9\u3060\u3088\u3002\u4ffa\u9054\u306e\u8a87\u308a\u3060", "\u3042\u3089\u3001\u5947\u9047\u306d\u3002\u30de\u30ea\u30fc\u3082\u79c1\u9054\u306e\u8a87\u308a\u3088", "\u8ab0\u3060\u3001\u305d\u308c", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u30fb\u30d5\u30a9\u30f3\u30fb\u30f4\u30a7\u30eb\u30d5\u30a1\u30eb\u30c8\u6bbf\u4e0b", "\u30cd\u30fc\u30d9\u30eb\u738b\u56fd\u306e\u7b2c\u4e00\u738b\u5973\u3067\u3001\u8cb4\u65b9\u9054\u3092\u52a9\u3051\u3088\u3046\u3068\u99c6\u3051\u3064\u3051\u305f\u5fa1\u65b9\u3002\u305d\u3057\u3066\u3001\u79c1\u306e\u552f\u4e00\u306e\u4e3b\u4eba", "\u8cb4\u65b9\u9054\u306e\u738b\u5b50\u69d8\u304c\u5982\u4f55\u306b\u7d20\u6674\u3089\u3057\u3044\u4eba\u3060\u308d\u3046\u3068\u3001\u95a2\u4fc2\u306a\u3044\u3002\u79c1\u9054\u306b\u547d\u4ee4\u51fa\u6765\u308b\u306e\u306f\u3001\u3042\u306e\u5b50\u3060\u3051\u3002\u30de\u30ea\u30fc\u3060\u3051\u3088", "\u2026\u2026\u306a\u3093\u3067\u3001\u4ed6\u56fd\u306e\u738b\u5973\u69d8\u304c\u4ffa\u9054\u306e\u305f\u3081\u306b\u2026\u2026\uff1f", "\u3055\u3041\u306d\u3002\u79c1\u3082\u3042\u306e\u5b50\u306e\u4e8b\u3092\u8a73\u3057\u304f\u77e5\u3063\u3066\u3044\u308b\u8a33\u3058\u3083\u306a\u3044\u3057", "\u307e\u3055\u304b\u3042\u306e\u5b50\u306b\u3001\u597d\u304d\u306a\u4eba\u304c\u3044\u308b\u3068\u306f\u306d\u3048\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/129/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u770b\u8b77\u3002", "discourse": ["\u2026\u2026\u3082\u3046\u3061\u3087\u3063\u3068\u3001\u4f11\u3093\u3067\u3044\u3066\u306d", "\u3061\u3087\u3063\u3068\u898b\u306a\u3044\u3046\u3061\u306b\u3001\u30a4\u30b1\u30e1\u30f3\u306b\u306a\u3063\u3061\u3083\u3063\u3066", "\u2026\u2026\u79c1\u3082\u3001\u9811\u5f35\u308b\u304b\u3089\u306d", "\u2026\u2026\u304a\u59c9\u3061\u3083\u3093\u306f\u3001\u304a\u5144\u3061\u3083\u3093\u306e\u304a\u59c9\u3061\u3083\u3093\u306a\u3093\u3067\u3057\u3087\uff1f", "\u3046\u3093\u3001\u305d\u3046\u3088\u3002\u3053\u3053\u3067\u7720\u3063\u3066\u3044\u308b\u304a\u5144\u3061\u3083\u3093\u306f\u3001\u79c1\u306e\u5f1f\u306a\u306e", "\u3054\u3081\u3093\u306a\u3055\u3044\u3063\uff01", "\u3048\u3063\uff1f", "\u307c\u304f\u304c\u3001\u307c\u304f\u306e\u305b\u3044\u306a\u3093\u3060\u3002\u50d5\u304c\u304a\u5144\u3061\u3083\u3093\u306b\u52a9\u3051\u3066\u3063\u3066\u8a00\u3063\u305f\u304b\u3089\u2026\u2026\u304a\u5144\u3061\u3083\u3093\u306f\u602a\u6211\u3092\u3057\u3061\u3083\u3063\u305f", "\u9055\u3046\u3001\u60aa\u3044\u306e\u306f\u30aa\u30ec\u306a\u3093\u3067\u3059\uff01\u30aa\u30ec\u304c\u3001\u305d\u306e\u5b50\u306e\u7236\u89aa\u306b\u7d61\u3093\u3067\u3060\u304b\u3089\uff01", "\u3044\u3084\u60aa\u3044\u306e\u306f\u30aa\u30ec\u3060\uff01\u30aa\u30ec\u304c\u77f3\u306a\u3093\u304b\u6295\u3052\u305f\u304b\u3089", "\u3044\u3044\u3048\u3001\u79c1\u304c\uff01", "\u3054\u3081\u3093\u306a\u3055\u3044\u3001\u304a\u59c9\u3061\u3083\u3093\u3002\u304a\u5144\u3061\u3083\u3093\u3092\u50b7\u3064\u3001\u3093\u3080\uff1f", "\u304a\u59c9\u3061\u3083\u3093\u306e\u5f1f\u306f\u306d\u3001\u6728\u306e\u6839\u306b\u8e93\u3044\u305f\u306e", "\u2026\u2026\u3063", "\u3060\u304b\u3089\u3042\u306e\u602a\u6211\u306f\u3001\u8ab0\u306e\u305b\u3044\u3067\u3082\u306a\u3044\u306e\u3088", "\u3067\u3082\u306d\u2026\u2026\u3082\u3057\u3001\u3042\u306e\u5b50\u306e\u602a\u6211\u304c\u3001\u8ab0\u304b\u3092\u5b88\u308d\u3046\u3068\u3057\u3066\u51fa\u6765\u305f\u3082\u306e\u306a\u3089", "\u3054\u3081\u3093\u306a\u3055\u3044\u3058\u3083\u306a\u304f\u3066\u3001\u3042\u308a\u304c\u3068\u3046\u3063\u3066\u8a00\u3063\u3066\u3042\u3052\u3066", "\uff01", "\u305d\u306e\u65b9\u304c\u3001\u304d\u3063\u3068\u559c\u3076\u308f", "\u7686\u3055\u3093\u3082\u3001\u3042\u306e\u5b50\u3092\u5fc3\u914d\u3057\u3066\u96c6\u307e\u3063\u3066\u304f\u308c\u3066\u3042\u308a\u304c\u3068\u3046\u3002\u3042\u306e\u5b50\u306f\u4f11\u3081\u3070\u5927\u4e08\u592b\u3067\u3059\u304b\u3089\u3001\u3054\u5bb6\u65cf\u306e\u5143\u306b\u623b\u3063\u3066\u3042\u3052\u3066\u304f\u3060\u3055\u3044", "\u2026\u2026\u8cb4\u65b9\u69d8\u306f", "\u306f\u3044\uff1f", "\u672c\u5f53\u306b\u738b\u5973\u2026\u2026\u3044\u3084\u3001\u3044\u3044\u3067\u3059\u3002\u306a\u3093\u3067\u3082\u3042\u308a\u307e\u305b\u3093", "\u30de\u30ea\u30fc\u69d8\u3001\u3053\u3061\u3089\u624b\u4f1d\u3063\u3066\u9802\u3051\u307e\u3059\u304b\uff1f", "\u306f\u30fc\u3044\uff01"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/128/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u5e0c\u671b\u3002", "discourse": ["\u304a\u9858\u3044\u3001\u4e00\u7dd2\u306b\u6765\u3066\uff01\u7236\u3055\u3093\u304c\u3063\uff01", "\uff01", "\u30e8\u30cf\u30f3\u69d8\u3001\u30aa\u30ec\u3082\u4e00\u7dd2\u306b\u884c\u304d\u307e\u3059\uff01", "\u8cb4\u65b9\u306f\u9a0e\u58eb\u56e3\u306e\u7686\u3055\u3093\u3092\u898b\u3066\u3044\u3066\u304f\u3060\u3055\u3044", "\u3053\u306e\u75ab\u75c5\u795e\u304c\u3063!!", "\u541b\u3001\u305d\u3063\u3061\u306f\u2026\u2026", "\u65e9\u304f\uff01\u7236\u3055\u3093\u304c\u6bba\u3055\u308c\u3061\u3083\u3046\uff01", "!?", "\u541b\u306f\u3053\u3053\u306b\u3044\u306a\u3055\u3044", "\u3082\u3089\u3063\u305f\u5206\u306e\u85ac\u3068\u98df\u6599\u3092\u3001\u65e9\u304f\u5bc4\u8d8a\u305b\u3088\uff01\u305d\u308c\u3067\u8a31\u3057\u3066\u3084\u308b\u3063\u3066\u8a00\u3063\u3066\u3093\u3060\u304b\u3089", "\u3042\u308c\u306f\u30aa\u30ec\u306e\u59bb\u306e\u5206\u3060\u3002\u6e21\u305b\u306a\u3044", "\u56f3\u3005\u3057\u3044\uff01\u3088\u304f\u305d\u3093\u306a\u4e8b\u304c\u8a00\u3048\u305f\u3082\u306e\u3060\u3002\u304a\u524d\u3089\u304c\u68ee\u304b\u3089\u51fa\u3066\u3053\u306a\u3051\u308c\u3070\u3001\u3053\u3093\u306a\u3053\u3068\u306b\u306a\u3089\u306a\u304b\u3063\u305f\u3002\u30aa\u30ec\u306e\u6bcd\u89aa\u304c\u82e6\u3057\u3093\u3067\u3044\u308b\u306e\u3082\u3001\u30aa\u30ec\u304c\u3053\u3093\u306a\u5834\u6240\u306b\u3044\u308b\u306e\u3082\u3001\u5168\u90e8\u304a\u524d\u3089\u306e\u305b\u3044\u3058\u3083\u306d\u3048\u304b\uff01", "\u9055\u3046\uff01\u30aa\u30ec\u9054\u306e\u305b\u3044\u3058\u3083\u306a\u3044\uff01", "\u5618\u3092\u3064\u304f\u306a\uff01\u304a\u524d\u3089\u304c\u8857\u306b\u6765\u308b\u3088\u3046\u306b\u306a\u3063\u3066\u304b\u3089\u3001\u75c5\u304c\u6d41\u884c\u308a\u59cb\u3081\u305f\u3093\u3060\u305e!?", "\u5143\u3092\u6b63\u305b\u3070\u3001\u304a\u524d\u3089\u304c\u68ee\u306e\u6728\u3092\u5207\u308a\u59cb\u3081\u305f\u305b\u3044\u3060\u308d\u3046\uff01\u30aa\u30ec\u9054\u3060\u3063\u3066\u3001\u8857\u306b\u51fa\u305f\u304f\u306a\u3069\u306a\u304b\u3063\u305f\uff01\u3060\u304c\u3001\u304a\u524d\u3089\u304c\u68ee\u3092\u8352\u3089\u3057\u305f\u305b\u3044\u3067\u3001\u307e\u3068\u3082\u306a\u751f\u6d3b\u304c\u51fa\u6765\u306a\u304f\u306a\u3063\u305f\u3093\u3060", "\u30aa\u30ec\u9054\u306e\u305b\u3044\u3060\u3068!?", "\u6b62\u3081\u3066\u304f\u3060\u3055\u3044\uff01", "\u843d\u3061\u7740\u3044\u3066\u3002\u3069\u3061\u3089\u3082\u982d\u3092\u51b7\u3084\u3057\u3066\u304f\u3060\u3055\u3044", "\u30a2\u30f3\u30bf\u306b\u306f\u95a2\u4fc2\u306a\u3044\u3060\u308d\u3046\uff01\u305d\u3053\u3092\u9000\u3044\u3066\u304f\u308c\uff01", "\u9000\u304d\u307e\u305b\u3093\u3002\u3053\u306e\u4eba\u3092\u8cac\u3081\u3066\u3082\u3001\u4e8b\u614b\u306f\u306a\u306b\u3082\u5909\u308f\u3089\u306a\u3044\u3067\u3057\u3087\u3046", "\u3060\u3063\u305f\u3089\u3001\u3069\u3046\u3059\u308c\u3070\u5909\u308f\u308b!?", "\u75c5\u306b\u7f79\u3063\u305f\u5bb6\u65cf\u3054\u3068\u3001\u3053\u3093\u306a\u68ee\u306e\u5965\u306e\u6751\u306b\u9589\u3058\u8fbc\u3081\u3089\u308c\u3066\u3001\u56fd\u306b\u307e\u3067\u898b\u653e\u3055\u308c\u3066\uff01\u30aa\u30ec\u9054\u304c\u3053\u3093\u306a\u76ee\u306b\u5408\u3063\u3066\u3044\u308b\u306e\u306f\u3001\u5168\u90e8\u305d\u3044\u3064\u3089\u306e\u305b\u3044\u3058\u3083\u306a\u3044\u304b\uff01", "\u305d\u3001\u305d\u3046\u3060\u3002\u3053\u306e\u6751\u306e\u5974\u3089\u306e\u305b\u3044\u3060", "\u3053\u3044\u3064\u7b49\u3055\u3048\u3044\u306a\u3051\u308c\u3070\u2026\u2026", "\u6d88\u3048\u308d", "\u30aa\u30ec\u9054\u306e\u524d\u304b\u3089\u6d88\u3048\u308d\uff01", "\u3063\u3050\u2026\u2026", "\u843d\u3061\u7740\u3044\u3066\u304f\u3060\u3055\u3044", "\u56fd\u306f\u3001\u8cb4\u65b9\u9054\u3092\u898b\u6368\u3066\u3066\u306a\u3069\u3044\u306a\u3044", "\u7b2c\u4e8c\u738b\u5b50\u3001\u30ca\u30cf\u30c8\u30fb\u30d5\u30a9\u30f3\u30fb\u30a8\u30eb\u30b9\u30bf\u30fc\u306f\u3001\u8cb4\u65b9\u9054\u3092\u6551\u3046\u305f\u3081\u306b\u5954\u8d70\u3057\u3066\u3044\u307e\u3059", "\u30ca\u30cf\u30c8\u69d8\u304c\u2026\u2026\uff1f", "\u305d\u3093\u306a\u4e8b\u4fe1\u3058\u3089\u308c\u308b\u304b\u3002\u738b\u65cf\u304c\u3001\u3053\u3093\u306a\u8fba\u5883\u306e\u8857\u306e\u4e8b\u306a\u3093\u3066\u6c17\u306b\u3059\u308b\u8a33\u306a\u3044\u3060\u308d", "\u3067\u3082\u3001\u504f\u5c48\u738b\u5b50\u3060\u305e\u3002\u30aa\u30ec\u9054\u306e\u3088\u3046\u306a\u5e73\u6c11\u306b\u3082\u58f0\u3092\u304b\u3051\u3066\u304f\u3060\u3055\u308b\u5909\u308f\u308a\u8005\u306e\u738b\u5b50\u69d8\u3060", "\u30ca\u30cf\u30c8\u306f\u50d5\u3068\u5171\u306b\u3001\u6751\u306e\u5165\u308a\u53e3\u307e\u3067\u6765\u3066\u3044\u307e\u3057\u305f\u3002\u8cb4\u65b9\u9054\u306b\u914d\u3063\u305f\u85ac\u3084\u98df\u6599\u306f\u3001\u5f7c\u304c\u624b\u914d\u3057\u305f\u3082\u306e\u3067\u3059\u3002\u672c\u5f53\u306f\u76f4\u63a5\u3001\u624b\u6e21\u3057\u305f\u304b\u3063\u305f\u4e8b\u3067\u3057\u3087\u3046\u3002\u3067\u3059\u304c\u5f7c\u304c\u8cb4\u65b9\u9054\u306e\u770b\u75c5\u3092\u3057\u3066\u3082\u3001\u6839\u672c\u7684\u306a\u89e3\u6c7a\u306b\u306f\u306a\u3089\u306a\u3044\u3002\u305d\u308c\u304c\u5206\u304b\u3063\u3066\u3044\u305f\u304b\u3089\u3001\u30ca\u30cf\u30c8\u306f\u738b\u90fd\u3078\u3068\u5f15\u304d\u8fd4\u3057\u307e\u3057\u305f\u3002\u3082\u3063\u3068\u591a\u304f\u306e\u85ac\u3068\u85ac\u5e2b\u3092\u3001\u9023\u308c\u3066\u304f\u308b\u305f\u3081\u306b", "\u30a2\u30f3\u30bf\u3001\u4e00\u4f53\u2026\u2026", "\u3061\u3087\u3001\u30e8\u30cf\u30f3\u69d8!?\u305d\u306e\u602a\u6211\u306f\u3069\u3046\u3055\u308c\u305f\u3093\u3067\u3059!?", "\u30e8\u30cf\u30f3\u69d8\u3063\u3066\u2026\u2026\u307e\u3055\u304b\u96a3\u56fd\u306e\u738b\u5b50\u2026\u2026!?", "\u305d\u3046\u3044\u3084\u3001\u30cf\u30a4\u30f3\u30c4\u69d8\u3068\u4e00\u7dd2\u306b\u3044\u308b\u306e\u3092\u898b\u305f\u4e8b\u304c\u3042\u308b\u2026\u2026\u5618\u3060\u308d\u2026\u2026\u30aa\u30ec\u9054\u3001\u306a\u3093\u3066\u3053\u3068\u3092\u2026\u2026", "\u50d5\u304c\u2026\u2026\u30e8\u30cf\u30f3\u30fb\u30d5\u30a9\u30f3\u30fb\u30f4\u30a7\u30eb\u30d5\u30a1\u30eb\u30c8\u304c\u3053\u3053\u306b\u3044\u308b\u4e8b\u304c\u8a3c\u3067\u3059", "\u91cd\u306d\u3066\u8a00\u3044\u307e\u3059\u3002\u56fd\u306f\u8cb4\u65b9\u9054\u3092\u898b\u6368\u3066\u3066\u306f\u3044\u306a\u3044\u3002\u30ca\u30cf\u30c8\u306f\u8cb4\u65b9\u9054\u3001\u56fd\u6c11\u3092\u5fc3\u304b\u3089\u611b\u3057\u3001\u6551\u304a\u3046\u3068\u52aa\u529b\u3057\u3066\u3044\u307e\u3059", "\u3060\u304b\u3089\u8cb4\u65b9\u9054\u3082\u3001\u5f7c\u304c\u8a87\u308a\u306b\u601d\u3046\u56fd\u6c11\u3067\u3042\u3063\u3066\u304f\u3060\u3055\u3044", "\u5bb6\u65cf\u304c\u82e6\u3057\u3093\u3067\u3044\u308b\u306e\u3092\u898b\u308b\u306e\u306f\u8f9b\u3044\u3068\u601d\u3044\u307e\u3059\u3002\u4e0d\u5b89\u3067\u3001\u8f9b\u304f\u3066\u7720\u308c\u306a\u3044\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u3002\u3067\u3059\u304c\u3001\u3069\u3046\u304b\u30ca\u30cf\u30c8\u3092\u4fe1\u3058\u3001\u3082\u3046\u5c11\u3057\u3060\u3051\u5f85\u3063\u3066\u304f\u3060\u3055\u3044\u3002\u50d5\u3068\u5171\u306b\u3001\u3053\u3053\u3067\u6301\u3061\u582a\u3048\u3066\u6b32\u3057\u3044", "\u30e8\u30cf\u30f3\u69d8!?", "\u305d\u3046\u3044\u3048\u3070\u3001\u3053\u306e\u602a\u6211\u306f\u3001\u6728\u306e\u6839\u306b\u8e93\u3044\u305f\u3063\u3066\u3053\u3068\u3067\u2026\u2026\u3088\u308d\u3057\u304f", "\u3061\u3087\u3063\u3068\u30e8\u30cf\u30f3\u69d8!!\u3057\u3063\u304b\u308a\u3057\u3066\u304f\u3060\u3055\u3044\uff01", "\u2026\u2026\u2026\u2026\uff1f", "\u30e8\u30cf\u30f3\u3001\u8d77\u304d\u305f\u306e\u2026\u2026\uff1f", "\u2026\u2026\u59c9\u69d8\uff1f", "\u826f\u304b\u3063\u305f\u3002\u899a\u3048\u3066\u3044\u3066\u304f\u308c\u305f\u306e\u306d", "\u8272\u3005\u8a71\u3057\u305f\u3044\u3051\u308c\u3069\u3001\u3082\u3046\u5c11\u3057\u4f11\u3093\u3067\u3044\u3066\u3002\u602a\u6211\u306b\u97ff\u304f\u308f", "\u3067\u3059\u304c\u3001\u307e\u3060\u3084\u308b\u4e8b\u304c", "\u3082\u3046\u5927\u4e08\u592b", "\u2026\u2026\u3048\uff1f", "\u7279\u52b9\u85ac\u3092\u6301\u3063\u3066\u3001\u512a\u79c0\u306a\u85ac\u5e2b\u306e\u7686\u3055\u3093\u304c\u6765\u3066\u304f\u308c\u3066\u3044\u308b\u304b\u3089\u3001\u3082\u3046\u5927\u4e08\u592b\u3088", "\u3088\u304f\u9811\u5f35\u3063\u305f\u308f\u306d\u3001\u30e8\u30cf\u30f3\u3002\u79c1\u306f\u8cb4\u65b9\u306e\u59c9\u3067\u3042\u308b\u4e8b\u3092\u8a87\u308a\u306b\u601d\u3046\u308f", "\u2026\u2026\u3063"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/127/", "subtitle": "\u504f\u5c48\u738b\u5b50\u306e\u5e0c\u671b\u3002(2)", "discourse": ["\u79c1\u304c\u9006\u306b\u304a\u805e\u304d\u3057\u305f\u3044\u3067\u3059\u3088\u3002\u3053\u3093\u306a\u5834\u6240\u3067\u306a\u306b\u3092\u306a\u3055\u3063\u3066\u3044\u308b\u306e\u3067\u3059\u304b\u3001\u738b\u5b50\u6bbf\u4e0b", "\u738b\u90fd\u306b\u304a\u623b\u308a\u306b\u306a\u308b\u3068\u4ef0\u3063\u3066\u3044\u305f\u306e\u306b\u3001\u307e\u305f\u3053\u306e\u3088\u3046\u306a\u5834\u6240\u3067\u304a\u4f1a\u3044\u3059\u308b\u4e8b\u306b\u306a\u308b\u3068\u306f\u601d\u3044\u3082\u3057\u307e\u305b\u3093\u3067\u3057\u305f", "\u3042\u3042\u3001\u79c1\u3082\u4f1a\u3044\u305f\u304f\u306f\u306a\u304b\u3063\u305f", "\u3082\u3046\u4e00\u5ea6\u805e\u304f\u305e\u3002\u4f55\u3092\u3001\u3057\u3088\u3046\u3068\u3057\u3066\u3044\u305f\uff1f", "\u6b62\u3081\u308d\uff01", "\u2026\u2026\u3063", "\u30ca\u30cf\u30c8\u69d8", "\u2026\u2026\u3063\u3001\u3042\u3042", "\u5982\u4f55\u81f4\u3057\u307e\u3057\u3087\u3046\u304b", "\u2026\u2026\u7121\u529b\u5316\u3057\u3066\u304f\u308c", "\u304b\u3057\u3053\u307e\u308a\u307e\u3057\u305f", "\u3046\u308f\u3041\u3042\u3042\u3042\u3042\u3042\u3063!!", "\u6b7b\u306d\u3063\uff01", "\u2026\u2026\u2026\u2026", "\u968f\u5206\u3068\u5f37\u3044\u8b77\u885b\u304c\u3044\u3089\u3063\u3057\u3083\u308b\u306e\u3067\u3059\u306d", "\u8996\u5bdf\u306e\u6642\u306f\u9023\u308c\u3066\u3044\u306a\u304b\u3063\u305f\u3088\u3046\u3067\u3059\u304c\u3001\u3069\u3053\u304b\u3089\u8abf\u9054\u3057\u305f\u306e\u304b\u3002\u2026\u2026\u3042\u3042\u3001\u3082\u3046\u3001\u4e88\u5b9a\u901a\u308a\u306b\u306a\u3089\u306a\u3044\u4e8b\u3070\u304b\u308a\u3060", "\u305d\u3046\u3060\u3002\u304a\u524d\u306e\u601d\u3044\u901a\u308a\u306b\u306a\u3093\u3066\u3055\u305b\u306a\u3044\u3002\u5927\u4eba\u3057\u304f\u6295\u964d\u3057\u308d", "\u2026\u2026\u672c\u5f53\u306b\u3001\u305d\u308c\u3067\u5b9c\u3057\u3044\u3093\u3067\u3059\u304b\uff1f", "\u4f55\u304c\u3060", "\u30b0\u30ec\u30f3\u30c4\u30a7\u3067\u6d41\u884c\u3063\u305f\u75c5\u306f\u3001\u7279\u52b9\u85ac\u304c\u3042\u308a\u307e\u305b\u3093\u3002\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u5bb6\u304a\u62b1\u3048\u306e\u85ac\u5e2b\u3067\u3082\u3001\u624b\u306e\u65bd\u3057\u3088\u3046\u304c\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u3002\u3042\u306e\u307e\u307e\u8857\u306b\u75c5\u4eba\u3092\u7559\u3081\u304a\u3051\u3070\u3001\u4eca\u9803\u3001\u8857\u5168\u4f53\u306b\u75c5\u304c\u5e83\u304c\u3063\u3066\u3044\u305f\u306f\u305a\u3067\u3059", "\u3053\u3053\u3067\u98df\u3044\u6b62\u3081\u306a\u3051\u308c\u3070\u3001\u75c5\u306f\u3084\u304c\u3066\u56fd\u4e2d\u306b\u5e83\u304c\u308b\u3002\u5426\u3001\u56fd\u5883\u3092\u98db\u3073\u8d8a\u3048\u3001\u4e16\u754c\u4e2d\u306b\u5e83\u304c\u308b\u3067\u3057\u3087\u3046", "\u2026\u2026\u305f\u3068\u3048\u305d\u308c\u304c\u4e8b\u5b9f\u3067\u3042\u3063\u3066\u3082\u3001\u304a\u524d\u304c\u7f6a\u306e\u306a\u3044\u6c11\u3092\u68ee\u3054\u3068\u713c\u3053\u3046\u3068\u3057\u305f\u8a00\u3044\u8a33\u306b\u306f\u306a\u3089\u306a\u3044", "\u3067\u3057\u3087\u3046\u306d\u3002\u3067\u3059\u304c\u3001\u3053\u308c\u304b\u3089\u5148\u306f\u8cb4\u65b9\u69d8\u306e\u7f6a\u3067\u3059\u3002\u6570\u5341\u4eba\u306e\u547d\u3092\u9577\u5f15\u304b\u305b\u308b\u305f\u3081\u306b\u3001\u4e16\u754c\u5404\u5730\u306b\u6b7b\u306e\u75c5\u3092\u6492\u304d\u6563\u3089\u3059\u3002\u305d\u306e\u7f6a\u6df1\u3055\u306b\u3001\u8010\u3048\u3089\u308c\u308b\u81ea\u4fe1\u306f\u304a\u6709\u308a\u3067\u3059\u304b", "\u30ca\u30cf\u30c8\u69d8\uff01", "\u3063\u3001\u2026\u2026\u30aa\u30eb\u30bb\u30a4\u30f3\u6bbf\uff1f", "\u3069\u3046\u304b\u60d1\u308f\u3055\u308c\u306a\u3044\u3067\u4e0b\u3055\u3044\u3002\u5e0c\u671b\u306f\u3001\u307e\u3060\u6b8b\u3063\u3066\u3044\u307e\u3059", "\u2026\u2026\u3069\u3053\u306b\u3060\u3002\u3069\u3053\u306b\u3082\u898b\u3048\u3084\u3057\u306a\u3044\u3002\u3042\u308a\u306f\u3057\u306a\u3044\u3058\u3083\u306a\u3044\u304b\u2026\u2026\uff01", "\u3042\u308a\u307e\u3059\u3002\u4eca\u306f\u898b\u3048\u306a\u304f\u3068\u3082\u3001\u5fc5\u305a\u3002\u6211\u304c\u56fd\u306e\u2026\u2026\u3044\u3044\u3048\u3001\u30aa\u30ec\u306e\u5e0c\u671b\u306e\u5149\u306f\u3001\u6c7a\u3057\u3066\u6d88\u3048\u306a\u3044", "\u59eb\u3055\u30fc\u3093\u3001\u751f\u304d\u3066\u308b\u30fc\uff1f", "\u751f\u304d\u3066\u308b\u3051\u3069\u3063\uff01\u306a\u3093\u3067\u6025\u306b\u3001\u65b9\u5411\u8ee2\u63db\u3057\u305f\u306e!?", "\u76ee\u7684\u5730\u304c\u5909\u308f\u3063\u305f\u3093\u3067\u3059\u3088\u3002\u307b\u30fc\u3089\u3001\u3068\u3046\u3061\u3083\u30fc\u304f", "\u3048\u3063\u2026\u2026\u30ec\u30aa\u30f3\u69d8\u2026\u2026!?", "\u59eb\u541b\u2026\u2026\uff01", "\u3069\u3001\u3069\u3046\u3057\u3066\u30ec\u30aa\u30f3\u69d8\u304c\u3053\u3053\u306b\u2026\u2026", "\u3046\u3046\u3093\u3001\u4eca\u306f\u7406\u7531\u3092\u805e\u3044\u3066\u3044\u308b\u5834\u5408\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u306d\u3002\u30ec\u30aa\u30f3\u69d8\u3001\u79c1\u306f\u9593\u306b\u5408\u3044\u307e\u3057\u305f\u304b\uff1f", "\u3063\u2026\u2026\u3067\u306f\u3001\u59eb\u541b", "\u306f\u3044\u3002\u85ac\u3092\u304a\u5c4a\u3051\u306b\u53c2\u308a\u307e\u3057\u305f", "\u85ac\u3068\u3001\u2026\u2026\u4eca\u3001\u8cb4\u65b9\u306f\u85ac\u3092\u6301\u3063\u3066\u304d\u305f\u3068\u8a00\u3063\u305f\u306e\u304b", "\u8cb4\u65b9\u306e\u5927\u5207\u306a\u65b9\u3082\u3001\u3082\u3057\u304b\u3057\u3066\u75c5\u306b\u7f79\u3063\u3066\u3044\u308b\u306e\uff1f", "\u3042\u3042\u2026\u2026\u5927\u5207\u306a\u3001\u5927\u5207\u306a\u4eba\u9054\u306a\u3093\u3060", "\u5927\u4e08\u592b\u3002\u85ac\u3060\u3051\u3058\u3083\u306a\u304f\u3066\u3001\u512a\u79c0\u306a\u85ac\u5e2b\u306e\u4eba\u9054\u3082\u6765\u3066\u304f\u308c\u3066\u3044\u308b\u306e\u3002\u8cb4\u65b9\u306e\u5927\u5207\u306a\u4eba\u3092\u3001\u7d76\u5bfe\u306b\u52a9\u3051\u3066\u304f\u308c\u308b\u308f", "\u2026\u2026\u3063\u3001\u3042\u308a\u304c\u3001\u3068\u3046\u2026\u2026\u3063\uff01"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/126/", "subtitle": "\u504f\u5c48\u738b\u5b50\u306e\u5e0c\u671b\u3002", "discourse": ["\u3063\u2026\u2026", "\u30ca\u30cf\u30c8\u69d8\uff1f", "\u554f\u984c\u306a\u3044", "\u2026\u2026\uff1f", "\u30aa\u30eb\u30bb\u30a4\u30f3\u6bbf\uff01", "\u306f\u3044", "\u3069\u3046\u304b\u3057\u305f\u3093\u3067\u3059\u304b\uff1f", "\u68ee\u306e\u65b9\u3078\u5411\u304b\u3063\u3066\u3044\u307e\u3059\u306d", "\u3053\u3093\u306a\u6642\u9593\u306b\uff1f", "\u898b\u5f35\u308a\u306e\u4ea4\u4ee3\u3067\u306f\uff1f", "\u2026\u2026", "\u5982\u4f55\u306a\u3055\u3044\u307e\u3059\u304b", "\u2026\u2026\u5148\u3092\u6025\u3054\u3046", "\u6b62\u307e\u3063\u3066\u304f\u308c\uff01", "\u30ca\u30cf\u30c8\u69d8\u3001\u3069\u3046\u304b\u3055\u308c\u307e\u3057\u305f\u304b\uff1f", "\u2026\u2026", "\u610f\u898b\u3092\u5909\u3048\u3066\u3059\u307e\u306a\u3044\u304c\u3001\u3084\u306f\u308a\u623b\u3063\u3066\u6b32\u3057\u3044", "\u5148\u7a0b\u306e\u4e00\u56e3\u3092\u8ffd\u3044\u307e\u3059\u304b", "\u983c\u3080\u3002\u5acc\u306a\u4e88\u611f\u304c\u3059\u308b\u3093\u3060", "\u2026\u2026\u3063!?", "\u30aa\u30eb\u30bb\u30a4\u30f3\u6bbf\uff01", "\u2026\u2026\u4f55\u3092\u3057\u3066\u3044\u308b", "\u4f55\u3092\u3057\u3066\u3044\u308b\u306e\u304b\u3068\u3001\u805e\u3044\u3066\u3044\u308b\u3093\u3060\u3002\u2015\u2015\u30d5\u30a3\u30ea\u30c3\u30d7"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/125/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u596e\u95d8\u3002", "discourse": ["\u9177\u3044\u306a\u2026\u2026", "\u7269\u8cc7\u3082\u4eba\u624b\u3082\u3001\u4f55\u3082\u304b\u3082\u304c\u8db3\u308a\u306a\u3044\u3093\u3067\u3059", "\u53d6\u308a\u6562\u3048\u305a\u3001\u6c34\u3092\u6c72\u3093\u3067\u304d\u307e\u3059\u3002\u4e95\u6238\u306f\u4f55\u51e6\u3067\u3059\u304b\uff1f", "\u304a\u624b\u4f1d\u3044\u3057\u307e\u3059", "\u306d\u3048\u3001\u8cb4\u65b9\u3002\u898b\u305f\u3053\u3068\u306e\u306a\u3044\u4eba\u3060\u3051\u3069\u3001\u3082\u3057\u304b\u3057\u3066\u5916\u304b\u3089\u6765\u305f\u306e!?", "\u85ac\u306f\uff1f\u85ac\u306f\u6301\u3063\u3066\u304d\u3066\u304f\u308c\u305f\u306e\uff1f\u79c1\u306e\u53ef\u611b\u3044\u574a\u3084\u304c\u3001\u82e6\u3057\u3093\u3067\u3044\u308b\u306e\u3002\u304a\u9858\u3044\u3001\u52a9\u3051\u3066\uff01", "\u2026\u2026\u5206\u304b\u308a\u307e\u3057\u305f\u3002\u3059\u3050\u306b\u884c\u304d\u307e\u3059", "\u2026\u2026\u3063", "\u574a\u3084\u3001\u574a\u3084\u2026\u2026\uff01", "\u2026\u2026\uff1f", "\u6c34\u306f\u98f2\u3081\u305d\u3046\u304b\u3044\uff1f", "\u8131\u6c34\u75c7\u72b6\u306b\u306a\u3089\u306a\u3044\u3088\u3046\u3001\u3053\u307e\u3081\u306b\u6c34\u3092\u98f2\u307e\u305b\u3066\u304f\u3060\u3055\u3044\u3002\u6c34\u306f\u6e29\u3081\u3067\u3001\u5c11\u3057\u5869\u3092\u6df7\u305c\u3066\u3042\u3052\u308b\u3068\u3044\u3044\u3067\u3059\u3088\u3002\u307e\u305f\u5410\u304d\u305d\u3046\u306a\u3088\u3046\u3067\u3057\u305f\u3089\u3001\u6a2a\u5411\u304d\u306b\u3057\u3066\u80cc\u3092\u64e6\u3063\u3066\u3001\u5410\u3044\u305f\u3082\u306e\u304c\u5589\u306b\u8a70\u307e\u3089\u306a\u3044\u3088\u3046\u6c17\u3092\u3064\u3051\u3066\u304f\u3060\u3055\u3044", "\u3042\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3063\uff01", "\u3042\u306e\u3001\u85ac\u304c\u3042\u308b\u3068\u805e\u3044\u305f\u3093\u3067\u3059\u304c\uff01", "\u30aa\u30ec\u306b\u3082\u5206\u3051\u3066\u304f\u308c\uff01", "\u98df\u6599\u306f\u306a\u3044\u306e\u304b!?", "\u843d\u3061\u7740\u3044\u3066\u304f\u3060\u3055\u3044\uff01\u5b50\u4f9b\u304c\u5bdd\u3066\u3044\u308b\u3093\u3067\u3059", "\u304a\u75b2\u308c\u69d8\u3067\u3059", "\u3042\u308a\u304c\u3068\u3046", "\u30e8\u30cf\u30f3\u69d8\u306e\u304a\u9670\u3067\u3001\u7686\u3001\u5c11\u3057\u3060\u3051\u5143\u6c17\u3092\u53d6\u308a\u623b\u3057\u305f\u307f\u305f\u3044\u3067\u3059\u3002\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u2026\u2026\u305d\u308c\u3058\u3083\u99c4\u76ee\u306a\u3093\u3067\u3059\u3002\u6839\u672c\u7684\u306a\u89e3\u6c7a\u306b\u306f\u306a\u3063\u3066\u3044\u307e\u305b\u3093", "\u305d\u3082\u305d\u3082\u3001\u3053\u306e\u4e8b\u614b\u3092\u30cf\u30a4\u30f3\u30c4\u69d8\u306f\u3054\u5b58\u3058\u306a\u3093\u3067\u3059\u304b\uff1f", "\u2026\u2026\u2026\u2026", "\u30cf\u30a4\u30f3\u30c4\u69d8\u306f\u3001\u4f55\u3082\u77e5\u3089\u3055\u308c\u3066\u3044\u306a\u3044\u306f\u305a\u3067\u3059", "\u526f\u56e3\u9577\u3001\u8d77\u304d\u305f\u3093\u3067\u3059\u306d\u3002\u5589\u4e7e\u304d\u307e\u305b\u3093\u304b\uff1f", "\u3042\u308a\u304c\u3068\u3046", "\u30cf\u30a4\u30f3\u30c4\u69d8\u304c\u77e5\u3089\u306a\u3044\u3063\u3066\u3001\u3069\u3046\u3044\u3046\u4e8b\u3067\u3059\u304b\uff1f", "\u30cf\u30a4\u30f3\u30c4\u69d8\u306f\u4e00\u5e74\u307b\u3069\u524d\u306b\u5fc3\u81d3\u3092\u60aa\u304f\u3055\u308c\u3066\u3001\u75c5\u5e8a\u306b\u4f0f\u3057\u3066\u304a\u3089\u308c\u307e\u3059\u3002\u305d\u308c\u4ee5\u6765\u3001\u3054\u5b50\u606f\u3067\u3042\u308b\u30d5\u30a3\u30ea\u30c3\u30d7\u69d8\u304c\u4ee3\u7406\u3067\u30b0\u30ec\u30f3\u30c4\u30a7\u3092\u6cbb\u3081\u308b\u3088\u3046\u306b\u306a\u308a\u307e\u3057\u305f", "\u30d5\u30a3\u30ea\u30c3\u30d7\u69d8\u306f\u5fc5\u6b7b\u306b\u3001\u30cf\u30a4\u30f3\u30c4\u69d8\u306e\u4ee3\u308f\u308a\u3092\u52d9\u3081\u3088\u3046\u3068\u306a\u3055\u3063\u3066\u3044\u307e\u3057\u305f\u3002\u30b0\u30ec\u30f3\u30c4\u30a7\u3092\u3082\u308a\u305f\u3066\u3088\u3046\u3068\u5c3d\u529b\u3055\u308c\u3066\u3044\u305f\u3002\u79c1\u9054\u3082\u305d\u3093\u306a\u3042\u306e\u65b9\u3092\u652f\u3048\u3088\u3046\u3068\u3057\u305f\u306e\u3067\u3059\u304c\u3001\u9006\u306b\u9060\u3056\u3051\u3089\u308c\u3066\u3057\u307e\u3044\u307e\u3057\u305f\u3002\u5143\u3005\u3042\u306e\u65b9\u306f\u3001\u30cf\u30a4\u30f3\u30c4\u69d8\u306e\u304a\u508d\u306b\u3044\u305f\u6211\u3089\u3092\u3001\u758e\u3093\u3058\u3066\u3044\u305f\u306e\u3067\u3057\u3087\u3046", "\u79c1\u9054\u306a\u3069\u3044\u306a\u304f\u3066\u3082\u3001\u30d5\u30a3\u30ea\u30c3\u30d7\u69d8\u306f\u81ea\u8eab\u306e\u304a\u529b\u3067\u30b0\u30ec\u30f3\u30c4\u30a7\u3092\u7e41\u6804\u3055\u305b\u3066\u307f\u305b\u308b\u3068\u4ef0\u3063\u3066\u3044\u307e\u3057\u305f\u3002\u4e8b\u5b9f\u3001\u30b0\u30ec\u30f3\u30c4\u30a7\u306f\u8cbf\u6613\u306e\u8981\u3068\u3057\u3066\u3001\u767a\u5c55\u3057\u59cb\u3081\u305f\u3002\u3057\u304b\u3057\u305d\u306e\u77e2\u5148\u306b\u3001\u75c5\u304c\u6d41\u884c\u308a\u3060\u3057\u305f\u306e\u3067\u3059", "\u305d\u308c\u3067\u96a0\u853d\u3057\u3088\u3046\u3068\u3057\u305f\u3001\u3068", "\u306a\u306b\u3082\u6700\u521d\u304b\u3089\u3001\u75c5\u4eba\u3092\u96a0\u853d\u3057\u3088\u3046\u3068\u3057\u305f\u8a33\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u305f\u3060\u306e\u71b1\u75c5\u3060\u3068\u601d\u308f\u308c\u3066\u3044\u307e\u3057\u305f\u304b\u3089\u3001\u85ac\u3092\u624b\u914d\u3057\u3001\u4f4f\u6c11\u306b\u6ce8\u610f\u3092\u559a\u8d77\u3057\u307e\u3057\u305f\u3002\u3067\u3059\u304c\u3001\u75c5\u306f\u53ce\u307e\u308b\u3069\u3053\u308d\u304b\u3001\u5e83\u304c\u3063\u3066\u3044\u3063\u305f", "\u2026\u2026\u306a\u308b\u307b\u3069", "\u60f3\u50cf\u4ee5\u4e0a\u306b\u3001\u72b6\u6cc1\u304c\u60aa\u3044\u3053\u3068\u304c\u7406\u89e3\u51fa\u6765\u307e\u3057\u305f", "\u6700\u60aa\u3060"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/124/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u6c7a\u65ad\u3002(2)", "discourse": ["\u30ca\u30cf\u30c8\u69d8\u2026\u2026", "\u3048!?\u304a\u3001\u738b\u5b50\u6bbf\u4e0b\u2026\u2026!?", "\u3069\u3046\u3057\u3066", "\u305d\u308c\u306f\u304a\u524d\u9054\u304c\u826f\u304f\u77e5\u3063\u3066\u3044\u308b\u3093\u3058\u3083\u306a\u3044\u304b\uff1f", "\u3063\u2026\u2026\u305d\u308c\u306f\u2026\u2026", "\u307e\u3041\u3001\u3044\u3044\u3002\u8a71\u306f\u5f8c\u3067\u3086\u3063\u304f\u308a\u805e\u304f\u3002\u305d\u308c\u3088\u308a\u3082\u4e2d\u3078\u5165\u308c\u3066\u304f\u308c", "\u99c4\u76ee\u3067\u3059\u3063!!\u2026\u2026\u3063", "\u526f\u56e3\u9577\u2026\u2026\u8cb4\u65b9\u3082\u3067\u3059\u304b", "\u3042\u3042\u3002\u898b\u3066\u306e\u901a\u308a\u3001\u3053\u306e\u30b6\u30de\u3060", "\u30ca\u30cf\u30c8\u69d8\u3001\u6751\u306e\u4e2d\u306f\u75c5\u4eba\u3067\u6ea2\u308c\u304b\u3048\u3063\u3066\u3044\u307e\u3059\u3002\u3069\u3046\u304b\u6751\u306b\u306f\u5165\u3089\u305a\u3001\u3053\u306e\u307e\u307e\u304a\u623b\u308a\u304f\u3060\u3055\u3044", "\u2026\u2026\u79c1\u304c\u3053\u3053\u306b\u3044\u308b\u7406\u7531\u306f\u3001\u5206\u304b\u3063\u3066\u3044\u308b\u3060\u308d\u3046\u3002\u305d\u308c\u306a\u306e\u306b\u3001\u5f15\u304d\u8fd4\u305b\u3068\uff1f", "\u75c5\u3092\u767a\u75c7\u3057\u305f\u8857\u306e\u4eba\u9593\u3092\u3001\u6751\u306b\u76e3\u7981\u3057\u3066\u3044\u305f\u4e8b\u306b\u3064\u3044\u3066\u8a00\u3044\u9003\u308c\u3059\u308b\u3064\u3082\u308a\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u3069\u306e\u3088\u3046\u306a\u7f70\u3082\u53d7\u3051\u307e\u3059", "\u30de\u30eb\u30af\u30b9", "\u8a3c\u4eba\u304c\u5fc5\u8981\u3067\u3057\u305f\u3089\u3001\u30d4\u30fc\u30bf\u30fc\u3092\u304a\u9023\u308c\u304f\u3060\u3055\u3044\u3002\u5f7c\u306f\u82e5\u304f\u4f53\u529b\u3082\u3042\u308b\u306e\u3067\u3001\u79c1\u9054\u3088\u308a\u75c5\u306b\u7f79\u308a\u96e3\u3044\u306f\u305a\u3067\u3059", "\u30de\u30eb\u30af\u30b9\uff01", "\u75c5\u4eba\u3092\u898b\u6368\u3066\u308d\u3068\u8a00\u3046\u306e\u304b", "\u2026\u2026\u305d\u3046\u53d6\u3063\u3066\u9802\u3044\u3066\u69cb\u3044\u307e\u305b\u3093\u3002\u8cb4\u65b9\u69d8\u306f\u3053\u3093\u306a\u5834\u6240\u306b\u3044\u3066\u3044\u3044\u65b9\u3067\u306f\u306a\u3044", "\u3053\u3053\u306f\u79c1\u306e\u6bcd\u56fd\u3060\u3002\u8857\u4e2d\u3060\u308d\u3046\u3068\u68ee\u306e\u4e2d\u3060\u308d\u3046\u3068\u3001\u56fd\u5883\u3092\u8d85\u3048\u306a\u3044\u9650\u308a\u306f\u79c1\u304c\u3044\u3066\u306f\u3044\u3051\u306a\u3044\u5834\u6240\u306a\u3069\u5b58\u5728\u3057\u306a\u3044", "\u30ca\u30cf\u30c8", "\u541b\u307e\u3067\u90aa\u9b54\u3092\u3059\u308b\u3064\u3082\u308a\u304b", "\u843d\u3061\u7740\u3044\u3066\u3001\u50d5\u306e\u8a71\u3092\u805e\u3044\u3066\u304f\u3060\u3055\u3044", "\u79c1\u306f\u2026\u2026\u3063", "\u2026\u2026\u306a\u3093\u3060", "\u73fe\u72b6\u3092\u6574\u7406\u3057\u307e\u3057\u3087\u3046\u3002\u30de\u30eb\u30af\u30b9\u3055\u3093\u306e\u304a\u8a71\u3092\u4fe1\u3058\u308b\u306a\u3089\u3070\u3001\u6751\u306e\u4e2d\u306b\u306f\u591a\u304f\u306e\u75c5\u4eba\u304c\u3044\u307e\u3059\u3002\u305d\u3057\u3066\u3001\u30de\u30eb\u30af\u30b9\u3055\u3093\u306e\u3088\u3046\u306b\u3001\u521d\u3081\u306f\u5065\u5eb7\u3060\u3063\u305f\u306f\u305a\u306e\u4eba\u9054\u306b\u3082\u79fb\u308a\u3001\u75c5\u4eba\u306e\u6570\u306f\u65e5\u3092\u8ffd\u3046\u6bce\u306b\u5897\u3048\u3066\u3044\u308b", "\u3053\u3053\u306b\u3044\u3066\u3082\u5b89\u5168\u3068\u306f\u8a00\u3044\u96e3\u3044\u3067\u3059\u304c\u3001\u6751\u306e\u4e2d\u306b\u5165\u308c\u3070\u66f4\u306b\u5371\u967a\u6027\u306f\u5897\u3057\u307e\u3059\u3002\u50d5\u9054\u3082\u3001\u75c5\u306b\u7f79\u308b\u304b\u3082\u3057\u308c\u307e\u305b\u3093", "\u3060\u304b\u3089\u306a\u3093\u3060\u3002\u68ee\u3092\u76ee\u6307\u3059\u3068\u6c7a\u3081\u305f\u6642\u306b\u3001\u899a\u609f\u306f\u3057\u3066\u3044\u305f", "\u75c5\u4eba\u304c\u5897\u3048\u7d9a\u3051\u3066\u3044\u308b\u3068\u3044\u3046\u4e8b\u306f\u3001\u85ac\u304c\u52b9\u3044\u3066\u3044\u306a\u3044\u3068\u3044\u3046\u4e8b\u3067\u3059\u3002\u304a\u305d\u3089\u304f\u3001\u50d5\u9054\u306e\u624b\u6301\u3061\u306e\u85ac\u3067\u3082\u671b\u307f\u306f\u8584\u3044", "\u30ca\u30cf\u30c8\u3002\u770b\u75c5\u306e\u7d4c\u9a13\u3082\u306a\u3044\u8cb4\u65b9\u304c\u6751\u306b\u5165\u3063\u3066\u3082\u3001\u7121\u99c4\u306b\u9ad8\u8cb4\u306a\u75c5\u4eba\u3092\u5897\u3084\u3059\u3060\u3051\u306e\u7d50\u679c\u306b\u306a\u308a\u307e\u3059", "\u2026\u2026\u8a00\u3063\u3066\u304f\u308c\u308b\u306a", "\u4e8b\u5b9f\u3067\u3059\u3002\u3053\u3053\u3067\u8cb4\u65b9\u304c\u51fa\u6765\u308b\u3053\u3068\u306f\u3001\u306a\u3044\u306b\u7b49\u3057\u3044", "\u306a\u3089\u2026\u2026\u306a\u3089\u3070\uff01\u3069\u3046\u3059\u308c\u3070\u3044\u3044!?\u3069\u3046\u3059\u308c\u3070\u3001\u6c11\u3092\u6551\u3048\u308b\u3068\u8a00\u3046\u3093\u3060!!", "\u30ca\u30cf\u30c8\u306f\u3053\u306e\u307e\u307e\u5f15\u304d\u8fd4\u3057\u3066\u304f\u3060\u3055\u3044\u3002\u305f\u3060\u306e\u5c11\u5e74\u3067\u3042\u308b\u30ca\u30cf\u30c8\u306b\u306f\u51fa\u6765\u308b\u4e8b\u306f\u306a\u304f\u3068\u3082\u3001\u738b\u5b50\u3067\u3042\u308b\u8cb4\u65b9\u306b\u306f\u51fa\u6765\u308b\u4e8b\u304c\u3042\u308b\u3067\u3057\u3087\u3046", "\u5927\u5c40\u3092\u898b\u308d\u3068\u8a00\u3044\u305f\u3044\u306e\u304b\u3002\u5927\u52e2\u306e\u4eba\u9593\u3092\u6551\u3046\u305f\u3081\u306b\u3001\u4eca\u3001\u76ee\u306e\u524d\u306b\u3042\u308b\u547d\u3092\u898b\u6bba\u3057\u306b\u3057\u308d\u3068", "\u8cb4\u65b9\u304c\u52d5\u304b\u306a\u3051\u308c\u3070\u3001\u3053\u306e\u6751\u306e\u4eba\u9593\u306f\u3044\u305a\u308c\u5207\u308a\u6368\u3066\u3089\u308c\u308b\u3002\u3069\u3046\u3059\u308b\u306e\u304c\u6b63\u89e3\u304b\u3001\u8ce2\u660e\u306a\u8cb4\u65b9\u306a\u3089\u5206\u304b\u308b\u306f\u305a\u3060", "\u2026\u2026", "\u738b\u90fd\u306b\u623b\u3063\u3066\u3001\u85ac\u3068\u85ac\u5e2b\u3092\u63bb\u304d\u96c6\u3081\u3066\u304d\u3066\u304f\u3060\u3055\u3044\u3002\u8db3\u308a\u306a\u3044\u306e\u306a\u3089\u3001\u30cd\u30fc\u30d9\u30eb\u306b\u6551\u63f4\u8981\u8acb\u3092\u51fa\u3059\u306e\u3082\u826f\u3044\u3002\u78ba\u5b9f\u306b\u3001\u6c11\u3092\u52a9\u3051\u308b\u65b9\u6cd5\u3092\u63a2\u3057\u51fa\u3059\u306e\u3067\u3059", "\u305d\u306e\u9593\u306b\u3001\u3069\u308c\u3060\u3051\u306e\u4eba\u9593\u304c\u6b7b\u306c\u3002\u3069\u308c\u3060\u3051\u306e\u547d\u304c\u3001\u79c1\u306e\u624b\u304b\u3089\u96f6\u308c\u843d\u3061\u308b\u3093\u3060\u2026\u2026!?", "\u50d5\u304c\u3001\u98df\u3044\u6b62\u3081\u307e\u3059", "\u2026\u2026\u306f\uff1f", "\u5e78\u3044\u50d5\u306f\u85ac\u5b66\u306e\u52c9\u5f37\u3082\u3057\u3066\u3044\u307e\u3059\u3002\u5404\u5730\u3092\u56de\u3063\u3066\u3044\u308b\u6642\u306b\u6559\u3048\u3066\u3082\u3089\u3063\u305f\u306e\u3067\u3001\u5fdc\u6025\u51e6\u7f6e\u306e\u77e5\u8b58\u3082\u3042\u308b\u3002\u3053\u3053\u306b\u6b8b\u3063\u3066\u8cb4\u65b9\u306e\u4ee3\u308f\u308a\u306b\u3001\u4e00\u3064\u3067\u3082\u591a\u304f\u306e\u547d\u3092\u7e4b\u3044\u3067\u307f\u305b\u307e\u3059", "\u99ac\u9e7f\u3092\u8a00\u3046\u306a\uff01\u541b\u306f\u81ea\u5206\u306e\u7acb\u5834\u3092\u5fd8\u308c\u305f\u306e\u304b!?\u540c\u76df\u56fd\u306e\u738b\u5b50\u304c\u7559\u5b66\u4e2d\u306b\u6d41\u884c\u308a\u75c5\u306b\u7f79\u308b\u306a\u3069\u3001\u5197\u8ac7\u3067\u306f\u6e08\u307e\u306a\u3044\u305e", "\u653e\u8569\u606f\u5b50\u304c\u75c5\u306b\u7f79\u308d\u3046\u304c\u6b7b\u306e\u3046\u304c\u3001\u3046\u3061\u306e\u7236\u306f\u6c17\u306b\u3082\u3057\u307e\u305b\u3093\u3088", "\u50d5\u304c\u3053\u3053\u3067\u75c5\u306b\u7f79\u3063\u3066\u3082\u3001\u81ea\u696d\u81ea\u5f97\u3002\u50d5\u306e\u884c\u52d5\u306e\u7d50\u679c\u3067\u3042\u3063\u3066\u3001\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306b\u8cac\u4efb\u306f\u3042\u308a\u307e\u305b\u3093", "\u99c4\u76ee\u3060\uff01\u305d\u308c\u306a\u3089\u79c1\u304c\u2026\u2026", "\u30ca\u30cf\u30c8\u3002\u5802\u3005\u5de1\u308a\u306e\u554f\u7b54\u3092\u7d9a\u3051\u308b\u3064\u3082\u308a\u3067\u3059\u304b", "\u50d5\u304c\u6b8b\u3063\u3066\u3001\u8cb4\u65b9\u304c\u623b\u308b\u3002\u3053\u308c\u304c\u6700\u5584\u3067\u3059", "\u2026\u2026\u3063\u3001", "\u6b7b\u306c\u304b\u3082\u3057\u308c\u306a\u3044\u3093\u3060\u305e", "\u305d\u3046\u306a\u3089\u306a\u3044\u3088\u3046\u306b\u3001\u4e00\u523b\u3082\u65e9\u304f\u623b\u3063\u3066\u304d\u3066\u304f\u3060\u3055\u3044\u306d", "\u2026\u2026\u541b\u306f\u99ac\u9e7f\u3060", "\u30ec\u30aa\u30f3\u30cf\u30eb\u30c8", "\u306f\u3044", "\u30ca\u30cf\u30c8\u306b\u540c\u884c\u3057\u3066\u304f\u308c", "\u50d5\u306e\u4ee3\u308f\u308a\u306b\u53cb\u3092\u5b88\u3063\u3066\u6b32\u3057\u3044"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/123/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u6c7a\u65ad\u3002", "discourse": ["\u8ab0\u3060", "\u30de\u30eb\u30af\u30b9\u3055\u3093\u3001\u7121\u7406\u306b\u52d5\u304b\u306a\u3044\u65b9\u304c\u3044\u3044\u3067\u3059", "\u306a\u3093\u3067\u30aa\u30ec\u306e\u540d\u524d\u3092\u2026\u2026\u2026\u2026\u3001\u2026\u2026\u3063!?", "\u2026\u2026\u307e\u3055\u304b\u3001\u30e8\u30cf\u30f3\u69d8\uff1f", "\u306f\u3044\u3001\u304a\u4e45\u3057\u3076\u308a\u3067\u3059", "\u306a\u3093\u3001\u2026\u2026\u3063\u3001\u3050\u30c3", "\u3063\u3001\u3044\u3044\u2026\u2026\u3001\u89e6\u308b\u306a\u3002\u75c5\u304c\u79fb\u308b\u305e", "\u6c17\u306b\u3059\u308b\u306a", "\u3053\u306e\u7a0b\u5ea6\u306e\u63a5\u89e6\u3067\u79fb\u308b\u306e\u306a\u3089\u3001\u3069\u3046\u305b\u3082\u3046\u624b\u9045\u308c\u3060\u3002\u305d\u308c\u3088\u308a\u3082\u3001\u6c34\u3092\u98f2\u3081\u308b\u304b\uff1f", "\u3042\u3041\u3001\u3059\u307e\u306a\u3044\u2026\u2026", "\u52a9\u304b\u3063\u305f", "\u8cb4\u6bbf\u306f\u3001\u8fba\u5883\u9a0e\u58eb\u56e3\u306b\u5c5e\u3059\u308b\u9a0e\u58eb\u304b\uff1f", "\uff01\u2026\u2026\u307e\u3055\u304b\u3001\u8cb4\u65b9\u69d8\u307e\u3067", "\u304a\u898b\u82e6\u3057\u3044\u59ff\u3067\u3001\u7533\u3057\u8a33\u3054\u3056\u3044\u307e\u305b\u3093\u3002\u79c1\u306f\u897f\u65b9\u8fba\u5883\u9a0e\u58eb\u56e3\u526f\u56e3\u9577\u3001\u30de\u30eb\u30af\u30b9\u30fb\u30b2\u30eb\u30c8\u30ca\u30fc\u3068\u7533\u3057\u307e\u3059", "\u30de\u30eb\u30af\u30b9\u3002\u541b\u306f\u75c5\u304c\u79fb\u308b\u3068\u8a00\u3063\u305f\u306a\uff1f\u3064\u307e\u308a\u3001\u3053\u306e\u6751\u3067\u75c5\u304c\u6d41\u884c\u3063\u3066\u3044\u308b\u3068\u3044\u3046\u3053\u3068\u3067\u9593\u9055\u3044\u306a\u3044\u304b", "\u5fa1\u610f\u306b\u3054\u3056\u3044\u307e\u3059", "\u30b0\u30ec\u30f3\u30c4\u30a7\u3067\u6d41\u884c\u3063\u3066\u3044\u305f\u71b1\u75c5\u304c\u7d42\u606f\u3057\u305f\u306e\u3067\u306f\u306a\u304f\u3001\u3053\u306e\u6751\u306b\u2026\u2026", "\u526f\u56e3\u9577\u304c\u3044\u306a\u3044\u305e!?", "\u30de\u30eb\u30af\u30b9\u30fc\uff01\u3069\u3053\u3060\u30fc!?", "\u3053\u3053\u3060", "\u4f55\u8005\u3060", "\u6b62\u3081\u308d", "\u30de\u30eb\u30af\u30b9\u306b\u4f55\u3092\u3057\u305f", "\u4f55\u3082\u3057\u3066\u306a\u3044\u3002\u5c11\u3057\u843d\u3061\u7740\u3051", "\u4f55\u3082\u3057\u306a\u3044\u3067\u526f\u56e3\u9577\u304c\u305d\u3093\u306a\u98a8\u306b\u306a\u308b\u8a33\u306a\u3044\u3060\u308d!?", "\u30da\u30fc\u30bf\u30fc!!", "\u2026\u2026\u3069\u3063\u304b\u3067\u898b\u305f\u4e8b\u304c\u3042\u308b\u9854\u3060\u3068\u601d\u3063\u305f\u304c", "\u307e\u3055\u304b\u3053\u3093\u306a\u50fb\u5730\u3067\u3001\u9ed2\u7345\u5b50\u306b\u4f1a\u3048\u308b\u3068\u306f\u306a\u3041", "\u6b62\u3081\u3066\u304f\u308c", "\u9ed2\u7345\u5b50\u2026\u2026\u3063\u3066\u3001\u30cd\u30fc\u30d9\u30eb\u306e\u82f1\u96c4\u306e!?", "\u306a\u3093\u3067\u3001\u2026\u2026\u306a\u3093\u3067\u3053\u3093\u306a\u6240\u306b\u3001\u9ed2\u7345\u5b50\u5c06\u8ecd\u304c\u2026\u2026\uff1f", "\u79c1\u9054\u306e\u8b77\u885b\u3060"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/122/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u518d\u4f1a\u3002(3)", "discourse": ["\u30af\u30e9\u30a6\u30b9\u2026\u2026\uff1f", "\u3063\uff01", "\u3042\u3063", "\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3063", "\u5f85\u3061\u306a\u3055\u3044\u3001\u30af\u30e9\u30a6\u30b9\uff01", "\uff01", "\u30af\u30e9\u30a6\u30b9", "\u3063\u3001\u3082\u3046\u3057\u308f\u3051\u3001\u3042\u308a\u307e\u305b\u3093\u2026\u2026\u3063", "\u2026\u2026\u305d\u308c\u306f\u3001\u4f55\u306b\u5bfe\u3057\u3066\uff1f", "\u2026\u2026\u8cb4\u65b9\u69d8\u3092\u3001\u4f55\u5ea6\u3082\u5371\u967a\u306b\u6652\u3057\u307e\u3057\u305f\u3002\u7121\u69d8\u306b\u3082\u602a\u6211\u3092\u8ca0\u3044\u3001\u8ff7\u60d1\u3092\u304a\u304b\u3051\u3057\u307e\u3057\u305f\u3002\u508d\u306b\u3044\u306a\u304c\u3089\u652b\u308f\u308c\u305f\u4e8b\u306b\u3082\u6c17\u4ed8\u3051\u305a\u3001\u8ffd\u3046\u3053\u3068\u3082\u51fa\u6765\u306a\u304b\u3063\u305f\u3002\u79c1\u306f\u2026\u2026\u8b77\u885b\u5931\u683c\u3067\u3059", "\u8cb4\u65b9\u69d8\u306b\u3001\u5408\u308f\u305b\u308b\u9854\u304c\u3042\u308a\u307e\u305b\u3093", "\u30af\u30e9\u30a6\u30b9\u2026\u2026\u3063\u3001\u2026\u2026", "\u2026\u2026\u2026\u2026\u30af\u30e9\u30a6\u30b9", "\u2026\u2026\u306f\u3044", "\u79c1\u3001\u63a2\u3057\u3066\u3044\u305f\u85ac\u5e2b\u306e\u4e00\u65cf\u306b\u4f1a\u3048\u305f\u308f", "\uff1f\u2026\u2026\u306f\u3044", "\u4ea4\u6e09\u306e\u7d50\u679c\u3001\u85ac\u3092\u63d0\u4f9b\u3059\u308b\u3060\u3051\u3067\u306f\u306a\u304f\u3001\u6cbb\u7642\u306b\u3082\u624b\u3092\u8cb8\u3057\u3066\u8cb0\u3048\u308b\u3053\u3068\u306b\u306a\u3063\u305f\u306e", "\u6700\u9ad8\u306e\u6210\u679c\u3092\u6301\u3061\u5e30\u3089\u308c\u305f\u306e\u3067\u3059\u306d", "\u534a\u5206\u306f\u3001\u8cb4\u65b9\u306e\u6210\u679c\u3088", "\u2026\u2026\u2026\u2026\u3048\uff1f", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093\u304c\u30af\u30fc\u30a2\u65cf\u306e\u4e00\u54e1\u3060\u3063\u305f\u306e\u3002\u8cb4\u65b9\u304c\u602a\u6211\u3092\u3057\u305f\u304b\u3089\u3001\u30f4\u30a9\u30eb\u30d5\u3055\u3093\u306f\u85ac\u5e2b\u3060\u3063\u3066\u540d\u4e57\u308a\u51fa\u305f\u3002\u305d\u3057\u3066\u90e8\u4e0b\u3067\u3042\u308b\u8cb4\u65b9\u3092\u6551\u304a\u3046\u3068\u3057\u305f\u79c1\u306b\u3001\u8208\u5473\u3092\u6301\u3063\u3066\u304f\u308c\u305f", "\u2026\u2026", "\u652b\u308f\u308c\u305f\u79c1\u3092\u9023\u308c\u623b\u3057\u3066\u3044\u305f\u3089\u3001\u304d\u3063\u3068\u30af\u30fc\u30a2\u65cf\u306e\u7686\u306b\u5354\u529b\u3057\u3066\u3082\u3089\u3046\u4e8b\u306f\u51fa\u6765\u306a\u304b\u3063\u305f\u3002\u85ac\u3092\u8b72\u3063\u3066\u3082\u3089\u3046\u4e8b\u3059\u3089\u3001\u51fa\u6765\u306a\u304b\u3063\u305f\u304b\u3082\u3057\u308c\u306a\u3044", "\u2026\u2026\u305d\u308c\u306f", "\u306a\u306b\u3088\u308a\u3001\u8cb4\u65b9\u304c\u547d\u304c\u3051\u3067\u5b88\u3063\u3066\u304f\u308c\u305f\u304b\u3089\u3001\u79c1\u306f\u3053\u3053\u306b\u3044\u308b", "\uff01", "\u8cb4\u65b9\u304c\u79c1\u3092\u5b88\u3063\u3066\u304f\u308c\u305f\u304b\u3089\u3001\u85ac\u304c\u624b\u306b\u5165\u308b\u3002\u85ac\u5e2b\u306e\u5354\u529b\u3082\u5f97\u3089\u308c\u308b\u3002\u75c5\u306b\u82e6\u3057\u3080\u4eba\u9054\u3092\u304d\u3063\u3068\u6551\u3048\u308b\u3002\u5168\u90e8\u3001\u8cb4\u65b9\u304c\u52a9\u3051\u3066\u304f\u308c\u306a\u304b\u3063\u305f\u3089\u3001\u51fa\u6765\u306a\u304b\u3063\u305f\u3053\u3068\u3088", "\u30af\u30e9\u30a6\u30b9\u3001\u5927\u4e08\u592b\uff1f", "\u2026\u2026\u30aa\u30ec\u306f\u3001", "\u30aa\u30ec\u306f\u3001\u8cb4\u65b9\u306e\u304a\u5f79\u306b\u7acb\u3066\u3066\u3044\u308b\u306e\u3067\u3057\u3087\u3046\u304b\u2026\u2026\uff1f", "\u6ca2\u5c71\u3001\u52a9\u3051\u3066\u3082\u3089\u3063\u3066\u3044\u308b\u308f", "\u3042\u308a\u304c\u3068\u3046\u3001\u30af\u30e9\u30a6\u30b9", "\u2026\u2026\u3063", "\u30af\u30e9\u30a6\u30b9\u3002\u79c1\u306f\u3053\u308c\u304b\u3089\u3001\u30f4\u30a3\u30f3\u30c8\u306b\u5411\u304b\u3046\u308f", "\u2026\u2026\u9023\u308c\u3066\u3044\u3063\u3066\u306f\u9802\u3051\u306a\u3044\u306e\u3067\u3059\u306d", "\u4e07\u5168\u3067\u306a\u3044\u8cb4\u65b9\u306f\u3001\u9023\u308c\u3066\u884c\u3051\u306a\u3044\u3002\u3069\u3046\u304b\u602a\u6211\u3092\u6cbb\u3059\u4e8b\u306b\u5c02\u5ff5\u3057\u3066", "\u2026\u2026\u3069\u3046\u304b\u3001\u7121\u7406\u306f\u306a\u3055\u3089\u306a\u3044\u3067\u304f\u3060\u3055\u3044", "\u672c\u56fd\u3067\u3001\u8cb4\u65b9\u69d8\u306e\u5e30\u308a\u3092\u304a\u5f85\u3061\u3057\u3066\u304a\u308a\u307e\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/121/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u518d\u4f1a\u3002(2)", "discourse": ["\u306d\u3047\u3001\u30de\u30ea\u30fc\u3061\u3083\u3093", "\u30de\u30ea\u30fc\u3061\u3083\u3093\u3082\u3001\u4e00\u7dd2\u306b\u884c\u304f\u6c17\u306a\u306e\u3088\u306d\uff1f", "\u2026\u2026\u2026\u2026\u305d\u3046", "\u8cb4\u65b9\u306a\u3089\u3001\u305d\u3046\u8a00\u3046\u3093\u3058\u3083\u306a\u3044\u304b\u3063\u3066\u6c17\u306f\u3057\u3066\u3044\u305f\u308f", "\u79c1\u306f\u304d\u3063\u3068\u8db3\u624b\u307e\u3068\u3044\u306b\u306a\u3063\u3066\u3057\u307e\u3046\u304b\u3089\u3001\u4e00\u7dd2\u306b\u306f\u3044\u3051\u306a\u3044", "\u306f\u3044", "\u3067\u3082\u3001\u3069\u3046\u304b\u7121\u7406\u306f\u3057\u306a\u3044\u3067\u3002\u4e00\u4eba\u3067\u9811\u5f35\u3063\u3066\u3057\u307e\u3046\u524d\u306b\u5468\u308a\u3092\u983c\u3063\u3066\u306d\uff1f", "\u306f\u3044", "\u30df\u30cf\u30a4\u30eb\u306f\u8cb4\u65b9\u306b\u3064\u3044\u3066\u884c\u304f\u304b\u3089\u3001\u9060\u616e\u306a\u304f\u3053\u304d\u4f7f\u3063\u3066\u3042\u3052\u3066", "\u3088\u3001\u3088\u308d\u3057\u304f\u304a\u9858\u3044\u3057\u307e\u3059\uff01", "\u3048\u3063", "\u305f\u3076\u3093\u3001\u3044\u3048\u3001\u7d76\u5bfe\u3001\u5f79\u306b\u7acb\u3063\u3066\u307f\u305b\u307e\u3059\u306e\u3067\uff01", "\u3044\u3048\u3001\u305d\u308c\u306f\u77e5\u3063\u3066\u3044\u308b\u3051\u308c\u3069\u3001\u305d\u3046\u3058\u3083\u306a\u304f\u3066\u2026\u2026\u3044\u3044\u306e\uff1f", "\u3082\u3061\u308d\u3093", "\u4eba\u306e\u547d\u3092\u6551\u3046\u304a\u624b\u4f1d\u3044\u304c\u51fa\u6765\u308b\u306a\u3089\u3001\u3053\u3093\u306a\u306b\u5b09\u3057\u3044\u3053\u3068\u306f\u3042\u308a\u307e\u305b\u3093", "\u3053\u3061\u3089\u3053\u305d\u3001\u3088\u308d\u3057\u304f\u304a\u9858\u3044\u3057\u307e\u3059\u2026\u2026\u3063\uff01", "\u30de\u30ea\u30fc\uff01\u7528\u610f\u304c\u51fa\u6765\u305f\u3089\u3001\u5148\u306b\u99ac\u8eca\u306b\u4e57\u3063\u3066\u3044\u3066\u9802\u6234", "\u3058\u3083\u3042\u3001\u30d3\u30a2\u30f3\u30ab\u3055\u3093\u3002\u614c\u305f\u3060\u3057\u304f\u3066\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u305d\u308d\u305d\u308d\u884c\u304d\u307e\u3059\u306d", "\u5206\u304b\u3063\u305f\u308f\u3002\u5148\u306b\u30cd\u30fc\u30d9\u30eb\u306b\u623b\u3063\u3066\u3001\u8cb4\u65b9\u9054\u306e\u5e30\u308a\u3092\u5f85\u3063\u3066\u3044\u308b\u304b\u3089", "\u306f\u3044\u2026\u2026\u3042\u3001\u3042\u306e\u3002\u51fa\u6765\u308c\u3070\u3001\u304a\u9858\u3044\u304c\u3042\u308b\u3093\u3067\u3059\u304c", "\u306a\u306b\u304b\u3057\u3089\uff1f\u79c1\u306b\u51fa\u6765\u308b\u3053\u3068\u306a\u3089\u3001\u4f55\u3067\u3082\u3059\u308b\u3051\u308c\u3069", "\u30cd\u30fc\u30d9\u30eb\u306b\u5e30\u308b\u307e\u3067\u3001\u30af\u30e9\u30a6\u30b9\u306e\u4e8b\u3092\u304a\u9858\u3044\u3057\u3066\u3082\u3044\u3044\u3067\u3057\u3087\u3046\u304b\uff1f", "\u304a\u305d\u3089\u304f\u30b2\u30aa\u30eb\u30af\u69d8\u304c\u3001\u5e30\u56fd\u306e\u624b\u914d\u307e\u3067\u3057\u3066\u304f\u3060\u3055\u3063\u3066\u3044\u308b\u3068\u601d\u3046\u3093\u3067\u3059\u304c\u2026\u2026\u602a\u6211\u304c\u9177\u304b\u3063\u305f\u306e\u3067\u3001\u5c11\u3057\u4e0d\u5b89\u3067\u3002\u51fa\u6765\u308c\u3070\u3001\u3064\u3044\u3066\u3044\u3066\u3042\u3052\u3066\u6b32\u3057\u3044\u3093\u3067\u3059", "\u9593\u9055\u3063\u3066\u3082\u3001\u79c1\u3092\u8ffd\u3063\u3066\u6765\u306a\u3044\u3088\u3046\u306b\u3001\u898b\u5f35\u3063\u3066\u6b32\u3057\u3044\u3093\u3067\u3059\u3002\u51fa\u6765\u308c\u3070\u3001\u4e00\u58f0\u304b\u3051\u3066\u304b\u3089\u884c\u304d\u305f\u3044\u3093\u3067\u3059\u3051\u3069\u2026\u2026\u6642\u9593\u3082\u306a\u3044\u3067\u3059\u3057\u3001\u4f11\u3093\u3067\u3044\u308b\u30af\u30e9\u30a6\u30b9\u3092\u8d77\u3053\u3059\u306e\u3082\u53ef\u54c0\u60f3\u3067\u3059\u3057\u306d", "\u2026\u2026\u3042\u306e\u3001\u30de\u30ea\u30fc\u3061\u3083\u3093\uff1f", "\u3082\u3061\u308d\u3093\u3001\u8a00\u308f\u308c\u305a\u3068\u3082\u5f7c\u3092\u672c\u56fd\u307e\u3067\u5f15\u304d\u647a\u3063\u3066\u5e30\u308b\u3064\u3082\u308a\u306a\u3093\u3060\u3051\u308c\u3069\u2026\u2026\u305d\u306e\u3001\u306d\uff1f", "\u2026\u2026\u3093\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/120/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u518d\u4f1a\u3002", "discourse": ["\u3072\u3043\u3044\u3044\u3044\u3044\u3063", "\u982d\u306e\u4e0a\u3067\u53eb\u3070\u3093\u3067\u304f\u3060\u3055\u3044\u3088", "\u5c11\u3057\u3067\u3082\u65e9\u304f\u9e93\u306b\u305f\u3069\u308a\u7740\u304d\u305f\u3044\u3067\u3057\u3087\uff1f\u591a\u5c11\u63fa\u308c\u308b\u306e\u306f\u6211\u6162\u3057\u3066\u304f\u3060\u3055\u3044\u3088\u3063\u3068", "\u3057\u3001\u3057\u306c\u3046\u3046\u3046\uff01", "\u6b7b\u306a\u306a\u3044\u3001\u6b7b\u306a\u306a\u3044\u3002\u30a2\u30f3\u30bf\u610f\u5916\u3068\u4e08\u592b\u3060\u304b\u3089\u3001\u3061\u3087\u3063\u3068\u843d\u3068\u3057\u305f\u304f\u3089\u3044\u3058\u3083\u3001\u306a\u3093\u3068\u3082\u7121\u3044\u3067\u3057\u3087", "\u820c\u565b\u3093\u3058\u3083\u30de\u30ba\u3044\u304b\u3089\u53eb\u3093\u3067\u306a\u3044\u3067\u3001\u3061\u3083\u3093\u3068\u53e3\u9589\u3058\u3066\u3066\u304f\u3060\u3055\u3044", "\u305d\u308c\u3068\u3082\u3001\u901f\u5ea6\u3092\u7de9\u3081\u307e\u3059\uff1f\u3082\u3057\u304f\u306f\u3001\u3086\u3063\u304f\u308a\u3068\u81ea\u5206\u306e\u8db3\u3067\u4e0b\u5c71\u3057\u307e\u3059\u304b\uff1f", "\u305d\u306e\u3001\u307e\u307e\u3067\u3002\u53ef\u80fd\u306a\u9650\u308a\u306e\u901f\u3055\u3067\u3001\u304a\u3001\u9858\u3044\u3057\u307e\u3059\u3063", "\u4e86\u89e3", "\u30de\u30ea\u30fc\u3061\u3083\u3093\u3063!!", "\u7121\u4e8b\u3067\u826f\u304b\u3063\u305f\u2026\u2026\u3063", "\u30d3\u30a2\u30f3\u30ab\u3055\u3093\u2026\u2026", "\u5fc3\u914d\u304b\u3051\u3066\u3001\u3054\u3081\u3093\u306a\u3055\u3044", "\u5143\u6c17\u3067\u3044\u3066\u304f\u308c\u305f\u306a\u3089\u3001\u3044\u3044\u306e\u3088", "\u304a\u4e8c\u4eba\u306b\u3082\u3001\u5fc3\u914d\u3092\u304a\u304b\u3051\u3057\u3066\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f", "\u3063\u3001\u3044\u3044\u3048\u3002\u3054\u7121\u4e8b\u3067\u306a\u306b\u3088\u308a\u3067\u3059", "\u305d\u308c\u304b\u3089\u79c1\u306e\u7121\u8336\u306a\u9858\u3044\u3092\u53f6\u3048\u3066\u304f\u3060\u3055\u3063\u3066\u3001\u672c\u5f53\u306b\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059\u3002\u8cb4\u65b9\u306b\u306f\u4f55\u5ea6\u52a9\u3051\u3089\u308c\u305f\u304b\u5206\u304b\u308a\u307e\u305b\u3093", "\u2026\u2026\u3082\u3063\u3068\u983c\u3063\u3066\u9802\u304d\u305f\u3044\u304f\u3089\u3044\u3067\u3059\u3002\u304a\u529b\u306b\u306a\u308a\u305f\u3044\u3068\u9858\u3063\u3066\u3044\u308b\u306e\u306b\u3001\u50d5\u306b\u51fa\u6765\u308b\u304a\u624b\u4f1d\u3044\u306f\u3001\u307b\u3093\u306e\u5c0f\u3055\u306a\u3053\u3068\u3070\u304b\u308a\u3002\u8cb4\u65b9\u306f\u3069\u3093\u306a\u96e3\u984c\u3067\u3082\u3001\u3054\u81ea\u5206\u306e\u529b\u3067\u89e3\u6c7a\u51fa\u6765\u3066\u3057\u307e\u3046\u304b\u3089", "\u4efb\u305b\u3066\u9802\u3051\u306a\u304b\u3063\u305f\u306e\u306f\u3001\u5c11\u3057\u6094\u3057\u3044", "\u2026\u2026\u30b2\u30aa\u30eb\u30af\u69d8\u3001\u79c1\u306f", "\u3067\u3082\u540c\u6642\u306b\u3001\u8cb4\u65b9\u3089\u3057\u3044\u3068\u3082\u601d\u3046\u3093\u3067\u3059", "\u3048\u2026\u2026\uff1f", "\u8cb4\u65b9\u306f\u3044\u3064\u3082\u3001\u8ab0\u304b\u3092\u6551\u3046\u305f\u3081\u306b\u5168\u529b\u3092\u5c3d\u304f\u3057\u3066\u3044\u308b\u3002\u305d\u308c\u3067\u3053\u305d\u3001\u30de\u30ea\u30fc\u69d8\u3060", "\u304a\u3044\u3001\u305d\u3053\u306e", "\u8a00\u8449\u9063\u3044\u304c\u306a\u3063\u3066\u306a\u3044\u308f\u306d\u3001\u304a\u574a\u3061\u3083\u307e", "\u30a2\u30f3\u30bf\u306b\u306f\u8a00\u3044\u305f\u3044\u3053\u3068\u304c\u5c71\u306e\u3088\u3046\u306b\u3042\u308b\u304b\u3089\u306a\u3002\u2026\u2026\u3060\u304c\u3001\u305d\u308c\u306f\u5f8c\u56de\u3057\u3060\u3002\u8377\u7269\u3068\u4eba\u3092\u632f\u308a\u5206\u3051\u308b\u3002\u6765\u3066\u304f\u308c"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/119/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u63a2\u7d22\u3002(3)", "discourse": ["\u30e8\u30cf\u30f3\u69d8\uff1f\u5982\u4f55\u3055\u308c\u307e\u3057\u305f\u304b\uff1f", "\u2026\u2026\u866b\u304c\u3044\u305f\u3060\u3051\u3060", "\u306a\u3041\u3001\u30e8\u30cf\u30f3\u3002\u30d5\u30a3\u30ea\u30c3\u30d7\u306b\u3064\u3044\u3066\u5c11\u3057\u805e\u304d\u305f\u3044\u306e\u3060\u304c", "\u306a\u3093\u3067\u3057\u3087\u3046\uff1f", "\u5f7c\u306f\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u537f\u306e\u5b9f\u5b50\u304b\uff1f", "\u968f\u5206\u3068\u7387\u76f4\u306a\u8cea\u554f\u3067\u3059\u306d", "\u3053\u3093\u306a\u5834\u6240\u3067\u53d6\u308a\u7e55\u3063\u3066\u3082\u3001\u610f\u5473\u304c\u306a\u3044\u3060\u308d\u3046", "\u78ba\u304b\u306b", "\u30d5\u30a3\u30ea\u30c3\u30d7\u306f\u30cf\u30a4\u30f3\u30c4\u69d8\u3068\u3001\u82e5\u304f\u3057\u3066\u4ea1\u304f\u306a\u3063\u305f\u5965\u69d8\u306e\u9593\u306b\u751f\u307e\u308c\u305f\u5b50\u4f9b\u3067\u3059\u3002\u3067\u3059\u304c\u3001\u751f\u307e\u308c\u3064\u304d\u4f53\u304c\u5f31\u304f\u3001\u516c\u5f0f\u306e\u5834\u306b\u306f\u6b86\u3069\u51fa\u305f\u4e8b\u304c\u306a\u304b\u3063\u305f\u3068\u805e\u304d\u307e\u3057\u305f\u3002\u73fe\u306b\u50d5\u3082\u3001\u59ff\u3092\u898b\u305f\u306e\u306f\u521d\u3081\u3066\u3067\u3059", "\u306a\u308b\u307b\u3069\u3002\u9053\u7406\u3067\u4e00\u7dd2\u306b\u3044\u308b\u306e\u3092\u898b\u305f\u4e8b\u304c\u306a\u3044\u308f\u3051\u3060\u3002\u2026\u2026\u305d\u308c\u306b\u3057\u3066\u3082\u3001\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u537f\u306e\u5b50\u4f9b\u304c\u3001\u75c5\u5f31\u3068\u306f\u3002\u3055\u305e\u751f\u304d\u8f9b\u304b\u3063\u305f\u308d\u3046\u306a", "\u3067\u3059\u304c\u3001\u30ca\u30cf\u30c8", "\u5206\u304b\u3063\u3066\u3044\u308b\u3002\u30d5\u30a3\u30ea\u30c3\u30d7\u306e\u5883\u9047\u306b\u306f\u540c\u60c5\u3059\u308b\u304c\u3001\u305d\u308c\u3060\u3051\u3060\u3002\u3082\u3057\u6c11\u3092\u82e6\u3057\u3081\u3066\u3044\u308b\u306e\u3067\u3042\u308c\u3070\u3001\u8a31\u3055\u308c\u308b\u4e8b\u3067\u306f\u306a\u3044", "\u76f8\u5fdc\u306e\u5831\u3044\u306f\u53d7\u3051\u3055\u305b\u308b", "\u305d\u308d\u305d\u308d\u51fa\u767a\u3059\u308b\u304b\u3002\u3042\u307e\u308a\u9577\u304f\u4f11\u61a9\u3057\u3066\u3044\u308b\u3068\u3001\u6839\u304c\u751f\u3048\u3066\u3057\u307e\u3044\u305d\u3046\u3060", "\u6751\u306e\u524d\u306b\u898b\u5f35\u308a\u304c\u3044\u307e\u3059", "\u898b\u5f35\u308a\u306f\u3069\u3046\u3084\u3089\u3001\u3053\u3061\u3089\u3078\u80cc\u3092\u5411\u3051\u3066\u3044\u308b\u3088\u3046\u3067\u3059\u3002\u5c11\u3057\u8fd1\u3065\u3044\u3066\u307f\u307e\u3057\u3087\u3046", "\u2026\u2026\u69d8\u5b50\u304c\u304a\u304b\u3057\u3044\u3067\u3059\u306d", "\u2026\u2026\uff01", "\u3053\u3053\u306b\u3044\u3066\u4e0b\u3055\u3044", "\u304a\u4e8c\u4eba\u306f\u3001\u3042\u307e\u308a\u8fd1\u3065\u304b\u306a\u3044\u3067\u4e0b\u3055\u3044", "\u898b\u5f35\u308a\u3082\u75c5\u4eba\u3068\u306f\u306a\u2026\u2026", "\u2026\u2026\uff1f", "\uff01"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/118/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u63a2\u7d22\u3002(2)", "discourse": ["\u30ca\u30cf\u30c8\u3001\u5927\u4e08\u592b\u3067\u3059\u304b\uff1f", "\u5408\u6d41\u5730\u70b9\u3067\u3059\u304c\u3001\u898b\u5f35\u308a\u306f\u3044\u306a\u3044\u3088\u3046\u3067\u3059", "\u3053\u3053\u3067\u4f11\u61a9\u3057\u307e\u3057\u3087\u3046", "\u4eca\u5ea7\u308b\u3068\u3001\u7acb\u3066\u306a\u304f\u306a\u308a\u305d\u3046\u3060", "\u30aa\u30eb\u30bb\u30a4\u30f3\u6bbf\u3001\u5c11\u3057\u6559\u3048\u3066\u9802\u304d\u305f\u3044", "\u306f\u3044\u3002\u81ea\u5206\u3067\u304a\u7b54\u3048\u3067\u304d\u308b\u3053\u3068\u3067\u3057\u305f\u3089", "\u571f\u7802\u5d29\u308c\u304c\u8d77\u3053\u308a\u305d\u3046\u306a\u5730\u5f62\u306f\u3001\u3053\u306e\u5148\u306b\u3082\u3042\u308b\u306e\u3060\u308d\u3046\u304b\uff1f\u81ea\u56fd\u306e\u5730\u5f62\u306b\u758e\u3044\u3068\u3044\u3046\u306e\u306f\u6065\u305a\u304b\u3057\u3044\u8a71\u3060\u304c\u3001\u8cb4\u65b9\u306e\u898b\u89e3\u3092\u304a\u805e\u304d\u3057\u305f\u3044", "\u306a\u3044\u3001\u3068\u306f\u8a00\u3044\u5207\u308c\u307e\u305b\u3093\u304c\u53ef\u80fd\u6027\u306f\u4f4e\u3044\u3067\u3059\u306d", "\u306a\u3089\u3070\u3001\u30d5\u30a3\u30ea\u30c3\u30d7\u306e\u8a00\u3046\u300e\u571f\u7802\u5d29\u308c\u3067\u9053\u304c\u585e\u304c\u308c\u305f\u300f\u306f\u3001\u3084\u306f\u308a\u5618\u304b", "\u3044\u3088\u3044\u3088\u3001\u75c5\u4eba\u306e\u96a0\u853d\u8aac\u304c\u6fc3\u539a\u306b\u306a\u3063\u3066\u304d\u305f\u306a", "\u75c5\u4eba\u3092\u9694\u96e2\u3059\u308b\u306e\u306f\u3044\u3044\u3002\u75c5\u3092\u8513\u5ef6\u3055\u305b\u306a\u3044\u305f\u3081\u306e\u5fc5\u8981\u306a\u51e6\u7f6e\u3060\u3002\u3060\u304c\u3001\u3053\u3093\u306a\u68ee\u6df1\u304f\u306b\u9589\u3058\u8fbc\u3081\u3066\u3001\u7269\u8cc7\u3092\u9001\u3063\u3066\u3044\u308b\u69d8\u5b50\u3059\u3089\u306a\u3044\u3068\u306f\u3069\u3046\u3044\u3046\u4e8b\u3060\u3002\u305d\u306e\u307e\u307e\u6b7b\u306d\u3068\u8a00\u3063\u3066\u3044\u308b\u3088\u3046\u306a\u3082\u306e\u3060\u308d\u3046\u3002\u6c5a\u308c\u305f\u66f8\u985e\u3092\u7834\u308a\u6368\u3066\u308b\u3088\u3046\u306b\u3001\u6c11\u3092\u898b\u6bba\u3057\u306b\u3059\u308b\u306a\u3069\u4e0a\u306b\u7acb\u3064\u8005\u306e\u3059\u308b\u4e8b\u304b\u2026\u2026\uff01", "\u30ca\u30cf\u30c8\u3001\u843d\u3061\u7740\u3044\u3066\u304f\u3060\u3055\u3044", "\u30ac\u30ad\u306e\u3088\u3046\u306b\u7647\u766a\u3092\u8d77\u3053\u3057\u305f\u3068\u3053\u308d\u3067\u3001\u4e8b\u614b\u306f\u4f55\u3082\u5909\u308f\u308a\u306f\u3057\u306a\u3044\u3002\u305d\u308c\u304f\u3089\u3044\u5206\u304b\u3063\u3066\u3044\u308b\u3064\u3082\u308a\u3060\u3063\u305f\u3093\u3060\u304c\u3002\u79c1\u3082\u307e\u3060\u307e\u3060\u672a\u719f\u306a\u30ac\u30ad\u3060\u306a", "\u30ca\u30cf\u30c8\u69d8\u306e\u6012\u308a\u306e\u5927\u304d\u3055\u306f\u3001\u305d\u306e\u307e\u307e\u6c11\u3078\u306e\u611b\u306e\u6df1\u3055\u3067\u3057\u3087\u3046\u3002\u8cb4\u65b9\u69d8\u306f\u304d\u3063\u3068\u3001\u826f\u3044\u7d71\u6cbb\u8005\u306b\u306a\u3089\u308c\u307e\u3059", "\u79c1\u306f\u305d\u3093\u306a\u5668\u3067\u306f\u306a\u3044\u3055", "\u5df1\u306e\u611f\u60c5\u3055\u3048\u5236\u5fa1\u3067\u304d\u306a\u3044\u3001\u305f\u3060\u306e\u30af\u30bd\u30ac\u30ad\u3060\u3002\u2026\u2026\u3069\u3093\u306a\u6642\u3067\u3082\u51b7\u9759\u306b\u632f\u308b\u821e\u3048\u308b\u8cb4\u65b9\u304c\u7fa8\u307e\u3057\u3044", "\u81ea\u5206\u306f\u305d\u3093\u306a\u98a8\u306b\u4ef0\u3063\u3066\u9802\u3051\u308b\u3088\u3046\u306a\u3001\u7acb\u6d3e\u306a\u7537\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u52ff\u8ad6\u3001\u306a\u308b\u3079\u304f\u51b7\u9759\u3067\u3042\u308b\u3088\u3046\u5fc3\u304c\u3051\u3066\u306f\u304a\u308a\u307e\u3059\u304c\u3001\u53d6\u308a\u4e71\u3059\u3053\u3068\u3060\u3063\u3066\u3042\u308a\u307e\u3059\u3088", "\u8cb4\u65b9\u304c\uff1f", "\u5927\u5207\u306a\u4eba\u306e\u5371\u6a5f\u306b\u52d5\u63fa\u3059\u308b\u306e\u306f\u3001\u8ab0\u3060\u3063\u3066\u540c\u3058\u3067\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/117/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u63a2\u7d22\u3002", "discourse": ["\u30e8\u30cf\u30f3", "\u3053\u3061\u3089\u306b\u306f\u3001\u4eba\u306f\u3044\u306a\u3044\u3088\u3046\u3060\u306a", "\u8cb4\u65b9\u306e\u52a9\u8a00\u306b\u5f93\u3063\u3066\u826f\u304b\u3063\u305f", "\u304a\u5f79\u306b\u7acb\u3066\u305f\u306e\u306a\u3089\u3070\u826f\u304b\u3063\u305f\u3067\u3059", "\u304a\u4e8c\u4eba\u3068\u3082\u3002\u6539\u3081\u3066\u304a\u805e\u304d\u3057\u307e\u3059\u304c\u3001\u672c\u5f53\u306b\u68ee\u306b\u5165\u308b\u304a\u3064\u3082\u308a\u3067\u3059\u304b", "\u3053\u308c\u3088\u308a\u5148\u306f\u3001\u5371\u967a\u304c\u591a\u304f\u6f5c\u3093\u3067\u304a\u308a\u307e\u3059\u3002\u308f\u3056\u308f\u3056\u304a\u4e8c\u4eba\u304c\u51fa\u5411\u304b\u305a\u3068\u3082\u3001\u304a\u4efb\u305b\u9802\u3051\u308c\u3070\u3001\u81ea\u5206\u304c\u4e00\u4eba\u3067\u69d8\u5b50\u3092\u63a2\u3063\u3066\u53c2\u308a\u307e\u3057\u3087\u3046", "\u2026\u2026\u305d\u306e\u65b9\u304c\u78ba\u5b9f\u3060\u306a\u3002\u79c1\u9054\u304c\u3064\u3044\u3066\u3044\u3063\u3066\u3082\u3001\u8db3\u624b\u307e\u3068\u3044\u306b\u306a\u308a\u304b\u306d\u306a\u3044\u3002\u8ce2\u660e\u306a\u5224\u65ad\u3068\u3044\u3048\u308b", "\u30ca\u30cf\u30c8", "\u3053\u3053\u3067\u300e\u306f\u3044\u3001\u305d\u3046\u3067\u3059\u304b\u300f\u3068\u9837\u3051\u308b\u3088\u3046\u306a\u3089\u3001\u79c1\u306f\u79c1\u3092\u3084\u3063\u3066\u3044\u306a\u3044", "\u3053\u306e\u68ee\u306e\u4e2d\u3067\u3001\u6211\u304c\u56fd\u306e\u6c11\u304c\u82e6\u3057\u3093\u3067\u3044\u308b\u304b\u3082\u3057\u308c\u306a\u3044\u3002\u305d\u308c\u3092\u627f\u77e5\u3067\u3001\u5b89\u5168\u306a\u5834\u6240\u3067\u5927\u4eba\u3057\u304f\u5f85\u3064\u306a\u3069\u3068\u3044\u3046\u99ac\u9e7f\u3052\u305f\u9078\u629e\u3092\u3057\u3066\u305f\u307e\u308b\u304b\u3002\u8ce2\u660e\u306a\u5224\u65ad\u306a\u3069\u30af\u30bd\u98df\u3089\u3048\u3060\u3002\u79c1\u306f\u4f0a\u9054\u306b\u3001\u504f\u5c48\u738b\u5b50\u306a\u3069\u3068\u306f\u547c\u3070\u308c\u3066\u3044\u306a\u3044\u305e", "\u307e\u3041\u3001\u5b9f\u969b\u306f\u305f\u3060\u306e\u304a\u8377\u7269\u3067\u3001\u5b88\u3089\u308c\u308b\u6c17\u6e80\u3005\u3060\u304c\u306a\u3002\u5384\u4ecb\u306a\u8377\u7269\u904b\u642c\u3092\u8acb\u3051\u8ca0\u3063\u305f\u6c17\u6301\u3061\u3067\u983c\u3080", "\u30e8\u30cf\u30f3\u69d8\u306f\u5982\u4f55\u3067\u3059\u304b", "\u8a00\u3044\u305f\u3044\u3053\u3068\u306f\u3001\u6982\u306d\u4e00\u7dd2\u3060", "\u304b\u3057\u3053\u307e\u308a\u307e\u3057\u305f", "\u306f\uff1f", "\u3067\u306f\u3001\u53c2\u308a\u307e\u3057\u3087\u3046\u304b", "\u305d\u308c\u3060\u3051\u304b!?", "\u306f\u3044", "\u304a\u4e8c\u4eba\u304c\u884c\u304f\u3068\u6c7a\u3081\u305f\u306e\u3067\u3057\u305f\u3089\u3001\u81ea\u5206\u306f\u305f\u3060\u5168\u529b\u3067\u304a\u5b88\u308a\u3059\u308b\u3060\u3051\u3067\u3059", "\u3067\u306f\u68ee\u306b\u5165\u308b\u524d\u306b\u3001\u3053\u3061\u3089\u3092\u808c\u306b\u5857\u3063\u3066\u3044\u305f\u3060\u3051\u307e\u3059\u304b", "\u808c\u306b\uff1f", "\u690d\u7269\u304b\u3089\u3068\u308c\u305f\u6cb9\u3067\u3059\u3002\u6b63\u78ba\u306b\u306f\u305d\u308c\u3092\u3001\u5e0c\u91c8\u3057\u305f\u3082\u306e\u3060\u305d\u3046\u3067\u3059\u304c", "\u7cbe\u6cb9\u304b\u3002\u3057\u304b\u3057\u3001\u4f55\u6545\u305d\u3093\u306a\u3082\u306e\u3092\u4eca\uff1f", "\u866b\u9664\u3051\u3067\u3059\u3088\u3002\u7363\u3084\u4eba\u304b\u3089\u306f\u304a\u5b88\u308a\u3059\u308b\u3053\u3068\u304c\u51fa\u6765\u3066\u3082\u3001\u866b\u306f\u96e3\u3057\u3044\u3067\u3059\u304b\u3089", "\u306a\u308b\u307b\u3069\u3002\u51c4\u3044\u306a\u3001\u8cb4\u65b9\u306f\u3002\u306a\u3093\u3067\u3082\u77e5\u3063\u3066\u3044\u308b", "\u8cb7\u3044\u304b\u3076\u308a\u3067\u3059\u3088\u3002\u81ea\u5206\u306b\u306f\u504f\u3063\u305f\u77e5\u8b58\u3057\u304b\u3042\u308a\u307e\u305b\u3093"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/116/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u9a5a\u304d\u3002", "discourse": ["\u738b\u5973\u6bbf\u4e0b", "\u306f\u3044", "\u79fb\u52d5\u8ddd\u96e2\u3068\u6642\u9593\u3092\u8003\u616e\u3057\u307e\u3059\u3068\u3001\u9023\u308c\u3066\u3044\u304f\u306e\u306f\u82e5\u3044\u9023\u4e2d\u304c\u3044\u3044\u3068\u5224\u65ad\u3057\u307e\u3057\u305f\u3002\u4e09\u5341\u4f59\u540d\u306b\u306f\u65c5\u652f\u5ea6\u3092\u3002\u305d\u308c\u4ee5\u5916\u306e\u4eba\u9593\u306b\u306f\u3001\u5728\u5eab\u306e\u85ac\u3068\u85ac\u306e\u6750\u6599\u3001\u6cbb\u7642\u306b\u5fc5\u8981\u306a\u9053\u5177\u985e\u3001\u305d\u308c\u304b\u3089\u6570\u65e5\u5206\u306e\u98df\u6599\u3092\u7528\u610f\u3055\u305b\u3066\u3044\u307e\u3059", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u8ffd\u52a0\u306e\u85ac\u304c\u5fc5\u8981\u306b\u306a\u308b\u5834\u5408\u3092\u60f3\u5b9a\u3057\u3001\u79c1\u306f\u6751\u306b\u6b8b\u308a\u307e\u3059\u3002\u6bbf\u4e0b\u306b\u540c\u884c\u3055\u305b\u308b\u8005\u9054\u306e\u6307\u63ee\u306f\u3001\u30f4\u30a9\u30eb\u30d5\u306b\u4e00\u4efb\u3059\u308b\u4e8b\u306b\u81f4\u3057\u307e\u3057\u305f", "\u5206\u304b\u308a\u307e\u3057\u305f", "\u6025\u304c\u305b\u3066\u3044\u307e\u3059\u306e\u3067\u3001\u652f\u5ea6\u306b\u305d\u308c\u307b\u3069\u6642\u9593\u306f\u304b\u304b\u308a\u307e\u305b\u3093\u304c\u2026\u2026\u554f\u984c\u306f\u79fb\u52d5\u65b9\u6cd5\u3067\u3059\u306a", "\u306a\u306b\u3088\uff1f\u5fd9\u3057\u3044\u306e\u306b\u547c\u3073\u3064\u3051\u306a\u3044\u3067\u9802\u6234", "\u304a\u524d\u306f\u5148\u306b\u4e0b\u5c71\u3057\u3066\u3001\u9e93\u306e\u6751\u3067\u99ac\u8eca\u3092\u8abf\u9054\u3057\u308d", "\u79fb\u52d5\u624b\u6bb5\u306f\u8003\u3048\u308b\u3079\u304d\u3060\u3051\u3069\u2026\u2026\u3042\u306e\u5c0f\u3055\u306a\u6751\u306b\u5927\u578b\u306e\u99ac\u8eca\u306a\u3093\u3066\u306a\u3044\u308f\u3088", "\u3060\u308d\u3046\u306a\u3001\u5143\u3088\u308a\u671f\u5f85\u306f\u3057\u3066\u3044\u306a\u3044\u3002\u3060\u304c\u4e8b\u306f\u6025\u3092\u8981\u3059\u3002\u51fa\u6765\u308b\u9650\u308a\u306e\u99ac\u3068\u99ac\u8eca\u3092\u63bb\u304d\u96c6\u3081\u3001\u5148\u306b\u884c\u3051\u308b\u8005\u304b\u3089\u884c\u304b\u305b\u308b\u3057\u304b\u306a\u3044", "\u304a\u56f0\u308a\u3067\u3059\u304b\u306d\uff1f", "\u3061\u3087\u3001\u3069\u3001\u306a\u3093\u3067\u3063!?", "\u3042\u306f\u306f\u3002\u59eb\u3055\u3093\u306e\u9854\u9762\u767d\u3044\u30fc", "\u305d\u308c\u306f\u5931\u793c\u3057\u307e\u3057\u305f\uff01\u307e\u3055\u304b\u8cb4\u65b9\u304c\u6751\u306e\u4e2d\u3092\u30d5\u30e9\u30d5\u30e9\u3057\u3066\u3044\u308b\u306a\u3093\u3066\u3001\u4e88\u60f3\u3082\u3057\u306a\u304b\u3063\u305f\u3082\u306e\u3067!!", "\u3055\u3063\u304d\u307e\u3067\u306f\u3001\u3061\u3083\u3093\u3068\u5fcd\u3093\u3067\u307e\u3057\u305f\u3063\u3066\u30fc\u3002\u305f\u3060\u3082\u3046\u3001\u5fc5\u8981\u306a\u3044\u304b\u3063\u3066\u601d\u3063\u305f\u3093\u3059\u3088", "\u738b\u5973\u6bbf\u4e0b\u306b\u8b77\u885b\u304c\u4e00\u4eba\u3082\u3044\u306a\u3044\u3068\u306f\u601d\u3044\u307e\u305b\u3093\u3067\u3057\u305f\u304c\u2026\u2026\u5168\u304f\u6c17\u3065\u304b\u306a\u304b\u3063\u305f\u3068\u3044\u3046\u306e\u3082\u60c5\u3051\u306a\u3044\u8a71\u3067\u3059\u306a\u3002\u3067\u3059\u304c\u305d\u306e\u7537\u306e\u8a00\u3046\u901a\u308a\u3001\u3082\u3046\u5fcd\u3076\u5fc5\u8981\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u79c1\u9054\u306f\u8cb4\u65b9\u306b\u5354\u529b\u3059\u308b\u3068\u6c7a\u3081\u305f\u306e\u3067\u3059\u304b\u3089", "\u307b\u3089\u306d", "\u307b\u3089\u307b\u3089\u59eb\u3055\u3093\u3002\u305d\u3093\u306a\u7709\u9593\u306b\u76ba\u3064\u304f\u3063\u3066\u3061\u3083\u3001\u53ef\u611b\u3044\u9854\u304c\u53f0\u7121\u3057\u3060\u305c\uff1f", "\u8ab0\u306e\u305b\u3044\u304b\u306a", "\u59eb\u3055\u3093\u3066\u3070\u51b7\u305f\u3044\u3002\u305b\u3063\u304b\u304f\u30a2\u30f3\u30bf\u306e\u305f\u3081\u306b\u3001\u8272\u3005\u3068\u624b\u914d\u3057\u305f\u306e\u306b", "\u2026\u2026\u3048\uff1f", "\u4e88\u60f3\u5916\u3067\u3057\u3087\uff1f", "\u30aa\u30ec\u3082\u306d\u3001\u4e88\u60f3\u5916", "\u30a2\u30f3\u30bf\u304c\u306a\u306b\u3057\u3088\u3046\u3068\u3001\u4f55\u3092\u671b\u3082\u3046\u3068\u30aa\u30ec\u306b\u306f\u95a2\u4fc2\u306a\u3044\u3002\u30aa\u30ec\u306e\u4ed5\u4e8b\u306f\u3042\u304f\u307e\u3067\u3001\u30a2\u30f3\u30bf\u3092\u751f\u304b\u3057\u3066\u56fd\u306b\u5e30\u3059\u3053\u3068\u3060\u3051\u3002\u305d\u308c\u4ee5\u4e0a\u306f\u696d\u52d9\u5916\u3060", "\u3058\u3083\u3042\u3001\u3069\u3046\u3057\u3066", "\u306a\u3093\u304b\u9762\u767d\u3044\u3082\u3093\u3001\u898b\u305b\u3066\u3082\u3089\u3063\u305f\u304b\u3089", "\u306a\u306b\u304c\u9762\u767d\u304b\u3063\u305f\u306e\u304b\u306f\u77e5\u3089\u306a\u3044\u3051\u308c\u3069\u3001\u79fb\u52d5\u624b\u6bb5\u3092\u898b\u3064\u3051\u3066\u304f\u308c\u305f\u3063\u3066\u601d\u3063\u3066\u3044\u3044\u306e\u304b\u3057\u3089\uff1f", "\u52ff\u8ad6\u3002\u2026\u2026\u3068\u8a00\u3063\u3066\u3082\u3001\u30aa\u30ec\u304c\u3057\u305f\u306e\u306f\u30a2\u30a4\u30b2\u30eb\u5bb6\u306e\u574a\u3063\u3061\u3083\u3093\u9054\u3068\u9023\u7d61\u3092\u3068\u3063\u305f\u3060\u3051\u3060\u304c\u306d\u3002\u6709\u80fd\u306a\u574a\u3063\u3061\u3083\u3093\u3068\u305d\u306e\u304a\u4ef2\u9593\u304c\u4eca\u9803\u3001\u99ac\u8eca\u3084\u305d\u306e\u4ed6\u8af8\u3005\u3092\u7528\u610f\u3057\u3066\u304f\u308c\u3066\u308b\u3060\u308d\u3046\u3055", "\u5b09\u3057\u3044\uff1f", "\u3082\u3061\u308d\u3093\u3002\u3042\u308a\u304c\u3068\u3046\u3001\u30ab\u30e9\u30b9"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/115/", "subtitle": "\u6b21\u671f\u65cf\u9577\u306e\u6b53\u559c\u3002(2)", "discourse": ["\u3044\u3044\u305c", "\u30aa\u30ec\u306f\u30a2\u30f3\u30bf\u306b\u3064\u3044\u3066\u884c\u304f\u3002\u30aa\u30ec\u306f\u30ac\u30ad\u3067\u5927\u3057\u305f\u6226\u529b\u306b\u306f\u306a\u3089\u306a\u3044\u3068\u601d\u3046\u304c\u3001\u624b\u4f1d\u3046\u3053\u3068\u306f\u51fa\u6765\u308b\u3002\u306a\u3093\u3067\u3082\u8a00\u3048", "\u2026\u2026\u306f\u3063\uff1f", "\u30aa\u30ec\u306f\u30a2\u30f3\u30bf\u306b\u5f93\u304a\u3046\u3002\u738b\u5973\u6bbf\u4e0b", "\u3061\u3087\u3063\u3068\u30ed\u30eb\u30d5\uff01\u30a2\u30f3\u30bf\u306a\u306b\u7c21\u5358\u306b\u8a00\u3063\u3066\u308b\u306e\u3088!?", "\u7c21\u5358\u306b\u306f\u8a00\u3063\u3066\u306a\u3044", "\u8a00\u3063\u3066\u308b\u3060\u308d\u3046\u304c\uff01\u3061\u3087\u3063\u3068\u9ed9\u308c\uff01", "\u5acc\u3060\u3001\u9ed9\u3089\u306a\u3044\uff01\u3042\u3044\u3064\u306f\u5973\u795e\u3068\u3057\u3066\u30aa\u30ec\u9054\u3092\u9a19\u3059\u3053\u3068\u3082\u51fa\u6765\u305f\u3002\u738b\u5973\u3068\u3057\u3066\u547d\u4ee4\u3059\u308b\u3053\u3068\u3060\u3063\u3066\u3001\u672c\u5f53\u306f\u51fa\u6765\u308b\u3002\u3067\u3082\u305d\u3046\u306f\u3057\u306a\u304b\u3063\u305f\u3002\u85ac\u5e2b\u3068\u3057\u3066\u306e\u30aa\u30ec\u9054\u306e\u8a87\u308a\u3092\u8b77\u308d\u3046\u3068\u3001\u8a00\u8449\u3092\u5c3d\u304f\u3057\u3066\u982d\u3092\u4e0b\u3052\u3066\u304f\u308c\u3066\u308b\u3002\u540c\u3058\u4eba\u9593\u3068\u3057\u3066\u3001\u5bfe\u7b49\u306a\u7acb\u5834\u3067\u8a71\u3092\u3057\u3066\u304f\u308c\u3088\u3046\u3068\u3057\u3066\u3093\u3060\u3088\u3002\u305d\u306e\u8aa0\u610f\u306b\u3001\u8aa0\u610f\u4ee5\u5916\u306e\u306a\u306b\u3092\u8fd4\u3059\u3093\u3060!?", "\u2026\u2026\u3063", "\u308f\u3001\u308f\u305f\u3057\u3082\u2026\u2026\u79c1\u3082\u3063\uff01", "\u79c1\u3082\u3001\u8a31\u3055\u308c\u308b\u306a\u3089\u8cb4\u65b9\u3068\u4e00\u7dd2\u306b\u884c\u304d\u305f\u3044\u3001\u3067\u3059", "\u3046\u3046\u3093\u3001\u8a31\u3055\u308c\u306a\u304f\u3066\u3082\u3044\u3044\u3002\u884c\u304d\u305f\u3044\u3001\u9023\u308c\u3066\u3044\u3063\u3066\u304f\u3060\u3055\u3044\u3002\u79c1\u3082\u85ac\u5e2b\u3068\u3057\u3066\u3001\u81ea\u5206\u3092\u8a87\u308c\u308b\u751f\u304d\u65b9\u304c\u3057\u305f\u3044\u3002\u3042\u306a\u305f\u3068\u3001\u30de\u30ea\u30fc\u69d8\u3068\u4e00\u7dd2\u306b\u751f\u304d\u305f\u3044\u3063\uff01", "\u30ea\u30ea\u30fc\u3055\u3093\u2026\u2026\u3063", "\u30aa\u30ec\u306e\u6642\u3068\u53cd\u5fdc\u9055\u3046\u3058\u3083\u306d\u3048\u304b\uff01", "\u305d\u308a\u3083\u3001\u65e5\u9803\u306e\u884c\u3044\u306e\u5dee\u3060\u308d", "\u9055\u3044\u306d\u3047\u306a", "\u30ea\u30ea\u30fc\u3068\u540c\u5217\u306b\u6271\u3063\u3066\u3082\u3089\u304a\u3046\u306a\u3093\u3066\u56f3\u3005\u3057\u3044\u3002\u666e\u6bb5\u306e\u304a\u524d\u306e\u8a00\u52d5\u3068\u884c\u52d5\u3092\u601d\u3044\u8fd4\u3057\u3066\u307f\u308d\u3088\u3001\u7cde\u30ac\u30ad", "\u3046\u3063\u305b\uff01", "\u5947\u8de1\u306e\u3088\u3046\u306a\u5149\u666f\u3060", "\u6211\u304c\u4e00\u65cf\u306f\u4fdd\u5b88\u7684\u3067\u3001\u5909\u5316\u3092\u5acc\u3046\u8005\u304c\u591a\u3044\u3002\u3060\u304b\u3089\u3053\u305d\u79c1\u306f\u5f37\u5f15\u306b\u3067\u3082\u9023\u308c\u51fa\u3059\u624b\u6bb5\u3092\u9078\u3093\u3060\u3002\u305d\u308c\u304c\u6700\u5584\u3060\u3068\u4fe1\u3058\u3066\u3044\u305f\u3002\u2026\u2026\u3060\u304c\u3001\u9593\u9055\u3044\u3060\u3063\u305f\u3002\u79c1\u306f\u3001\u4ef2\u9593\u306e\u3053\u3068\u3082\u738b\u5973\u6bbf\u4e0b\u306e\u3053\u3068\u3082\u898b\u7e0a\u3063\u3066\u3044\u305f\u306e\u3060\u306a", "\u738b\u5973\u6bbf\u4e0b", "\u305e\u3001\u65cf\u9577\u3055\u3093\u3063\uff1f", "\u5c0f\u8ce2\u3057\u3044\u829d\u5c45\u3092\u5f37\u8981\u3057\u3066\u3001\u8cb4\u65b9\u306e\u8a87\u308a\u3092\u50b7\u4ed8\u3051\u3088\u3046\u3068\u3057\u305f\u7f6a\u304c\u3001\u982d\u3092\u4e0b\u3052\u305f\u7a0b\u5ea6\u3067\u306a\u304b\u3063\u305f\u4e8b\u306b\u306a\u308b\u3068\u306f\u601d\u3063\u3066\u304a\u308a\u307e\u305b\u3093\u3002\u3067\u3059\u304c\u3001\u3069\u3046\u304b\u8b1d\u7f6a\u3059\u308b\u4e8b\u3060\u3051\u306f\u304a\u8a31\u3057\u3092\u3002\u6b64\u5ea6\u306e\u4ef6\u3001\u8aa0\u306b\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f", "\u2026\u2026\u8b1d\u3063\u3066\u3044\u305f\u3060\u304f\u3088\u3046\u306a\u4e8b\u306f\u3001\u306a\u306b\u3082\u3042\u308a\u307e\u305b\u3093\u3002\u79c1\u306f\u7d50\u5c40\u3001\u81ea\u5206\u306e\u610f\u5fd7\u3092\u66f2\u3052\u3089\u308c\u306a\u304b\u3063\u305f\u306e\u3067\u3059\u304b\u3089", "\u78ba\u304b\u306b\u305d\u308c\u306f\u4e88\u60f3\u5916\u3067\u3057\u305f\u304c\u3001\u7d50\u679c\u3068\u3057\u3066\u8cb4\u65b9\u306f\u6700\u826f\u306e\u9053\u3092\u9078\u3073\u53d6\u3063\u305f", "\u3048\uff1f", "\u5168\u54e1\u4e00\u4eba\u6b8b\u3089\u305a\u3001\u8cb4\u65b9\u306b\u5fe0\u8aa0\u3092\u8a93\u3046\u3068\u306f\u7533\u3057\u307e\u305b\u3093\u3002\u8a71\u3057\u5408\u3044\u3082\u305b\u305a\u306b\u3001\u4e00\u65cf\u306e\u672a\u6765\u3092\u6c7a\u3081\u3066\u3057\u307e\u3048\u308b\u6a29\u5229\u306f\u79c1\u306b\u306f\u306a\u3044\u3002\u3067\u3059\u304c\u79c1\u9054\u306f\u85ac\u5e2b\u3002\u75c5\u4eba\u304c\u3044\u308b\u306e\u306a\u3089\u3070\u3001\u3069\u3053\u3078\u3067\u3082\u99c6\u3051\u3064\u3051\u307e\u3057\u3087\u3046", "\uff01\u3067\u306f\u2026\u2026\uff1f", "\u85ac\u5e2b\u3068\u3057\u3066\u306e\u6211\u3089\u3092\u5c0a\u91cd\u3057\u3066\u304f\u3060\u3055\u3063\u305f\u8cb4\u65b9\u306b\u5831\u3044\u3089\u308c\u308b\u3088\u3046\u3001\u5c3d\u529b\u81f4\u3057\u307e\u3059"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/114/", "subtitle": "\u6b21\u671f\u65cf\u9577\u306e\u6b53\u559c\u3002", "discourse": ["\u30f4\u30a9\u30eb\u30d5\u69d8", "\u2026\u2026\u306a\u3041\u306b\uff1f\u30ea\u30ea\u30fc", "\u79c1\u306f\u6700\u521d\u3001\u3042\u306e\u4eba\u304c\u82e6\u624b\u3067\u3057\u305f", "\u305d\u3046\u306a\u306e\u2026\u2026\uff1f", "\u306f\u3044\u3002\u3060\u3063\u3066\u3042\u307e\u308a\u306b\u3082\u53ef\u611b\u3089\u3057\u304f\u3066\u7dba\u9e97\u3067\u3001\u81ea\u5206\u3068\u306f\u5225\u4e16\u754c\u306b\u751f\u304d\u3066\u3044\u308b\u4eba\u306a\u3093\u3060\u3068\u601d\u3063\u305f\u3093\u3067\u3059\u3002\u304d\u3063\u3068\u4f55\u3067\u3082\u6301\u3063\u3066\u3044\u308b\u3057\u3001\u60a9\u307f\u3082\u82e6\u3057\u307f\u3082\u77e5\u3089\u306a\u3044\u304a\u59eb\u69d8\u306a\u3093\u3060\u308d\u3046\u3063\u3066", "\u3067\u3082\u8ddd\u96e2\u3092\u7f6e\u3053\u3046\u3068\u3059\u308b\u79c1\u9054\u306b\u3001\u30de\u30ea\u30fc\u69d8\u306f\u6b69\u307f\u5bc4\u3063\u3066\u304f\u308c\u305f\u3002\u4e00\u7dd2\u306b\u8fb2\u4f5c\u696d\u3092\u3057\u3066\u3001\u5bb6\u4e8b\u3092\u3057\u3066\u3002\u7dba\u9e97\u306a\u624b\u3084\u9aea\u304c\u6ce5\u3067\u6c5a\u308c\u3066\u3082\u5168\u7136\u6c17\u306b\u3057\u306a\u3044\u3067\u3001\u512a\u3057\u304f\u7b11\u3044\u304b\u3051\u3066\u304f\u308c\u305f\u3093\u3067\u3059", "\u3042\u306e\u4eba\u304c\u79c1\u9054\u306e\u4e3b\u306b\u306a\u3063\u3066\u304f\u308c\u305f\u3089\u3001\u7d20\u6575\u3060\u3068\u601d\u3044\u307e\u3059\u3002\u304d\u3063\u3068\u79c1\u9054\u306e\u8eab\u3060\u3051\u3067\u306a\u304f\u3001\u8a87\u308a\u3082\u5b88\u3063\u3066\u304f\u308c\u308b\u3002\u2026\u2026\u3067\u3082\u3001\u3042\u3093\u306a\u9854\u3055\u305b\u308b\u304f\u3089\u3044\u306a\u3089\u3001\u306a\u3089\u306a\u304f\u3066\u3082\u3044\u3044", "\u30ea\u30ea\u30fc\u2026\u2026", "\u7686\u3067\u5bc4\u3063\u3066\u305f\u304b\u3063\u3066\u53d6\u308a\u56f2\u3093\u3067\u3001\u30de\u30ea\u30fc\u69d8\u304c\u6ce3\u304d\u305d\u3046\u306a\u306e\u306b\u3082\u6c17\u4ed8\u3044\u3066\u306a\u3044\u306a\u3093\u3066\u3002\u3042\u3093\u306a\u9854\u3001\u3055\u305b\u3061\u3083\u99c4\u76ee\u306a\u306e\u306b", "\u2026\u2026\u7686\u3055\u3093\u306b\u3001\u304a\u8a71\u3057\u3057\u305f\u3044\u3053\u3068\u304c\u3042\u308a\u307e\u3059", "\u5927\u5207\u306a\u8a71\u3067\u3059\u3002\u3067\u3082\u3001\u305d\u306e\u524d\u306b\u898b\u3066\u9802\u304d\u305f\u3044\u3082\u306e\u304c\u3042\u308a\u307e\u3059", "\u7f8e\u3057\u3044\u77f3\u3067\u3059\u304c\u3001\u3053\u308c\u304c\u4f55\u304b\uff1f", "\u3072\u3063!?", "\u4eca\u306e\u73fe\u8c61\u3092\u3001\u79c1\u306e\u56fd\u3067\u306f\u9b54\u6cd5\u3068\u547c\u3073\u307e\u3059", "\u79c1\u306f\u9b54\u6cd5\u304c\u4f7f\u3048\u306a\u3044\u306e\u3067\u4eca\u306e\u306f\u898b\u305b\u304b\u3051\u3067\u3059\u304c\u3001\u672c\u5f53\u306e\u9b54\u6cd5\u306f\u3001\u9b54\u5c0e\u5e2b\u3068\u547c\u3070\u308c\u308b\u4e00\u63e1\u308a\u306e\u4eba\u9593\u3060\u3051\u304c\u4f7f\u3048\u308b\u5947\u8de1\u306e\u529b\u3067\u3059\u3002\u6271\u3048\u308b\u9b54\u6cd5\u306e\u7a2e\u985e\u306f\u4eba\u306b\u3088\u3063\u3066\u9055\u3063\u3066\u3001\u706b\u3092\u6271\u3048\u308b\u4eba\u3001\u6c37\u3092\u6271\u3048\u308b\u4eba\u3068\u69d8\u3005\u3067\u3059\u3002\u305d\u306e\u4e2d\u306b\u5730\u5c5e\u6027\u3068\u547c\u3070\u308c\u308b\u529b\u304c\u3042\u3063\u3066\u3001\u690d\u7269\u306e\u6210\u9577\u3092\u52a9\u3051\u305f\u308a\u3001\u4eba\u306e\u50b7\u3092\u585e\u3044\u3060\u308a\u3082\u51fa\u6765\u307e\u3059", "\u79c1\u306e\u53cb\u4eba\u306b\u3082\u4e00\u4eba\u3001\u624b\u3092\u7ff3\u3057\u3066\u602a\u6211\u3092\u6cbb\u305b\u308b\u4eba\u304c\u3044\u307e\u3059\u3002\u2026\u2026\u7686\u3055\u3093\u306e\u5973\u795e\u69d8\u3068\u3001\u540c\u3058\u3088\u3046\u306b", "\u4eca\u306f\u30cd\u30fc\u30d9\u30eb\u738b\u56fd\u306b\u3057\u304b\u3044\u307e\u305b\u3093\u304c\u3001\u4f55\u767e\u5e74\u3082\u524d\u306b\u306f\u4e16\u754c\u5404\u5730\u306b\u9b54\u5c0e\u5e2b\u304c\u3044\u305f\u305d\u3046\u3067\u3059\u3002\u30af\u30fc\u30a2\u65cf\u306e\u5973\u795e\u69d8\u3082\u304d\u3063\u3068\u3001\u5730\u5c5e\u6027\u306e\u9b54\u5c0e\u5e2b\u3060\u3063\u305f\u3093\u3058\u3083\u306a\u3044\u3067\u3057\u3087\u3046\u304b\u3002\u3067\u3059\u304c\u9b54\u6cd5\u3092\u4f7f\u3048\u308b\u4eba\u306f\u3001\u5f90\u3005\u306b\u305d\u306e\u6570\u3092\u6e1b\u3089\u3057\u3066\u3044\u3063\u305f\u3068\u4f1d\u627f\u306b\u306f\u3042\u308a\u307e\u3059\u3002\u7686\u3055\u3093\u306e\u4e00\u65cf\u306e\u4e2d\u3067\u3001\u5947\u8de1\u306e\u529b\u3092\u4f7f\u3048\u308b\u4eba\u304c\u9014\u7d76\u3048\u305f\u306e\u3082\u3001\u305d\u308c\u304c\u7406\u7531\u3060\u3068\u79c1\u306f\u8003\u3048\u3066\u3044\u307e\u3059", "\u3082\u3046\u6b62\u3081\u3066\u304f\u308c\uff01", "\u3067\u3059\u304c\u2026\u2026", "\u30a2\u30f3\u30bf\u304c\u5102\u3089\u306e\u4e3b\u306b\u306a\u308a\u305f\u304f\u306a\u3044\u306e\u306f\u5206\u304b\u3063\u305f\uff01\u3060\u304b\u3089\u3082\u3046\u3001\u3044\u3044\u3060\u308d\u3046!?\u305d\u3093\u306a\u8a71\u3092\u805e\u304b\u305b\u3066\u3001\u5102\u3089\u3092\u8cb6\u3081\u305f\u3044\u306e\u304b\u306d!?", "\u3061\u304c\u3063\u3001\u9055\u3046\uff01\u5927\u4f2f\u7236\u69d8\u3001\u9055\u3046\u308f\uff01", "\u30de\u30ea\u30fc\u69d8\u306f\u3001\u5947\u8de1\u306e\u529b\u3092\u5931\u3063\u305f\u306e\u306f\u79c1\u9054\u306e\u305b\u3044\u3067\u306f\u306a\u3044\u3063\u3066\u8a00\u3063\u3066\u308b\u306e\u3002\u3069\u3046\u3057\u3088\u3046\u3082\u306a\u3044\u4e8b\u3060\u3063\u305f\u3093\u3060\u3063\u3066\u3002\u79c1\u9054\u306e\u8cac\u4efb\u3067\u306f\u306a\u3044\u304b\u3089\u3001\u3082\u3046\u7e1b\u3089\u308c\u306a\u304f\u3066\u3044\u3044\u3063\u3066\u2026\u2026\u305d\u3046\u6559\u3048\u3066\u304f\u308c\u3066\u3044\u308b\u3093\u3067\u3059", "\u30ea\u30ea\u30fc\u2026\u2026\u304a\u524d", "\u5973\u795e\u69d8\u304c\u4eba\u9593\u3060\u3063\u3066\u3001\u5c0a\u656c\u3059\u308b\u6c17\u6301\u3061\u306f\u5909\u308f\u3089\u306a\u3044\u308f\u3002\u79c1\u9054\u4e00\u65cf\u306e\u8a87\u308a\u3060\u3063\u3066\u3001\u80f8\u3092\u5f35\u3063\u3066\u8a00\u3048\u308b\u3002\u5927\u4f2f\u7236\u69d8\u306f\u9055\u3046\u306e\uff1f", "\u2026\u2026\u2026\u2026\u305d\u308c\u306f", "\u7686\u3055\u3093\u306e\u304a\u5fc3\u3092\u4e71\u3059\u3088\u3046\u306a\u8a71\u3092\u3057\u3066\u3001\u3054\u3081\u3093\u306a\u3055\u3044", "\u3067\u3059\u304c\u3001\u601d\u3044\u51fa\u3057\u305f\u3089\u8a00\u308f\u305a\u306b\u306f\u3044\u3089\u308c\u306a\u304b\u3063\u305f", "\u2026\u2026\u4f55\u3092\u3067\u3059\uff1f", "\u79c1\u306f\u75c5\u306b\u82e6\u3057\u3080\u4eba\u9054\u3092\u52a9\u3051\u305f\u304f\u3066\u3001\u3053\u306e\u56fd\u306b\u6765\u307e\u3057\u305f", "\u79c1\u304c\u52a9\u3051\u3092\u6c42\u3081\u305f\u3044\u306e\u306f\u3001\u5947\u8de1\u306e\u529b\u3092\u6301\u3064\u304b\u3082\u3057\u308c\u306a\u3044\u4e00\u65cf\u3067\u306f\u306a\u304f\u3001\u8c4a\u5bcc\u306a\u77e5\u8b58\u3068\u78ba\u304b\u306a\u6280\u8853\u3092\u6301\u3064\u3001\u85ac\u5e2b\u306e\u7686\u3055\u3093\u306a\u3093\u3067\u3059", "\u4f55\u3082\u77e5\u3089\u306a\u3044\u90e8\u5916\u8005\u304c\u3001\u751f\u610f\u6c17\u3060\u3068\u601d\u308f\u308c\u308b\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u3002\u3067\u3059\u304c\u7686\u3055\u3093\u306f\u3001\u5973\u795e\u69d8\u304b\u3089\u6388\u304b\u3063\u305f\u6700\u3082\u91cd\u8981\u306a\u3082\u306e\u3092\u7acb\u6d3e\u306b\u53d7\u3051\u7d99\u3044\u3067\u3044\u308b\u3068\u79c1\u306f\u601d\u3044\u307e\u3059", "\u4eca\u3001\u96a3\u56fd\u306e\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u3067\u75c5\u304c\u5e83\u304c\u308a\u3064\u3064\u3042\u308a\u307e\u3059\u3002\u79c1\u306f\u305d\u308c\u3092\u3001\u306a\u3093\u3068\u3057\u3066\u3082\u98df\u3044\u6b62\u3081\u305f\u3044\u3002\u305d\u306e\u305f\u3081\u306b\u306f\u3001\u8cb4\u65b9\u9054\u306e\u529b\u304c\u3069\u3046\u3057\u3066\u3082\u5fc5\u8981\u306a\u3093\u3067\u3059", "\u304a\u9858\u3044\u3057\u307e\u3059\u3002\u3069\u3046\u304b\u79c1\u306b\u529b\u3092\u8cb8\u3057\u3066\u304f\u3060\u3055\u3044"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/113/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u6c7a\u65ad\u3002(4)", "discourse": ["\u30af\u30fc\u30a2\u65cf\u306f\u5909\u308f\u308b\u3079\u304d\u3060\u3002\u7d42\u7109\u3092\u76ee\u524d\u306b\u3057\u305f\u4eca\u3001\u738b\u5973\u6bbf\u4e0b\u304c\u73fe\u308c\u305f\u4e8b\u3082\u904b\u547d\u3060\u3068\u3001\u79c1\u306f\u305d\u3046\u601d\u3063\u3066\u3044\u308b", "\u738b\u5973\u6bbf\u4e0b\u3001\u3053\u3053\u306b\u3044\u3089\u3057\u3066\u9802\u3051\u307e\u3059\u304b", "\u65cf\u9577\uff01\u307e\u3055\u304b\u3001\u30f4\u30a9\u30eb\u30d5\u574a\u3063\u3061\u3083\u3093\u306e\u8a00\u3046\u901a\u308a\u306b\u306a\u3055\u308d\u3046\u3068\u3057\u3066\u3044\u308b\u3093\u3058\u3083\u3042\u308a\u307e\u305b\u3093\u3088\u306d!?", "\u30f4\u30a9\u30eb\u30d5\u69d8\u306e\u3001\u3063\u3066\u2026\u2026\u738b\u5973\u69d8\u3092\u30af\u30fc\u30a2\u65cf\u306e\u4e3b\u306b\u8fce\u3048\u308b\u3063\u3066\u30a2\u30ec\u304b\uff1f", "\u77ed\u3044\u9593\u3060\u304c\u3001\u6bbf\u4e0b\u3068\u5171\u306b\u66ae\u3089\u3057\u3066\u307f\u3066\u7686\u306f\u3069\u3046\u601d\u3063\u305f\uff1f", "\u3069\u3046\u3063\u3066\u2026\u2026\u305d\u308a\u3083\u3042\u3001\u3068\u3066\u3082\u826f\u3044\u65b9\u3060\u3068\u306f\u601d\u3044\u307e\u3059\u304c", "\u8cb4\u65cf\u3069\u3053\u308d\u304b\u5546\u4eba\u306e\u5a18\u3088\u308a\u6c17\u3055\u304f\u3067\u3001\u512a\u3057\u3044\u304a\u5b22\u3055\u3093\u3067\u3059\u3088\u3002\u3067\u3082\u3001\u305d\u308c\u3068\u3053\u308c\u3068\u306f\u8a71\u304c\u5225\u3067\u3059", "\u305d\u308c\u3060\u3051\u304b\uff1f", "\u738b\u5973\u69d8\u306f\u3001\u3068\u3066\u3082\u77e5\u8b58\u304c\u8c4a\u5bcc\u306a\u65b9\u3067\u3059\u3002\u898b\u305f\u3053\u3068\u3082\u306a\u3044\u304a\u6599\u7406\u3092\u4f5c\u3089\u308c\u3066\u3001\u3057\u304b\u3082\u51c4\u304f\u7f8e\u5473\u3057\u3044\u3093\u3067\u3059\u3088", "\u3042\u3042\u3001\u304a\u88fe\u5206\u3051\u3057\u3066\u8cb0\u3063\u305f\u6599\u7406\u306a\u3002\u306a\u3093\u3060\u3063\u3051\u3002\u304b\u3089\u3044\u3001\u3060\u3063\u305f\u304b\uff1f\u3042\u308c\u51c4\u304f\u7f8e\u5473\u304b\u3063\u305f\u306a", "\u30ab\u30ec\u30fc\u3060\u3088", "\u305d\u308c\u306b\u85ac\u8349\u306b\u3082\u8a73\u3057\u3044\u305e\u3002\u6559\u3048\u306a\u304f\u3066\u3082\u3001\u3069\u306e\u85ac\u8349\u306b\u306f\u3069\u306e\u4f4d\u306e\u983b\u5ea6\u306e\u6c34\u3084\u308a\u304c\u5fc5\u8981\u304b\u5206\u304b\u3063\u3066\u3044\u305f\u3057", "\u3042\u3042\u3002\u85ac\u8349\u306e\u77e5\u8b58\u306f\u4e0b\u624b\u3057\u305f\u3089\u3001\u305d\u306e\u8fba\u306e\u5c0f\u3055\u306a\u6751\u306b\u3044\u308b\u85ac\u5e2b\u3088\u308a\u8a73\u3057\u3044\u3093\u3058\u3083\u306a\u3044\u304b\uff1f", "\u7a81\u7136\u3084\u3063\u3066\u304d\u305f\u7570\u56fd\u306e\u738b\u5973\u6bbf\u4e0b\u304c\u3001\u9a55\u3063\u305f\u3068\u3053\u308d\u306e\u306a\u3044\u5fc3\u512a\u3057\u3044\u65b9\u3060\u3068\u3044\u3046\u3060\u3051\u3067\u3082\u73cd\u3057\u3044\u3068\u3044\u3046\u306e\u306b\u3002\u3057\u304b\u3082\u535a\u5b66\u3067\u85ac\u5b66\u306b\u3082\u7cbe\u901a\u3057\u3066\u3044\u308b\u3002\u3053\u308c\u3092\u5076\u7136\u306e\u4e00\u8a00\u3067\u7247\u4ed8\u3051\u3066\u3044\u3044\u3082\u306e\u3060\u308d\u3046\u304b", "\u4e16\u754c\u306b\u306f\u6ca2\u5c71\u306e\u56fd\u304c\u3042\u308a\u3001\u4eba\u304c\u3044\u308b\u3002\u6c11\u306e\u8a00\u8449\u306b\u8033\u3092\u50be\u3051\u306a\u3044\u738b\u304c\u3044\u308b\u3002\u6c11\u306e\u66ae\u3089\u3057\u306a\u3069\u9867\u307f\u305a\u3001\u8d05\u306e\u9650\u308a\u3092\u5c3d\u304f\u3059\u8cb4\u65cf\u304c\u3044\u308b\u3002\u79c1\u8179\u3092\u80a5\u3084\u3059\u4e8b\u3060\u3051\u306b\u5fc5\u6b7b\u306a\u5f79\u4eba\u3001\u305d\u3057\u3066\u305d\u308c\u3089\u306b\u64e6\u308a\u5bc4\u308b\u5546\u4eba\u9054\u3002\u50b2\u6162\u3067\u7121\u6148\u60b2\u306a\u4eba\u9593\u304c\u4e16\u754c\u306b\u306f\u6ea2\u308c\u3066\u3044\u308b\u3002\u305d\u306e\u4e2d\u3067\u79c1\u9054\u306f\u738b\u5973\u6bbf\u4e0b\u3068\u3044\u3046\u7a00\u6709\u306a\u65b9\u306b\u5de1\u308a\u4f1a\u3048\u305f", "\u3053\u306e\u51fa\u4f1a\u3044\u306f\u5973\u795e\u306e\u5c0e\u304d\u3067\u306f\u306a\u3044\u304b\u3068\u3001\u79c1\u306f\u601d\u3063\u3066\u3044\u308b\u3002\u6216\u3044\u306f\u3001\u8870\u9000\u3059\u308b\u6211\u3089\u306b\u9f4e\u3055\u308c\u305f\u6551\u3044\u3060\u3068\u3082", "\u738b\u5973\u69d8\u304c\u3001\u795e\u306e\u5fa1\u4f7f\u3044\u2026\u2026\uff1f", "\u305d\u3093\u306a\u99ac\u9e7f\u306a\u8a71\u304c\u3042\u308b\u304b\uff01\u3042\u306e\u4eba\u306f\u4ed6\u56fd\u306e\u738b\u65cf\u3060\u308d\u3046\u3002\u5973\u795e\u306e\u4f7f\u3044\u3067\u3042\u308b\u306f\u305a\u304c\u306a\u3044", "\u3067\u3082\u3001\u78ba\u304b\u306b\u4e0d\u601d\u8b70\u306a\u4eba\u3067\u3059\u3088\u306d\u3002\u738b\u5973\u69d8\u3068\u306f\u601d\u3048\u306a\u3044\u307b\u3069\u3001\u8272\u3093\u306a\u4e8b\u3092\u77e5\u3063\u3066\u308b\u308f", "\u79c1\u306f\u795e\u306e\u4f7f\u3044\u306a\u3069\u3067\u306f\u3042\u308a\u307e\u305b\u3093\uff01\u305d\u3093\u306a\u7acb\u6d3e\u306a\u5b58\u5728\u3058\u3083\u306a\u3044\u3067\u3059", "\u3067\u3059\u304c\u6bbf\u4e0b\u3002\u606f\u5b50\u306b\u805e\u3044\u305f\u3068\u3053\u308d\u306b\u3088\u308b\u3068\u3001\u8cb4\u65b9\u306f\u8239\u4e57\u308a\u305f\u3061\u306b\u5e83\u307e\u308a\u304b\u3051\u3066\u3044\u305f\u75c5\u3092\u9632\u3044\u3067\u307f\u305b\u305f\u3068\u304b", "\u300e\u6d77\u306e\u3057\u305a\u304f\u300f\u306b\u7e8f\u308f\u308b\u8a71\u306f\u3001\u9060\u304f\u96e2\u308c\u305f\u6211\u304c\u56fd\u306b\u307e\u3067\u5c4a\u3044\u3066\u3044\u307e\u3059\u3088", "\u300e\u6d77\u306e\u3057\u305a\u304f\u300f\u3063\u3066\u3001\u8ab0\u304b\u304c\u6e2f\u753a\u304b\u3089\u6301\u3061\u5e30\u3063\u305f\u3084\u3064\u3088\u306d\uff1f\u5e72\u3057\u3066\u306a\u3044\u306e\u306b\u9577\u671f\u306e\u4fdd\u5b58\u304c\u53ef\u80fd\u3063\u3066\u3060\u3051\u3067\u3082\u9a5a\u304d\u3060\u3063\u305f\u308f", "\u3042\u308c\u3001\u304a\u5b22\u3055\u3093\u304c\u4f5c\u3063\u305f\u306e\u304b!?", "\u602a\u6211\u306e\u624b\u5f53\u3066\u3084\u3001\u6025\u75c5\u306e\u51e6\u7f6e\u3082\u51fa\u6765\u308b\u3068\u805e\u304d\u307e\u3057\u305f", "\u306f\u3063\uff1f", "\u738b\u5973\u69d8\u304c\u3001\u602a\u6211\u306e\u624b\u5f53\u3066\uff1f\u666e\u901a\u306e\u3054\u4ee4\u5b22\u306f\u8840\u3092\u898b\u305f\u3060\u3051\u3067\u5012\u308c\u308b\u3063\u3066\u306e\u306b\uff1f", "\u6025\u75c5\u306e\u51e6\u7f6e\u306a\u3093\u3066\u3001\u82e5\u3044\u533b\u8005\u3060\u3063\u3066\u307e\u3054\u3064\u304f\u305e\uff1f\u51c4\u3044\u306a", "\u8cb4\u65b9\u306e\u77e5\u8b58\u91cf\u3082\u6280\u8853\u3082\u3001\u5e74\u9f62\u3084\u5883\u9047\u306b\u305d\u3050\u308f\u306a\u3044\u3002\u79c1\u306b\u306f\u3001\u8cb4\u65b9\u306e\u5b58\u5728\u305d\u306e\u3082\u306e\u304c\u5947\u8de1\u3060\u3068\u3059\u3089\u611f\u3058\u3066\u304a\u308a\u307e\u3059", "\u2026\u2026\u2026\u2026", "\u738b\u5973\u6bbf\u4e0b\u3002\u8cb4\u65b9\u306f\u3082\u3057\u3084\u3001\u5973\u795e\u306e\u751f\u307e\u308c\u5909\u308f\u308a\u306a\u306e\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304b\uff1f", "\u2026\u2026\u2026\u2026\u3063"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/112/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u6c7a\u65ad\u3002(3)", "discourse": ["\u65cf\u9577\u3001\u3053\u3093\u306a\u671d\u304b\u3089\u4e00\u4f53\u2026\u2026", "\u304a\u306f\u3088\u3046", "\u30af\u30bd\u89aa\u7236\u2026\u2026", "\u671d\u304b\u3089\u547c\u3073\u51fa\u3057\u3066\u3057\u307e\u3063\u3066\u7533\u3057\u8a33\u306a\u3044\u3002\u5973\u9054\u306f\u4e00\u756a\u5fd9\u3057\u3044\u6642\u9593\u3060\u3063\u305f\u3060\u308d\u3046\u3002\u8a71\u304c\u7d42\u308f\u3063\u305f\u3089\u3001\u3050\u3046\u305f\u3089\u3068\u5ea7\u3063\u3066\u3044\u308b\u3060\u3051\u306e\u65e6\u90a3\u306e\u5c3b\u3092\u8e74\u3063\u3066\u3001\u5b58\u5206\u306b\u4f7f\u3063\u3066\u3084\u3063\u3066\u304f\u308c\u3002\u79c1\u304c\u8a31\u53ef\u3092\u3057\u3088\u3046", "\u8001\u4eba\u306e\u9577\u8a71\u306f\u5acc\u308f\u308c\u308b\u3060\u308d\u3046\u304c\u3001\u624b\u77ed\u306b\u6e08\u307e\u305b\u3089\u308c\u308b\u3082\u306e\u3067\u306f\u306a\u3044\u306e\u3067\u306a\u3002\u5c11\u3057\u3070\u304b\u308a\u6642\u9593\u3092\u5272\u3044\u3066\u6b32\u3057\u3044", "\u6211\u3089\u30af\u30fc\u30a2\u65cf\u306e\u8d77\u6e90\u306f\u7d04\u516d\u767e\u5e74\u524d\u3002\u4e00\u4eba\u306e\u5973\u6027\u304b\u3089\u59cb\u307e\u3063\u305f\u3068\u3055\u308c\u3066\u3044\u308b\u3002\u305d\u306e\u5fa1\u65b9\u306f\u85ac\u5b66\u306b\u9020\u8a63\u304c\u6df1\u3044\u3060\u3051\u3067\u306a\u304f\u3001\u8349\u6728\u3092\u4e00\u77ac\u3067\u6210\u9577\u3055\u305b\u3001\u4e00\u64ab\u3067\u3067\u602a\u6211\u3084\u75c5\u6c17\u3092\u6cbb\u3059\u7a00\u6709\u306a\u529b\u3092\u6301\u3063\u3066\u3044\u305f", "\u6211\u304c\u4e00\u65cf\u306f\u3001\u304b\u306e\u5fa1\u65b9\u306e\u8840\u3092\u53d7\u3051\u7d99\u304e\u3001\u305a\u3063\u3068\u5b88\u308a\u7d9a\u3051\u3066\u304d\u305f\u3002\u3060\u304c\u5947\u8de1\u306e\u529b\u306f\u3060\u3093\u3060\u3093\u3068\u5931\u308f\u308c\u3001\u767e\u5e74\u4ee5\u4e0a\u3082\u524d\u306b\u9014\u7d76\u3048\u305f\u3002\u3082\u3046\u53d7\u3051\u7d99\u3050\u8005\u306f\u4e00\u4eba\u3082\u3044\u306a\u3044", "\u79c1\u9054\u306f\u3001\u3044\u3063\u305f\u3044\u4f55\u306e\u305f\u3081\u306b\u8840\u3092\u5b88\u308a\u7d9a\u3051\u3066\u3044\u308b\u306e\u3060\u308d\u3046\u304b", "\u65cf\u9577\uff01", "\u3082\u3046\u76ee\u3092\u9038\u3089\u3057\u3066\u3044\u3089\u308c\u308b\u6642\u671f\u306f\u3001\u75be\u3046\u306b\u904e\u304e\u305f\u3002\u79c1\u9054\u306f\u5909\u5316\u3092\u53ad\u3044\u3001\u6163\u7fd2\u306b\u7e1b\u3089\u308c\u7d9a\u3051\u305f\u7d50\u679c\u3001\u591a\u304f\u306e\u5927\u5207\u306a\u3082\u306e\u3092\u5931\u3063\u305f", "\u2026\u2026\u3063\u3001", "\u6700\u76db\u671f\u306b\u306f\u5343\u4eba\u3092\u8d85\u3057\u305f\u3068\u8a00\u308f\u308c\u3066\u3044\u308b\u6211\u3089\u4e00\u65cf\u306f\u3001\u3082\u3046\u4e8c\u767e\u4eba\u3082\u3044\u306a\u3044\u3002\u3057\u304b\u3082\u79c1\u3092\u59cb\u3081\u3068\u3057\u305f\u8001\u4eba\u304c\u591a\u304f\u3092\u5360\u3081\u3001\u5b50\u4f9b\u306e\u6570\u306f\u5e74\u3005\u6e1b\u308b\u3070\u304b\u308a\u3002\u3082\u306f\u3084\u3001\u6ec5\u3073\u306f\u76ee\u524d\u3060", "\u307e\u3060\u6ec5\u3073\u308b\u3068\u6c7a\u307e\u3063\u305f\u8a33\u3067\u306f\u306a\u3044\uff01\u30a2\u30f3\u30bf\u304c\u305d\u3093\u306a\u4e8b\u3092\u8a00\u3063\u305f\u3089\u3001\u82e5\u3044\u9023\u4e2d\u304c\u4e0d\u5b89\u306b\u306a\u308b\u3060\u308d\u3046\uff01", "\u304a\u6b62\u3081\u306a\u3055\u3044\u306a\u3001\u8cb4\u65b9\u3002\u65cf\u9577\u304c\u4f55\u3092\u8a00\u3044\u305f\u3044\u306e\u304b\u306f\u3001\u79c1\u3089\u5e74\u5bc4\u308a\u304c\u4e00\u756a\u5206\u304b\u3063\u3066\u3044\u308b\u306f\u305a\u3067\u3059\u3002\u2026\u2026\u79c1\u306f\u3001\u6ce3\u304d\u58f0\u3059\u3089\u3042\u3052\u305a\u306b\u65c5\u7acb\u3063\u3066\u3057\u307e\u3063\u305f\u3042\u306e\u5b50\u306e\u3053\u3068\u3092\u3001\u5fd8\u308c\u305f\u4e8b\u306f\u3042\u308a\u307e\u305b\u3093\u3088", "\u304a\u524d\u2026\u2026", "\u4e2d\u3005\u5b50\u5b9d\u306b\u6075\u307e\u308c\u306a\u304b\u3063\u305f\u79c1\u9054\u306e\u5143\u306b\u304d\u3066\u304f\u308c\u305f\u3001\u53ef\u611b\u3044\u5b50\u3002\u76ee\u5143\u304c\u8cb4\u65b9\u305d\u3063\u304f\u308a\u3067\u3001\u8033\u306e\u5f62\u306f\u79c1\u306b\u4f3c\u3066\u3044\u305f\u7537\u306e\u5b50\u3060\u3063\u305f\u308f\u3002\u4e08\u592b\u306b\u751f\u3093\u3067\u3042\u3052\u3089\u308c\u305f\u3089\u3001\u4eca\u3082\u96a3\u3067\u7b11\u3063\u3066\u3044\u3066\u304f\u308c\u305f\u3093\u3067\u3057\u3087\u3046\u304b\u306d\u2026\u2026", "\u65cf\u9577\u3001\u3082\u3057\u2026\u2026\u3082\u3057\u3082\u3001\u5b50\u4f9b\u9054\u304c\u6751\u306e\u5916\u306e\u4eba\u9054\u3068\u7d50\u5a5a\u3057\u305f\u3089\u3001\u4e08\u592b\u306a\u5b50\u304c\u751f\u307e\u308c\u307e\u3059\u304b\uff1f\u79c1\u9054\u306e\u3088\u3046\u306b\u3001\u5b50\u306e\u846c\u5f0f\u306a\u3069\u305b\u305a\u306b\u6e08\u3080\u306e\u3067\u3057\u3087\u3046\u304b\uff1f", "\u5206\u304b\u3089\u306a\u3044", "\u6211\u304c\u4e00\u65cf\u306b\u5b50\u304c\u751f\u307e\u308c\u96e3\u304f\u306a\u3063\u305f\u306e\u3082\u3001\u4f53\u304c\u5f31\u304f\u3001\u5e7c\u304f\u3057\u3066\u4ea1\u304f\u306a\u308b\u5b50\u304c\u591a\u3044\u306e\u3082\u3001\u539f\u56e0\u306f\u5b9a\u304b\u3067\u306f\u306a\u3044\u3002\u5b50\u304c\u89aa\u306b\u4f3c\u308b\u3088\u3046\u306b\u3001\u75c5\u3082\u53d7\u3051\u7d99\u304c\u308c\u3066\u3057\u307e\u3063\u3066\u3044\u308b\u53ef\u80fd\u6027\u306f\u3042\u308b\u3002\u3060\u304c\u8a3c\u62e0\u306f\u306a\u3044\u3002\u6545\u306b\u3001\u5916\u90e8\u306e\u4eba\u9593\u3068\u306e\u9593\u306b\u51fa\u6765\u305f\u5b50\u304c\u4e08\u592b\u306a\u306e\u304b\u3069\u3046\u304b\u3082\u3001\u751f\u307e\u308c\u3066\u307f\u308b\u307e\u3067\u306f\u5206\u304b\u3089\u306a\u3044", "\u5206\u304b\u3089\u306a\u3044\u4e8b\u3060\u3089\u3051\u3067\u52d5\u304d\u3060\u3059\u306e\u306f\u4e0d\u5b89\u3060\u308d\u3046\u3002\u3060\u304c\u3001\u52d5\u304b\u306a\u3051\u308c\u3070\u6c38\u9060\u306b\u5206\u304b\u3089\u306a\u3044\u307e\u307e\u3060", "\u5b50\u4f9b\u9054\u306b\u3001\u6211\u3089\u306e\u30c4\u30b1\u3092\u6255\u308f\u305b\u3066\u306f\u306a\u3089\u306a\u3044\u3002\u610f\u5473\u3092\u5931\u3063\u305f\u6163\u7fd2\u3092\u62bc\u3057\u4ed8\u3051\u3066\u3001\u72ed\u3044\u7bb1\u5ead\u306b\u56f2\u3044\u3001\u305f\u3060\u5893\u7a74\u3092\u6398\u308b\u672a\u6765\u3092\u80cc\u8ca0\u308f\u305b\u3066\u306a\u3093\u306b\u306a\u308b\u3002\u5b50\u4f9b\u9054\u306e\u672a\u6765\u306f\u3001\u5b50\u4f9b\u9054\u304c\u9078\u3076\u3079\u304d\u3060", "\u2026\u2026\u3042\u3042\u3001\u305d\u3063\u304b"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/111/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u6c7a\u65ad\u3002(2)", "discourse": ["\u2026\u2026\u8272\u3005\u3068\u304a\u805e\u304d\u3057\u305f\u3044\u4e8b\u306f\u3042\u308a\u307e\u3059\u304c\u3001\u307e\u305a\u306f\u982d\u3092\u4e0a\u3052\u3066\u4e0b\u3055\u3044", "\u75c5\u4eba\u304c\u3044\u308b\u306e\u306a\u3089\u85ac\u3092\u58f2\u308b\u306e\u306f\u5f53\u7136\u3067\u3059\u3002\u8cb4\u65b9\u304c\u4ef0\u3063\u3066\u3044\u308b\u4e8b\u304c\u771f\u5b9f\u306a\u3089\u3070\u3001\u79c1\u304c\u6e0b\u308b\u7406\u7531\u306f\u3054\u3056\u3044\u307e\u305b\u3093", "\u2026\u2026\u8a3c\u62e0\u306f\u3042\u308a\u307e\u305b\u3093", "\u76ee\u306b\u898b\u3048\u308b\u8a3c\u62e0\u3092\u51fa\u305b\u306a\u3069\u3068\u3044\u3046\u7121\u8336\u306f\u8a00\u3044\u307e\u305b\u3093\u3002\u73fe\u5728\u5206\u304b\u3063\u3066\u3044\u308b\u3053\u3068\u3060\u3051\u3067\u3082\u3001\u6559\u3048\u3066\u4e0b\u3055\u3044\u3002\u5f8c\u306f\u3053\u3061\u3089\u3067\u5224\u65ad\u81f4\u3057\u307e\u3059", "\u75c7\u72b6\u306b\u5fc3\u5f53\u305f\u308a\u304c\u3042\u308a\u307e\u3059\u3002\u5b9f\u969b\u306b\u60a3\u8005\u3092\u898b\u3066\u307f\u308b\u307e\u3067\u306f\u65ad\u8a00\u306f\u51fa\u6765\u307e\u305b\u3093\u304c\u3001\u3082\u3057\u304b\u3057\u305f\u3089\u3001\u304a\u529b\u306b\u306a\u308c\u308b\u304b\u3082\u3057\u308c\u307e\u305b\u3093", "\u3067\u306f\u3001", "\u3060\u304c\u3001\u305d\u306e\u524d\u306b\u4e00\u3064\u78ba\u8a8d\u3057\u305f\u3044\u4e8b\u304c\u3054\u3056\u3044\u307e\u3059\u3002\u306a\u305c\u8cb4\u65b9\u306f\u3001\u3053\u306e\u56fd\u306b\u3044\u3089\u3057\u305f\u306e\u3067\u3059\u304b\uff1f\u304a\u5fcd\u3073\u3067\u89b3\u5149\u3001\u3068\u3044\u3063\u305f\u69d8\u5b50\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304c", "\u2026\u2026\u3048\u3063", "\u30de\u30ea\u30fc\u3002\u8cb4\u65b9\u3001\u71b1\u75c5\u306e\u85ac\u3092\u63a2\u3057\u306b\u6765\u305f\u3063\u3066\u3001\u4ee5\u524d\u8a00\u3063\u3066\u3044\u305f\u308f\u3088\u306d", "\u2026\u2026\u306f\u3044", "\u52d8\u9055\u3044\u3055\u308c\u3066\u3044\u308b\u3088\u3046\u3067\u3059\u304c\u3001\u79c1\u306f\u8cb4\u65b9\u304c\u5618\u3092\u5410\u3044\u3066\u3044\u308b\u3068\u306f\u601d\u3063\u3066\u3044\u307e\u305b\u3093", "\u305d\u3046\u306d\u3002\u30de\u30ea\u30fc\u306f\u305d\u3093\u306a\u60aa\u8cea\u306a\u5618\u3092\u5410\u3051\u308b\u5b50\u3058\u3083\u306a\u3044\u308f", "\u305d\u308c\u306b\u30a2\u30f3\u30bf\u304c\u8a00\u3063\u305f\u75c5\u306e\u75c7\u72b6\u306f\u3001\u9069\u5f53\u306b\u601d\u3044\u3064\u304f\u3088\u3046\u306a\u30e2\u30f3\u3058\u3083\u306a\u3044\u3002\u6d41\u884c\u3063\u3066\u3044\u308b\u5834\u6240\u306b\u3082\u4fe1\u6191\u6027\u304c\u3042\u308b\u3057\u306d", "\u5834\u6240\uff1f", "\u30b0\u30ec\u30f3\u30c4\u30a7\u306e\u5357\u897f\u306b\u3042\u308b\u68ee\u306f\u3001\u4eca\u304b\u306a\u308a\u306e\u901f\u5ea6\u3067\u5207\u308a\u958b\u304b\u308c\u3066\u3044\u308b\u3067\u3057\u3087\u3046\u3002\u305d\u3046\u3044\u3046\u5834\u6240\u3067\u306f\u3001\u75c5\u304c\u6d41\u884c\u308a\u3084\u3059\u3044\u306e\u3088\u3002\u6691\u3044\u5730\u57df\u306e\u68ee\u306e\u5965\u306b\u306f\u3001\u85ac\u5e2b\u3082\u77e5\u3089\u306a\u3044\u75c5\u304c\u6ca2\u5c71\u6f5c\u3093\u3067\u3044\u308b\u306e", "\u305d\u306e\u70b9\u3092\u8e0f\u307e\u3048\u3066\u3082\u3001\u30a2\u30f3\u30bf\u306e\u8a71\u306b\u304a\u304b\u3057\u306a\u90e8\u5206\u306f\u306a\u3044\u3002\u305f\u3060\u2026\u2026\u8a71\u304c\u4e0a\u624b\u304f\u904b\u3073\u3059\u304e\u3066\u3044\u308b\u3060\u3051\u3002\u307e\u308b\u3067\u3001\u672a\u6765\u3092\u898b\u3066\u304d\u305f\u307f\u305f\u3044\u306b\u306d", "\u2026\u2026", "\u738b\u5973\u6bbf\u4e0b\u3001\u8cb4\u65b9\u306f\u4e0d\u601d\u8b70\u306a\u529b\u3092\u304a\u6301\u3061\u306a\u306e\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u304b\uff1f", "\u3044\u3044\u3048\u3001\u305f\u3060\u306e\u5076\u7136\u3067\u3059\u3002\u79c1\u306f\u738b\u5973\u3068\u3044\u3046\u8eab\u5206\u3092\u53d6\u308a\u6255\u3063\u3066\u3057\u307e\u3048\u3070\u7279\u7b46\u3059\u3079\u304d\u70b9\u3082\u306a\u3044\u51e1\u5eb8\u306a\u4eba\u9593\u3067\u3059", "\u8b19\u905c\u3082\u904e\u304e\u308c\u3070\u5acc\u5473\u306b\u306a\u308a\u307e\u3059\u3088\u3002\u606f\u5b50\u304b\u3089\u3001\u8cb4\u65b9\u306f\u300e\u6d77\u306e\u96eb\u300f\u306e\u767a\u6848\u8005\u3060\u3068\u805e\u304d\u307e\u3057\u305f\u3002\u8239\u4e0a\u3067\u306e\u75c5\u4eba\u306e\u51e6\u7f6e\u3082\u3001\u7d20\u6674\u3089\u3057\u3044\u3082\u306e\u3060\u3063\u305f\u3068", "\u307e\u3055\u306b\u3001\u300e\u5973\u795e\u300f\u306e\u540d\u306b\u76f8\u5fdc\u3057\u3044", "\u2026\u2026\u2026\u2026\uff1f", "\u307e\u3055\u304b\u3001\u3053\u306e\u5b50\u3092\u5229\u7528\u3057\u3066\u7686\u3092\u9a19\u3059\u6c17\uff1f", "\u4f59\u6240\u8005\u306e\u738b\u5973\u69d8\u306b\u306f\u5f93\u3048\u306a\u304f\u3068\u3082\u5973\u795e\u306b\u306a\u3089\u5f93\u3046\u3060\u308d\u3046\u3063\u3066\u3001\u305d\u3046\u3044\u3046\u8179\u306a\u306e!?", "\u305d\u3046\u3060", "\u305d\u3093\u306a\u306e\u3001\u8ab0\u3082\u5e78\u305b\u306b\u306a\u308c\u306a\u3044\u3058\u3083\u306a\u3044\u2026\u2026\u3063", "\u306a\u3089\u3070\u3001\u304a\u524d\u306b\u7b56\u306f\u3042\u308b\u306e\u304b\uff1f", "\u3063\u3001\u2026\u2026", "\u738b\u5973\u6bbf\u4e0b\u306f\u826f\u3044\u65b9\u3060\u3002\u9ad8\u8cb4\u306a\u8eab\u5206\u306e\u5973\u6027\u3068\u306f\u601d\u3048\u306c\u307b\u3069\u3001\u6c17\u3055\u304f\u3067\u5fc3\u512a\u3057\u3044\u3002\u6642\u9593\u3092\u304b\u3051\u308c\u3070\u3001\u6211\u3089\u306e\u826f\u304d\u4e3b\u3068\u306a\u3063\u3066\u4e0b\u3055\u308b\u3060\u308d\u3046\u3002\u3060\u304c\u3001\u305d\u306e\u809d\u5fc3\u306a\u6642\u9593\u304c\u306a\u3044\u3002\u6211\u304c\u4e00\u65cf\u3082\u6b8b\u3055\u308c\u305f\u6642\u306f\u3001\u6c7a\u3057\u3066\u591a\u304f\u306f\u306a\u3044\u306e\u3060", "\u5206\u304b\u3063\u3066\u308b\u308f\u3088\uff01\u6642\u9593\u304c\u306a\u3044\u4e8b\u3082\u3001\u5f37\u884c\u7b56\u3067\u3082\u3068\u3089\u306a\u304d\u3083\u72b6\u6cc1\u3092\u6253\u7834\u51fa\u6765\u306a\u3044\u3053\u3068\u3082\u306d\uff01\u3060\u304b\u3089\u3063\u3066\u3053\u308c\u306f\u9055\u3046\u3067\u3057\u3087\u3046\u3002\u30af\u30fc\u30a2\u65cf\u306f\u504f\u5c48\u306a\u9811\u56fa\u8005\u304c\u591a\u3044\u3051\u308c\u3069\u3001\u5927\u6982\u306e\u3053\u3068\u306f\u6d41\u305b\u308b\u512a\u3057\u3055\u3082\u6301\u3063\u3066\u3044\u308b\u3002\u3067\u3082\u5973\u795e\u306f\u5225\u3088\u3002\u6211\u3089\u306e\u8a87\u308a\u3067\u3042\u308b\u5973\u795e\u306e\u540d\u3092\u5229\u7528\u3057\u3066\u9a19\u3057\u305f\u3068\u77e5\u308c\u305f\u3089\u3001\u7d76\u5bfe\u306b\u8a31\u3055\u306a\u3044\u308f\u3002\u53d6\u308a\u8fd4\u3057\u306e\u3064\u304b\u306a\u3044\u6e9d\u304c\u51fa\u6765\u308b\u3002\u3053\u306e\u5b50\u306b\u2026\u2026\u6211\u304c\u4e3b\u306b\u3001\u305d\u3093\u306a\u3082\u306e\u3092\u80cc\u8ca0\u308f\u305b\u308b\u3053\u3068\u3092\u3001\u8a31\u3059\u308f\u3051\u306b\u306f\u3044\u304b\u306a\u3044", "\u6211\u304c\u4e3b\u3001\u304b", "\u2026\u2026\u306a\u306b\u3088", "\u304a\u524d\u306f\u8179\u3092\u6c7a\u3081\u305f\u306e\u3060\u306a", "\u7236\u4e0a\u2026\u2026", "\u5fc3\u914d\u3059\u308b\u306a\u3002\u8cac\u4efb\u306f\u5168\u3066\u79c1\u304c\u53d6\u308b", "\u3048\uff1f", "\u738b\u5973\u6bbf\u4e0b\u3002\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093\u304c\u3001\u5c11\u3057\u3060\u3051\u8336\u756a\u306b\u304a\u4ed8\u304d\u5408\u3044\u4e0b\u3055\u3044", "\u3042\u306e\u3001\u305d\u308c\u306f\u3069\u3046\u3044\u3046\u2026\u2026\uff1f", "\u8cb4\u65b9\u306f\u3001\u5973\u795e\u306e\u30d5\u30ea\u3092\u3057\u3066\u4e0b\u3055\u308c\u3070\u3044\u3044\u3002\u8aac\u5f97\u529b\u3092\u6301\u305f\u305b\u308b\u305f\u3081\u306b\u3001\u4e0d\u601d\u8b70\u306a\u529b\u3092\u4f7f\u3048\u308b\u3068\u3044\u3046\u8a2d\u5b9a\u306b\u3057\u305f\u3044\u306e\u3067\u3059\u304c\u2026\u2026\u306a\u306b\u304b\u826f\u3044\u6848\u306f\u3054\u3056\u3044\u307e\u3059\u304b\u306a\uff1f", "\u3048\u3048\u3063\uff1f\u4e0d\u601d\u8b70\u306a\u529b\u3001\u3067\u3059\u304b\u2026\u2026\u898b\u305b\u304b\u3051\u3067\u3088\u3051\u308c\u3070\u3001\u306a\u3044\u4e8b\u3082\u306a\u3044\u3067\u3059\u304c", "\u305d\u308c\u306f\u91cd\u7573"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/110/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u6c7a\u65ad\u3002", "discourse": ["\u3054\u8db3\u52b4\u9802\u304d\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u6563\u3089\u304b\u3063\u3066\u3044\u3066\u7533\u3057\u8a33\u306a\u3044\u3002\u3069\u3046\u305e", "\u3082\u3046\u5c11\u3057\u7247\u4ed8\u3051\u3066\u304a\u304d\u306a\u3055\u3044\u3088\u3001\u30af\u30bd\u89aa\u7236\u3002\u53ef\u611b\u3044\u5973\u306e\u5b50\u3092\u62db\u3044\u3066\u3044\u3044\u90e8\u5c4b\u3058\u3083\u306a\u3044\u308f\u3001\u3053\u308c\u306f", "\u3053\u308c\u3067\u3082\u5c11\u3057\u306f\u7dba\u9e97\u306b\u3057\u305f\u3093\u3060", "\u52aa\u529b\u306e\u8de1\u304c\u5fae\u5875\u3082\u898b\u5f53\u305f\u3089\u306a\u3044\u308f\u306d", "\u6751\u3067\u306e\u751f\u6d3b\u306b\u306f\u6163\u308c\u307e\u3057\u305f\u304b\u306a\uff1f", "\u306f\u3044\u3002\u3042\u307e\u308a\u5668\u7528\u3067\u306f\u306a\u3044\u306e\u3067\u5931\u6557\u3082\u591a\u3044\u3067\u3059\u304c\u3001\u30ea\u30ea\u30fc\u3055\u3093\u306b\u624b\u52a9\u3051\u3057\u3066\u9802\u3044\u3066\u304a\u308a\u307e\u3059\u306e\u3067\u3001\u306a\u3093\u3068\u304b", "\u30ea\u30ea\u30fc\u306f\u826f\u3044\u5b50\u3067\u3057\u3087\u3046", "\u51c4\u304f", "\u3042\u306e\u5b50\u3082\u8cb4\u65b9\u306b\u61d0\u3044\u3066\u3044\u308b\u3088\u3046\u3060\u304b\u3089\u3001\u3053\u308c\u304b\u3089\u3082\u4ef2\u826f\u304f\u3057\u3066\u3084\u3063\u3066\u4e0b\u3055\u3044", "\u2026\u2026\u30af\u30bd\u89aa\u7236\u3002\u610f\u5730\u304c\u60aa\u3044\u308f\u3088", "\u3053\u306e\u5b50\u3092\u8a66\u3059\u306e\u306f\u6b62\u3081\u3066", "\u304a\u524d\u304c\u8a00\u3046\u306e\u304b", "\u2026\u2026\u306a\u306b\u3088\u3001\u305d\u308c", "\u304a\u524d\u306e\u3088\u3046\u306b\u637b\u304f\u308c\u305f\u7537\u304c\u3001\u7c21\u5358\u306b\u4eba\u3092\u4fe1\u3058\u308b\u3068\u306f\u601d\u3048\u3093\u3002\u4fe1\u983c\u51fa\u6765\u308b\u4eba\u7269\u304b\u3001\u4e3b\u306b\u76f8\u5fdc\u3057\u3044\u5668\u304b\u3002\u305d\u3046\u3084\u3063\u3066\u81ea\u5206\u52dd\u624b\u306b\u8a2d\u3051\u305f\u5408\u683c\u70b9\u306b\u5c4a\u304f\u304b\u3069\u3046\u304b\u3001\u305d\u306e\u65b9\u3092\u4f55\u5ea6\u3082\u8a66\u3057\u305f\u306f\u305a\u3060", "\u2026\u2026\u3068\u306f\u3044\u3048\u3001\u305d\u308c\u306f\u79c1\u306e\u7121\u4f5c\u6cd5\u304c\u8a31\u3055\u308c\u308b\u7406\u7531\u306b\u306f\u306a\u3089\u3093\u306a", "\u305d\u3093\u306a", "\u7121\u4f5c\u6cd5\u306f\u79c1\u3082\u540c\u3058\u2026\u2026\u3044\u3044\u3048\u3001\u3082\u3063\u3068\u9177\u3044\u3002\u79c1\u306f\u8cb4\u65b9\u304c\u305f\u306b\u3001\u3082\u3063\u3068\u9177\u3044\u3053\u3068\u3092\u3057\u3088\u3046\u3068\u3057\u3066\u3044\u307e\u3059", "\u9177\u3044\uff1f", "\u79c1\u306f\u3001\u30af\u30fc\u30a2\u65cf\u306e\u4e3b\u306b\u306f\u306a\u308c\u307e\u305b\u3093", "\u8cb4\u65b9\u304c\u305f\u306e\u9818\u57df\u306b\u571f\u8db3\u3067\u8e0f\u307f\u5165\u308a\u3001\u597d\u304d\u52dd\u624b\u306b\u304b\u304d\u56de\u3057\u305f\u6319\u53e5\u306b\u3001\u7acb\u3061\u53bb\u308b\u3053\u3068\u3057\u304b\u51fa\u6765\u306a\u3044\u3002\u8a31\u3057\u3066\u4e0b\u3055\u3044\u3068\u306f\u53e3\u304c\u88c2\u3051\u3066\u3082\u8a00\u3048\u306a\u3044\u66b4\u6319\u3067\u3059\u3002\u3067\u3059\u304c\u3001\u3082\u3046\u79c1\u306f\u3053\u3053\u306b\u306f\u7559\u307e\u308c\u307e\u305b\u3093", "\u2026\u2026\u2026\u2026\u7406\u7531\u3092\u304a\u805e\u304d\u3057\u3066\u3082\uff1f", "\u7406\u7531\u3068\u3044\u3046\u306e\u306f\u3001\u300e\u30af\u30fc\u30a2\u65cf\u306e\u4e3b\u306b\u306a\u308c\u306a\u3044\u4e8b\u300f\u3067\u3057\u3087\u3046\u304b\u3002\u305d\u308c\u3068\u3082\u3001\u300e\u3053\u3053\u306b\u7559\u307e\u308c\u306a\u3044\u4e8b\u300f\u306e\u65b9\u3067\u3059\u304b", "\u3069\u3061\u3089\u3082\u3067\u3059\u304c\u3001\u307e\u305a\u306f\u524d\u8005\u306e\u65b9\u3092\u3002\u79c1\u304c\u8a00\u3046\u306e\u3082\u304a\u304b\u3057\u306a\u8a71\u3067\u3059\u304c\u3001\u6211\u304c\u4e00\u65cf\u306f\u305d\u308c\u306a\u308a\u306b\u512a\u79c0\u306a\u4eba\u6750\u304c\u63c3\u3063\u3066\u304a\u308a\u307e\u3059\u3002\u6211\u3089\u3092\u914d\u4e0b\u306b\u51fa\u6765\u308b\u306a\u3089\u3070\u3001\u5e7e\u3089\u3067\u3082\u91d1\u8ca8\u3092\u7a4d\u307f\u4e0a\u3052\u3088\u3046\u3068\u3044\u3046\u738b\u4faf\u8cb4\u65cf\u306f\u3001\u5c11\u306a\u304f\u306a\u3044\u3002\u3060\u304c\u8cb4\u65b9\u306b\u3068\u3063\u3066\u6211\u3005\u306f\u3001\u305d\u308c\u7a0b\u306e\u4fa1\u5024\u304c\u306a\u3044\u3068\u3044\u3046\u4e8b\u3067\u3057\u3087\u3046\u304b\uff1f", "\u3044\u3044\u3048\u3002\u91d1\u8ca8\u3092\u9ad8\u304f\u7a4d\u307f\u4e0a\u3052\u3066\u3082\u5f97\u3089\u308c\u306a\u3044\u4fa1\u5024\u304c\u3042\u308b\u3068\u601d\u3063\u3066\u304a\u308a\u307e\u3059", "\u79c1\u306f\u3001\u30af\u30fc\u30a2\u65cf\u306e\u4e3b\u306b\u300e\u306a\u308a\u305f\u304f\u306a\u3044\u300f\u306e\u3067\u306f\u306a\u304f\u3001\u300e\u306a\u308c\u306a\u3044\u300f\u306e\u3067\u3059", "\u8cb4\u65b9\u304c\u305f\u3092\u6b32\u3057\u3044\u3068\u9858\u3046\u306a\u3089\u3001\u91d1\u8ca8\u3082\u5b9d\u77f3\u3082\u7121\u610f\u5473\u3067\u3057\u3087\u3046\u3002\u5fc5\u8981\u306a\u306e\u306f\u8aa0\u610f\u3068\u7406\u89e3\u3068\u4fe1\u983c\u95a2\u4fc2\u3092\u7bc9\u304f\u305f\u3081\u306e\u9577\u3044\u6642\u9593\u3067\u3059\u3002\u3067\u3059\u304c\u79c1\u306f\u3082\u3046\u3001\u4e00\u65e5\u3060\u3063\u3066\u8cb4\u65b9\u304c\u305f\u306e\u305f\u3081\u306b\u5dee\u3057\u51fa\u305b\u306a\u3044", "\u2026\u2026\u305d\u308c\u306f\u3001\u7559\u307e\u308c\u306a\u3044\u7406\u7531\u3068\u3084\u3089\u304c\u95a2\u4fc2\u3057\u3066\u3044\u308b\u306e\u3067\u3059\u304b\u306a\uff1f", "\u306f\u3044", "\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u5357\u897f\u90e8\u3067\u3001\u75c5\u306e\u6d41\u884c\u304c\u78ba\u8a8d\u3055\u308c\u307e\u3057\u305f\u3002\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u5168\u571f\u306b\u5e83\u304c\u308b\u524d\u306b\u3001\u98df\u3044\u6b62\u3081\u306a\u3051\u308c\u3070\u306a\u308a\u307e\u305b\u3093", "\u75c5\u2026\u2026\uff1f", "\u56f3\u3005\u3057\u3044\u9858\u3044\u3060\u3068\u627f\u77e5\u3057\u3066\u304a\u308a\u307e\u3059\u3002\u3067\u3059\u304c\u3069\u3046\u304b\u3001\u85ac\u3092\u58f2\u3063\u3066\u4e0b\u3055\u3044"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/109/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u9021\u5de1\u3002(3)", "discourse": ["\u305d\u3046\u3044\u3048\u3070\u2026\u2026", "\u75db\u3063", "\u2026\u2026\u2026\u2026", "\u306f\u3044\u3001\u2026\u2026\u3048\uff1f", "\u4e45\u3057\u3076\u308a\u3002\u5143\u6c17\u3060\u3063\u305f\uff1f", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093\uff01", "\u5909\u306a\u6c17\u3092\u9063\u3046\u3093\u3058\u3083\u306a\u3044\u308f\u3088", "\u2026\u2026\u306f\u3044", "\u3042\u308b\u4eba\u304c\u30a2\u30f3\u30bf\u3092\u547c\u3093\u3067\u308b\u308f\u3002\u4e00\u7dd2\u306b\u6765\u3066\u304f\u308c\u308b\u304b\u3057\u3089\uff1f", "\u5206\u304b\u308a\u307e\u3057\u305f", "\u65cf\u9577\u3055\u3093\u304c\u547c\u3093\u3067\u3044\u308b\u3093\u3067\u3059\u306d\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/108/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u9021\u5de1\u3002(2)", "discourse": ["\u3053\u306e\u304f\u3089\u3044\u3067\u5b9c\u3057\u3044\u3067\u3059\u304b\uff1f", "\u3046\u3093\u3001\u826f\u3044\u611f\u3058\u3002\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u6b21\u306f\uff1f", "\u3053\u308c\u3092\u5165\u308c\u3066\u3001\u307e\u305f\u7092\u3081\u3066\u4e0b\u3055\u3044", "\u30af\u30df\u30f3\u3068\u30b3\u30ea\u30a2\u30f3\u30c0\u30fc\u3092\u591a\u3081\u306b\u3057\u3066\u3001\u30ec\u30c3\u30c9\u30c1\u30ea\u30d1\u30a6\u30c0\u30fc\u306f\u5c11\u3057\u306b\u3057\u3088\u3046", "\u304a\u524d\u2026\u2026\u672c\u5f53\u306b\u30bd\u30ec\u3001\u6599\u7406\u306e\u3064\u3082\u308a\u304b\uff1f", "\u7f8e\u5473\u3057\u3044\u304b\u3069\u3046\u304b\u306f\u500b\u4eba\u306e\u597d\u307f\u3060\u3051\u3069\u3001\u98df\u3079\u3089\u308c\u308b\u3082\u306e\u306f\u51fa\u6765\u308b\u7b48\u3088", "\u3069\u3046\u3060\u304b", "\u305d\u306e\u4f4d\u3067\u3044\u3044\u308f\u3002\u3042\u3068\u306f\u751f\u5730\u304c\u99b4\u67d3\u3080\u307e\u3067\u653e\u7f6e\u306d", "\u304a\u624b\u4f1d\u3044\u3001\u3042\u308a\u304c\u3068\u3046", "\u6c17\u304c\u5411\u3044\u305f\u3060\u3051\u3060\u3002\u3082\u3046\u3084\u3089\u306d\u3048\u304b\u3089\u306a", "\u5bb6\u4e8b\u306f\u899a\u3048\u3066\u304a\u3044\u305f\u65b9\u304c\u3044\u3044\u3088\u3002\u5c06\u6765\u7d50\u5a5a\u3057\u305f\u6642\u306b\u3001\u624b\u4f1d\u3063\u3066\u304f\u308c\u305f\u3089\u5965\u3055\u3093\u3082\u304d\u3063\u3068\u559c\u3076\u308f", "\u3069\u3046\u305b\u7d50\u5a5a\u306a\u3093\u3066\u51fa\u6765\u306d\u3047\u3088", "\u78ba\u304b\u306b\u30ed\u30eb\u30d5\u306f\u7121\u795e\u7d4c\u3060\u3051\u3069\u3001\u305d\u3093\u306a\u306b\u81ea\u5206\u3092\u5351\u4e0b\u3059\u308b\u4e8b\u306f\u306a\u3044\u3093\u3058\u3083\u306a\u3044\uff1f", "\u305d\u3093\u306a\u8a71\u306f\u3057\u3066\u306d\u3048\u3047\u3088\u3002\u3063\u3066\u3044\u3046\u304b\u3001\u304a\u524d\u304c\u30aa\u30ec\u3092\u3069\u3046\u601d\u3063\u3066\u3044\u308b\u304b\u306f\u826f\u304f\u5206\u304b\u3063\u305f", "\u5358\u7d14\u306b\u3001\u76f8\u624b\u304c\u3044\u306a\u3044\u3060\u3051\u3060\u3002\u5e74\u9f62\u7684\u306b\u91e3\u308a\u5408\u3046\u5973\u306f\u3001\u307b\u307c\u65e2\u5a5a\u8005\u3060\u304b\u3089\u306a", "\u3048\uff1f", "\u30de\u30ea\u30fc\u69d8\u3001\u305d\u308d\u305d\u308d\u30c8\u30de\u30c8\u3092\u5165\u308c\u3066\u3082\u3044\u3044\u3067\u3059\u304b\uff1f", "\u306f\u3044\u3001\u304a\u9858\u3044\u3057\u307e\u3059", "\u30ea\u30ea\u30fc\u306f\u9055\u3046\u305e", "\u30ea\u30ea\u30fc\u306f\u3001\u30f4\u30a9\u30eb\u30d5\u69d8\u306e\u5a5a\u7d04\u8005\u5019\u88dc\u3060", "\u30ea\u30ea\u30fc\u3055\u3093\u304c!?", "\u5341\u6b73\u5dee\u304f\u3089\u3044\u3001\u8a31\u5bb9\u7bc4\u56f2\u3060\u308d\u3002\u30ea\u30ea\u30fc\u3092\u5973\u3068\u3057\u3066\u898b\u308b\u306e\u306f\u4eca\u306e\u3068\u3053\u308d\u96e3\u3057\u3044\u3060\u308d\u3046\u304c\u3001\u6b21\u671f\u65cf\u9577\u304c\u672a\u5a5a\u3063\u3066\u8a33\u306b\u306f\u3044\u304b\u306a\u3044\u3057\u3001\u4ed5\u65b9\u306a\u3044", "\u7169\u3044\u308f\u3001\u30ed\u30eb\u30d5", "\u3078\u3044\u3078\u3044\u3002\u60aa\u304b\u3063\u305f\u306a", "\u5341\u6b73\u5dee\uff1f", "\u30f4\u30a9\u30eb\u30d5\u69d8\u304c\u4e8c\u5341\u4e03\u6b73\u3067\u3044\u3089\u3063\u3057\u3083\u308b\u306e\u3067\u3001\u6b63\u3057\u304f\u306f\u5341\u4e00\u6b73\u5dee\u3067\u3059\u306d\u3002\u79c1\u306f\u3064\u3044\u3053\u306e\u524d\u3001\u5341\u516d\u306b\u306a\u3063\u305f\u3070\u304b\u308a\u3067\u3059\u306e\u3067", "\u2026\u2026\u3093\uff1f", "\u2026\u2026\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/107/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u9021\u5de1\u3002", "discourse": ["\u3053\u3001\u3053\u307c\u308c\u308b\u3045\u3063\u2026\u2026\uff01", "\u3067\u3059\u304b\u3089\u3001\u6876\u306f\u4e00\u3064\u306b\u3057\u305f\u65b9\u304c\u826f\u3044\u3068\u8a00\u3044\u307e\u3057\u305f\u306e\u306b", "\u307b\u3089\u3001\u6876\u3092\u7f6e\u3044\u3066\u4e0b\u3055\u3044\u3002\u5c11\u3057\u4f11\u61a9\u3057\u307e\u3057\u3087\u3046", "\u3044\u305f\u3044\u2026\u2026", "\u738b\u5973\u69d8\u304c\u3001\u6c34\u6c72\u307f\u306a\u3093\u3066\u3059\u308b\u304b\u3089\u3067\u3059", "\u3060\u3063\u3066\u3001\u4ed6\u306e\u4e8b\u306f\u3082\u3063\u3068\u51fa\u6765\u306a\u3044\u3067\u3059\u3057\u2026\u2026", "\u9006\u3067\u3059\u3002\u8cb4\u65b9\u306f\u529b\u4ed5\u4e8b\u304c\u4e00\u756a\u5411\u3044\u3066\u307e\u305b\u3093\u3088", "\u305d\u3046\u3060\u306a\u3002\u304a\u59eb\u69d8\u306f\u5ba4\u5185\u3067\u5927\u4eba\u3057\u304f\u3057\u3066\u308a\u3083\u3042\u3044\u3044", "\u3042\u3001\u3042\u306e!?\u308f\u305f\u3057\u3001\u6301\u3061\u307e\u3059\u306e\u3067\u3063\uff01", "\u30a2\u30f3\u30bf\u306b\u4efb\u305b\u3066\u3044\u305f\u3089\u65e5\u304c\u66ae\u308c\u308b", "\u305d\u3046\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u304c\uff01\u3067\u3082", "\u90aa\u9b54\u3060\u305e\u3001\u306e\u308d\u307e", "\u3046\u304e\u3083\u3063!?", "\u4f55\u3092\u3059\u308b\u306e\u3088!!", "\u304a\u524d\u306e\u670d\u3001\u3072\u3089\u3072\u3089\u3057\u3066\u90aa\u9b54\u304f\u3055\u3044\u3093\u3060\u3088\u3002\u901a\u308b\u306e\u306b\u90aa\u9b54\u3060\u304b\u3089\u6255\u3063\u305f\u3060\u3051\u3060", "\u5931\u793c\u306a\u4e8b\u3092\u3057\u306a\u3044\u3067\u3001\u30ed\u30eb\u30d5", "\u3078\u3044\u3078\u3044", "\u306a\u306b\u30b8\u30ed\u30b8\u30ed\u898b\u3066\u3093\u3060\u3088\u3001\u30d6\u30b9", "\u2026\u2026\u306a\u3093\u3067\u3082\u306a\u3044\u308f\u3088", "\u30de\u30ea\u30fc\u69d8\u3002\u884c\u304d\u307e\u3057\u3087\u3046", "\u306f\u3044", "\u304a\u5f85\u305f\u305b\u3057\u307e\u3057\u305f", "\u4eca\u65e5\u306e\u98df\u4e8b\u3082\u3001\u304a\u524d\u304c\u3064\u304f\u308b\u306e\u304b\uff1f", "\u305d\u3046\u3088", "\u672c\u65e5\u306f\u3001\u4f55\u3092\u3064\u304f\u308b\u306e\u3067\u3059\u304b\uff1f", "\u9999\u8f9b\u6599\u3092\u5206\u3051\u3066\u3082\u3089\u3048\u305f\u304b\u3089\u3001\u5c11\u3057\u5909\u308f\u3063\u305f\u3082\u306e\u3092\u4f5c\u308a\u305f\u3044\u3068\u601d\u3063\u3066\u3044\u308b\u3093\u3060", "\u30ea\u30ea\u30fc\u3055\u3093\u306f\u3001\u8f9b\u3044\u3082\u306e\u306f\u5927\u4e08\u592b\u3067\u3059\u304b\uff1f", "\u306f\u3044\u3002\u3069\u3061\u3089\u304b\u3068\u3044\u3046\u3068\u597d\u304d\u306a\u65b9\u3067\u3059", "\u30aa\u30ec\u3082", "\u8cb4\u65b9\u306b\u306f\u805e\u3044\u3066\u306a\u3044", "\u2026\u2026\u5fd8\u308c\u3066\u306a\u3044\u308f\u3088"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/106/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u8996\u5bdf\u3002(4)", "discourse": ["\u3067\u306f\u3001\u9053\u4e2d\u304a\u6c17\u3092\u3064\u3051\u3066", "\u3042\u308a\u304c\u3068\u3046\u3002\u304a\u7236\u4e0a\u306b\u304a\u4f1a\u3044\u51fa\u6765\u306a\u304b\u3063\u305f\u306e\u306f\u6b8b\u5ff5\u3060\u304c\u3001\u5b9c\u3057\u304f\u304a\u4f1d\u3048\u3057\u3066\u304f\u308c", "\u738b\u90fd\u306f\u604b\u3057\u3044\u3051\u308c\u3069\u3001\u3044\u3056\u5e30\u308b\u3068\u306a\u308b\u3068\u540d\u6b8b\u60dc\u3057\u3044\u306d", "\u3053\u306e\u5148\u306b\u3042\u308b\u8857\u3067\u3001\u4e00\u5ea6\u4f11\u61a9\u3059\u308b\u306e\u3060\u308d\u3046\uff1f\u5c11\u3057\u8cb7\u3044\u7269\u3092\u3057\u3066\u3082\u3044\u3044\u304b\u306a\uff1f\u304a\u571f\u7523\u3092\u3082\u3046\u5c11\u3057\u898b\u305f\u3044", "\u3044\u3044\u3048\u3002\u4f11\u61a9\u3068\u98df\u4e8b\u3092\u7d42\u3048\u305f\u3089\u3001\u3059\u3050\u306b\u51fa\u7acb\u3057\u3066\u9802\u304d\u307e\u3059", "\u3069\u3046\u3057\u3066\uff1f", "\u5144\u4e0a\u306b\u306f\u3001\u30d5\u30a3\u30ea\u30c3\u30d7\u306e\u6ce8\u610f\u3092\u5f15\u304d\u4ed8\u3051\u3066\u6b32\u3057\u3044\u306e\u3067\u3059", "\u30d5\u30a3\u30ea\u30c3\u30d7\u6bbf\u306e\uff1f\u2026\u2026\u30ca\u30cf\u30c8\u3002\u8a00\u3063\u3066\u3044\u308b\u610f\u5473\u304c\u3001\u826f\u304f\u5206\u304b\u3089\u306a\u3044\u3088", "\u2026\u2026\u3048\u30fc\u3068\u3002\u30ca\u30cf\u30c8\u306f\u3001\u30d5\u30a3\u30ea\u30c3\u30d7\u6bbf\u304c\u60aa\u3044\u4e8b\u3092\u3057\u3066\u3044\u308b\u3063\u3066\u8a00\u3044\u305f\u3044\u306e\u304b\u306a\uff1f", "\u307e\u3041\u3001\u5927\u96d1\u628a\u306b\u8a00\u3063\u3066\u3057\u307e\u3048\u3070\u3001\u305d\u3046\u3044\u3046\u4e8b\u3067\u3059", "\u3067\u3001\u75c5\u4eba\u304c\u3069\u3053\u304b\u306b\u3044\u308b\u304b\u3082\u3057\u308c\u306a\u3044\u304b\u3089\u3001\u63a2\u3057\u306b\u884c\u304d\u305f\u3044\u3068\uff1f", "\u30ca\u30cf\u30c8\u304c\uff1f", "\u306f\u3044", "\u305d\u308c\u306f\u99c4\u76ee\u3060", "\u305d\u3093\u306a\u4e8b\u3092\u3057\u306a\u304f\u3066\u3082\u3001\u30d5\u30a3\u30ea\u30c3\u30d7\u6bbf\u306b\u554f\u3044\u305f\u3060\u305b\u3070\u3044\u3044\u3002\u306a\u3093\u306a\u3089\u547d\u4ee4\u3057\u3066\u3001\u8abf\u3079\u305f\u3044\u3068\u3053\u308d\u3092\u8abf\u3079\u3088\u3046\u3002\u79c1\u9054\u306b\u306f\u3001\u305d\u306e\u6a29\u9650\u304c\u3042\u308b", "\u5144\u4e0a\u3002\u79c1\u9054\u306e\u8003\u3048\u306f\u3001\u3042\u304f\u307e\u3067\u60f3\u50cf\u306e\u57df\u3067\u3057\u304b\u306a\u3044\u306e\u3067\u3059\u3002\u8a3c\u62e0\u3082\u306a\u3044\u307e\u307e\u7f6a\u3092\u554f\u3044\u3001\u6a29\u9650\u3092\u632f\u308a\u304b\u3056\u305b\u3070\u3001\u6c11\u306f\u3069\u3046\u601d\u3046\u3067\u3057\u3087\u3046\u304b\u3002\u897f\u65b9\u4e00\u5e2f\u306b\u5f37\u3044\u5f71\u97ff\u529b\u3092\u6301\u3064\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u5bb6\u3068\u3001\u7406\u7531\u3082\u306a\u304f\u5bfe\u7acb\u3057\u3066\u306f\u306a\u3089\u306a\u3044\u3002\u305d\u308c\u304c\u8a31\u3055\u308c\u308b\u306e\u306f\u3001\u6c11\u306e\u76ee\u306b\u3082\u660e\u3089\u304b\u306a\u5f62\u3067\u7f6a\u72b6\u304c\u78ba\u5b9a\u3057\u305f\u6642\u306e\u307f\u3060\u3002\u305d\u308c\u306b\u79c1\u9054\u304c\u4e0d\u7528\u610f\u306a\u884c\u52d5\u3092\u3068\u308c\u3070\u3001\u6700\u60aa\u306a\u4e8b\u614b\u3092\u62db\u304d\u304b\u306d\u306a\u3044", "\u2026\u2026\u6700\u60aa\u306a\u4e8b\u614b\uff1f", "\u2026\u2026\u3068\u306b\u304b\u304f\u3001\u30d5\u30a3\u30ea\u30c3\u30d7\u306b\u6c17\u53d6\u3089\u308c\u308b\u3088\u3046\u306a\u884c\u52d5\u306f\u614e\u3080\u3079\u304d\u3067\u3059", "\u3060\u3068\u3057\u3066\u3082\uff01\u30ca\u30cf\u30c8\u304c\u884c\u304f\u5fc5\u8981\u306a\u3093\u3066\u306a\u3044", "\u8fd1\u885b\u9a0e\u58eb\u306b\u5c11\u6570\u3067\u8abf\u67fb\u3055\u305b\u305f\u3068\u3057\u3066\u3001\u4eee\u306b\u8a3c\u62e0\u3092\u63b4\u3093\u3060\u3068\u3057\u3066\u3082\u3001\u63e1\u308a\u3064\u3076\u3055\u308c\u308c\u3070\u7d42\u308f\u308a\u3067\u3059\u3002\u6700\u60aa\u3001\u53e3\u5c01\u3058\u3092\u3055\u308c\u304b\u306d\u306a\u3044\u3002\u305d\u306e\u70b9\u3001\u898b\u3064\u3051\u305f\u306e\u304c\u79c1\u306a\u3089\u3070\u7c21\u5358\u306b\u306f\u3082\u307f\u6d88\u305b\u306a\u3044\u3067\u3057\u3087\u3046", "\u5371\u967a\u304c\u306a\u3044\u3068\u306f\u8a00\u3044\u5207\u308c\u306a\u3044\u3060\u308d\u3046!?", "\u78ba\u304b\u306b\u30bc\u30ed\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u3067\u3059\u304c\u8eab\u5206\u3092\u8003\u3048\u308c\u3070\u3001\u9a0e\u58eb\u306b\u884c\u304b\u305b\u308b\u3088\u308a\u306f\u305a\u3063\u3068\u3001\u79c1\u306e\u307b\u3046\u304c\u751f\u5b58\u7387\u306f\u9ad8\u3044", "\u75c5\u306b\u7f79\u3063\u305f\u3089\u3069\u3046\u3059\u308b\u3093\u3060\uff01", "\u305d\u3046\u306a\u3063\u305f\u3089\u3001\u85ac\u3092\u63a2\u3057\u307e\u3059\u3088\u3002\u5143\u3088\u308a\u3001\u75c5\u4eba\u3092\u6cbb\u3059\u305f\u3081\u306b\u884c\u304f\u306e\u3067\u3059\u304b\u3089", "\u30ca\u30cf\u30c8\uff01", "\u2026\u2026\u306a\u3089\u79c1\u304c\u884c\u304f", "\u99c4\u76ee\u306b\u6c7a\u307e\u3063\u3066\u3044\u308b\u3067\u3057\u3087\u3046\u3002\u8cb4\u65b9\u306f\u3053\u306e\u56fd\u306e\u738b\u306b\u306a\u308b\u4eba\u3060", "\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306b\u5fc5\u8981\u306a\u306e\u306f\u304a\u524d\u3060\u3088\u3001\u30ca\u30cf\u30c8\u3002\u79c1\u3058\u3083\u306a\u3044", "\u306a\u306b\u3092\u8a00\u3044\u51fa\u3059\u3093\u3067\u3059\u304b", "\u7236\u4e0a\u3060\u3063\u3066\u3001\u304a\u524d\u304c\u738b\u306b\u306a\u308b\u4e8b\u3092\u304a\u671b\u307f\u3060\u3002\u79c1\u3082\u738b\u306b\u306a\u3063\u305f\u304a\u524d\u3092\u3001\u8fd1\u885b\u9a0e\u58eb\u56e3\u9577\u306b\u306a\u3063\u3066\u8b77\u308b\u4e8b\u3092\u5922\u898b\u3066\u3044\u305f\u3002\u306a\u306e\u306b\u3001\u304a\u524d\u304c\u5acc\u3060\u3063\u3066\u8a00\u3063\u305f\u3093\u3058\u3083\u306a\u3044\u304b\u3002\u81ea\u5206\u306f\u305d\u3093\u306a\u5668\u3067\u306f\u306a\u3044\u3001\u79c1\u306e\u65b9\u304c\u5411\u3044\u3066\u3044\u308b\u3063\u3066\u3001\u304a\u524d\u304c\u62bc\u3057\u4ed8\u3051\u305f\u3093\u3058\u3083\u306a\u3044\u304b", "\u4e8b\u5b9f\u3067\u3059\u3002\u738b\u306f\u56fd\u5bb6\u306e\u4ee3\u8868\u3067\u3042\u308a\u8c61\u5fb4\u3067\u3082\u3042\u308b\u3002\u79c1\u306e\u3088\u3046\u306a\u9670\u9b31\u306a\u7537\u3088\u308a\u3001\u5149\u306e\u8c61\u5fb4\u306e\u3088\u3046\u306a\u8cb4\u65b9\u304c\u76f8\u5fdc\u3057\u3044", "\u898b\u76ee\u304c\u591a\u5c11\u826f\u304f\u3068\u3082\u3001\u653f\u52d9\u306b\u306f\u4f55\u306e\u5f79\u306b\u3082\u305f\u305f\u306a\u3044\u3002\u304a\u524d\u304c\u508d\u3067\u652f\u3048\u3066\u304f\u308c\u306a\u3051\u308c\u3070\u3001\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306f\u79c1\u306e\u4ee3\u3067\u6ec5\u3076\u3088", "\u306a\u3093\u3060\u3001\u305d\u306e\u76ee\u306f", "\u3044\u3048\u3002\u307e\u3055\u304b\u305d\u3093\u306a\u80cc\u666f\u304c\u3042\u308b\u3068\u306f\u77e5\u3089\u306a\u304b\u3063\u305f\u306e\u3067\u3002\u3061\u3087\u3063\u3068\u30ea\u30d2\u30c8\u306b\u540c\u60c5\u3057\u3066\u3044\u307e\u3057\u305f", "\u3057\u3001\u3057\u304b\u305f\u306a\u3044\u3060\u308d\u3046\uff01\u5065\u5eb7\u306a\u7b2c\u4e00\u738b\u5b50\u304c\u3044\u308b\u306e\u306b\u3001\u62bc\u3057\u9000\u3051\u3066\u7b2c\u4e8c\u738b\u5b50\u304c\u5373\u4f4d\u3059\u308b\u306a\u3069\u3001\u56fd\u5bb6\u3092\u6df7\u4e71\u3055\u305b\u304b\u306d\u306a\u3044\u3002\u4e0b\u624b\u3057\u305f\u3089\u4e8c\u3064\u306e\u6d3e\u95a5\u304c\u51fa\u6765\u3066\u3001\u56fd\u304c\u5272\u308c\u308b\u3002\u79c1\u306f\u3001\u305d\u3046\u3044\u3046\u5371\u6a5f\u3092\u56de\u907f\u3059\u308b\u305f\u3081\u306b\u3082\u3060\u306a\u2026\u2026", "\u9762\u5012\u3060\u3063\u305f\u3060\u3051\u3067\u306f", "\u30ca\u30cf\u30c8\u2026\u2026", "\u5fc5\u305a\u3001\u751f\u304d\u3066\u5e30\u308a\u307e\u3059\u3002\u304a\u7d04\u675f\u3057\u307e\u3059", "\u3055\u3066\u3002\u3053\u308c\u304b\u3089\u3069\u3046\u3059\u308b\u304b", "\u99ac\u3068\u98df\u6599\u306f\u7528\u610f\u3057\u3066\u3042\u308b\u306e\u3067\u2026\u2026\u3042\u3068\u306f\u3001\u8b77\u885b\u3067\u3059\u304b\u306d", "\u8b77\u885b\u304b\u3001\u78ba\u304b\u306b\u5fc5\u8981\u3060\u306a\u3002\u541b\u3060\u3051\u306a\u3089\u3070\u3068\u3082\u304b\u304f\u3001\u79c1\u306f\u975e\u5e38\u306b\u5f31\u3044\u3002\u8972\u308f\u308c\u305f\u3089\u4e00\u6483\u3067\u6b7b\u306c\u3002\u2026\u2026\u3060\u304c\u3001\u305d\u3046\u7c21\u5358\u306b\u898b\u3064\u304b\u308b\u3082\u306e\u304b\uff1f", "\u9152\u5834\u306b\u884c\u3051\u3070\u3001\u50ad\u5175\u306e\u4e00\u4eba\u3084\u4e8c\u4eba\u3001\u3044\u305d\u3046\u3067\u3059\u304c\u2026\u2026", "\u6761\u4ef6\u306b\u5408\u3046\u4eba\u9593\u3092\u63a2\u3059\u306e\u306f\u3001\u96e3\u3057\u305d\u3046\u3067\u3059\u306d", "\u305d\u3093\u306a\u90fd\u5408\u826f\u304f\u3001\u3044\u308b\u308f\u3051\u306a\u3044\u3093\u3060\u3088\u306a\u3041\u2026\u2026", "\u73cd\u3057\u304f\u3001\u5f31\u6c17\u3067\u3044\u3089\u3063\u3057\u3083\u308b", "\u3063!?", "\u2026\u2026!?"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/105/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u8996\u5bdf\u3002(3)", "discourse": ["\u4eca\u65e5\u3082\u6691\u3044\u306a\u3002\u738b\u90fd\u304c\u604b\u3057\u304f\u306a\u3063\u3066\u304d\u305f", "\u8996\u5bdf\u3082\u4f1a\u8ac7\u3082\u6ede\u308a\u306a\u304f\u7d42\u308f\u308a\u307e\u3057\u305f\u3057\u3001\u305d\u308d\u305d\u308d\u5e30\u308c\u308b\u306e\u3067\u306f\uff1f", "\u305d\u3046\u3060\u306a\u3002\u738b\u90fd\u306b\u5e30\u308b\u6e96\u5099\u3092\u3059\u308b\u304b", "\u304a\u571f\u7523\u3092\u4f55\u304b\u3001\u8cb7\u3063\u3066\u5e30\u308a\u307e\u3057\u3087\u3046\u304b", "\u305d\u308c\u306f\u3044\u3044\u306a\u3002\u30d5\u30e9\u30f3\u30e1\u306e\u7e54\u7269\u304c\u898b\u4e8b\u3060\u3068\u805e\u3044\u305f", "\u30d5\u30e9\u30f3\u30e1\u306e\u7e54\u7269\u306f\u3001\u738b\u90fd\u306e\u5973\u6027\u306b\u3082\u4eba\u6c17\u3060\u305d\u3046\u3067\u3059\u3088", "\u305d\u308c\u306f\u672c\u5f53\u304b\u3044!?", "\u3052", "\u6700\u8fd1\u3001\u30b3\u30ea\u30f3\u30ca\u3084\u30a8\u30ec\u30aa\u30ce\u30fc\u30e9\u306e\u6a5f\u5acc\u304c\u60aa\u3044\u304b\u3089\u3001\u304a\u571f\u7523\u3092\u8cb7\u3063\u3066\u5e30\u308d\u3046\u3068\u601d\u3063\u3066\u3044\u305f\u3093\u3060\u3051\u3069\u3001\u4f55\u306b\u3057\u305f\u3089\u3044\u3044\u304b\u60a9\u3093\u3067\u3044\u305f\u3093\u3060\u3002\u7d20\u6674\u3089\u3057\u3044\u4e8b\u3092\u6559\u3048\u3066\u304f\u308c\u3066\u3042\u308a\u304c\u3068\u3046\uff01", "\u2026\u2026\u304a\u5f79\u306b\u7acb\u3066\u305f\u306e\u306a\u3089\u826f\u304b\u3063\u305f\u3067\u3059\u3088\u3002\u30ea\u30d2\u30c8", "\u305d\u306e\u307e\u307e\u8ddd\u96e2\u3092\u7f6e\u304b\u308c\u305f\u3089\u5982\u4f55\u3067\u3059\uff1f", "\u4f55\u6545\u3060\u3044\uff1f", "\u672a\u5a5a\u306e\u5973\u6027\u3092\u3001\u60d1\u308f\u305b\u308b\u3082\u306e\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3088\u3001\u5144\u4e0a\u3002\u3054\u4ee4\u5b22\u65b9\u306e\u5a5a\u59fb\u306b\u97ff\u3044\u3066\u3057\u307e\u3063\u3066\u3082\u3001\u8cac\u4efb\u306f\u53d6\u308c\u306a\u3044\u3093\u3067\u3059\u304b\u3089", "\u8d08\u308a\u7269\u3092\u3059\u308b\u4e8b\u304c\u3001\u3069\u3046\u3057\u3066\u60d1\u308f\u305b\u308b\u4e8b\u306b\u306a\u308b\u3093\u3060\u3044\uff1f\u6700\u4e0a\u7d1a\u306e\u7e54\u7269\u3092\u8d08\u308c\u3070\u3001\u304d\u3063\u3068\u6700\u9ad8\u306e\u7b11\u9854\u3092\u898b\u305b\u3066\u304f\u308c\u308b\u3002\u79c1\u306f\u7f8e\u3057\u3044\u5973\u6027\u306b\u306f\u3001\u7b11\u9854\u3067\u3044\u3066\u6b32\u3057\u3044\u3060\u3051\u3060\u3088", "\u306d\u3047\u3001\u30e8\u30cf\u30f3\u3002\u541b\u306a\u3089\u5206\u304b\u308b\u3060\u308d\u3046\uff1f\u541b\u3082\u7f8e\u3057\u3044\u59c9\u541b\u306b\u306f\u3001\u7b11\u9854\u3067\u3044\u3066\u6b32\u3057\u3044\u3088\u306d\uff1f", "\u2026\u2026\u306f\uff1f", "\u541b\u306e\u59c9\u541b\u306f\u3001\u307e\u308b\u3067\u4e00\u6d41\u306e\u8077\u4eba\u304c\u4f5c\u3063\u305f\u4eba\u5f62\u306e\u3088\u3046\u306b\u7f8e\u3057\u3044\u65b9\u3060\u3068\u805e\u3044\u305f\u3088\u3002\u91d1\u306e\u9aea\u306b\u9752\u3044\u77b3\u306e\u65b9\u306b\u306f\u3001\u3069\u3093\u306a\u8272\u5408\u3044\u306e\u30c9\u30ec\u30b9\u304c\u4f3c\u5408\u3046\u304b\u306a\uff1f\u7740\u3066\u3044\u308b\u3068\u3053\u308d\u3092\u60f3\u50cf\u3059\u308b\u3060\u3051\u3067\u3082\u3001\u5b09\u3057\u304f\u306a\u308b\u3088\u306d", "\u541b\u306e\u59c9\u541b\u306b\u3082\u3001\u3044\u3064\u304b\u8d08\u308a\u7269\u3092\u3055\u305b\u3066\u6b32\u3057\u3044\u306a\u3002\u5b9d\u77f3\u3082\u30c9\u30ec\u30b9\u3082\u3001\u4e00\u6d41\u306e\u54c1\u3092\u7528\u610f\u3059\u308b\u3002\u3042\u3001\u7518\u3044\u3082\u306e\u306f\u304a\u597d\u304d\u304b\u306a\uff1f\u3046\u3061\u306e\u6599\u7406\u4eba\u306b\u3001\u8155\u3092\u632f\u308b\u308f\u305b\u308b\u3088", "\u30ea\u30d2\u30c8\u304c\u59c9\u306b\u8d08\u308a\u7269\uff1f\u9802\u304f\u7406\u7531\u304c\u3042\u308a\u307e\u305b\u3093\u3088\u306d", "\u3042\u308b\u3068\u3082\uff01\u7f8e\u3057\u3044\u65b9\u3092\u7f8e\u3057\u304f\u98fe\u308b\u306e\u306f\u3001\u79c1\u306e\u751f\u304d\u304c\u3044\u3067\u3042\u308a\u4f7f\u547d\u2026\u2026", "\u30ea\u30d2\u30c8", "\u3054\u5197\u8ac7\u3092", "\u2026\u2026\u5197\u8ac7\u3067\u306f\u306a\u3001\u30e2\u30b4\u30c3!?", "\u304a\u9858\u3044\u3067\u3059\u304b\u3089\u3001\u3082\u3046\u9ed9\u3063\u3066\u4e0b\u3055\u3044"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/104/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u8996\u5bdf\u3002(2)", "discourse": ["\u304a\u8179\u3059\u3044\u3061\u3083\u3063\u305f\u306a", "\u3042\u3001\u3067\u306f\u3001\u5c4b\u6577\u306b\u623b\u308a\u307e\u3057\u305f\u3089\u304a\u98df\u4e8b\u3092\u7528\u610f\u3055\u305b\u307e\u3059\u306d", "\u308f\u3056\u308f\u3056\u7528\u610f\u3057\u3066\u304f\u308c\u306a\u304f\u3066\u3082\u3044\u3044\u3088\u3002\u8efd\u304f\u98df\u3079\u3066\u5e30\u308d\u3046", "\u3048\u3063\uff1f\u3067\u3001\u3067\u3059\u304c", "\u3055\u3063\u304d\u304b\u3089\u826f\u3044\u5302\u3044\u304c\u3059\u308b\u3093\u3060\u3088\u306d\u3002\u5c4b\u53f0\u3067\u8089\u3067\u3082\u713c\u3044\u3066\u3044\u308b\u306e\u304b\u306a\uff1f", "\u3048\u3048\u3001\u7f8a\u8089\u306e\u4e32\u713c\u304d\u304c\u540d\u7269\u306a\u3093\u3067\u3059\u3002\u2026\u2026\u3067\u3082\u3001\u738b\u5b50\u6bbf\u4e0b\u306e\u53ec\u3057\u4e0a\u304c\u308b\u3088\u3046\u306a\u3082\u306e\u3067\u306f\uff01", "\u3042\u3042\u3001\u30bb\u30ea\u79d1\u306e\u690d\u7269\u306e\u7a2e\u3092\u9999\u8f9b\u6599\u3068\u3057\u3066\u4f7f\u3046\u3093\u3060\u3063\u3051\uff1f\u8272\u3093\u306a\u7a2e\u985e\u306e\u9999\u8f9b\u6599\u3092\u6df7\u305c\u308b\u3063\u3066\u805e\u3044\u305f\u3051\u3069\u3001\u672c\u5f53\uff1f", "\u306f\u3044\uff01\u5e97\u3054\u3068\u306b\u914d\u5408\u304c\u9055\u3046\u306e\u3067\u3001\u7f8e\u5473\u3057\u3044\u5e97\u3092\u63a2\u3059\u306e\u304c\u918d\u9190\u5473\u3067\u3057\u3066\u2026\u2026\u304a\u8a73\u3057\u3044\u3067\u3059\u306d", "\u77e5\u308a\u5408\u3044\u306e\u5546\u4eba\u306b\u6559\u3048\u3066\u3082\u3089\u3063\u305f\u3093\u3060\u3002\u305b\u3063\u304b\u304f\u306e\u65c5\u306a\u3093\u3060\u304b\u3089\u3001\u7f8e\u5473\u3057\u3044\u3082\u306e\u3092\u98df\u3079\u3066\u697d\u3057\u307f\u305f\u3044\u3058\u3083\u306a\u3044\u304b", "\u4eba\u76ee\u306e\u5c11\u306a\u3044\u3068\u3053\u308d\u3067\u3001\u99ac\u8eca\u3092\u6b62\u3081\u3066\u304f\u308c", "\u5c11\u3057\u304f\u3089\u3044\u5bc4\u308a\u9053\u3057\u3066\u3082\u5927\u4e08\u592b\u3060\u308d\u3046\uff1f", "\u3053\u3001\u56f0\u308a\u307e\u3059\uff01\u305d\u308c\u306b\u3001\u305d\u306e\u3001\u76ee\u7acb\u3061\u307e\u3059\u3057\u2026\u2026", "\u305d\u3046\u3044\u3048\u3070\u3001\u305d\u3046\u3060\u306a", "\u30b8\u30ec\u3092\u8131\u3052\u3070\u3001\u591a\u5c11\u306f\u30de\u30b7\u306b\u306a\u308b\u304b\u306a", "\u6bbf\u4e0b\u3001\u3053\u3061\u3089\u3092\u3069\u3046\u305e", "\u7f8e\u5473\u3057\u3044\u5e97\u306f\u3069\u3053\u304b\u306a\u3002\u30aa\u30b9\u30b9\u30e1\u3063\u3066\u3042\u308b\u304b\u3044\uff1f", "\u306f\u3041\u3002\u3053\u306e\u5148\u306e\u901a\u308a\u306b\u3042\u308a\u307e\u3059", "\u3058\u3083\u3042\u3001\u305d\u3053\u306b\u884c\u3053\u3046\u304b", "\u2026\u2026\u76ee\u629c\u304d\u901a\u308a\u306f\u4eba\u304c\u591a\u3044\u306e\u3067\u3001\u9038\u308c\u306a\u3044\u3067\u4e0b\u3055\u3044\u306d", "\u3042\u305d\u3053\u306e\u5e97\u3067\u3059", "\u50d5\u304c\u8cb7\u3063\u3066\u304d\u307e\u3059\u306e\u3067\u3001\u5c11\u3057\u304a\u5f85\u3061\u4e0b\u3055\u3044", "\u2026\u2026\uff1f", "\u2026\u2026\u305d\u3046\u304b", "\u5225\u306e\u5834\u6240\u304b", "\u304a\u5f85\u305f\u305b\u81f4\u3057\u307e\u3057\u305f\uff01", "\u304a\u304b\u3048\u308a\u3002\u4e00\u4eba\u3067\u4e26\u3070\u305b\u3066\u60aa\u304b\u3063\u305f\u306d", "\u3044\u3044\u3048\u3002\u3088\u304f\u4e26\u3076\u306e\u3067\u3001\u82e6\u306b\u306a\u308a\u307e\u305b\u3093\u3002\u305d\u308c\u3088\u308a\u3082\u71b1\u3044\u3046\u3061\u306b\u3069\u3046\u305e\uff01", "\u3042\u3001\u7acb\u3063\u305f\u307e\u307e\u306f\u307e\u305a\u3044\u304b\u2026\u2026\u3069\u3053\u304b\u5ea7\u308b\u5834\u6240\u3092\u3054\u7528\u610f\u3057\u307e\u3059\u306d", "\u3044\u3044\u3088\u3002\u4e32\u713c\u304d\u3092\u884c\u5100\u3088\u304f\u98df\u3079\u308b\u306a\u3093\u3066\u3001\u9006\u306b\u9593\u629c\u3051\u3060\u308d\uff1f", "\u304a\u5473\u306f\u3069\u3046\u3067\u3059\u304b\uff1f", "\u3046\u3093\u3001\u7f8e\u5473\u3057\u3044\u3088\u3002\u3053\u3053\u306e\u8089\u306f\u67d4\u3089\u304b\u3044\u306d", "\u82e5\u3044\u7f8a\u3092\u4f7f\u3063\u3066\u3044\u308b\u305d\u3046\u3067\u3059\u3088\u3002\u5e74\u3092\u53d6\u3063\u305f\u7f8a\u306e\u8089\u306f\u81ed\u307f\u304c\u5897\u3059\u306e\u3067\u3001\u8857\u306e\u4f4f\u4eba\u3067\u3082\u82e6\u624b\u306a\u4eba\u306f\u3044\u307e\u3059", "\u305d\u3046\u306a\u3093\u3060", "\u98df\u3079\u7d42\u308f\u3063\u305f\u3089\u3001\u304a\u5c4b\u6577\u306b\u623b\u308a\u307e\u3057\u3087\u3046", "\u3042\u3042\u3001\u3046\u3093\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/103/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u8996\u5bdf\u3002", "discourse": ["\u6691\u3044", "\u6691\u3044\u3001\u72ed\u3044\u3001\u606f\u82e6\u3057\u3044", "\u3067\u306f\u3001\u5916\u3067\u99ac\u306b\u4e57\u308a\u307e\u3059\u304b\uff1f", "\u308f\u3056\u308f\u3056\u65e5\u5dee\u3057\u306b\u6652\u3055\u308c\u308b\u306a\u3093\u3066\u5197\u8ac7\u3058\u3083\u306a\u3044\u3002\u5c48\u5f37\u306a\u5175\u58eb\u9054\u306a\u3089\u3068\u3082\u304b\u304f\u3001\u5ba4\u5185\u3067\u3075\u3093\u305e\u308a\u8fd4\u308b\u3060\u3051\u306e\u738b\u65cf\u304c\u3001\u3053\u306e\u6691\u3055\u306b\u8010\u3048\u3089\u308c\u308b\u3082\u306e\u304b\u3002\u4e00\u77ac\u3067\u5e72\u304b\u3089\u3073\u308b\u306e\u304c\u30aa\u30c1\u3060\u308d\u3046", "\u8cb4\u65b9\u306e\u5144\u541b\u306f\u3001\u5b9f\u306b\u697d\u3057\u305d\u3046\u3067\u3059\u3088\uff1f", "\u3042\u308c\u306f\u4f8b\u5916\u3060", "\u5168\u304f\u3001\u8ff7\u60d1\u306a\u4eba\u3060\u3002\u738b\u5b50\u3089\u3057\u304f\u99ac\u8eca\u306e\u4e2d\u306b\u9589\u3058\u3053\u3082\u3063\u3066\u3044\u3066\u6b32\u3057\u3044\u2026\u2026\u304c\u3001\u4e2d\u3067\u7169\u304f\u3055\u308c\u308b\u306e\u3082\u8ff7\u60d1\u3060\u306a", "\u3069\u3046\u305b\u3001\u3082\u3046\u3059\u3050\u7740\u304f\u3002\u5144\u4e0a\u306f\u597d\u304d\u306b\u3055\u305b\u3066\u304a\u3053\u3046", "\u3057\u304b\u3057\u2026\u2026\u3053\u3061\u3089\u306f\u968f\u5206\u3068\u6691\u3044\u3093\u3060\u306a\u3002\u738b\u90fd\u304b\u3089\u5c11\u3057\u5357\u306b\u4f4d\u7f6e\u3059\u308b\u3068\u306f\u3044\u3048\u3001\u3053\u3046\u3082\u6e29\u5ea6\u304c\u5909\u308f\u308b\u3068\u306f\u601d\u308f\u306a\u304b\u3063\u305f", "\u3044\u3044\u3048\u3001\u6e29\u5ea6\u306f\u738b\u90fd\u3068\u3055\u3057\u3066\u5909\u308f\u308a\u307e\u305b\u3093\u3088\u3002\u4eca\u5e74\u304c\u4f8b\u5916\u306a\u3093\u3067\u3057\u3087\u3046", "\u6765\u305f\u4e8b\u304c\u3042\u308b\u306e\u304b\uff1f", "\u6570\u5e74\u524d\u306b\u3001\u4f55\u5ea6\u304b\u3002\u78ba\u304b\u521d\u590f\u306b\u3082\u6765\u307e\u3057\u305f\u304c\u3001\u3053\u3093\u306a\u306b\u3082\u6691\u304f\u306f\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f", "\u541b\u306f\u9854\u306b\u4f3c\u5408\u308f\u305a\u884c\u52d5\u7684\u3068\u3044\u3046\u304b\u3001\u8eab\u8efd\u3068\u3044\u3046\u304b\u3002\u77e5\u3089\u306a\u3044\u9593\u306b\u3001\u4f55\u51e6\u3078\u3067\u3082\u884c\u3063\u3066\u3044\u308b\u306a", "\u71b1\u75c5\u304c\u6d41\u884c\u3063\u3066\u3044\u308b\u306e\u3082\u3001\u3053\u306e\u6691\u3055\u306e\u305b\u3044\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u306d", "\u3060\u3068\u3057\u305f\u3089\u3001\u738b\u90fd\u304b\u3089\u6301\u3063\u3066\u6765\u305f\u85ac\u3067\u3082\u5341\u5206\u5bfe\u5fdc\u51fa\u6765\u308b\u53ef\u80fd\u6027\u306f\u3042\u308b\u3002\u65b0\u7a2e\u306e\u75c5\u304b\u3082\u3057\u308c\u306a\u3044\u3068\u61f8\u5ff5\u3057\u3066\u3044\u305f\u304c\u3001\u675e\u6182\u306b\u7d42\u308f\u308b\u306a\u3089\u3001\u305d\u308c\u306b\u8d8a\u3057\u305f\u3053\u3068\u306f\u306a\u3044", "\u71b1\u75c5\u304c\u6d41\u884c\u3063\u3066\u3044\u308b\u3068\u805e\u304d\u307e\u3057\u305f\u304c\u3001\u30ae\u30fc\u30a2\u30b9\u30bf\u30fc\u6bbf\u3082\u540c\u3058\u75c5\u306b\u7f79\u3063\u3066\u3057\u307e\u308f\u308c\u305f\u306e\u3067\u3057\u3087\u3046\u304b\uff1f", "\u4f55\u6545\u3001\u71b1\u75c5\u306e\u4e8b\u3092\u3054\u5b58\u3058\u306a\u306e\u3067\u3057\u3087\u3046\u304b", "\u5546\u4eba\u9054\u306e\u5642\u3092\u8033\u306b\u3057\u305f\u3082\u306e\u3067\u3002\u2026\u2026\u306a\u306b\u304b\u554f\u984c\u3067\u3082\uff1f", "\u3044\u3044\u3048\u3002\u307e\u3055\u304b\u65e2\u306b\u3001\u738b\u90fd\u3067\u5642\u306b\u306a\u3063\u3066\u3044\u308b\u3068\u306f\u601d\u3044\u307e\u305b\u3093\u3067\u3057\u305f\u306e\u3067", "\u71b1\u75c5\u306f\u65e2\u306b\u7d42\u606f\u81f4\u3057\u307e\u3057\u305f\u3002\u7236\u306f\u6301\u75c5\u306e\u60aa\u5316\u304c\u539f\u56e0\u3067\u3059\u306e\u3067\u3001\u305d\u308c\u3089\u306f\u95a2\u4fc2\u3042\u308a\u307e\u305b\u3093", "\u7d42\u606f\uff1f\u305d\u308c\u306f\u78ba\u304b\u3067\u3059\u304b", "\u306f\u3044\u3002\u4eca\u5e74\u306f\u6691\u3055\u306e\u305b\u3044\u304b\u3001\u968f\u5206\u3068\u5e83\u304c\u308a\u304c\u65e9\u304b\u3063\u305f\u306e\u3067\u3001\u5927\u8888\u88df\u306a\u5642\u306b\u306a\u3063\u3066\u3057\u307e\u3063\u305f\u3093\u3067\u3057\u3087\u3046\u306d\u3002\u71b1\u51b7\u307e\u3057\u304c\u52b9\u3044\u3066\u3001\u7686\u3001\u3059\u3050\u306b\u56de\u5fa9\u3057\u307e\u3057\u305f", "\u2026\u2026\u305d\u3046\u3067\u3059\u304b", "\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/102/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u7126\u71e5\u3002(2)", "discourse": ["\u3053\u3061\u3089\u306e\u90e8\u5c4b\u3092\u4f7f\u3063\u3066\u4e0b\u3055\u3044", "\u3042\u306e\u2026\u2026\u672c\u5f53\u306b\u3001\u3053\u3053\u3067\u3044\u3044\u3093\u3067\u3059\u304b\uff1f", "\u5927\u56fd\u306e\u738b\u5973\u6bbf\u4e0b\u3092\u3001\u7262\u5c4b\u306b\u306a\u3069\u5165\u308c\u3089\u308c\u306a\u3044\u3067\u3057\u3087\u3046\u3002\u3067\u3059\u304c\u3001\u305d\u308c\u306f\u9577\u3068\u3057\u3066\u3001\u4e00\u65cf\u3092\u8b77\u308b\u7fa9\u52d9\u304c\u3042\u308b\u304b\u3089\u3053\u305d\u306e\u6c7a\u5b9a\u3067\u3059\u3002\u8cb4\u65b9\u3092\u6b53\u8fce\u3057\u3066\u3044\u308b\u8a33\u3067\u306f\u306a\u3044\u4e8b\u306f\u3054\u7406\u89e3\u9802\u304d\u305f\u3044", "\u306f\u3044", "\u4e16\u8a71\u3092\u3059\u308b\u4eba\u9593\u3092\u4e00\u4eba\u3064\u3051\u307e\u3059\u306e\u3067\u3001\u5206\u304b\u3089\u306a\u3044\u4e8b\u304c\u3042\u3063\u305f\u3089\u3001\u305d\u306e\u8005\u306b\u8a0a\u306d\u3066\u4e0b\u3055\u3044\u3002\u304a\u3044\u3067\u3001\u30ea\u30ea\u30fc", "\u3042\u306e\u2026\u2026\u30ea\u30ea\u30fc\u3055\u3093\uff1f", "\u306f\u3044", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093\u306f\u3001\u3069\u3053\u306b\uff1f", "\u7262\u5c4b\u3067\u3059", "\u7262\u5c4b!?", "\u305d\u306e\u3001\u4f1a\u3048\u305f\u308a\u306f\u2026\u2026", "\u5fa1\u7528\u304c\u306a\u3044\u306e\u3067\u3057\u305f\u3089\u3001\u4e0b\u304c\u3089\u305b\u3066\u3044\u305f\u3060\u304d\u307e\u3059", "\u3048\u3063", "\u5916\u306b\u304a\u308a\u307e\u3059\u306e\u3067\u3001\u5fa1\u7528\u304c\u3042\u308c\u3070\u6238\u3092\u53e9\u3044\u3066\u4e0b\u3055\u3044", "\u3067\u306f\u2026\u2026", "\u3042\u3042\u3042\u3042\u3001\u3042\u306e\u3063\u3001\u5c11\u3057\u304a\u8a71\u3057\u3092\u3057\u3066\u3082\u3088\u308d\u3057\u3044\u3067\u3059\u304b!?", "\u3088\u304b\u3063\u305f\u3089\u3001\u6905\u5b50\u306b\u2026\u2026", "\u7d50\u69cb\u3067\u3059\u3002\u305d\u308c\u3067\u3001\u3069\u306e\u3088\u3046\u306a\u304a\u8a71\u3067\u3057\u3087\u3046\u304b", "\u30af\u30fc\u30a2\u65cf\u306b\u3064\u3044\u3066\u3001\u6559\u3048\u3066\u9802\u304d\u305f\u3044\u3093\u3067\u3059", "\u3082\u3061\u308d\u3093\u85ac\u306e\u6750\u6599\u3068\u304b\u4f5c\u308a\u65b9\u3068\u304b\u3001\u305d\u3046\u3044\u3063\u305f\u90e8\u5916\u306e\u4eba\u9593\u306b\u6d29\u3089\u3057\u3066\u306f\u3044\u3051\u306a\u3044\u3088\u3046\u306a\u5185\u5bb9\u306f\u805e\u304d\u307e\u305b\u3093\u3002\u305d\u3046\u3058\u3083\u306a\u304f\u3066\u3001\u6210\u308a\u7acb\u3061\u3068\u304b\u3001\u305d\u3046\u3044\u3046\u2026\u2026", "\u2026\u2026\u8aac\u660e\u306f\u3001\u660e\u65e5\u3002\u6751\u306e\u4e2d\u3092\u6848\u5185\u3057\u307e\u3059\u306e\u3067\u3001\u305d\u306e\u6642\u306b", "\u306f\u3044\u3001\u99c4\u76ee\u3067\u3059\u3088\u306d\u2026\u2026\u3048\uff1f", "\u9577\u304b\u3089\u3001\u305d\u306e\u3088\u3046\u306b\u627f\u3063\u3066\u304a\u308a\u307e\u3059", "\u6751\u306e\u4e2d\u3092\u3001\u6b69\u3044\u3066\u3044\u3044\u3093\u3067\u3059\u304b\uff1f", "\u30af\u30fc\u30a2\u65cf\u3063\u3066\u3001\u306a\u306b\u304b\u554f\u984c\u304c\u3042\u308b\u306e\u304b\u306a\u2026\u2026\uff1f", "\u2026\u2026\u8003\u3048\u305f\u3089\u3001\u4f59\u8a08\u5206\u304b\u3093\u306a\u304f\u306a\u3063\u305f", "\u2026\u2026\u75db\u3063!?", "\u2026\u2026\u2026\u2026\u3042"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/101/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u7126\u71e5\u3002", "discourse": ["\u30f4\u30a9\u30eb\u30d5\u3002\u304a\u524d\u306f\u4e00\u4f53\u3001\u3069\u3046\u3044\u3046\u3064\u3082\u308a\u3060", "\u4f59\u6240\u8005\u3092\u6751\u306b\u62db\u304d\u5165\u308c\u308b\u306a\u3069\u3001\u524d\u4ee3\u672a\u805e\u3002\u639f\u3092\u7834\u3063\u3066\u3001\u305f\u3060\u3067\u6e08\u3080\u3068\u306f\u601d\u3063\u3066\u3044\u306a\u3044\u3060\u308d\u3046\u306a", "\u307e\u3041\u306d", "\u6b21\u671f\u65cf\u9577\u3067\u3042\u308b\u304a\u524d\u304c\u3001\u4f55\u6545\u3053\u3093\u306a\u99ac\u9e7f\u306a\u771f\u4f3c\u3092\u3057\u305f", "\u30af\u30fc\u30a2\u65cf\u306e\u70ba\u306b\u306a\u308b\u3068\u601d\u3063\u305f\u3002\u305d\u3046\u8a00\u3063\u305f\u3089\u4fe1\u3058\u3066\u304f\u308c\u308b\u304b\u3057\u3089\uff1f", "\u4fe1\u3058\u3066\u6b32\u3057\u304b\u3063\u305f\u3089\u3001\u307e\u305a\u306f\u3001\u305d\u306e\u3075\u3056\u3051\u305f\u614b\u5ea6\u3068\u53e3\u8abf\u3092\u6539\u3081\u308d", "\u4f7f\u3063\u3066\u3044\u308b\u3046\u3061\u306b\u6163\u308c\u3061\u3083\u3063\u305f\u306e\u3088\u3002\u3044\u3044\u3058\u3083\u306a\u3044\u3002\u3053\u3093\u306a\u53e3\u8abf\u306e\u5974\u304c\u30af\u30fc\u30a2\u65cf\u3060\u306a\u3093\u3066\u3001\u8ab0\u3082\u601d\u308f\u306a\u3044\u3067\u3057\u3087\u3046\uff1f", "\u3069\u3046\u3060\u304b\u306a", "\u3042\u3089\u3002\u3069\u3046\u3044\u3046\u610f\u5473\u304b\u3057\u3089", "\u4e16\u6163\u308c\u3057\u3066\u3044\u306a\u3044\u5a18\u3092\u9a19\u3059\u305f\u3081\u306b\u3001\u7121\u5bb3\u306a\u30d5\u30ea\u3092\u3057\u3066\u3044\u305f\u3093\u3058\u3083\u306a\u3044\u306e\u304b\uff1f", "\u5b9f\u306e\u606f\u5b50\u306b\u5bfe\u3057\u3066\u3001\u3042\u3093\u307e\u308a\u306a\u8a00\u3044\u8349\u306d", "\u5b9f\u306e\u606f\u5b50\u304c\u304a\u524d\u306e\u3088\u3046\u306a\u99ac\u9e7f\u3067\u3001\u672c\u5f53\u306b\u6b8b\u5ff5\u3060\u3002\u3053\u3093\u306a\u5e7c\u3044\u5a18\u3092\u8a91\u304b\u3057\u3066\u6765\u3066\u3001\u5c71\u5965\u3067\u4e00\u751f\u3092\u7d42\u3048\u3055\u305b\u308b\u6c17\u304b", "\u5e7c\u304f\u3066\u3082\u3001\u3053\u306e\u5b50\u306f\u51c4\u3044\u308f\u3088\u3002\u85ac\u306e\u77e5\u8b58\u306f\u8c4a\u5bcc\u3060\u3057\u3001\u6cbb\u7642\u3082\u51fa\u6765\u308b\u308f\u3002\u79c1\u9054\u306e\u77e5\u3089\u306a\u3044\u75c5\u306e\u5bfe\u51e6\u3082\u77e5\u3063\u3066\u3044\u308b\u3093\u3060\u304b\u3089", "\u305d\u308c\u304c\u76ee\u7684\u304b\u3002\u5148\u7956\u4ee3\u3005\u53d7\u3051\u7d99\u3044\u3067\u304d\u305f\u77e5\u8b58\u3060\u3051\u3067\u306f\u6e80\u8db3\u51fa\u6765\u305a\u3001\u65b0\u3057\u3044\u3082\u306e\u3092\u53d6\u308a\u8fbc\u3082\u3046\u3068\u8a00\u3046\u8a33\u3060\u306a\u3002\u2026\u2026\u8caa\u6b32\u306a\u304a\u524d\u3089\u3057\u3044", "\u9577\uff01\u307e\u3055\u304b\u3001\u304a\u8a8d\u3081\u306b\u306a\u308b\u3064\u3082\u308a\u3067\u3059\u304b!?", "\u79c1\u3060\u3063\u3066\u8a8d\u3081\u305f\u304f\u306f\u306a\u3044\u3002\u3060\u304c\u3001\u3053\u3046\u3057\u3066\u9023\u308c\u5e30\u3063\u3066\u6765\u3066\u3057\u307e\u3063\u305f\u3001\u4eca\u3001\u4ed6\u306b\u3069\u3046\u3059\u308b\u3068\u3044\u3046\u306e\u3060", "\u305d\u308c\u306f\u2026\u2026", "\u6751\u306e\u5834\u6240\u3092\u77e5\u3089\u308c\u3066\u3057\u307e\u3063\u305f\u4ee5\u4e0a\u3001\u5143\u5c45\u305f\u5834\u6240\u306b\u306f\u5e30\u305b\u306a\u3044\u3002\u304b\u3068\u3044\u3063\u3066\u3001\u4e00\u751f\u7262\u5c4b\u306b\u9589\u3058\u8fbc\u3081\u3066\u304a\u304f\u8a33\u306b\u3082\u3044\u304b\u3093\u3060\u308d\u3046", "\u3060\u304b\u3089\u3068\u3044\u3063\u3066\u3001\u6b21\u671f\u65cf\u9577\u306e\u5ac1\u304c\u4f59\u6240\u8005\u3060\u306a\u3093\u3066\uff01", "\u3057\u304b\u3082\u3001\u305d\u306e\u5a18\u306e\u5bb9\u59ff\u3001\u30d5\u30e9\u30f3\u30e1\u306e\u4eba\u9593\u3067\u3059\u3089\u306a\u3044\u3067\u3057\u3087\u3046\u3002\u3044\u304f\u3089\u65b0\u3057\u3044\u77e5\u8b58\u3084\u6280\u8853\u3092\u53d6\u308a\u8fbc\u307f\u305f\u304b\u3063\u305f\u3068\u3057\u3066\u3082\u3001\u5916\u56fd\u306e\u4eba\u9593\u306e\u8840\u3092\u30af\u30fc\u30a2\u65cf\u306b\u5165\u308c\u308b\u306a\u3069\u2026\u2026\u5148\u7956\u306b\u306a\u3093\u3068\u8a00\u3063\u3066\u8a6b\u3073\u308c\u3070\u3044\u3044\u306e\u3067\u3059\u304b", "\u3053\u306e\u5b50\u306f\u3001\u79c1\u306e\u5ac1\u3058\u3083\u306a\u3044", "\u4f55\u3092\u8a00\u3063\u3066\u3044\u308b\uff1f\u306a\u3089\u3001\u305d\u306e\u5a18\u3092\u3069\u3046\u3059\u308b\u6c17\u3060\u3002\u4ed6\u306e\u6751\u4eba\u306b\u5ac1\u304c\u305b\u308b\u3068\u3067\u3082\u8a00\u3046\u3064\u3082\u308a\u304b\uff1f", "\u307e\u3055\u304b\u3002\u3053\u306e\u5b50\u3092\u5ac1\u306b\u8fce\u3048\u308b\u306b\u306f\u3001\u9ad8\u3044\u8eab\u5206\u3068\u7235\u4f4d\u304c\u5fc5\u8981\u306a\u306e\u3088\u3002\u3053\u3093\u306a\u5c0f\u3055\u306a\u6751\u306e\u4eba\u9593\u306a\u3093\u304b\u304a\u547c\u3073\u3058\u3083\u306a\u3044\u308f", "\u2026\u2026\u8eab\u5206\u3068\u7235\u4f4d\u3060\u3068\uff1f", "\u305d\u3046\u3088", "\u3053\u3061\u3089\u306b\u5fa1\u5ea7\u3059\u306f\u3001\u30cd\u30fc\u30d9\u30eb\u738b\u56fd\u306e\u7b2c\u4e00\u738b\u5973\u3002\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u30fb\u30d5\u30a9\u30f3\u30fb\u30f4\u30a7\u30eb\u30d5\u30a1\u30eb\u30c8\u6bbf\u4e0b", "\u306f\u2026\u2026", "\u79c1\u9054\u3001\u30af\u30fc\u30a2\u65cf\u306e\u4e3b\u4eba\u3068\u306a\u308b\u65b9\u3088"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/100/", "subtitle": "\u7b2c\u4e00\u738b\u5b50\u306e\u52d5\u63fa\u3002", "discourse": ["\u965b\u4e0b", "\u30e8\u30cf\u30f3\u304b\u3089\u306e\u5831\u544a\u66f8\u306b\u306f\u76ee\u3092\u901a\u3057\u305f\u304b", "\u30f4\u30a3\u30f3\u30c8\u897f\u65b9\u306e\u8996\u5bdf\u306b\u540c\u884c\u3059\u308b\u4ef6\u3067\u3057\u3087\u3046\u304b", "\u76ee\u7684\u306f\u8fba\u5883\u4f2f\u3068\u306e\u4f1a\u8ac7\u53ca\u3073\u3001\u5357\u897f\u306e\u68ee\u306e\u8996\u5bdf\u3002\u2026\u2026\u9045\u904e\u304e\u308b\u304f\u3089\u3044\u3060\u306a", "\u30b9\u30b1\u30eb\u30c4\u3068\u306e\u56fd\u4ea4\u65ad\u7d76\u304c\u89e3\u9664\u3055\u308c\u308b\u524d\u304b\u3089\u3001\u30d5\u30e9\u30f3\u30e1\u3068\u306e\u6728\u6750\u306e\u4ea4\u6613\u306f\u3042\u3063\u305f\u3002\u9678\u8def\u304c\u4f7f\u3048\u308b\u3088\u3046\u306b\u306a\u308c\u3070\u66f4\u306b\u9700\u8981\u304c\u9ad8\u307e\u308b\u4e8b\u304f\u3089\u3044\u3001\u5e7c\u5b50\u3067\u3082\u4e88\u60f3\u304c\u3064\u304f\u3002\u305d\u3046\u306a\u308b\u524d\u306b\u3001\u5236\u9650\u3092\u8a2d\u3051\u3066\u304a\u304f\u3079\u304d\u3060\u3063\u305f", "\u8cc7\u6e90\u304c\u8c4a\u5bcc\u904e\u304e\u305f\u3093\u3067\u3057\u3087\u3046\u306d\u3002\u68ee\u306e\u5e83\u5927\u3055\u3092\u8003\u3048\u308c\u3070\u3001\u4eba\u4e00\u4eba\u304c\u6728\u3092\u5207\u308a\u5012\u3057\u305f\u3068\u3053\u308d\u3067\u3001\u5927\u3057\u305f\u554f\u984c\u306b\u306f\u306a\u3089\u306a\u3044\u3068\u601d\u3063\u3066\u3044\u305f\u3093\u3067\u3057\u3087\u3046\u3002\u5343\u4eba\u3001\u4e07\u4eba\u304c\u7fa4\u304c\u308c\u3070\u3001\u8cc7\u6e90\u306a\u3069\u4e00\u77ac\u3067\u67af\u6e07\u3059\u308b\u3068\u3044\u3046\u306e\u306b\u3002\u3053\u308c\u304b\u3089\u30f4\u30a3\u30f3\u30c8\u738b\u56fd\u306f\u5927\u5909\u3067\u3059\u306d", "\u307e\u305a\u306f\u8fba\u5883\u4f2f\u3068\u306e\u4f1a\u8ac7\u3067\u3001\u3069\u3053\u307e\u3067\u8a71\u3092\u9032\u3081\u3089\u308c\u308b\u304b\u3002\u30ea\u30d2\u30c8\u6bbf\u4e0b\u306e\u624b\u8155\u306b\u304b\u304b\u3063\u3066\u3044\u307e\u3059\u304c\u2026\u2026", "\u305d\u308c\u4ee5\u524d\u306b\u3001\u307e\u3068\u3082\u306a\u8a71\u3057\u5408\u3044\u306b\u306a\u308b\u304b\u3059\u3089\u602a\u3057\u3044", "\u75c5\u3067\u3059\u304b", "\u5357\u3067\u306f\u306a\u304f\u897f\u3067\u71b1\u75c5\u304c\u5e83\u304c\u308b\u306e\u306f\u73cd\u3057\u3044\u3002\u65b0\u7a2e\u306e\u75c5\u3067\u306a\u3051\u308c\u3070\u3044\u3044\u304c\u306a", "\u68ee\u6797\u4f10\u63a1\u3068\u95a2\u4fc2\u304c\u3042\u3063\u305f\u5834\u5408\u3001\u53ef\u80fd\u6027\u306f\u30bc\u30ed\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u306d\u3002\u6551\u63f4\u8981\u8acb\u306b\u5099\u3048\u3066\u304a\u304d\u307e\u3059", "\u65b0\u7a2e\u3067\u3042\u308c\u3070\u3001\u6211\u304c\u56fd\u306b\u3082\u7279\u52b9\u85ac\u306a\u3069\u306a\u3044", "\u2026\u2026\u305d\u3046\u3044\u3048\u3070\u3001\u306a\u3093\u306e\u75c5\u306b\u52b9\u304f\u304b\u306f\u77e5\u3089\u3093\u304c\u3001\u7279\u52b9\u85ac\u3092\u63a2\u3057\u306b\u3044\u3063\u305f\u5a18\u304c\u3044\u305f\u306a", "\u3042\u308c\u306f\u672c\u5f53\u306b\u3001\u30c7\u30bf\u30e9\u30e1\u3060\u306a\u3002\u975e\u5408\u7406\u7684\u306a\u8003\u3048\u65b9\u3070\u304b\u308a\u3059\u308b\u304f\u305b\u306b\u3001\u4f55\u6545\u304b\u6838\u5fc3\u3092\u7a81\u304f", "\u305d\u308c\u306f\u2026\u2026\u59b9\u306e\u3001\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u306e\u4e8b\u3067\u3059\u304b", "\u305d\u3046\u3060", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u306f\u3001\u4eca\u2026\u2026", "\u5831\u544a\u66f8\u3060", "\uff01", "\u2026\u2026\u6d77\u8cca\u2026\u2026!?", "\u2026\u2026\u3063", "\u2026\u2026\u3042\u308c\u306f\u3001\u3068\u3093\u3067\u3082\u306a\u3044\u5b58\u5728\u3060\u306a", "\u4e00\u4f53\u3001\u4f55\u4eba\u306e\u5f31\u70b9\u306b\u306a\u3063\u3066\u3044\u308b\u306e\u3084\u3089\u3002\u8003\u3048\u308b\u3060\u3051\u3067\u6050\u308d\u3057\u3044", "\u4f55\u6642\u9593\u304b\u3051\u308b\u3064\u3082\u308a\u3060\u304b\u77e5\u3089\u3093\u304c\u3001\u3055\u3063\u3055\u3068\u8aad\u3081\u3002\u738b\u5973\u306e\u8eab\u306b\u306a\u306b\u304b\u3042\u308c\u3070\u3001\u60a0\u3005\u3068\u5831\u544a\u66f8\u306a\u3069\u8aad\u3093\u3067\u3044\u308b\u5834\u5408\u3067\u306f\u306a\u3044\u4e8b\u304f\u3089\u3044\u5206\u304b\u308b\u3060\u308d\u3046", "\u968f\u5206\u3068\u75b2\u308c\u3066\u3044\u308b\u3088\u3046\u3060\u306a", "\u7533\u3057\u8a33\u3054\u3056\u3044\u307e\u305b\u3093", "\u3044\u3084\u3001\u8a6b\u3073\u305a\u3068\u3082\u826f\u3044\u3002\u3060\u304c\u2026\u2026"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/99/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u9053\u4e2d\u3002(2)", "discourse": ["\u30de\u30ea\u30fc\u3001\u8db3\u306b\u89e6\u308c\u3066\u3082\u3044\u3044\u304b\u3057\u3089\uff1f", "\u2026\u2026\uff1f", "\u305d\u306e\u307e\u307e\u7720\u3063\u3066\u3082\u3044\u3044\u308f\u3088", "\u80cc\u8ca0\u308f\u305b\u308d\u3063\u3066\u8a00\u3063\u3066\u3082\u805e\u304b\u306a\u3044\u3057\u3001\u30d8\u30ed\u30d8\u30ed\u306a\u306e\u306b\u307e\u3060\u6b69\u3051\u308b\u3063\u3066\u8a00\u3046\u3057", "\u30a2\u30f3\u30bf\u3063\u3066\u3001\u672c\u5f53\u9811\u56fa\u3002\u2026\u2026\u3067\u3082\u6839\u6027\u304c\u3042\u308b\u308f", "\u306f\u3044\u3001\u7d42\u308f\u308a\u3002\u3053\u308c\u3067\u660e\u65e5\u306e\u671d\u306b\u306f\u3001\u5927\u5206\u816b\u308c\u3082\u5f15\u3044\u3066\u3044\u308b\u3068\u601d\u3046\u308f", "\u51c4\u3044\u3067\u3059\u306d\u2026\u2026", "\u96c7\u3046\u6c17\u306b\u306a\u3063\u305f\u304b\u3057\u3089\uff1f", "\u3053\u3063\u3061\u304c\u60c5\u5831\u3092\u958b\u793a\u3057\u3066\u3044\u306a\u3044\u306e\u306b\u3001\u9078\u629e\u3092\u8feb\u308b\u306e\u306f\u516c\u5e73\u3068\u306f\u3044\u3048\u306a\u3044\u308f\u306d", "\u60c5\u5831\u3063\u3066\u3001\u3055\u3063\u304d\u30ab\u30e9\u30b9\u304c\u8a00\u3063\u305f\u4e8b\u3067\u3059\u304b\uff1f", "\u7b54\u3048\u306f\u3001\u300e\u3069\u3061\u3089\u3082\u300f\u304b\u3057\u3089\u306d\u3002\u4e3b\u3092\u6301\u3064\u3079\u304d\u3060\u3068\u3044\u3046\u8003\u3048\u306f\u3001\u4e00\u65cf\u306e\u6b21\u671f\u9577\u3068\u3057\u3066\u306e\u3082\u306e\u3060\u3051\u3069\u3001\u30de\u30ea\u30fc\u3092\u9078\u3093\u3060\u306e\u306f\u79c1\u500b\u4eba\u306e\u5e0c\u671b\u3088", "\u79c1\u306f\u9069\u4efb\u3068\u306f\u8a00\u3044\u96e3\u3044\u3067\u3059\u3057\u306d", "\u2026\u2026\u305d\u3057\u3066\u3053\u3053\u304b\u3089\u304c\u3001\u4e00\u756a\u91cd\u8981\u306a\u306e\u3060\u3051\u308c\u3069", "\u3053\u308c\u306f\u4e00\u65cf\u306e\u7dcf\u610f\u3067\u306f\u306a\u3044\u308f", "\u3048\u3047\u30fc\u2026\u2026", "\u305d\u3093\u306a\u5927\u4e8b\u306a\u4e8b\u3001\u52dd\u624b\u306b\u6c7a\u3081\u305f\u3089\u307e\u305a\u3044\u3067\u3059\u3088", "\u4f55\u5ea6\u3082\u8a71\u3057\u5408\u3044\u306e\u5834\u3092\u8a2d\u3051\u305f\u308f\u3002\u3067\u3082\u9811\u56fa\u306a\u723a\u5171\u306f\u4e00\u8e74\u3057\u3066\u3001\u308d\u304f\u306b\u8a71\u3092\u805e\u3053\u3046\u3068\u3082\u3057\u306a\u3044", "\u3060\u304b\u3089\u3063\u3066\u5f37\u884c\u7b56\u306f\u5982\u4f55\u306a\u3082\u306e\u304b\u3068\u2026\u2026\u4f59\u6240\u8005\u306e\u79c1\u304c\u8a00\u3046\u306e\u3082\u306a\u3093\u3067\u3059\u304c\u3001\u3082\u3063\u3068\u6642\u9593\u3092\u304b\u3051\u308b\u3079\u304d\u6848\u4ef6\u3060\u3068\u601d\u3044\u307e\u3059\u3088", "\u3044\u3064\u304b\u3058\u3083\u99c4\u76ee\u306a\u306e\u3088\u3002\u305d\u308c\u3058\u3083\u9045\u3044\u306e", "\u79c1\u9054\u306b\u306f\u6280\u8853\u3068\u77e5\u8b58\u304c\u3042\u308b\u3002\u305d\u308c\u306a\u306e\u306b\u3001\u306a\u306b\u3082\u305b\u305a\u306b\u5c71\u5965\u306b\u5f15\u304d\u7bed\u3082\u3063\u3066\u3001\u3086\u308b\u3084\u304b\u306b\u6ec5\u3073\u3066\u3044\u304f\u306e\u3092\u5f85\u3064\u306a\u3093\u3066\u7d76\u5bfe\u306b\u5acc\u3060\u308f", "\u6ec5\u3073\u3063\u3066\u2026\u2026", "\u30af\u30fc\u30a2\u65cf\u306f\u5c71\u5965\u306b\u96a0\u308c\u4f4f\u307f\u3001\u5916\u754c\u3068\u306e\u95a2\u308f\u308a\u306f\u85ac\u3092\u58f2\u308a\u306b\u884c\u304f\u6642\u3060\u3051\u3002\u8a2a\u554f\u3059\u308b\u6751\u3084\u753a\u306b\u3082\u898f\u5247\u6027\u306f\u306a\u3044\u304b\u3089\u3001\u63a2\u3057\u51fa\u3059\u306e\u306f\u56f0\u96e3\u3068\u8a00\u308f\u308c\u3066\u3044\u308b\u3002\u3067\u3082\u306d\u3001\u6839\u6c17\u5f37\u304f\u5f85\u3061\u4f0f\u305b\u3059\u308c\u3070\u3001\u4f1a\u3048\u308b\u53ef\u80fd\u6027\u306f\u30bc\u30ed\u3067\u306f\u306a\u3044\u308f", "\u305d\u3057\u3066\u3001\u601d\u3044\u3064\u3044\u3066\u5b9f\u884c\u306b\u79fb\u3059\u306e\u304c\u5584\u4eba\u3060\u3051\u3068\u306f\u9650\u3089\u306a\u3044\u3002\u3046\u3046\u3093\u3002\u5927\u62b5\u30ed\u30af\u3067\u3082\u306a\u3044\u5974\u306e\u65b9\u304c\u3001\u60aa\u77e5\u6075\u304c\u50cd\u304f\u3082\u306e\u3088", "\u79c1\u9054\u306e\u6301\u3064\u85ac\u306f\u3001\u4eba\u306b\u3088\u3063\u3066\u306f\u9ec4\u91d1\u4ee5\u4e0a\u306e\u4fa1\u5024\u3092\u6301\u3064\u3002\u5b89\u76f4\u306b\u6bba\u3057\u3066\u85ac\u3092\u596a\u304a\u3046\u3068\u8003\u3048\u308b\u99ac\u9e7f\u3084\u3001\u6355\u307e\u3048\u3066\u58f2\u308a\u6255\u304a\u3046\u3068\u3059\u308b\u60aa\u515a\u304c\u3001\u7d50\u69cb\u3044\u308b\u306e\u3088", "\u4e00\u65cf\u306e\u4e2d\u306b\u306f\u3001\u5c71\u3092\u4e0b\u308a\u308b\u306e\u3092\u6b62\u3081\u3088\u3046\u3068\u307e\u3067\u8a00\u3044\u51fa\u3059\u4eba\u3082\u3044\u308b\u308f\u3002\u5916\u754c\u3068\u306e\u95a2\u308f\u308a\u3092\u5b8c\u5168\u306b\u65ad\u3064\u3079\u304d\u3060\u3001\u53ce\u5165\u304c\u306a\u304f\u3068\u3082\u3001\u4f5c\u7269\u3092\u80b2\u3066\u3066\u3072\u3063\u305d\u308a\u3068\u66ae\u3089\u3057\u3066\u3044\u3051\u308c\u3070\u3001\u305d\u308c\u3067\u3044\u3044\u3060\u308d\u3046\u3063\u3066\u306d\u3002\u3067\u3082\u3001\u305d\u308c\u3058\u3083\u79c1\u9054\u306f\u3001\u4f55\u306e\u305f\u3081\u306b\u5b58\u5728\u3059\u308b\u306e\u304b\u5206\u304b\u3089\u306a\u3044\u308f\u3002\u7956\u5148\u304c\u5b88\u308a\u53d7\u3051\u7d99\u3044\u3067\u304d\u305f\u77e5\u8b58\u3068\u6280\u8853\u306b\u3001\u610f\u5473\u304c\u306a\u304f\u306a\u3063\u3066\u3057\u307e\u3046", "\u6551\u3048\u308b\u547d\u304c\u3042\u308b\u306e\u306b\u3001\u4fdd\u8eab\u306e\u305f\u3081\u306b\u898b\u6368\u3066\u308b\u306a\u3093\u3066\u2026\u2026\u3082\u3046\u5fa1\u514d\u3060", "\u3082\u3046\u3059\u3050\u898b\u3048\u308b\u308f", "\u3046\u308f\u3041\u2026\u2026", "\u3053\u3053\u304c\u3001\u30af\u30fc\u30a2\u65cf\u306e\u6751\u3067\u3059\u304b", "\u305d\u3046\u3088\u3002\u79c1\u304c\u751f\u307e\u308c\u305f\u5834\u6240", "\u53d6\u308a\u6562\u3048\u305a\u3001\u79c1\u306f\u5148\u306b\u884c\u304f\u304b\u3089\u3001\u30a2\u30f3\u30bf\u306f\u3053\u3053\u3067\u5f85\u3063\u3066\u3044\u3066\u9802\u6234", "\u3048\u3063\u3002\u7f6e\u3044\u3066\u3044\u304f\u3093\u3067\u3059\u304b!?", "\u3059\u3050\u306b\u4ef2\u9593\u3092\u3088\u3053\u3059\u308f\u3002\u79c1\u304c\u7236\u89aa\u3092\u8aac\u5f97\u3059\u308b\u304b\u3089\u3001\u305d\u308c\u307e\u3067\u30bd\u30a4\u30c4\u306e\u5bb6\u306b\u96a0\u308c\u3066\u3044\u3066\u6b32\u3057\u3044\u306e", "\u3059\u3063\u3054\u3044\u7a81\u8cab\u5de5\u4e8b\u3068\u3044\u3044\u307e\u3059\u304b\u3001\u884c\u304d\u5f53\u305f\u308a\u3070\u3063\u305f\u308a\u306a\u4f5c\u6226\u3067\u3059\u306d\u2026\u2026", "\u30a2\u30f3\u30bf\u306b\u51fa\u4f1a\u3048\u305f\u4e8b\u81ea\u4f53\u3001\u60f3\u5b9a\u5916\u306e\u51fa\u6765\u4e8b\u3060\u3063\u305f\u304b\u3089\u306d\u30fc", "\u5927\u4e08\u592b\u3002\u3061\u3083\u3093\u3068\u8fce\u3048\u306b\u6765\u308b\u304b\u3089\u3001\u5f85\u3063\u3066\u3044\u3066", "\u305d\u306e\u5fc5\u8981\u306f\u306a\u3044", "!?", "\u304a\u51fa\u8fce\u3048\u3001\u3054\u82e6\u52b4\u69d8\u306d"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/98/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u9053\u4e2d\u3002", "discourse": ["\u3053\u306e\u8fba\u308a\u306f\u5ca9\u304c\u591a\u304f\u3066\u6b69\u304d\u96e3\u3044\u304b\u3089\u3001\u8db3\u5143\u6c17\u3092\u3064\u3051\u306a\u3055\u3044\u306d", "\u304a\u30fc\u3044\u3002\u751f\u307e\u308c\u305f\u3066\u306e\u4ed4\u99ac\u307f\u3066\u3047\u306b\u8db3\u9707\u3048\u3066\u307e\u3059\u3051\u3069\u5927\u4e08\u592b\u3067\u3059\u304b\u3044\uff1f", "\u3061\u3087\u3063\u3068\u30de\u30ea\u30fc\u3002\u30a2\u30f3\u30bf\u3001\u4eba\u8a9e\u3092\u3057\u3083\u3079\u308c\u306a\u304f\u306a\u3063\u3066\u306a\u3044\uff1f", "\u3053\u308a\u3083\u99c4\u76ee\u3060\u3002\u304a\u3044\u5144\u3055\u3093\u3001\u4f11\u61a9\u631f\u307e\u306a\u3044\u3068\u59eb\u3055\u3093\u304c\u6607\u5929\u3059\u308b\u305e", "\u30de\u30ea\u30fc\u3057\u3063\u304b\u308a\uff01\u79c1\u304c\u5206\u304b\u308b\uff1f", "\u2026\u2026\u3055\u3093\u306d\u3093\u307e\u3048\u306b\u3001\u4ea1\u304f\u306a\u3063\u305f\u304a\u3070\u3042\u3061\u3083\u3093\u2026\u2026\u3054\u3075", "\u30de\u30ea\u30fc!!", "\u306f\u3044\u3001\u6c34", "\u3044\u304d\u304b\u3048\u3063\u305f\u2026\u2026", "\u3084\u3063\u3068\u4eba\u9593\u306b\u623b\u308c\u305f\u3088\u3046\u3067\u3001\u306a\u306b\u3088\u308a\u3067\u3059\u3088\u3002\u3055\u3063\u304d\u307e\u3067\u30b3\u30d5\u30fc\u30b3\u30d5\u30fc\u3063\u3066\u304a\u304b\u3057\u306a\u547c\u5438\u3057\u3066\u305f\u304b\u3089\u3001\u3069\u3046\u3057\u3088\u3046\u304b\u3068\u601d\u3044\u307e\u3057\u305f", "\u57ce\u80b2\u3061\u306e\u3072\u5f31\u306a\u5c0f\u5a18\u306b\u3001\u5c71\u767b\u308a\u306f\u7121\u8336\u3060\u3088\u2026\u2026", "\u30a2\u30f3\u30bf\u306e\u9078\u629e\u306e\u7d50\u679c\u3060\u3002\u8ae6\u3081\u3066\u53d7\u3051\u5165\u308c\u3066\u4e0b\u3055\u3044\u3088", "\u3050\u3045\u2026\u2026", "\u3053\u3063\u304b\u3089\u5148\u306f\u80cc\u8ca0\u3044\u307e\u3057\u3087\u3046\u304b\uff1f\u30a2\u30f3\u30bf\u3001\u3082\u3046\u9650\u754c\u3067\u3057\u3087\uff1f", "\u305d\u308c\u3001\u7236\u69d8\u306b\u5831\u544a\u3059\u308b\u3064\u3082\u308a\u3060\u3088\u306d", "\u305d\u308a\u3083\u5f53\u7136\u3063\u3059\u308f\u3002\u304a\u59eb\u69d8\u306f\u3001\u81ea\u5206\u304c\u5927\u4e8b\u306b\u5927\u4e8b\u306b\u62b1\u3048\u3066\u767b\u308a\u307e\u3057\u305f\u3088\u30fc\u3063\u3066", "\u9019\u3063\u3066\u3067\u3082\u81ea\u529b\u3067\u767b\u308b\u308f", "\u79c1\u304c\u62b1\u3048\u308b\u308f\u3088\u3002\u30de\u30ea\u30fc\u306f\u79c1\u306e\u3001\u5927\u4e8b\u306a\u4e3b\u306a\u3093\u3060\u304b\u3089", "\u307e\u3060\u4e3b\u306b\u306a\u308b\u3063\u3066\u3001\u6c7a\u3081\u305f\u8a33\u3058\u3083\u306a\u3044\u3067\u3059", "\u305d\u3093\u306a\u9854\u3057\u306a\u304f\u3066\u3082\u3044\u3044\u308f\u3088", "\u8fd4\u4e8b\u3092\u4fdd\u7559\u3057\u305f\u306e\u306f\u6b63\u89e3\u3060\u308f\u3002\u79c1\u306f\u307e\u3060\u3001\u30de\u30ea\u30fc\u306b\u8a71\u3057\u3066\u306a\u3044\u4e8b\u304c\u5c71\u307b\u3069\u3042\u308b\u3057", "\u305d\u3046\u3060\u306a\u3002\u305d\u3082\u305d\u3082\u59eb\u3055\u3093\u3092\u4e3b\u306b\u3057\u305f\u3044\u3063\u3066\u306e\u304c\u3001\u4e00\u65cf\u306e\u6b21\u671f\u9577\u3068\u3057\u3066\u306e\u8a00\u8449\u306a\u306e\u304b\u3001\u500b\u4eba\u3068\u3057\u3066\u306e\u5e0c\u671b\u306a\u306e\u304b\u3001\u305d\u308c\u3059\u3089\u805e\u3044\u3066\u306a\u3044", "\u92ed\u3044\u308f\u306d", "\u307e\u3041\u3001\u805e\u304d\u305f\u3044\u4e8b\u3082\u8272\u3005\u3042\u308b\u3060\u308d\u3046\u3051\u3069\u3001\u53d6\u308a\u6562\u3048\u305a\u51fa\u767a\u3057\u307e\u3057\u3087\u3046\u304b\u3002\u591c\u306b\u306a\u308b\u524d\u306b\u3001\u3082\u3046\u5c11\u3057\u9032\u307f\u305f\u3044\u308f\u3002\u3053\u3093\u306a\u5834\u6240\u3067\u591c\u3092\u660e\u304b\u3059\u306e\u306f\u5fa1\u514d\u3088", "\u80cc\u8ca0\u3044\u307e\u3057\u3087\u3046\u304b\u3001\u304a\u59eb\u69d8", "\u9019\u3063\u3066\u3067\u3082\u767b\u308b\u3063\u3066\u3001\u8a00\u3063\u305f\u3067\u3057\u3087\u3046\uff1f", "\u30a2\u30f3\u30bf\u3001\u7d50\u69cb\u56f3\u592a\u3044\u3088\u306d\u3002\u3042\u3068\u9811\u56fa", "\u4eca\u9803\u5206\u304b\u3063\u305f\u306e\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/97/", "subtitle": "\u7b2c\u4e8c\u738b\u5b50\u306e\u4ea4\u6d41\u3002", "discourse": ["\u3050\u306d\u3050\u306d\u3068\u66f2\u304c\u308a\u304f\u306d\u3063\u3066\u6b69\u304d\u96e3\u3044\u4e8b\u3053\u306e\u4e0a\u306a\u3044\u306a\u3002\u82b8\u8853\u3060\u304b\u4f55\u3060\u304b\u77e5\u3089\u3093\u304c\u3001\u4f55\u6545\u901a\u8def\u4e00\u3064\u771f\u3063\u76f4\u3050\u306b\u3064\u304f\u308c\u306a\u3044\u306e\u304b\u3002\u5927\u4f53\u3001\u4e0a\u304b\u3089\u898b\u308b\u4e8b\u3092\u524d\u63d0\u306b\u3057\u305f\u6a21\u69d8\u3092\u3001\u3069\u3046\u3084\u3063\u3066\u5730\u4e0a\u304b\u3089\u697d\u3057\u3081\u3068\u3044\u3046\u3093\u3060\u3002\u3053\u308c\u3067\u306f\u3001\u305f\u3060\u306e\u969c\u5bb3\u7269\u3067\u306f\u306a\u3044\u304b", "\u82b8\u8853\u5bb6\u3068\u3044\u3046\u751f\u304d\u7269\u306f\u5fc3\u5e95\u3001\u7406\u89e3\u306b\u82e6\u3057\u3080\u3002\u305d\u3046\u306f\u601d\u308f\u306a\u3044\u304b\u3001\u30e8\u30cf\u30f3", "\u500b\u4eba\u7684\u306b\u306f\u540c\u610f\u3057\u307e\u3059\u304c\u3001\u304a\u305d\u3089\u304f\u50d5\u3068\u8cb4\u65b9\u306f\u5c11\u6570\u6d3e\u3067\u3059\u3088\u3002\u73fe\u306b\u8cb4\u65b9\u306e\u5144\u541b\u3068\u738b\u5973\u6bbf\u4e0b\u306f\u3001\u3068\u3066\u3082\u697d\u3057\u307e\u308c\u3066\u3044\u308b\u3088\u3046\u3060", "\u306a\u3093\u3068\u7de0\u308a\u306e\u306a\u3044\u9854\u3060\u3002\u6bce\u65e5\u306e\u3088\u3046\u306b\u5973\u3092\u4f8d\u3089\u305b\u3066\u304a\u3044\u3066\u3001\u307e\u3060\u8db3\u308a\u306a\u3044\u306e\u304b\u3002\u5144\u4e0a\u306e\u5973\u597d\u304d\u306f\u3001\u3044\u3064\u304b\u8eab\u3092\u6ec5\u307c\u3059\u306a", "\u305d\u308c\u306f\u5144\u541b\u3060\u3051\u306e\u305b\u3044\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3088\u3002\u3042\u308c\u307b\u3069\u306e\u7f8e\u7537\u3060\u3063\u305f\u3089\u3001\u5973\u6027\u306e\u65b9\u304c\u653e\u3063\u3066\u306f\u304a\u304b\u306a\u3044\u3067\u3057\u3087\u3046\u304b\u3089", "\u541b\u304c\u8a00\u3046\u3068\u5acc\u5473\u306b\u805e\u3053\u3048\u308b\u306a", "\u305d\u3046\u3067\u3059\u304b\uff1f", "\u305d\u3046\u3060\u308d\u3046\u3002\u5144\u4e0a\u3082\u305d\u308c\u306a\u308a\u306b\u6574\u3063\u305f\u9854\u7acb\u3061\u3060\u304c\u3001\u541b\u306e\u96a3\u306b\u4e26\u3079\u3070\u78ba\u5b9f\u306b\u898b\u52a3\u308a\u3059\u308b\u305e\u3002\u57ce\u306e\u4f8d\u5973\u3084\u8cb4\u65cf\u306e\u304a\u5b22\u69d8\u65b9\u306f\u7686\u3001\u541b\u306b\u5922\u4e2d\u3060\u3057\u306a", "\u307e\u3041\u3001\u809d\u5fc3\u306e\u5973\u6027\u306e\u5fc3\u306f\u3001\u5c04\u6b62\u3081\u3089\u308c\u3066\u306f\u3044\u306a\u3044\u3088\u3046\u3060\u304c\u306a", "\u2026\u2026\u809d\u5fc3\u306e\u5973\u6027\uff1f", "\u30e6\u30ea\u30a2\u738b\u5973\u306f\u3001\u3042\u307e\u308a\u541b\u306b\u306f\u8fd1\u3065\u304b\u306a\u3044\u3060\u308d\u3046\uff1f", "\u3048\u3048\u3001\u6b8b\u5ff5\u306a\u304c\u3089\u3002\u50d5\u3067\u306f\u8cb4\u65b9\u306e\u5144\u541b\u306b\u6575\u308f\u306a\u3044\u3088\u3046\u3067\u3059", "\u541b\u9054\u306e\u9593\u3067\u7e70\u308a\u5e83\u3052\u3089\u308c\u3066\u3044\u308b\u306e\u306f\u3001\u305d\u3093\u306a\u521d\u3005\u3057\u3044\u604b\u7269\u8a9e\u3067\u306f\u3042\u308b\u307e\u3044\u3002\u8133\u5473\u564c\u307e\u3067\u7b4b\u8089\u3067\u51fa\u6765\u3066\u3044\u308b\u3088\u3046\u306a\u5144\u4e0a\u306a\u3089\u3044\u3056\u77e5\u3089\u305a\u3002\u541b\u3068\u738b\u5973\u6bbf\u4e0b\u306e\u9063\u308a\u53d6\u308a\u306f\u3001\u3069\u3046\u898b\u3066\u3082\u72d0\u3068\u72f8\u306e\u5316\u304b\u3057\u5408\u3044\u3060", "\u50d5\u306f\u3068\u3082\u304b\u304f\u3001\u53ef\u6190\u306a\u59eb\u541b\u3092\u72d0\u6271\u3044\u306f\u5982\u4f55\u306a\u3082\u306e\u304b\u3068\u601d\u3044\u307e\u3059\u3088", "\u53ef\u6190\u306a\u59eb\u541b\u3001\u306d\u3047\u2026\u2026", "\u305f\u3060\u306e\u53ef\u6190\u306a\u59eb\u541b\u3067\u3042\u3063\u3066\u304f\u308c\u308c\u3070\u3001\u3069\u308c\u3060\u3051\u826f\u304b\u3063\u305f\u304b\u3002\u5168\u304f\u3001\u9762\u5012\u306a\u4e8b\u306b\u306a\u3063\u305f\u3082\u306e\u3060", "\u79c1\u3068\u3057\u3066\u306f\u541b\u306e\u59c9\u4e0a\u304c\u738b\u5983\u3068\u306a\u308a\u3001\u5144\u4e0a\u3092\u4e0a\u624b\u304f\u64cd\u7e26\u3057\u3066\u304f\u308c\u308b\u306e\u304c\u7406\u60f3\u3060\u3063\u305f\u3093\u3060\u304c\u306d", "\u3054\u5197\u8ac7\u3092", "\u5144\u4e0a\u306f\u5358\u7d14\u3067\u5973\u597d\u304d\u3060\u304c\u3001\u60aa\u3044\u4eba\u9593\u3067\u306f\u306a\u3044\u305e\u3002\u305d\u308c\u306b\u3001\u540c\u76df\u95a2\u4fc2\u306b\u3042\u308b\u96a3\u56fd\u306e\u738b\u5983\u3068\u3044\u3046\u306e\u306f\u3001\u541b\u306e\u59c9\u4e0a\u306b\u3068\u3063\u3066\u3082\u3001\u305d\u3046\u60aa\u3044\u8a71\u3067\u306f\u306a\u3044\u3068\u601d\u3046\u304c", "\u2026\u2026\u4ef0\u308b\u901a\u308a\u3067\u3059\u306d", "\u3067\u3059\u304c\u50d5\u306f\u59c9\u96e2\u308c\u51fa\u6765\u306a\u3044\u99c4\u76ee\u306a\u5f1f\u3067\u3059\u306e\u3067\u3001\u51fa\u6765\u308c\u3070\u59c9\u69d8\u306b\u306f\u672c\u56fd\u306b\u3044\u3066\u9802\u304d\u305f\u3044\u306e\u3067\u3059\u3088", "\u2026\u2026\u307e\u3041\u3001\u305d\u3046\u3044\u3046\u4e8b\u306b\u3057\u3066\u304a\u3053\u3046\u304b", "\u30ca\u30cf\u30c8\u30fc\u3001\u30e8\u30cf\u30f3\u30fc\uff01", "\u65e9\u304f\u304a\u3044\u3067\uff01\u304a\u8336\u306b\u3057\u3088\u3046\uff01", "\u8133\u5929\u6c17\u306a\u9854\u3092\u3057\u3066\u3002\u3042\u306e\u4eba\u306f\u3001\u79c1\u304c\u8a00\u3063\u305f\u897f\u65b9\u306e\u8996\u5bdf\u306e\u8a71\u3092\u899a\u3048\u3066\u3044\u308b\u3093\u3060\u308d\u3046\u304b", "\u897f\u65b9\u3068\u3044\u3044\u307e\u3059\u3068\u3001\u30b9\u30b1\u30eb\u30c4\u3068\u306e\u56fd\u5883\u4ed8\u8fd1\u306e\u68ee\u3067\u3059\u304b", "\u2026\u2026\u4e00\u3067\u5341\u3092\u7406\u89e3\u3059\u308b\u306e\u306f\u6b62\u3081\u3066\u304f\u308c", "\u6700\u8fd1\u306f\u3001\u30d5\u30e9\u30f3\u30e1\u3078\u6728\u6750\u306e\u8f38\u51fa\u304c\u5897\u3048\u3066\u3044\u307e\u3059\u304b\u3089\u306d\u3002\u3044\u304f\u3089\u5357\u897f\u306e\u68ee\u304c\u5e83\u5927\u3060\u3068\u306f\u3044\u3048\u3001\u8cc7\u6e90\u306b\u306f\u9650\u308a\u304c\u3042\u308b", "\u305d\u3046\u3044\u3048\u3070\u897f\u306e\u56fd\u5883\u4ed8\u8fd1\u306e\u753a\u3067\u3001\u75c5\u304c\u6d41\u884c\u3063\u3066\u3044\u308b\u305d\u3046\u3067\u3059\u306d", "\u306a\u3093\u3060\u3068\uff1f\u305d\u306e\u3088\u3046\u306a\u8a71\u306f\u805e\u3044\u3066\u3044\u306a\u3044\u304c\u3001\u3069\u3053\u306e\u60c5\u5831\u3060", "\u99b4\u67d3\u307f\u306e\u5546\u4eba\u9054\u3067\u3059\u3088\u3002\u71b1\u75c5\u304c\u5357\u3067\u306f\u306a\u304f\u897f\u3067\u6d41\u884c\u308b\u306e\u306f\u73cd\u3057\u3044\u3068\u3001\u6559\u3048\u3066\u304f\u308c\u307e\u3057\u305f", "\u71b1\u75c5\u304b\u3002\u897f\u90e8\u3067\u6d41\u884c\u308b\u4f8b\u304c\u306a\u3044\u308f\u3051\u3067\u306f\u306a\u3044\u304c\u2026\u2026\u6c17\u306b\u3057\u3066\u304a\u3044\u305f\u65b9\u304c\u826f\u3055\u305d\u3046\u3060\u306a", "\u30ca\u30cf\u30c8\u30fc\uff1f", "\u3048\u3048\u3044\u3001\u3042\u306e\u611a\u5144\u304c\uff01\u8336\u306a\u3093\u305e\u98f2\u3093\u3067\u3044\u308b\u5834\u5408\u304b!?", "\u30e8\u30cf\u30f3\u3001\u5f8c\u3067\u8a73\u3057\u304f\u805e\u304b\u305b\u3066\u304f\u308c\u3002\u51fa\u6765\u308c\u3070\u3001\u5546\u4eba\u304b\u3089\u3082\u76f4\u63a5\u8a71\u3092\u805e\u304d\u305f\u3044", "\u5206\u304b\u308a\u307e\u3057\u305f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/96/", "subtitle": "\u4faf\u7235\u4ee4\u606f\u306e\u7126\u71e5\u3002", "discourse": ["\u99c4\u76ee\u3060\u3002\u3069\u3053\u306b\u3082\u3044\u306a\u3044", "\u30de\u30ea\u30fc\u3061\u3083\u3093\u2026\u2026\u3044\u3063\u305f\u3044\u3001\u3069\u3053\u306b", "\u59c9\u3055\u3093\u3001\u3057\u3063\u304b\u308a\u3057\u3066", "\u3060\u3063\u3066\u3001\u30df\u30cf\u30a4\u30eb\u3002\u30de\u30ea\u30fc\u3061\u3083\u3093\u306f\u79c1\u9054\u306b\u5fc3\u914d\u304b\u3051\u3066\u5e73\u6c17\u306a\u5b50\u3058\u3083\u306a\u3044\u308f\u3002\u304d\u3063\u3068\u4f55\u304b\u3042\u3063\u305f\u306e\u3088", "\u305d\u3046\u3060\u306a\u2026\u2026\u3002\u5b22\u3061\u3083\u3093\u304c\u60aa\u622f\u3067\u3053\u3093\u306a\u4e8b\u3092\u3059\u308b\u3068\u306f\u601d\u3048\u306a\u3044\u3002\u60f3\u5b9a\u5916\u306e\u4e8b\u306b\u5dfb\u304d\u8fbc\u307e\u308c\u305f\u304b\u2026\u2026\u8ab0\u304b\u306b\u652b\u308f\u308c\u305f\u3068\u8003\u3048\u308b\u3079\u304d\u3060\u3002\u306a\u3041\u3001\u8cb4\u65cf\u306e\u5144\u3061\u3083\u3093\u3002\u3084\u3063\u3071\u308a\u6551\u63f4\u8981\u8acb\u3092\u51fa\u3057\u305f\u65b9\u304c\u3044\u3044\u3093\u3058\u3083\u306a\u3044\u304b\uff1f", "\u30de\u30ea\u30fc\u69d8\u306b\u3064\u3044\u3066\u3044\u305f\u7537\u6027\u3082\u3001\u898b\u3064\u304b\u308a\u307e\u305b\u3093\u304b", "\u2026\u2026\u3042\u3041", "\u738b\u5973\u6bbf\u4e0b\u306e\u635c\u7d22\u3068\u306a\u308c\u3070\u3001\u304b\u306a\u308a\u306e\u5927\u4e8b\u306b\u306a\u308a\u307e\u3059\u3002\u3044\u306a\u304f\u306a\u3063\u305f\u72b6\u6cc1\u3092\u8aac\u660e\u3059\u308c\u3070\u3001\u304a\u305d\u3089\u304f\u30f4\u30a9\u30eb\u30d5\u3068\u3044\u3046\u65b9\u306f\u3001\u738b\u5973\u8a98\u62d0\u306e\u91cd\u8981\u53c2\u8003\u4eba\u3068\u3057\u3066\u6307\u540d\u624b\u914d\u3055\u308c\u308b\u4e8b\u306b\u306a\u308b\u3068\u601d\u308f\u308c\u307e\u3059", "\u30f4\u30a9\u30eb\u30d5\u304c\u72af\u4eba\u3060\u306a\u3093\u3066\uff01\u305d\u3093\u306a\u8a33\u306a\u3044\u308f\uff01", "\u3067\u3059\u304c\u30de\u30ea\u30fc\u69d8\u304c\u3044\u306a\u304f\u306a\u3063\u305f\u6642\u306b\u508d\u306b\u3044\u305f\u306e\u306f\u3001\u5f7c\u3060\u3051\u3002\u3057\u304b\u3082\u3001\u5f7c\u81ea\u8eab\u3082\u4e00\u7dd2\u306b\u3044\u306a\u304f\u306a\u3063\u3066\u3044\u308b\u306e\u3067\u3059\u304b\u3089\u3001\u72b6\u6cc1\u8a3c\u62e0\u3068\u3057\u3066\u306f\u5145\u5206\u304b\u3068", "\u305d\u308c\u306f\u2026\u2026", "\u5ba4\u5185\u306b\u4e89\u3063\u305f\u5f62\u8de1\u306f\u3042\u308a\u307e\u305b\u3093\u3067\u3057\u305f\u3002\u82b1\u74f6\u306f\u843d\u3061\u3066\u3044\u307e\u3057\u305f\u304c\u3001\u3042\u3068\u306f\u7dba\u9e97\u306a\u307e\u307e\u3067\u3059\u3002\u30de\u30ea\u30fc\u69d8\u306f\u6c17\u3092\u5931\u3063\u3066\u3044\u305f\u306e\u304b\u3082\u3057\u308c\u307e\u305b\u3093\u304c\u3001\u305d\u306e\u7537\u6027\u304c\u7121\u62b5\u6297\u3067\u4e00\u7dd2\u306b\u652b\u308f\u308c\u305f\u3068\u8003\u3048\u308b\u306e\u306f\u4e0d\u81ea\u7136\u904e\u304e\u308b", "\u2026\u2026\u3067\u3082\u3001\u3042\u306e\u5144\u3055\u3093\u306f\u3001\u5b22\u3061\u3083\u3093\u306e\u4e8b\u3092\u3059\u3052\u3048\u53ef\u611b\u304c\u3063\u3066\u3044\u305f\u3093\u3060\u305c\u3002\u3042\u308c\u304c\u6f14\u6280\u3060\u3063\u305f\u3068\u306f\u3001\u30aa\u30ec\u306b\u306f\u601d\u3048\u306a\u3044", "\u305d\u3046\u3060\u306a\u3002\u307e\u308b\u3067\u59b9\u304b\u5a18\u307f\u305f\u3044\u306b\u53ef\u611b\u304c\u3063\u3066\u3044\u305f\u3002\u3042\u306e\u7537\u304c\u5f7c\u5973\u3092\u50b7\u4ed8\u3051\u308b\u3068\u306f\u8003\u3048\u96e3\u3044", "\u3067\u306f\u3001\u7121\u95a2\u4fc2\u3060\u3068\u3002\u305d\u3046\u4ef0\u308b\u306e\u3067\u3059\u304b", "\u2026\u2026\u2026\u2026", "\u30b2\u30aa\u30eb\u30af\u2026\u2026", "\u738b\u5973\u69d8\u3092\u5fc3\u914d\u3057\u3066\u3044\u308b\u306e\u306f\u3001\u7686\u4e00\u7dd2\u3060\u3088", "\u3042\u3042\u3001\u60aa\u304b\u3063\u305f", "\u3059\u307e\u306a\u304b\u3063\u305f\u306a\u3002\u5144\u3061\u3083\u3093\u306f\u771f\u5263\u306b\u8003\u3048\u3066\u304f\u308c\u305f\u306e\u306b\u3001\u611f\u60c5\u3060\u3051\u3067\u5426\u5b9a\u3057\u3061\u307e\u3063\u305f", "\u3044\u3044\u3048\u3001\u71b1\u304f\u306a\u3063\u3066\u3044\u305f\u306e\u306f\u50d5\u3082\u540c\u3058\u3067\u3059\u3002\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093", "\u4e00\u5148\u305a\u3001\u72b6\u6cc1\u3092\u6574\u7406\u3057\u307e\u3057\u3087\u3046\u3002\u8ab0\u304b\u5730\u56f3\u3092\u6301\u3063\u3066\u3044\u307e\u3059\u304b\uff1f\u5730\u5f62\u304c\u5206\u304b\u308c\u3070\u3001\u6bbf\u4e0b\u3092\u652b\u3063\u305f\u8005\u304c\u3001\u3069\u306e\u65b9\u89d2\u306b\u5411\u304b\u3063\u305f\u306e\u304b\u3001\u5c11\u3057\u306f\u7d5e\u308c\u308b\u304b\u3082\u3057\u308c\u306a\u3044", "\u3042\u3042\u3001\u78ba\u304b\u8377\u306e\u4e2d\u306b\u2026\u2026\u3061\u3087\u3063\u3068\u53d6\u3063\u3066\u304f\u308b", "\u3069\u3046\u3057\u305f\uff1f", "\uff01", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\u306f\u3001\u4f55\u51e6\u3060", "\u30af\u30e9\u30a6\u30b9\uff01\u8cb4\u65b9\u3001\u305d\u306e\u4f53\u3067\u8d77\u304d\u3066\u304d\u305f\u306e!?", "\u3080\u3001\u7121\u8336\u3067\u3059\uff01\u50b7\u306f\u5b8c\u5168\u306b\u306f\u585e\u3044\u3067\u3044\u306a\u3044\u3093\u3067\u3059\u3088!?", "\u3044\u3044\u3001\u69cb\u3046\u306a\u3002\u305d\u308c\u3088\u308a\u3082\u3001\u6bbf\u4e0b\u306f\u3069\u3061\u3089\u306b\u3044\u3089\u3063\u3057\u3083\u308b\uff1f", "\u2026\u2026", "\u6bbf\u4e0b\u3092\u652b\u3063\u305f\u8005\u3001\u3068\u8a00\u3063\u305f\u306a", "\u6bbf\u4e0b\u306f\u652b\u308f\u308c\u305f\u306e\u304b\u3002\u8ab0\u306b\u3060\uff1f\u4f55\u51e6\u306b\u3044\u3089\u3063\u3057\u3083\u308b\uff1f", "\u2026\u2026\u805e\u3044\u3066\u3044\u305f\u306e\u306a\u3089\u3001\u5206\u304b\u308b\u3067\u3057\u3087\u3046\u3002\u72af\u4eba\u306f\u5206\u304b\u3063\u3066\u304a\u308a\u307e\u305b\u3093\u3002\u4f55\u51e6\u306b\u884c\u3063\u305f\u306e\u304b\u3082\u3002\u305d\u308c\u3069\u3053\u308d\u304b\u3001\u307e\u3060\u652b\u308f\u308c\u305f\u3068\u78ba\u5b9a\u3057\u305f\u8a33\u3067\u3082\u3042\u308a\u307e\u305b\u3093", "\u3060\u304c\u3001\u3044\u306a\u304f\u306a\u3063\u305f\u3002\u305d\u308c\u3060\u3051\u306f\u4e8b\u5b9f\u3060\u308d\u3046\uff01", "\u5b89\u9759\u306b\u3057\u3066\u4e0b\u3055\u3044\uff01\u8cb4\u65b9\u306f\u307e\u3060\u3001\u52d5\u3051\u308b\u4f53\u3058\u3083\u306a\u3044", "\u3061\u3087\u3063\u3068\u3001\u4f55\u51e6\u3078\u884c\u304f\u3064\u3082\u308a\uff1f", "\u6bbf\u4e0b\u3092\u63a2\u3057\u306b\u884c\u304f", "\u305d\u306e\u4f53\u3067!?\u99ac\u9e7f\u3082\u4f11\u307f\u4f11\u307f\u8a00\u3044\u306a\u3055\u3044\u3088\uff01\u305d\u306e\u8fba\u3067\u91ce\u5782\u308c\u6b7b\u306c\u306e\u304c\u30aa\u30c1\u3060\u308f\uff01", "\u305d\u3046\u3060\u305c\u3001\u5144\u3055\u3093\u3002\u30a2\u30f3\u30bf\u306f\u7015\u6b7b\u306e\u91cd\u50b7\u3060\u3063\u305f\u3093\u3060\u305e", "\u7121\u7406\u3057\u3066\u52d5\u304f\u304b\u3089\u3001\u50b7\u53e3\u304c\u958b\u304d\u304b\u3051\u3066\u3093\u3058\u3083\u306d\u3048\u304b\uff01\u30a2\u30f3\u30bf\u306f\u5927\u4eba\u3057\u304f\u5bdd\u3066\u3044\u308d\uff01", "\u30aa\u30ec\u306f\u6bbf\u4e0b\u306e\u8b77\u885b\u3060\u3002\u30aa\u30ec\u304c\u63a2\u3055\u305a\u306b\u8ab0\u304c\u63a2\u3059", "\u30aa\u30ec\u9054\u304c\u63a2\u3057\u307e\u3059\u304b\u3089\uff01", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\u306b\u95a2\u308f\u308b\u4e8b\u3092\u3001\u4ed6\u306e\u4eba\u9593\u306b\u983c\u3080\u3064\u3082\u308a\u306f\u306a\u3044", "\u306a\u306b\u3053\u306e\u9811\u56fa\u8005!?", "\u30a2\u30f3\u30bf\u306b\u306a\u3093\u304b\u3042\u3063\u305f\u3089\u3001\u30aa\u30ec\u9054\u306f\u5b22\u3061\u3083\u3093\u306b\u306a\u3093\u3066\u8b1d\u3063\u305f\u3089\u3044\u3044\u3093\u3060\u3088!?\u983c\u3080\u304b\u3089\u5927\u4eba\u3057\u304f\u5bdd\u3066\u3044\u3066\u304f\u308c\uff01", "\u30aa\u30ec\u304c\u9593\u629c\u3051\u306b\u3082\u5bdd\u3066\u3044\u308b\u9593\u306b\u3001\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\u304c\u3044\u306a\u304f\u306a\u3063\u305f\u3093\u3060\u305e!?\u3053\u308c\u4ee5\u4e0a\u5bdd\u3066\u306a\u3069\u3044\u3089\u308c\u308b\u3082\u306e\u304b\uff01", "\u7121\u7406\u3057\u3066\u6b7b\u3093\u3060\u3089\u3001\u5143\u3082\u5b50\u3082\u306a\u3044\u3067\u3057\u3087\u3046\u304c!!", "\u30aa\u30ec\u306e\u547d\u306f\u3001\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u69d8\u306b\u6367\u3052\u305f\u3082\u306e\u3060\uff01\u3042\u306e\u65b9\u306e\u5371\u6a5f\u306b\u4f7f\u308f\u305a\u3057\u3066\u3001\u3044\u3064\u4f7f\u3046\uff01", "\u30af\u30e9\u30a6\u30b9\u2026\u2026\u8cb4\u65b9\u3001\u306a\u3093\u3066\u4e8b\u3092\u2026\u2026\uff01", "\u3063\u3050\u3001!?", "\u3075\u3056\u3051\u308b\u306a", "\u8cb4\u65b9\u306e\u547d\u306f\u3001\u5947\u8de1\u3067\u306f\u306a\u304f\u4eba\u306e\u52aa\u529b\u3067\u7e4b\u304c\u308c\u305f\u3082\u306e\u3060\u3002\u540c\u8239\u3057\u3066\u3044\u305f\u4eba\u9054\u304c\u3001\u738b\u5973\u69d8\u304c\u3001\u5fc5\u6b7b\u306b\u306a\u3063\u3066\u7e4b\u304e\u6b62\u3081\u3066\u304f\u308c\u305f\u7d50\u679c\u3001\u8cb4\u65b9\u306f\u4eca\u3001\u3053\u3046\u3057\u3066\u3053\u3053\u306b\u3044\u308b\u3002\u305d\u3093\u306a\u5927\u5207\u306a\u3082\u306e\u3092\u3001\u8cb4\u65b9\u306f\u81ea\u5206\u306e\u8eab\u52dd\u624b\u3067\u3001\u6368\u3066\u3088\u3046\u3068\u8a00\u3046\u306e\u304b!!", "\u2026\u2026\u3063", "\u738b\u5973\u69d8\u304c\u3069\u308c\u3060\u3051\u8cb4\u65b9\u3092\u547c\u3093\u3067\u3044\u305f\u304b\uff01\u3069\u308c\u3060\u3051\u8cb4\u65b9\u306e\u305f\u3081\u306b\u6ce3\u3044\u3066\u3044\u305f\u304b\uff01\u3042\u3093\u306a\u306b\u5927\u5207\u306b\u3057\u3066\u3082\u3089\u3063\u3066\u3001\u3069\u3046\u3057\u3066\u2026\u2026", "\u2026\u2026\u30df\u30cf\u30a4\u30eb", "\u2026\u2026\u2026\u2026\u3044\u3084\u3001", "\u2026\u2026\u9ce5\uff1f", "\u2026\u2026\u307e\u3055\u304b"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/95/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u52d5\u63fa\u3002(4)", "discourse": ["\u3068\u308a\u3042\u3048\u305a\u3001\u574a\u3063\u3061\u3083\u3093\u306b\u6587\u3092\u9001\u3063\u3068\u3044\u305f\u304b\u3089", "\u574a\u3063\u3061\u3083\u3093\u3063\u3066\u2026\u2026", "\u4faf\u7235\u5bb6\u306e\u574a\u3063\u3061\u3083\u3093\u306e\u4e8b\u3067\u3059\u3088\u3002\u30a2\u30f3\u30bf\u304c\u7121\u4e8b\u3060\u3063\u3066\u77e5\u3089\u305b\u3066\u304a\u304b\u306a\u3044\u3068\u3001\u63a2\u3057\u56de\u3063\u3061\u307e\u3046\u3060\u308d", "\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u2026\u2026\u306a\u3093\u3067\u3059\uff1f", "\u307e\u3060\u30aa\u30ec\u306e\u4e8b\u3092\u7591\u3063\u3066\u308b\u304f\u305b\u306b\u3001\u304a\u793c\u3068\u304b\u8a00\u3063\u3061\u3083\u3046\u3093\u3060\u306a", "\u2026\u2026\u3054\u3081\u3093\u306a\u3055\u3044", "\u305d\u306e\u4e0a\u3001\u8b1d\u7f6a\u3068\u304d\u305f\u304b\u3002\u30a2\u30f3\u30bf\u3001\u672c\u5f53\u306b\u738b\u65cf\uff1f", "\u30de\u30ea\u30fc\u306b\u738b\u65cf\u3089\u3057\u3055\u3092\u6c42\u3081\u3066\u3082\u7121\u99c4\u3088\u3002\u5a01\u53b3\u3060\u3063\u3066\u306a\u3044\u308f\u3051\u3058\u3083\u306a\u3044\u306e\u306b\u3001\u81ea\u5206\u3060\u3051\u306e\u305f\u3081\u306b\u306f\u5fae\u5875\u3082\u767a\u63ee\u51fa\u6765\u306a\u3044\u5b50\u3060\u304b\u3089", "\u8239\u306e\u4e0a\u3067\u3053\u306e\u5b50\u3092\u898b\u5b88\u3063\u3066\u3044\u305f\u306e\u306a\u3089\u3001\u305d\u306e\u4f4d\u5206\u304b\u308b\u3067\u3057\u3087", "\u898b\u5b88\u3063\u3066\u3044\u305f\u3068\u3044\u3046\u3088\u308a\u306f\u3001\u76e3\u8996\u3060\u3051\u3069\u306a", "\u307e\u3041\u3001\u3044\u3044\u3084\u3002\u305d\u308c\u3088\u308a\u3082\u59eb\u3055\u3093\u3002\u3053\u306e\u5144\u3055\u3093\u3068\u8a71\u3059\u3093\u3060\u308d\uff1f", "\u79c1\u306e\u76ee\u7684\u3092\u3001\u307e\u3060\u8a71\u3057\u3066\u3044\u306a\u304b\u3063\u305f\u308f\u306d", "\u306f\u3044\u3002\u3069\u3046\u3057\u3066\u3001\u79c1\u3092\u652b\u3063\u305f\u3093\u3067\u3059\u304b\uff1f", "\u305d\u3046\u3044\u3048\u3070\u3001\u30a2\u30f3\u30bf\u306b\u306f\u3001\u3061\u3083\u3093\u3068\u81ea\u5df1\u7d39\u4ecb\u3082\u3057\u3066\u306a\u304b\u3063\u305f\u308f", "\u3048\uff1f\u81ea\u5df1\u7d39\u4ecb\u306a\u3089\u3001\u521d\u3081\u3066\u4f1a\u3063\u305f\u6642\u306b\u2026\u2026", "\u30af\u30fc\u30a2\u65cf\u6b21\u671f\u65cf\u9577\u3001\u30f4\u30a9\u30eb\u30d5\u30fb\u30af\u30fc\u30a2\u30fb\u30ea\u30e5\u30c3\u30ab\u30fc\u3068\u7533\u3057\u307e\u3059\u3002\u738b\u5973\u6bbf\u4e0b\u306e\u3054\u5c0a\u9854\u3092\u62dd\u3057\u5949\u308a\u3001\u6050\u60a6\u81f3\u6975\u306b\u5b58\u3058\u307e\u3059", "\u3048\u2026\u2026\u3048\u2026\u2026!?", "\u3068\u3093\u3067\u3082\u306a\u3044\u306e\u3092\u91e3\u308a\u4e0a\u3052\u305f\u3082\u3093\u3060\u306a\u2026\u2026", "\u307b\u3001\u2026\u2026\u672c\u5f53\u306b\u2026\u2026\uff1f", "\u672c\u5f53\u306b", "\u30cd\u30fc\u30d9\u30eb\u306e\u5973\u795e\u3092\u63a2\u3057\u3066\u3044\u308b\u3068\u3001\u4ee5\u524d\u8a71\u3057\u305f\u308f\u3088\u306d\uff1f", "\u306f\u3044\u3002\u76ee\u7684\u307e\u3067\u306f\u805e\u3044\u3066\u307e\u305b\u3093\u3051\u3069", "\u3042\u3042\u3001\u305d\u308c\u306f\u5ac1\u63a2\u3057\u3088", "\u306f\uff1f", "\u5973\u795e\u3092\u5ac1\u306b\uff1f\u3064\u307e\u308a\u3001\u8272\u6c17\u304c\u7686\u7121\u306a\u3053\u306e\u59eb\u3055\u3093\u3092\u5a36\u308b\u3064\u3082\u308a\u304b\uff1f", "\u5927\u4e08\u592b\u3088\u3001\u30de\u30ea\u30fc\u3002\u79c1\u306f\u30a2\u30f3\u30bf\u3092\u5ac1\u306b\u3059\u308b\u6c17\u306f\u306a\u3044\u308f", "\u78ba\u304b\u306b\u30de\u30ea\u30fc\u306f\u53ef\u611b\u3044\u3051\u3069\u3001\u30a2\u30f3\u30bf\u306f\u300e\u305f\u3060\u306e\u53ef\u611b\u3044\u304a\u5ac1\u3055\u3093\u300f\u306a\u3093\u3066\u5668\u3058\u3083\u306a\u3044", "\u3048\uff1f", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093\u2026\u2026\uff1f", "\u306d\u3047\u3001\u30de\u30ea\u30fc\u3002\u79c1\u304c\u8a00\u3046\u306e\u3082\u306a\u3093\u3060\u3051\u3069\u3001\u30af\u30fc\u30a2\u65cf\u306f\u304a\u8cb7\u3044\u5f97\u3060\u3068\u601d\u3046\u308f\u3088\u3002\u77e5\u8b58\u306f\u8c4a\u5bcc\u3060\u304b\u3089\u3001\u3061\u3087\u3063\u3068\u73cd\u3057\u3044\u85ac\u3082\u4f5c\u308c\u308b\u3057\u3001\u8155\u3082\u826f\u3044\u304b\u3089\u6cbb\u7642\u3082\u51fa\u6765\u308b\u308f\u3002\u3061\u3087\u3063\u3068\u4eba\u898b\u77e5\u308a\u3067\u9811\u56fa\u3067\u504f\u5c48\u306a\u5974\u304c\u591a\u3044\u3051\u3069\u3001\u307e\u3041\u3001\u305d\u3053\u306f\u3054\u611b\u5b0c\u3063\u3066\u4e8b\u3067", "\u306f\u3001\u306f\u3041\u2026\u2026", "\u78ba\u304b\u306b\u30af\u30fc\u30a2\u65cf\u306e\u77e5\u8b58\u3068\u6280\u8853\u306f\u7d20\u6674\u3089\u3057\u3044\u3067\u3059\u3002\u73fe\u306b\u79c1\u3082\u3001\u71b1\u75c5\u306e\u85ac\u3092\u8b72\u3063\u3066\u6b32\u3057\u304f\u3066\u3001\u30d5\u30e9\u30f3\u30e1\u307e\u3067\u6765\u305f\u3093\u3067\u3059\u304b\u3089", "\u3042\u3089\u3001\u305d\u308c\u306a\u3089\u4e01\u5ea6\u3044\u3044\u308f\u306d", "\u3069\u3046\u305b\u306a\u3089\u3001\u30af\u30fc\u30a2\u65cf\u3054\u3068\u96c7\u3063\u3066\u6b32\u3057\u3044\u3093\u3060\u3051\u3069", "\u3048\uff1f", "\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u30fb\u30d5\u30a9\u30f3\u30fb\u30f4\u30a7\u30eb\u30d5\u30a1\u30eb\u30c8\u6bbf\u4e0b\u3002\u3069\u3046\u304b\u3001\u79c1\u9054\u306e\u4e3b\u4eba\u306b\u306a\u3063\u3066\u9802\u3051\u307e\u305b\u3093\u304b\uff1f", "\u2026\u2026\u306f\u3044\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/94/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u52d5\u63fa\u3002(3)", "discourse": ["\u3055\u3041\u3001\u3069\u3046\u6599\u7406\u3057\u3088\u3046\u304b\u3057\u3089\uff1f", "\u3042\u30fc\u2026\u2026\u6700\u60aa\u3060", "\u3067\u3001\u30a2\u30f3\u30bf\u306f\u4e00\u4f53\u4f55\u8005\u306a\u306e\uff1f\u8ab0\u306e\u5dee\u3057\u91d1\u3067\u79c1\u9054\u3092\u72d9\u3063\u305f\u306e\u304b\u3057\u3089", "\u4e00\u7dd2\u306e\u8239\u306b\u4e57\u3063\u3066\u3044\u305f\u308f\u3088\u306d\u3002\u6211\u4fad\u304a\u5b22\u69d8\u306e\u4f8d\u5973\u304c\u5012\u308c\u305f\u6642\u3001\u90e8\u5c4b\u3092\u660e\u3051\u6e21\u3057\u3066\u304f\u308c\u305f\u306e\u306f\u30a2\u30f3\u30bf\u3060\u3063\u305f\u308f", "\u6d77\u8cca\u306b\u8972\u6483\u3055\u308c\u305f\u6642\u306b\u5171\u95d8\u3057\u3066\u304f\u308c\u305f\u306e\u306f\u3001\u5358\u7d14\u306b\u5229\u5bb3\u306e\u4e00\u81f4\u3060\u3063\u305f\u306e\uff1f", "\u3060\u3093\u307e\u308a\uff1f", "\u907f\u3051\u3066!!", "\u2026\u2026\u3063!?", "\u30de\u30ea\u30fc\u30c3!!", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093\u3063\uff01", "\u96e2\u3057\u3066\u3063!!", "\u3042\u30fc\u3082\u30fc\u3001\u672c\u5f53\u30a2\u30f3\u30bf\u9762\u5012\u81ed\u3044\u306a", "\u2026\u2026\u3078\uff1f", "\u3064\u3046\u304b\u30a2\u30f3\u30bf\u3092\u652b\u3063\u305f\u306e\u306f\u3001\u3042\u306e\u7537\u3060\u308d\u3002\u4f55\u3067\u3001\u305d\u3063\u3061\u306b\u52a9\u3051\u3092\u6c42\u3081\u308b\u3093\u3060\uff1f\u30aa\u30ec\u306f\u52a9\u3051\u306b\u6765\u306a\u3044\u65b9\u304c\u826f\u304b\u3063\u305f\u3067\u3059\u304b\u306d\u3001\u304a\u59eb\u69d8", "\u2026\u2026\u52a9\u3051\uff1f", "\u305d\u3046\u3001\u52a9\u3051\u306b\u6765\u305f\u3093\u3067\u3059\u3088\u3002\u304a\u5206\u304b\u308a\uff1f", "\u305d\u308c\u306f\u306a\u3044\uff01", "\u2026\u2026\u3042\u3093\uff1f", "\u3060\u3001\u3060\u3060\u3060\u3060\u3063\u3066\uff01\u8cb4\u65b9\u304c\u79c1\u3092\u52a9\u3051\u308b\u7406\u7531\u304c\u306a\u3044\u3067\u3057\u3087\u3046!?", "\uff1f", "\u2026\u2026\u30a2\u30f3\u30bf\u3001\u30aa\u30ec\u306e\u4e8b\u3092\u965b\u4e0b\u304b\u3089\u805e\u3044\u3066\u3044\u305f\u3093\u3058\u3083\u306a\u3044\u306e\u304b\uff1f", "\u3048\uff1f\u305d\u308c\u306f\u3001\u3069\u3046\u3044\u3046\u2026\u2026", "\u59eb\u3055\u3093\u3001\u30aa\u30ec\u306e\u8cea\u554f\u306b\u7c21\u6f54\u306b\u7b54\u3048\u3066\u304f\u308c", "\u306f\uff1f", "\u5f8c\u308d\u304b\u3089\u8ffd\u3063\u3066\u304f\u308b\u7537\u306f\u3001\u30a2\u30f3\u30bf\u306b\u3068\u3063\u3066\u6392\u9664\u3059\u3079\u304d\u6575\u304b\uff1f", "\u3044\u3044\u3048\uff01", "\u3053\u306e\u307e\u307e\u56fd\u306b\u9003\u3052\u5e30\u308b\u306e\u3068\u3001\u85ac\u5e2b\u306e\u7537\u3068\u8a71\u3092\u3059\u308b\u306e\u3068\u3001\u3069\u3063\u3061\u304c\u3044\u3044\uff1f", "\u3053\u3001\u5f8c\u8005\u3067\uff01", "\u5206\u304b\u3063\u305f", "\u30f4\u30a9\u30eb\u30d5\u30fbK\u30fb\u30ea\u30e5\u30c3\u30ab\u30fc", "\u2026\u2026\u306a\u306b\uff1f", "\u30a2\u30f3\u30bf\u306f\u3001\u3053\u306e\u59eb\u3055\u3093\u306e\u6575\u304b\uff1f", "\u3044\u3044\u3048\u3002\u2026\u2026\u30de\u30ea\u30fc\u3092\u652b\u3063\u305f\u79c1\u304c\u8a00\u3063\u3066\u3082\u8aac\u5f97\u529b\u306f\u306a\u3044\u304b\u3082\u3057\u308c\u306a\u3044\u3051\u308c\u3069\u3001\u3053\u306e\u5b50\u3092\u50b7\u4ed8\u3051\u308b\u4e8b\u3060\u3051\u306f\u7d76\u5bfe\u306b\u3057\u306a\u3044\u308f", "\u3067\u3001\u59eb\u3055\u3093\u3002\u3069\u3046\u3059\u308b\uff1f\u4fe1\u3058\u308b\uff1f", "\u2026\u2026\u3093\uff1f", "\u3082\u3057\u304b\u3057\u3066\u2026\u2026\u7236\u69d8\u306e\u300e\u9ce5\u300f\uff1f", "\u4eca\u66f4\u5206\u304b\u3063\u305f\u306e\u304b\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/93/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u52d5\u63fa\u3002(2)", "discourse": ["\u4e0b\u304c\u3063\u3066\u308d", "\u3063\uff01", "\u3072\u3063!?", "\u2026\u2026\u305d\u306e\u683c\u597d\u3001\u8239\u306e\u4e0a\u3067\u898b\u305f\u6c17\u304c\u3059\u308b\u3093\u3060\u3051\u3069\u3001\u6c17\u306e\u305b\u3044\u304b\u3057\u3089\uff1f", "\u3063\u3050\u3001", "\u2026\u2026\u3063\u3001", "\u30a2\u30f3\u30bf\u3001", "\u52d5\u304f\u306a", "\u6b21\u306f\u6bba\u3059", "\u305d\u3063\u3061\u3082\u5927\u4eba\u3057\u304f\u3057\u3066\u3044\u3066\u304f\u308c", "\u2026\u2026\u2026\u2026\u304b\u3089\u3059\u2026\u2026\uff1f", "!?", "\u304a\u3089\u3063!!", "\u3050\u3063", "\u5f62\u52e2\u9006\u8ee2\u306d\u3002\u3056\u307e\u3042\u306a\u3044\u308f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/92/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u52d5\u63fa\u3002", "discourse": ["\u30de\u30ea\u30fc", "\u98df\u3079\u306a\u3044\u306e\uff1f", "\u3053\u3093\u306a\u98df\u4e8b\u3067\u3054\u3081\u3093\u306d\u3002\u3082\u3046\u5c11\u3057\u6751\u304b\u3089\u96e2\u308c\u305f\u3089\u3001\u8cb7\u3044\u7269\u3082\u51fa\u6765\u308b\u3060\u308d\u3046\u3057\u3001\u3061\u3083\u3093\u3068\u3057\u305f\u7269\u3092\u98df\u3079\u3055\u305b\u3066\u3042\u3052\u3089\u308c\u308b\u3068\u601d\u3046\u308f", "\u30de\u30ea\u30fc", "\u76ba\u5bc4\u3063\u3066\u308b\u3002\u53ef\u611b\u3044\u9854\u304c\u53f0\u7121\u3057\u3088\uff1f", "\u2026\u2026\u8ab0\u306e\u305b\u3044\u3067\u3059\u304b", "\u79c1\u306e\u305b\u3044\u306d", "\u2026\u2026\u3069\u3046\u3057\u3066\u79c1\u306a\u3093\u3066\u652b\u3063\u305f\u3093\u3067\u3059\u3002\u79c1\u3001\u672c\u7269\u306e\u738b\u5973\u306a\u3093\u3067\u3059\u3088\uff1f", "\u77e5\u3063\u3066\u308b\u308f\u3088", "\u3060\u3063\u305f\u3089\u3001\u306a\u3093\u3067\uff01\u738b\u5973\u652b\u3063\u3066\u304a\u3044\u3066\u3001\u5197\u8ac7\u3067\u3059\u3058\u3083\u6e08\u307e\u306a\u3044\u3093\u3067\u3059\u3088!?", "\u307e\u3041\u6700\u60aa\u3001\u6b7b\u7f6a\u3067\u3057\u3087\u3046\u306d", "\u305d\u308c\u304c\u5206\u304b\u3063\u3066\u3044\u308b\u304b\u3089\u3001\u308d\u304f\u306b\u62b5\u6297\u3057\u306a\u304b\u3063\u305f\u3093\u3067\u3057\u3087\uff1f\u79c1\u304c\u30a2\u30f3\u30bf\u3092\u652b\u3063\u305f\u3068\u3001\u8ab0\u304b\u306b\u77e5\u3089\u308c\u3066\u3057\u307e\u3048\u3070\u8a00\u3044\u9003\u308c\u306f\u51fa\u6765\u306a\u304f\u306a\u308b\u3002\u79c1\u3092\u7f6a\u4eba\u306b\u3057\u305f\u304f\u306a\u304f\u3066\u3001\u3053\u3093\u306a\u3068\u3053\u308d\u307e\u3067\u3064\u3044\u3066\u304d\u3061\u3083\u3063\u305f\u3093\u3060\u304b\u3089\u3001\u30a2\u30f3\u30bf\u3082\u76f8\u5f53\u306a\u304a\u4eba\u597d\u3057\u3088\u306d", "\u4eca\u306a\u3089\u307e\u3060\u3001\u9593\u306b\u5408\u3044\u307e\u3059\u3002\u79c1\u306e\u6211\u4fad\u3067\u629c\u3051\u51fa\u3057\u305f\u4e8b\u306b\u3057\u307e\u3057\u3087\u3046", "\u99c4\u76ee\u3088\u3002\u305d\u3093\u306a\u306b\u7c21\u5358\u306b\u8ae6\u3081\u3089\u308c\u308b\u306a\u3089\u3001\u738b\u5973\u3092\u652b\u3046\u306a\u3093\u3066\u5927\u305d\u308c\u305f\u771f\u4f3c\u306f\u3057\u3066\u306a\u3044\u308f", "\u3069\u3046\u3057\u3066\uff01\u8a00\u3063\u3066\u304a\u304d\u307e\u3059\u304c\u3001\u79c1\u306a\u3093\u306e\u4fa1\u5024\u3082\u306a\u3044\u3067\u3059\u3088!?\u8eab\u5206\u304c\u7121\u99c4\u306b\u9ad8\u3044\u3060\u3051\u306e\u5c0f\u5a18\u3067\u3059\uff01", "\u3042\u308b\u308f", "\u30a2\u30f3\u30bf\u306b\u306f\u3001\u4fa1\u5024\u304c\u3042\u308b", "\u4e16\u754c\u306b\u306f\u3001\u6ca2\u5c71\u306e\u91d1\u6301\u3061\u304c\u3044\u308b\u308f\u3002\u5927\u4f53\u304c\u81ea\u5206\u306e\u5229\u76ca\u3057\u304b\u76ee\u306b\u5165\u3063\u3066\u3044\u306a\u3044\u30af\u30ba\u3060\u3051\u3069\u3001\u826f\u8b58\u306e\u3042\u308b\u4eba\u3060\u3063\u3066\u52ff\u8ad6\u3044\u308b\u3002\u3067\u3082\u306d\u3001\u30a2\u30f3\u30bf\u307f\u305f\u3044\u306b\u3001\u90e8\u4e0b\u3092\u6551\u3046\u305f\u3081\u306b\u5168\u529b\u3092\u5c3d\u304f\u3059\u91d1\u6301\u3061\u306f\u3001\u6c7a\u3057\u3066\u591a\u304f\u306a\u3044\u308f\u3002\u3046\u3046\u3093\u3001\u79c1\u306f\u30a2\u30f3\u30bf\u4ee5\u5916\u3001\u305d\u3093\u306a\u99ac\u9e7f\u3092\u77e5\u3089\u306a\u3044", "\u2026\u2026\u99ac\u9e7f\u3063\u3066", "\u8cb7\u3044\u304b\u3076\u308a\u3067\u3059\u3002\u79c1\u4ee5\u4e0a\u306b\u7d20\u6674\u3089\u3057\u3044\u4eba\u306f\u3001\u5c71\u307b\u3069\u3044\u307e\u3059\u3088", "\u738b\u4faf\u8cb4\u65cf\u306e\u4e2d\u3067\u3001\u3069\u308c\u3060\u3051\u306e\u4eba\u9593\u304c\u90e8\u4e0b\u306e\u305f\u3081\u306b\u5fc5\u6b7b\u306b\u306a\u308c\u308b\uff1f\u3069\u308c\u3060\u3051\u306e\u4eba\u9593\u304c\u3001\u5e73\u6c11\u306b\u982d\u3092\u4e0b\u3052\u3089\u308c\u308b\u306e\uff1f", "\u30f4\u30a9\u30eb\u30d5\u3055\u2026\u2026", "\u30a2\u30f3\u30bf\u306f\u3061\u3083\u3093\u3068\u3001\u81ea\u5206\u306e\u4fa1\u5024\u3092\u77e5\u308b\u3079\u304d\u3060", "\u3063\u2026\u2026", "\u30de\u30ea\u30fc\u3001\u79c1\u306f\u2026\u2026", "\u6697\u5668\u2026\u2026\uff01"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/91/", "subtitle": "\u4faf\u7235\u4ee4\u606f\u306e\u75b2\u52b4\u3002", "discourse": ["\u75b2\u308c\u305f\u306a\u2026\u2026", "\u3042\u306e\u3001\u30b2\u30aa\u30eb\u30af\u69d8", "\u30b0\u30e9\u30fc\u30c4\u7537\u7235\u5bb6\u9577\u5973\u3001\u30d5\u30ed\u30fc\u30e9\u30fb\u30d5\u30a9\u30f3\u30fb\u30b0\u30e9\u30fc\u30c4\u3067\u3054\u3056\u3044\u307e\u3059", "\u30d5\u30ed\u30fc\u30e9\u5b22\uff1f\u50d5\u306e\u9854\u306b\u306a\u306b\u304b\uff1f", "\u3044\u3044\u3048\u3002\u305f\u3060\u2026\u2026\u8cb4\u65b9\u69d8\u306f\u3001\u610f\u5916\u3068\u8868\u60c5\u306b\u611f\u60c5\u304c\u51fa\u308b\u65b9\u306a\u306e\u3067\u3059\u306d", "\u3048\uff1f", "\u300e\u307e\u308b\u3067\u5225\u4eba\u3060\u300f", "!?", "\u305d\u3046\u3001\u304a\u9854\u306b\u66f8\u3044\u3066\u3042\u308a\u307e\u3057\u3066\u3088", "\u6b69\u304d\u306a\u304c\u3089\u3001\u5c11\u3057\u304a\u8a71\u3092\u3057\u3066\u3082\uff1f", "\u30d5\u30ed\u30fc\u30e9\u5b22\u306f\u3001\u30d5\u30e9\u30f3\u30e1\u3078\u3069\u306e\u3088\u3046\u306a\u5fa1\u7528\u3067\uff1f", "\u2026\u2026\u305d\u308c\u306f", "\u2026\u2026\u30b2\u30aa\u30eb\u30af\u69d8\u306f\uff1f\u30b2\u30aa\u30eb\u30af\u69d8\u306f\u3001\u3069\u306e\u3088\u3046\u306a\u3054\u7528\u4e8b\u304c\u3042\u3063\u3066\u3001\u30d5\u30e9\u30f3\u30e1\u3078\u3044\u3089\u3057\u305f\u306e\u3067\u3059\uff1f", "\u3042\u308b\u3082\u306e\u3092\u63a2\u3057\u306b", "\u635c\u3057\u7269\u3067\u3059\u304b\uff1f\u305d\u308c\u306f\u3054\u5546\u58f2\u306e\u2026\u2026\u3001\u4e0d\u8ebe\u306a\u8cea\u554f\u3092\u3057\u3066\u3057\u307e\u3063\u3066\u3001\u7533\u3057\u8a33\u3042\u308a\u307e\u305b\u3093", "\u3044\u3044\u3048\u3002\u305f\u3060\u3001\u50d5\u81ea\u8eab\u306e\u635c\u3057\u7269\u3067\u306f\u306a\u3044\u306e\u3067\u3001\u8a73\u3057\u304f\u306f\u304a\u6559\u3048\u51fa\u6765\u307e\u305b\u3093", "\u5225\u306e\u65b9\u306e\u305f\u3081\u306b\u2026\u2026\u30d5\u30e9\u30f3\u30e1\u307e\u3067\uff1f", "\u5446\u308c\u307e\u3057\u305f\u304b\uff1f", "\u3068\u3066\u3082\u5927\u5207\u306b\u3055\u308c\u3066\u3044\u308b\u65b9\u306e\u305f\u3081\u3001\u306a\u3093\u3067\u3059\u306d", "\uff01", "\u304a\u9854\u3092\u898b\u308c\u3070\u3001\u5206\u304b\u308a\u307e\u3059", "\u3042\u307e\u308a\u898b\u306a\u3044\u3067\u4e0b\u3055\u3044", "\u2026\u2026\u30d5\u30ed\u30fc\u30e9\u5b22\uff1f", "\u78ba\u304b\u3042\u305d\u3053\u306f\u3001\u738b\u5973\u6bbf\u4e0b\u304c\u2026\u2026", "\uff01", "\u5931\u793c\u81f4\u3057\u307e\u3059!!", "\u2026\u2026\u30de\u30ea\u30fc\u69d8\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/90/", "subtitle": "\u5b50\u7235\u4ee4\u5b22\u306e\u56de\u9867\u3002(2)", "discourse": ["\u2026\u2026\u52ff\u8ad6\u3088\u3002\u59c9\u3055\u3093\u306f\u30de\u30ea\u30fc\u3061\u3083\u3093\u3068\u4ef2\u826f\u3057\u306a\u3093\u3060\u304b\u3089", "\u305d\u3046\u306a\u3093\u3060", "\u305d\u3046\u3088\u3002\u3042\u3093\u306a\u306b\u53ef\u611b\u3044\u5b50\u3092\u3001\u79c1\u304c\u653e\u3063\u3066\u304a\u304f\u7b48\u306a\u3044\u3067\u3057\u3087\uff1f", "\u78ba\u304b\u306b\u738b\u5973\u69d8\u306f\u59c9\u3055\u3093\u306e\u597d\u307f\u3060\u306d", "\u672c\u306e\u4e2d\u304b\u3089\u304a\u59eb\u69d8\u304c\u629c\u3051\u51fa\u3057\u3066\u6765\u305f\u306e\u304b\u3068\u601d\u3063\u305f\u308f", "\u305d\u308c\u306b\u30de\u30ea\u30fc\u3061\u3083\u3093\u306f\u5bb9\u59ff\u3060\u3051\u3058\u3083\u306a\u304f\u3066\u3001\u4e2d\u8eab\u307e\u3067\u53ef\u611b\u3089\u3057\u3044\u306e\u3088\u3002\u3073\u3063\u304f\u308a\u3057\u305f\u308f\u3002\u76ee\u306e\u899a\u3081\u308b\u3088\u3046\u306a\u7f8e\u5c11\u5973\u306a\u306e\u306b\u3001\u9a55\u308a\u9ad8\u3076\u3063\u305f\u3068\u3053\u308d\u304c\u4e00\u5207\u306a\u3044\u306a\u3093\u3060\u3082\u306e", "\u3046\u3093\u3001\u738b\u5973\u69d8\u306f\u51c4\u3044\u3093\u3060\u3002\u5049\u3076\u3063\u3066\u306a\u3044\u306e\u306b\u3001\u5049\u3044", "\u738b\u65cf\u3068\u3057\u3066\u306e\u6a29\u5229\u3092\u4e3b\u5f35\u3057\u306a\u3044\u306e\u306b\u3001\u7fa9\u52d9\u306f\u679c\u305f\u305d\u3046\u3068\u52aa\u529b\u3059\u308b\u3002\u30aa\u30ec\u3088\u308a\u5e74\u4e0b\u306e\u5973\u306e\u5b50\u304c\u3001\u7121\u7406\u3057\u3066\u80cc\u4f38\u3073\u3059\u308b\u3093\u3058\u3083\u306a\u304f\u3066\u3001\u606f\u3092\u3059\u308b\u3088\u3046\u306b\u81ea\u7136\u306b\u3084\u308b\u3093\u3060\u3002\u51c4\u3044\u3068\u601d\u3063\u305f\u3002\u2026\u2026\u305d\u3057\u3066\u540c\u6642\u306b\u3001\u81ea\u5206\u304c\u6065\u305a\u304b\u3057\u304f\u306a\u3063\u305f\u3093\u3060\u3088", "\u30df\u30cf\u30a4\u30eb\u2026\u2026", "\u30aa\u30ec\u306b\u306f\u3001\u4ed6\u306e\u4eba\u306b\u306f\u306a\u3044\u7279\u6b8a\u306a\u529b\u304c\u3042\u308b\u3002\u9650\u5b9a\u7684\u3067\u4f7f\u3044\u52dd\u624b\u304c\u60aa\u3044\u529b\u3060\u3051\u3069\u3001\u8ab0\u304b\u3092\u52a9\u3051\u3089\u308c\u308b\u795d\u798f\u306e\u529b\u3002\u3067\u3082\u30aa\u30ec\u306b\u306f\u3001\u546a\u3044\u306b\u3057\u304b\u601d\u3048\u306a\u304b\u3063\u305f\u3093\u3060", "\u52a9\u3051\u3066\u3082\u3001\u304d\u3063\u3068\u62d2\u7d76\u3055\u308c\u308b\u3002\u6cbb\u3057\u3066\u3082\u559c\u3093\u3067\u306a\u3093\u3066\u8cb0\u3048\u306a\u3044\u3002\u8fd1\u4ed8\u304f\u306a\u3001\u5316\u7269\u3063\u3066\u7f75\u3089\u308c\u308b\u3093\u3060\u3002\u3060\u3063\u305f\u3089\u4f7f\u308f\u306a\u3044\u65b9\u304c\u3044\u3044\u3002\u529b\u306a\u3093\u304b\u4f7f\u308f\u306a\u304f\u3066\u3082\u4eba\u52a9\u3051\u306f\u51fa\u6765\u308b\u3063\u3066\u3001\u81ea\u5206\u306b\u8a00\u3044\u805e\u304b\u305b\u3066\u305f", "\u3067\u3082\u3001\u7d50\u5c40\u3069\u3046\u53d6\u308a\u7e55\u3063\u3066\u3082\u540c\u3058\u3002\u30aa\u30ec\u306f\u898b\u306a\u3044\u632f\u308a\u3092\u3057\u3066\u305f\u3060\u3051\u3002\u52a9\u3051\u3089\u308c\u308b\u547d\u304b\u3089\u3001\u76ee\u3092\u80cc\u3051\u3066\u3044\u305f\u3060\u3051\u3060", "\u3063\uff01\u305d\u3093\u306a\u4e8b\u2026\u2026", "\u3042\u308b\u3093\u3060\u3088\u3002\u98a8\u90aa\u3092\u62d7\u3089\u305b\u3066\u6b7b\u3093\u3067\u3057\u307e\u3063\u305f\u4eba\u3084\u3001\u602a\u6211\u304c\u5316\u81bf\u3057\u3066\u547d\u3092\u843d\u3068\u3057\u305f\u4eba\u304c\u3001\u4e16\u754c\u306e\u3069\u3053\u304b\u306b\u3044\u305f\u304b\u3082\u3057\u308c\u306a\u3044\u3002\u30aa\u30ec\u306a\u3089\u52a9\u3051\u3089\u308c\u305f\u306e\u306b", "\u4e16\u754c\u4e2d\u306e\u4eba\u3092\u52a9\u3051\u308b\u306a\u3093\u3066\u7121\u7406\u3088\uff01\u7406\u60f3\u3068\u73fe\u5b9f\u306f\u9055\u3046\u308f\uff01", "\u3046\u3093\u3002\u3067\u3082\u3001\u305d\u308c\u306f\u52aa\u529b\u3057\u305f\u4eba\u3060\u3051\u304c\u8a00\u3063\u3066\u3044\u3044\u8a00\u8449\u3060", "\u3063\u3001", "\u5c11\u306a\u304f\u3068\u3082\u3001\u76ee\u3092\u585e\u3044\u3067\u7e2e\u3053\u307e\u3063\u3066\u3001\u5168\u90e8\u304c\u7d42\u308f\u308b\u306e\u3092\u5f85\u3063\u3066\u3044\u305f\u30aa\u30ec\u304c\u8a00\u3063\u3066\u3044\u3044\u30bb\u30ea\u30d5\u3058\u3083\u306a\u3044\u3002\u305d\u308c\u306b\u3001\u738b\u5973\u69d8\u306a\u3089\u305d\u3093\u306a\u4e8b\u8a00\u308f\u306a\u3044\u3002\u52a9\u3051\u3089\u308c\u305f\u304b\u3082\u3057\u308c\u306a\u3044\u306e\u306b\u3001\u81ea\u5206\u306e\u529b\u4e0d\u8db3\u3067\u5931\u308f\u308c\u305f\u547d\u3092\u524d\u306b\u3001\u300e\u3057\u3087\u3046\u304c\u306a\u3044\u300f\u306a\u3093\u3066\u53e3\u304c\u88c2\u3051\u3066\u3082\u8a00\u308f\u306a\u3044\u3088", "\u672c\u5f53\u306b\u899a\u609f\u3092\u6c7a\u3081\u305f\u4eba\u9593\u306f\u3001\u8ab0\u306e\u305b\u3044\u306b\u3082\u3057\u306a\u3044\u3002\u7d50\u679c\u304c\u60aa\u304f\u3066\u3082\u3001\u52aa\u529b\u304c\u5831\u308f\u308c\u306a\u304f\u3066\u3082\u3001\u3061\u3083\u3093\u3068\u53d7\u3051\u6b62\u3081\u3089\u308c\u308b\u3002\u30aa\u30ec\u3082\u305d\u3046\u5728\u308d\u3046\u3063\u3066\u3001\u3084\u3063\u3068\u601d\u3048\u305f\u3093\u3060", "\u8ab0\u306b\u62d2\u7d76\u3055\u308c\u3066\u3082\u3001\u5acc\u308f\u308c\u3066\u3082\u3001\u524d\u3092\u5411\u3044\u3066\u9032\u3082\u3046\u3063\u3066\u6c7a\u3081\u305f\u3002\u30aa\u30ec\u306f\u5f31\u3044\u304b\u3089\u63fa\u3089\u3050\u3051\u3069\u3001\u5f15\u304d\u8fd4\u3059\u306e\u3060\u3051\u306f\u6b62\u3081\u3088\u3046\u3063\u3066\u601d\u3063\u305f\u3093\u3060\u3051\u3069\u2026\u2026\u5b09\u3057\u3044\u8aa4\u7b97\u304c\u3044\u3063\u3071\u3044\u3042\u3063\u305f\u3093\u3060\u3088", "\u53cb\u9054\u3068\u5148\u751f\u304c\u51fa\u6765\u305f\u3093\u3060\u3002\u738b\u5bae\u306e\u9b54\u5c0e\u5e2b\u9577\u306e\u30a4\u30ea\u30fc\u30cd\u69d8\u306f\u53b3\u3057\u3044\u65b9\u3060\u3051\u3069\u3001\u51c4\u304f\u512a\u3057\u3044\u3002\u30aa\u30ec\u3092\u3044\u3064\u3082\u6c17\u306b\u304b\u3051\u3066\u304f\u308c\u308b\u3002\u53cb\u9054\u2026\u2026\u30b2\u30aa\u30eb\u30af\u306f\u30aa\u30ec\u306e\u529b\u3092\u77e5\u3063\u3066\u3082\u3001\u9a5a\u304f\u3060\u3051\u3067\u5acc\u308f\u306a\u3044\u3067\u304f\u308c\u305f\u3002\u305d\u308c\u3082\u500b\u6027\u3060\u308d\u3046\u3063\u3066\u3002\u5b9f\u969b\u306b\u529b\u3092\u898b\u305b\u305f\u4e8b\u306f\u306a\u3044\u3093\u3060\u3051\u3069\u3001\u304d\u3063\u3068\u53d7\u3051\u5165\u308c\u3066\u304f\u308c\u308b\u3093\u3058\u3083\u306a\u3044\u304b\u3063\u3066\u3001\u4eca\u306a\u3089\u4fe1\u3058\u3089\u308c\u308b", "\u305d\u3046", "\u30aa\u30ec\u3001\u504f\u3063\u305f\u76ee\u3067\u898b\u3066\u305f\u3093\u3060\u306d\u3002\u4e16\u754c\u306b\u306f\u6016\u3044\u4e8b\u3068\u540c\u3058\u304f\u3089\u3044\u5b09\u3057\u3044\u4e8b\u304c\u3042\u3063\u3066\u3001\u30aa\u30ec\u3092\u62d2\u7d76\u3059\u308b\u4eba\u304c\u3044\u308b\u3088\u3046\u306b\u3001\u53d7\u3051\u5165\u308c\u3066\u304f\u308c\u308b\u4eba\u3082\u3044\u308b\u3002\u306a\u3089\u5927\u4e08\u592b\u3060\u3002\u5927\u5207\u306a\u4eba\u306b\u62d2\u7d76\u3055\u308c\u3066\u3082\u3001\u30aa\u30ec\u306f\u81ea\u5206\u3092\u8a8d\u3081\u3066\u3042\u3052\u3089\u308c\u308b\u3063\u3066\u2026\u2026\u305d\u3046\u3001\u601d\u3063\u305f\u306e\u306b", "\u30df\u30cf\u30a4\u30eb\u30c3\uff1f", "\u30df\u30cf\u30a4\u30eb\u2026\u2026", "\u3041\u308a\u3001\u304c\u3068\u3001\u2026\u2026\u3063\u3066", "\u3048\uff1f", "\u2026\u2026\u3063\u3001", "\u3042\u308a\u304c\u3068\u3046\u3063\u3066\u3001\u8a00\u3063\u3066\u304f\u308c\u305f\u3093\u3060", "\u79c1\u306e\u5927\u5207\u306a\u4ef2\u9593\u3092\u3001\u52a9\u3051\u3066\u304f\u308c\u3066\u3042\u308a\u304c\u3068\u3046\u3001\u30df\u30cf\u30a4\u30eb\u3063\u3066\u3002\u738b\u5973\u69d8\u306f\u6ce3\u304d\u306a\u304c\u3089\u8a00\u3063\u3066\u304f\u308c\u305f\u3002\u30aa\u30ec\u306e\u4e21\u624b\u3092\u63e1\u308a\u3057\u3081\u3066\u3001\u5fc3\u304b\u3089\u306e\u611f\u8b1d\u3092\u6367\u3052\u3066\u304f\u308c\u305f\u3093\u3060\u3088", "\u2026\u2026\u305d\u3046\u3002\u826f\u304b\u3063\u305f\u308f\u306d\u3001\u30df\u30cf\u30a4\u30eb", "\u3046\u3093\u3001\u59c9\u3055\u3093\u3002\u30aa\u30ec\u3001\u3053\u306e\u529b\u3092\u6301\u3063\u3066\u3044\u3066\u826f\u304b\u3063\u305f", "\u305d\u3063\u304b", "\u3082\u3046\u3001\u59c9\u3055\u3093\u304c\u3044\u306a\u304f\u3066\u3082\u5927\u4e08\u592b\u306a\u306e\u306d", "\u2026\u2026\u59c9\u3055\u3093\uff1f", "\u79c1\u306f\u99c4\u76ee\u306a\u59c9\u3055\u3093\u3060\u308f\u3002\u8cb4\u65b9\u306e\u81ea\u7acb\u3092\u59a8\u3052\u3066\u3070\u3063\u304b\u308a\u3002\u305d\u306e\u4e0a\u3001\u3053\u3093\u306a\u3068\u3053\u308d\u307e\u3067\u8ffd\u3063\u304b\u3051\u3066\u6765\u3061\u3083\u3046\u306a\u3093\u3066\u3001\u904e\u4fdd\u8b77\u3092\u901a\u308a\u8d8a\u3057\u3066\u91cd\u3044\u308f\u306d", "\u9b31\u9676\u3057\u304b\u3063\u305f\u308f\u3088\u306d\u3002\u3054\u3081\u3093\u306a\u3055\u3044", "\u59c9\u3055\u3093", "\u3067\u3082\u5fc3\u914d\u3060\u3063\u305f\u306e\u3088\u3002\u30df\u30cf\u30a4\u30eb\u306f\u7d14\u60c5\u3060\u304b\u3089\u3001\u5909\u306a\u5973\u306b\u6355\u307e\u3063\u3061\u3083\u3046\u3093\u3058\u3083\u306a\u3044\u304b\u3063\u3066\u6c17\u304c\u6c17\u3058\u3083\u306a\u304b\u3063\u305f\u308f\u3002\u3067\u3082\u5973\u306e\u5b50\u3092\u898b\u308b\u76ee\u304c\u3042\u308b\u307f\u305f\u3044\u3060\u3057\u3001\u3082\u3046\u5927\u4e08\u592b\u306d", "\u59c9\u3055\u3093", "\u3053\u308c\u304b\u3089\u306f\u3001\u4f55\u3082\u8a00\u308f\u306a\u3044\u3002\u8cb4\u65b9\u306e\u3084\u308a\u305f\u3044\u3088\u3046\u306b\u2026\u2026", "\u59c9\u3055\u3093\uff01", "\u59c9\u3055\u3093\u2026\u2026\u6ce3\u304b\u306a\u3044\u3067", "\u2026\u2026\u3048", "\u30aa\u30ec\u3001\u9b31\u9676\u3057\u3044\u306a\u3093\u3066\u4e00\u5ea6\u3082\u601d\u3063\u305f\u3053\u3068\u306a\u3044\u3088", "\u2026\u2026\u305d\u3046\u306d\u3002\u8cb4\u65b9\u306f\u512a\u3057\u3044\u5b50\u3060\u304b\u3089", "\u9055\u3046\u3088\u3002\u512a\u3057\u3044\u306e\u306f\u30aa\u30ec\u3058\u3083\u306a\u304f\u3066\u59c9\u3055\u3093\u3060\u3002\u6ce3\u3044\u3066\u3070\u304b\u308a\u306e\u5f1f\u3092\u62b1\u304d\u3057\u3081\u3066\u3001\u305a\u3063\u3068\u508d\u306b\u3044\u3066\u304f\u308c\u305f\u3002\u305d\u3093\u306a\u8cb4\u65b9\u3092\u3001\u30aa\u30ec\u304c\u3069\u3046\u3057\u3066\u6155\u308f\u306a\u3044\u3068\u601d\u3046\u306e\uff1f", "\u30df\u30cf\u30a4\u30eb\uff1f", "\u5927\u597d\u304d\u3060\u3088\u3002\u59c9\u3055\u3093\u304c\u3044\u306a\u304f\u3061\u3083\u3001\u30aa\u30ec\u306f\u3068\u3063\u304f\u306b\u30c0\u30e1\u306b\u306a\u3063\u3066\u305f\u3002\u8cb4\u65b9\u304c\u611b\u3092\u6ce8\u3044\u3067\u304f\u308c\u305f\u304b\u3089\u3053\u305d\u3001\u4eca\u3001\u3053\u3046\u3057\u3066\u3053\u3053\u306b\u5c45\u308b\u3093\u3060\u3088", "\u5927\u597d\u304d\u3060\u304b\u3089\u3053\u305d\u3001\u59c9\u3055\u3093\u306e\u91cd\u8377\u306b\u306a\u308a\u305f\u304f\u306a\u304b\u3063\u305f\u3093\u3060", "\u6012\u308b\u308f\u3088!?\u91cd\u8377\u306a\u3093\u3066\u601d\u3063\u305f\u4e8b\u306a\u3044\u308f", "\u3046\u3093\u3001\u77e5\u3063\u3066\u308b\u3002\u3067\u3082\u306d\u3001\u30aa\u30ec\u306f\u59c9\u3055\u3093\u306b\u5e78\u305b\u306b\u306a\u3063\u3066\u6b32\u3057\u304b\u3063\u305f\u3002\u30aa\u30ec\u306e\u4e8b\u3070\u3063\u304b\u308a\u6c17\u306b\u3057\u3066\u3001\u81ea\u5206\u3092\u4e8c\u306e\u6b21\u306b\u3059\u308b\u8cb4\u65b9\u306b\u3001\u81ea\u5206\u81ea\u8eab\u306e\u5e78\u305b\u3092\u8003\u3048\u3066\u6b32\u3057\u304b\u3063\u305f\u3093\u3060", "\u2026\u2026\u3060\u304b\u3089\u3001\u4f55\u3082\u8a00\u308f\u305a\u306b\u5bb6\u3092\u51fa\u305f\u306e\uff1f", "\u8a00\u3063\u305f\u3089\u3001\u8cb4\u65b9\u306f\u6b62\u3081\u305f\u3060\u308d\u3046\u304b\u3089", "\u306d\u3048\u3001\u59c9\u3055\u3093\u3002\u30aa\u30ec\u306f\u3082\u3046\u3001\u8cb4\u65b9\u306e\u9670\u306b\u96a0\u308c\u308b\u3057\u304b\u51fa\u6765\u306a\u3044\u5b50\u4f9b\u3058\u3083\u306a\u3044\u3088\u3002\u8cb4\u65b9\u304c\u5e78\u305b\u306b\u306a\u308b\u305f\u3081\u306b\u6b69\u304d\u51fa\u3059\u3093\u3060\u3063\u305f\u3089\u3001\u898b\u9001\u308c\u308b\u304f\u3089\u3044\u306b\u306f\u5f37\u304f\u306a\u3063\u305f", "\u30aa\u30ec\u304c\u3001\u59c9\u3055\u3093\u3092\u4efb\u305b\u3066\u3082\u5927\u4e08\u592b\u3060\u3063\u3066\u601d\u3048\u308b\u4eba\u3092\u898b\u3064\u3051\u304d\u3066\u3002\u6ca2\u5c71\u610f\u5730\u60aa\u3057\u3066\u56f0\u3089\u305b\u3066\u3001\u305d\u308c\u3067\u3082\u8ae6\u3081\u306a\u304b\u3063\u305f\u3089\u3001\u3061\u3083\u3093\u3068\u795d\u798f\u3059\u308b\u304b\u3089", "\u4f55\u3088\u3001\u305d\u308c", "\u30aa\u30ec\u306e\u5927\u4e8b\u306a\u59c9\u3055\u3093\u3092\u5b9c\u3057\u304f\u304a\u9858\u3044\u3057\u307e\u3059\u3063\u3066\u3001\u7b11\u3063\u3066\u9001\u308a\u51fa\u3057\u3066\u3042\u3052\u308b", "\u5f1f\u306e\u304f\u305b\u306b\u751f\u610f\u6c17\u3088"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/89/", "subtitle": "\u5b50\u7235\u4ee4\u5b22\u306e\u56de\u9867\u3002", "discourse": ["\u2026\u2026\u2026\u2026", "\u30d3\u30a2\u30f3\u30ab\u59c9\u3055\u3093", "\u5c11\u3057\u3001\u8a71\u3092\u3057\u3066\u3082\u3044\u3044\uff1f", "\u59c9\u3055\u3093", "\u5927\u4e08\u592b\u3002\u3061\u3087\u3063\u3068\u3084\u305d\u3063\u3068\u3058\u3083\u8d77\u304d\u306a\u3044\u308f\u3088", "\u968f\u5206\u3001\u7537\u524d\u306b\u306a\u3063\u305f\u308f\u306d", "\u305d\u3093\u306a\u4e8b\u306a\u3044\u3002\u30aa\u30ec\u306f\u5927\u3057\u3066\u5909\u308f\u3063\u3066\u306a\u3044\u3088", "\u6539\u3081\u3066\u3002\u4e45\u3057\u3076\u308a\u306d\u3001\u30df\u30cf\u30a4\u30eb", "\u3046\u3093\u3002\u4e45\u3057\u3076\u308a\u3001\u59c9\u3055\u3093\u3002\u4e2d\u3005\u4f1a\u3044\u306b\u884c\u3051\u306a\u304f\u3066\u3054\u3081\u3093\u306d", "\u8584\u60c5\u306a\u5f1f\u3092\u6301\u3063\u3066\u3001\u59c9\u3055\u3093\u306f\u54c0\u3057\u3044\u308f", "\u306d\u3047\u3001\u30df\u30cf\u30a4\u30eb", "\u3093\uff1f\u3069\u3046\u3057\u305f\u306e", "\u5f8c\u6094\u306f\u3057\u3066\u306a\u3044\uff1f", "\u59c9\u3055\u3093\u306f\u3001\u738b\u5973\u69d8\u3068\u8a71\u3057\u305f\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/88/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u9a5a\u6115\u3002", "discourse": ["\u2026\u2026\u2026\u2026", "\u30af\u30e9\u30a6\u30b9\u2026\u2026\u3063\u3001\u3044\u3063\u305f\u3041\u2026\u2026\u3063!?", "\u30af\u30e9\u30a6\u30b9\u306a\u3089\u3001\u3082\u3046\u5927\u4e08\u592b\u3088\u3002\u5b89\u5fc3\u306a\u3055\u3044", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093", "\u304a\u306f\u3088\u3046\u3002\u304a\u76ee\u899a\u3081\u306f\u3001\u3042\u3093\u307e\u308a\u5b9c\u3057\u304f\u306a\u3044\u307f\u305f\u3044\u306d", "\u79c1\u3001\u6c17\u3092\u5931\u3063\u305f\u3093\u3067\u3059\u304b\uff1f", "\u899a\u3048\u3066\u306a\u3044\u306e\uff1f", "\u3048\u30fc\u3063\u3068\u2026\u2026\u591a\u5c11\u306f\u3001\u3042\u308b\uff1f\u3088\u3046\u306a", "\u6b7b\u3093\u3060\u307f\u305f\u3044\u306b\u7720\u3063\u3066\u3044\u308b\u304b\u3089\u3001\u7686\u5fc3\u914d\u3057\u3066\u305f\u308f\u3088", "\u9762\u76ee\u3042\u308a\u307e\u305b\u3093\u2026\u2026", "\u306a\u306b\u840e\u308c\u3066\u3093\u306e\u3088", "\u3060\u3063\u3066\u3001\u7686\u306e\u624b\u5f53\u3066\u3082\u51fa\u6765\u306a\u304b\u3063\u305f\u3057\u3002\u52a9\u3051\u3066\u3082\u3089\u3063\u305f\u306e\u306b\u3001\u307e\u3060\u304a\u793c\u3082\u8a00\u3063\u3066\u307e\u305b\u3093", "\u9b54\u5c0e\u5e2b\u306e\u5144\u3055\u3093\u306b\u306f\u3001\u3061\u3083\u3093\u3068\u8a00\u3063\u3066\u305f\u308f\u3088", "\u3048\uff1f", "\u52a9\u3051\u8d77\u3053\u3057\u306b\u304d\u305f\u9b54\u5c0e\u5e2b\u306e\u5144\u3055\u3093\u306e\u624b\u3092\u63e1\u3063\u3066\u3001\u3042\u308a\u304c\u3068\u3046\u3063\u3066\u7e70\u308a\u8fd4\u3057\u3066\u305f\u3058\u3083\u306a\u3044\u3002\u4e8c\u4eba\u3067\u6ce3\u304d\u51fa\u3057\u3066\u3001\u3069\u3046\u3057\u3088\u3046\u304b\u3068\u601d\u3063\u305f\u3093\u3060\u3051\u3069\u2026\u2026", "\u79c1\u306b\u62b1\u3048\u3089\u308c\u3066\u304b\u3089\u3082\u3001\u8272\u3093\u306a\u4eba\u306b\u304a\u793c\u8a00\u3063\u3066\u305f\u308f\u306d\u3002\u3059\u308c\u9055\u3046\u4eba\u9054\u306b\u6ce3\u304d\u306a\u304c\u3089\u3001\u3042\u308a\u304c\u3068\u3046\u3001\u3042\u308a\u304c\u3068\u3046\u3063\u3066", "\u9762\u767d\u304b\u3063\u305f\u308f\u3088\u3002\u5927\u306e\u7537\u5171\u304c\u3001\u307f\u3093\u306a\u3057\u3066\u614c\u3066\u3075\u305f\u3081\u3044\u3061\u3083\u3063\u3066\u3002\u60c5\u3051\u306a\u304f\u3066\u3001\u898b\u308c\u305f\u3082\u3093\u3058\u3083\u306a\u304b\u3063\u305f\u308f\u3002\u30a2\u30f3\u30bf\u306e\u77e5\u308a\u5408\u3044\u306e\u8272\u7537\u3082\u3001\u9854\u771f\u3063\u8d64\u306b\u3057\u3061\u3083\u3063\u3066\u306d\u30fc", "\u3084\u3081\u3066\u304f\u3060\u3055\u3044\u3057\u3093\u3067\u3057\u307e\u3044\u307e\u3059\u2026\u2026", "\u30a2\u30f3\u30bf\u3001\u3084\u3063\u3071\u308a\u738b\u5973\u69d8\u3063\u307d\u304f\u306a\u3044\u308f", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093", "\u3093\uff1f", "\u3042\u308a\u304c\u3068\u3046\u3001\u3054\u3056\u3044\u307e\u3057\u305f", "\u3061\u3087\u3001\u30de\u30ea\u30fc\uff01\u30a2\u30f3\u30bf\u3001\u306a\u306b\u3057\u3066\u3093\u306e!?", "\u304a\u793c\u3092", "\u305d\u3093\u306a\u306e\u898b\u308c\u3070\u5206\u304b\u308b\u308f\u3088\uff01\u305d\u3046\u3058\u3083\u306a\u304f\u3066\u3001\u30a2\u30f3\u30bf\u306f\u738b\u5973\u69d8\u306a\u306e\u3088!?\u4e00\u4ecb\u306e\u85ac\u5e2b\u306b\u982d\u3092\u4e0b\u3052\u308b\u306a\u3093\u3066\u4e8b\u3001\u3042\u3063\u3066\u3044\u3044\u306f\u305a\u306a\u3044\u3067\u3057\u3087\u3046!?", "\u611f\u8b1d\u306e\u6c17\u6301\u3061\u3092\u8868\u3059\u306e\u306b\u3001\u85ac\u5e2b\u3082\u738b\u5973\u3082\u95a2\u4fc2\u3042\u308a\u307e\u305b\u3093\u3088\u3002\u305d\u308c\u306b\u4eca\u306f\u516c\u7684\u306a\u5834\u3067\u306f\u306a\u3044\u3057\u3001\u3044\u308b\u306e\u306f\u8cb4\u65b9\u3068\u79c1\u3060\u3051", "\u3060\u3068\u3057\u3066\u3082\uff01", "\u5947\u8de1\u306e\u4e00\u65cf\u3001\u30af\u30fc\u30a2", "\uff01", "\u8cb4\u65b9\u304c\u305f\u306f\u3001\u5916\u754c\u3068\u6b86\u3069\u95a2\u308f\u3089\u306a\u3044\u3001\u8b0e\u306b\u5305\u307e\u308c\u305f\u4e00\u65cf\u3060\u3068\u805e\u304d\u307e\u3057\u305f\u3002\u6b63\u4f53\u3092\u6652\u3059\u306e\u306f\u6700\u3082\u5fcc\u907f\u3059\u3079\u304d\u4e8b\u3060\u3063\u305f\u3093\u3058\u3083\u306a\u3044\u3067\u3059\u304b\uff1f", "\u898b\u306a\u3044\u3075\u308a\u3067\u901a\u3059\u4e8b\u3082\u51fa\u6765\u305f\u306e\u306b\u3001\u8cb4\u65b9\u306f\u6b63\u4f53\u3092\u77e5\u3089\u308c\u308b\u5371\u967a\u3092\u627f\u77e5\u3057\u306a\u304c\u3089\u3082\u3001\u30af\u30e9\u30a6\u30b9\u3092\u6551\u3046\u305f\u3081\u306b\u5168\u529b\u3092\u5c3d\u304f\u3057\u3066\u304f\u308c\u305f\u3002\u305d\u306e\u8aa0\u610f\u3068\u771f\u5fc3\u306b\u3001\u656c\u610f\u3068\u611f\u8b1d\u3092\u3002\u79c1\u306e\u5927\u5207\u306a\u4ef2\u9593\u3092\u6551\u3063\u3066\u4e0b\u3055\u3063\u3066\u3001\u3042\u308a\u304c\u3068\u3046\u3054\u3056\u3044\u307e\u3059", "\u2026\u2026\uff1f", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093\uff1f", "\u6b62\u3081\u3066\u3088\u3002\u79c1\u306f\u30a2\u30f3\u30bf\u306b\u611f\u8b1d\u3055\u308c\u308b\u3088\u3046\u306a\u3001\u7acb\u6d3e\u306a\u4eba\u9593\u3058\u3083\u306a\u3044\u308f", "\u4f8d\u5973\u306e\u5b50\u304c\u5012\u308c\u305f\u6642\u3082\u3001\u8239\u54e1\u304c\u8155\u3092\u6298\u3063\u305f\u6642\u3082\u3001\u30a2\u30f3\u30bf\u306b\u62bc\u3057\u4ed8\u3051\u3066\u3044\u305f\u306e\u3001\u899a\u3048\u3066\u308b\u3067\u3057\u3087\u3046\uff1f", "\u305d\u308c\u306f\u3001\u6b63\u4f53\u3092\u96a0\u3057\u3066\u3044\u305f\u3093\u3060\u304b\u3089\u4ed5\u65b9\u306a\u3044\u3067\u3059\u3088\u3002\u305d\u308c\u306b\u3082\u3057\u79c1\u304c\u7121\u7406\u3060\u3068\u8a00\u3063\u305f\u3089\u3001\u81ea\u5206\u3067\u624b\u5f53\u3066\u3092\u3059\u308b\u3064\u3082\u308a\u3060\u3063\u305f\u3093\u3067\u3059\u3088\u306d\uff1f", "\u79c1\u306f\uff01\u30a2\u30f3\u30bf\u3092\u8a66\u3057\u3066\u3044\u305f\u306e\uff01\u5206\u304b\u308b!?", "\u79c1\u3092\uff1f", "\u79c1\u306f\u5642\u306e\u5973\u795e\u306b\u4f1a\u3046\u305f\u3081\u306b\u3001\u30cd\u30fc\u30d9\u30eb\u306b\u7acb\u3061\u5bc4\u3063\u305f\u306e\u3088", "\u4e00\u5ea6\u5e30\u308b\u5fc5\u8981\u3082\u3042\u3063\u305f\u304b\u3089\u4e57\u8239\u3057\u3066\u307f\u305f\u3089\u5076\u7136\u306b\u3082\u3001\u5973\u795e\u3058\u3083\u306a\u3044\u304b\u3068\u5642\u3055\u308c\u3066\u3044\u308b\u5973\u306e\u5b50\u304c\u4e57\u3063\u3066\u3044\u308b\u3063\u3066\u3044\u3046\u3058\u3083\u306a\u3044\u3002\u306a\u3093\u3066\u5e78\u904b\u306a\u3093\u3060\u308d\u3046\u3063\u3066\u601d\u3063\u305f\u308f\u3002\u307e\u3041\u3001\u3059\u3050\u306b\u9055\u3046\u3063\u3066\u306e\u306f\u5206\u304b\u3063\u305f\u3051\u308c\u3069", "\u9aea\u306e\u8272\u304c\u9055\u3063\u305f\u306f\u305a\u3067\u3059\u304c", "\u305d\u3046\u306d\u3002\u3067\u3082\u6c17\u306b\u306a\u3063\u305f\u306e\u3002\u305d\u308c\u306b\u3001\u30a2\u30f3\u30bf\u304c\u5973\u795e\u3058\u3083\u306a\u304f\u3066\u3082\u826f\u304b\u3063\u305f\u306e\u3088\u3002\u79c1\u306e\u63a2\u3057\u3082\u306e\u306f\u5973\u795e\u3060\u3051\u3058\u3083\u306a\u304b\u3063\u305f\u304b\u3089", "\u2026\u2026\u79c1\u306f\u3001\u8cb4\u65b9\u306e\u671f\u5f85\u306b\u5c11\u3057\u306f\u5fdc\u3048\u3089\u308c\u305f\u3067\u3057\u3087\u3046\u304b\uff1f", "\u5c11\u3057\u3069\u3053\u308d\u3058\u3083\u306a\u3044\u308f\u3002\u672c\u5f53\u3001\u30a2\u30f3\u30bf\u306a\u3093\u306a\u306e\uff1f\u3069\u3046\u3057\u3066\u738b\u5973\u69d8\u306a\u308f\u3051\uff1f\u6a29\u529b\u3092\u6301\u3063\u3066\u3044\u308b\u306e\u306f\u5927\u5909\u7d50\u69cb\u3060\u3051\u3069\u3001\u3082\u3046\u5c11\u3057\u4e0b\u306e\u8eab\u5206\u306b\u751f\u307e\u308c\u3066\u6b32\u3057\u304b\u3063\u305f\u308f", "\u3082\u3057\u304f\u306f\u738b\u5973\u69d8\u306a\u3089\u738b\u5973\u69d8\u3089\u3057\u304f\u3001\u3082\u3063\u3068\u5c0a\u5927\u306b\u632f\u308b\u821e\u3044\u306a\u3055\u3044\u3088\u3002\u30a2\u30f3\u30bf\u304c\u7518\u3084\u304b\u3055\u308c\u305f\u304a\u59eb\u69d8\u3089\u3057\u304f\u3001\u7121\u77e5\u3067\u8106\u5f31\u3067\u50b2\u6162\u3060\u3063\u305f\u3089\u2026\u2026\u5225\u306e\u4eba\u9593\u3092\u63a2\u305b\u305f\u306e\u306b\u3002\u826f\u8b58\u306e\u3042\u308b\u91d1\u6301\u3061\u306a\u3093\u3066\u3044\u304f\u3089\u3067\u3082\u3044\u308b\u3063\u3066\u3001\u5272\u308a\u5207\u308c\u305f\u306e\u306b", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093\u2026\u2026\uff1f", "\u2026\u2026\u306d\u3048\u3001\u30de\u30ea\u30fc", "\u30a2\u30f3\u30bf\u3001\u3053\u308c\u304b\u3089\u81ea\u5206\u304c\u3069\u3046\u306a\u308b\u3068\u601d\u3046\uff1f", "\u3048\u3063\u3068\u2026\u2026\u738b\u5973\u3060\u3068\u660e\u304b\u3057\u3066\u3057\u307e\u3063\u305f\u4e8b\u3067\u3059\u3057\u3001\u30d5\u30e9\u30f3\u30e1\u306e\u738b\u5bae\u306b\u9023\u308c\u3066\u884c\u304b\u308c\u3066\u3001\u305d\u306e\u5f8c\u306f\u5f37\u5236\u9001\u9084\u3067\u3059\u304b\u306d", "\u3082\u3046\u4e00\u5ea6\u3001\u6765\u308b\u4e8b\u306f\uff1f", "\u7121\u7406\u3067\u3057\u3087\u3046\u306d\u2026\u2026\u3002\u57ce\u3092\u51fa\u308b\u306e\u3059\u3089\u96e3\u3057\u3044\u304b\u3082\u3057\u308c\u307e\u305b\u3093", "\u305d\u3046\u3002\u2026\u2026\u306a\u3089\u3001\u4ed5\u65b9\u306a\u3044\u308f\u306d", "\u3048\uff1f\u3063\u3001\u3066\u2026\u2026\u306a\u306b!?", "\u3048\u3001\u306a\u306b\uff1f\u3053\u308c\u3001\u306a\u3093\u306a\u3093\u3067\u3059!?", "\u3061\u3087\u3063\u3068\u79c1\u306b\u652b\u308f\u308c\u3066\u304f\u308c\u308b\uff1f", "\u2026\u2026\u306f\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/87/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u5ba2\u4eba\u3002(2)", "discourse": ["\u30aa\u30ec\u306e\u9b54\u6cd5\u306f\u4e07\u80fd\u3067\u306f\u3042\u308a\u307e\u305b\u3093", "\u6295\u85ac\u3084\u624b\u8853\u304c\u5fc5\u8981\u306a\u75c5\u6c17\u306f\u6cbb\u305b\u307e\u305b\u3093\u3002\u4eca\u56de\u306e\u6bd2\u306e\u3088\u3046\u306b\u3001\u7279\u6b8a\u306a\u6cbb\u7642\u304c\u5fc5\u8981\u306a\u602a\u6211\u3082\u540c\u3058\u3067\u3059", "\u8840\u3092\u6b62\u3081\u3089\u308c\u308b\u306a\u3089\u3001\u5145\u5206\u3060\u308f", "\u305f\u3060\u3001\u305d\u308c\u306b\u3082\u554f\u984c\u304c\u3042\u308a\u307e\u3059\u3002\u5f37\u5f15\u306b\u6cbb\u7652\u529b\u3092\u5f15\u304d\u51fa\u3059\u8a33\u3067\u3059\u304b\u3089\u3001\u4f53\u529b\u3092\u596a\u3044\u307e\u3059\u3002\u50b7\u304c\u585e\u304c\u308b\u3088\u308a\u5148\u306b\u4f53\u529b\u304c\u5c3d\u304d\u3066\u3057\u307e\u3048\u3070\u3001\u2026\u2026", "\u306a\u3089\u3001\u5c1a\u66f4\u306d", "\u3042\u3042\u3002\u3068\u3063\u3068\u3068\u3084\u308b\u304b", "\u30de\u30ea\u30fc", "\u306f\u3001\u306f\u3044\u3063", "\u7121\u7406\u3057\u306a\u3044\u3067\u3001\u5ea7\u3063\u3066\u306a\u3055\u3044", "\u3044\u3001\u3044\u3044\u3048\uff01\u79c1\u3082\u3053\u3053\u3067\u2026\u2026", "\u51fa\u3066\u884c\u3051\u3068\u306f\u8a00\u308f\u306a\u3044\u304b\u3089\u3002\u305d\u3053\u3067\u3001\u58f0\u3092\u304b\u3051\u3066\u3042\u3052\u3066", "\u3048\u3063", "\u30a2\u30f3\u30bf\u306e\u58f0\u304c\u4e00\u756a\u5c4a\u304f\u3068\u601d\u3046\u308f\u3002\u3061\u3083\u3093\u3068\u3001\u5f15\u304d\u6b62\u3081\u306a\u3055\u3044", "\u2026\u2026\u306f\u3044\u3063", "\u30af\u30e9\u30a6\u30b9", "\u30af\u30e9\u30a6\u30b9\u3001\u304a\u9858\u3044", "\u3063\u3050\u3045\u2026\u2026\u3063!!", "\u30af\u30e9\u30a6\u30b9\u3063\uff01", "\u305d\u3063\u3061\u62bc\u3055\u3048\u3066\uff01", "\u5206\u304b\u308a\u307e\u3057\u305f\u3063!!", "\u3050\u3042\u3041\u3042\u3042\u3042\u3042\u3063!!", "\u30af\u30e9\u30a6\u30b9\uff01\u30af\u30e9\u30a6\u30b9!!", "\u7d42\u308f\u3063\u305f\u305e!!\u3042\u3068\u306f\u983c\u3093\u3067\u3044\u3044\u3093\u3060\u306a\u3001\u5144\u3061\u3083\u3093!?", "\u306f\u3044\uff01", "\u3063\u2026\u2026\u30af\u30e9\u30a6\u30b9\u3063!!", "\u8a31\u3055\u306a\u3044\u308f\u3088\uff01\u52dd\u624b\u306b\u6b7b\u306c\u306a\u3093\u3066\u3001\u7d76\u5bfe\u306b\u8a31\u3055\u306a\u3044\u3093\u3060\u304b\u3089!!", "\u8cb4\u65b9\u306f\u3001\u79c1\u306e\u8b77\u885b\u3067\u3057\u3087\u3046!?\u3053\u3093\u306a\u5834\u6240\u3067\u3001\u653e\u308a\u51fa\u3059\u306e!?\u305d\u3093\u306a\u306e\u7121\u8cac\u4efb\u3058\u3083\u306a\u3044!!", "\u30af\u30e9\u30a6\u30b9\u3001\u306d\u3047\u3001\u30af\u30e9\u30a6\u30b9\u2026\u2026!!", "\u3057\u3001\u6b7b\u3093\u3060\u3089\u3001\u79c1\u3001\u4e00\u4eba\u3067\u884c\u304f\u304b\u3089\u3063!!\u30af\u30e9\u30a6\u30b9\u306a\u3093\u3066\u2026\u2026\u3063\u3001\u3053\u3053\u306b\u7f6e\u3044\u3066\u884c\u3063\u3061\u3083\u3046\u3093\u3060\u304b\u3089\u306d!?", "\u30cd\u30fc\u30d9\u30eb\u306b\u3001\u5e30\u308c\u306a\u3044\u3057\u3063\u2026\u2026\u3001\u8cb4\u65b9\u306e\u3053\u3068\u77e5\u3089\u306a\u3044\u4eba\u3070\u3063\u304b\u308a\u3060\u304b\u3089\u3001\u304a\u5893\u3060\u3063\u3066\u8352\u308c\u653e\u984c\u306b\u306a\u308b\u308f\uff01\u308f\u305f\u3057\u306e\u8b77\u885b\u3060\u3063\u3066\u3001\u3079\u3064\u306e\u3001\u3072\u3068\u306b\u306a\u308b\u3093\u3060\u304b\u3089\u2026\u2026!!\u3044\u3044\u306e!?", "\u305d\u308c\u306f\u3001\u3053\u307e\u308a\u307e\u3059\u2026\u2026\u306d", "!?", "\u30ed\u30fc\u30bc\u3001\u30de\u30ea\u30fc\u3055\u307e", "\u2026\u2026\u3063", "\u3042\u3041\u3001\u6ce3\u304b\u306a\u3044\u3067\u2026\u2026\u4f53\u304c\u3001\u52d5\u304b\u306a\u3044\u3093\u3067\u3059", "\u3053\u308c\u3058\u3083\u3042\u8cb4\u65b9\u306e\u6d99\u3092\u3001\u62ed\u3048\u307e\u305b\u3093"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/86/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u5ba2\u4eba\u3002", "discourse": ["\u3053\u308a\u3083\u3042\u2026\u2026\u307e\u305a\u3044\u306a", "\u5cf6\u3092\u6839\u57ce\u306b\u3059\u308b\u6d77\u8cca\u5171\u306b\u3084\u3089\u308c\u305f\u306a\uff1f\u3042\u3044\u3064\u7b49\u306e\u6bd2\u3092\u53d7\u3051\u3066\u3001\u3088\u304f\u751f\u304d\u5ef6\u3073\u3066\u3044\u3089\u308c\u308b\u3082\u3093\u3060\u3002\u85ac\u306f\u4f55\u3092\u4f7f\u3063\u305f\uff1f", "\u79c1\u304c\u8abf\u5408\u3057\u305f\u3082\u306e\u3088", "\u304a\u524d\u3055\u3093\u304c\uff1f\u9ad8\u3044\u91d1\u3092\u6255\u3063\u3066\u5546\u4eba\u304b\u3089\u8cb7\u3063\u305f\u85ac\u3092\u3001\u305f\u307e\u305f\u307e\u6301\u3063\u3066\u3044\u305f\u3093\u3058\u3083\u306a\u304f\u3001\u4e00\u304b\u3089\u4f5c\u3063\u305f\u3063\u3066\u306e\u304b\u3044\uff1f", "\u2026\u2026\u5546\u58f2\u67c4\u3001\u85ac\u306f\u5927\u91cf\u306b\u6301\u3063\u3066\u3044\u308b\u304b\u3089\u3002\u9069\u5f53\u306b\u6df7\u305c\u5408\u308f\u305b\u305f\u3060\u3051\u3088", "\u9069\u5f53\u306b\u3001\u304b\u3044\u3002\u305d\u308a\u3083\u3042\u51c4\u3044\u306a\u3002\u307e\u3055\u306b\u795e\u306e\u5fa1\u696d\u3060", "\u3053\u3093\u306a\u9119\u3073\u305f\u753a\u3067\u3001\u51fa\u4f1a\u3048\u308b\u3068\u306f\u601d\u308f\u306a\u304b\u3063\u305f\u3088\u3002\u9577\u751f\u304d\u306f\u3059\u308b\u3082\u306e\u3060\u306a", "\u5149\u6804\u3060\u3051\u3069\u3001\u7121\u99c4\u8a71\u3092\u3057\u3066\u3044\u308b\u6642\u9593\u306f\u306a\u3044\u308f", "\u305d\u3046\u3060\u306a\u3002\u2026\u2026\u3057\u304b\u3057\u3001\u3069\u3046\u3057\u305f\u3082\u3093\u304b", "\u50b7\u53e3\u306e\u5468\u308a\u306e\u58ca\u6b7b\u3057\u304b\u304b\u3063\u3066\u3044\u308b\u90e8\u5206\u3092\u3001\u524a\u304e\u843d\u3068\u3057\u305f\u3044\u3002\u3060\u304c\u306a\u3041\u2026\u2026\u3053\u308c\u4ee5\u4e0a\u3001\u8840\u3092\u5931\u304f\u305b\u3070\u547d\u306b\u95a2\u308f\u308b", "\u60a3\u90e8\u3092\u5207\u308a\u53d6\u3063\u3066\u3001\u3059\u3050\u306b\u8840\u3092\u6b62\u3081\u308b\u65b9\u6cd5\u3067\u3082\u3042\u308c\u3070\u5225\u3060\u304c\u3002\u6d41\u77f3\u306b\u3001\u305d\u3093\u306a\u9b54\u6cd5\u306e\u3088\u3046\u306a\u85ac\u306f\uff1f", "\u306a\u3044\u308f\u306d\u3002\u3067\u3082\u3001\u3084\u308b\u3057\u304b\u306a\u3044\u3067\u3057\u3087\u3046", "\u304a\u3044\u3001\u304a\u524d\u3089\uff01\u6e6f\u3092\u6cb8\u304b\u305b\uff01", "\u30de\u30ea\u30fc\u3001\u30a2\u30f3\u30bf\u306f\u2026\u2026", "\u624b\u4f1d\u3044\u307e\u3059", "\u60a3\u90e8\u3092\u5207\u308a\u843d\u3068\u3059\u306e\u3088\uff1f\u5f53\u7136\u3001\u3055\u3063\u304d\u3088\u308a\u8840\u3060\u3063\u3066\u6d41\u308c\u308b\u308f\u3002\u5206\u304b\u3063\u3066\u308b\uff1f", "\u306f\u3044", "\u2026\u2026\u30a2\u30f3\u30bf\u3063\u3066\u5b50\u306f\u3001\u672c\u5f53\u306b", "\u3044\u3044\u308f\u3001\u5206\u304b\u3063\u305f\u3002\u306a\u3089\u307e\u305a\u6c5a\u308c\u3092\u843d\u3068\u3057\u3066\u3089\u3063\u3057\u3083\u3044", "\u60aa\u3044\u5974\u306b\u306f\u898b\u3048\u306a\u304b\u3063\u305f\u304c\u2026\u2026\u304a\u5b22\u3055\u3093\u306b\u5fc3\u5f53\u305f\u308a\u304c\u306a\u3044\u306a\u3089\u65ad\u3063\u3066\u304a\u304f\u3002\u5ff5\u306e\u305f\u3081\u3001\u30a2\u30f3\u30bf\u306f\u4e00\u4eba\u3067\u884c\u52d5\u3059\u308b\u306a\u3088\u3002\u5371\u306a\u3044\u5974\u3060\u3063\u305f\u3089\u56f0\u308b\u304b\u3089\u306a", "\u3057\u307e\u3063\u305f\u2026\u2026\u3064\u3044\u3001\u4eca\u307e\u3067\u3068\u540c\u3058\u3088\u3046\u306b\u6271\u3063\u3061\u307e\u3063\u305f\u3002\u3054\u7121\u793c\u3092\u3001\u738b\u5973\u6bbf\u4e0b", "\uff01\u6b62\u3081\u3066\u4e0b\u3055\u3044\u3063", "\u59cb\u3081\u308b\u305e", "\u30de\u30ea\u30fc\u69d8\u3063!!", "\uff01\uff1f", "\u30b2\u30aa\u30eb\u30af\u69d8!?", "\u826f\u304b\u3063\u305f\u2026\u2026\u3002\u3054\u7121\u4e8b\u3060\u3063\u305f\u3093\u3067\u3059\u306d", "\u3069\u3046\u3057\u3066\u3001\u8cb4\u65b9\u304c\u3053\u3053\u306b\uff1f", "\u9ce5\u304c\u624b\u7d19\u3092\u904b\u3093\u3067\u304d\u305f\u3093\u3067\u3059\u3088\u3002\u8cb4\u65b9\u306e\u4e57\u308b\u8239\u304c\u6d77\u8cca\u306b\u8972\u308f\u308c\u3001\u6025\u907d\u3001\u3053\u306e\u6e2f\u3092\u76ee\u6307\u3059\u3068", "\u2026\u2026\u9ce5\uff1f", "\u30de\u30ea\u30fc\u3001\u611f\u52d5\u306e\u518d\u4f1a\u306f\u5f8c\u3067\u3084\u3063\u3066\u3002\u305d\u306e\u8272\u7537\u3092\u8ffd\u3044\u51fa\u3057\u3066\u9802\u6234", "\u3059\u307f\u307e\u305b\u3093\uff01", "\u30b2\u30aa\u30eb\u30af\uff1f", "\u305d\u306e\u6cbb\u7642\u3001\u5f85\u3063\u3066\u4e0b\u3055\u3044", "\u4eba\u306e\u751f\u6b7b\u304c\u304b\u304b\u3063\u3066\u3044\u308b\u3082\u306e\u3092\u3001\u5f85\u3066\uff1f\u30a2\u30f3\u30bf\u306f\u4f55\u69d8\u306a\u306e\u3002\u795e\u69d8\uff1f\u4eba\u306e\u904b\u547d\u3092\u5909\u3048\u3089\u308c\u308b\u306e\u304b\u3057\u3089", "\u3063\uff01", "\u795e\u3067\u306f\u3042\u308a\u307e\u305b\u3093\u3002\u50d5\u306f\u5927\u3057\u305f\u7279\u6280\u3082\u6301\u305f\u306a\u3044\u3001\u305f\u3060\u306e\u30ac\u30ad\u3060\u3002\u2026\u2026\u3067\u3059\u304c\u3001\u5f7c\u306a\u3089\u5909\u3048\u3089\u308c\u308b\u304b\u3082\u3057\u308c\u306a\u3044", "\u2026\u2026\u5f7c\uff1f", "\u3053\u3053\u307e\u3067\u3067\u3001\u3044\u3044\u3088", "\u3067\u3082\u3001\u30df\u30cf\u30a4\u30eb\u2026\u2026", "\u3082\u3046\u5927\u4e08\u592b\u3060\u304b\u3089\u3002\u3042\u308a\u304c\u3068\u3001\u59c9\u3055\u3093", "\u738b\u5973\u69d8", "\u8cb4\u65b9\u306b\u3001\u79d8\u5bc6\u306b\u3057\u3066\u3044\u305f\u3053\u3068\u304c\u3042\u308b\u3093\u3060", "\u3048\uff1f", "\u30aa\u30ec\u306f\u3001\u5730\u5c5e\u6027\u306e\u9b54\u5c0e\u5e2b\u3002\u305d\u308c\u306f\u3001\u77e5\u3063\u3066\u307e\u3059\u3088\u306d", "\u653b\u6483\u9b54\u6cd5\u306e\u4f7f\u3048\u306a\u3044\u9b54\u5c0e\u5e2b\u304c\u3001\u4f7f\u3048\u308b\u9b54\u6cd5\u306f\u306a\u3093\u3060\u3068\u601d\u3044\u307e\u3059\uff1f", "\u30aa\u30ec\u304c\u3001\u8cb4\u65b9\u306e\u5927\u5207\u306a\u4eba\u3092\u52a9\u3051\u307e\u3059\u3002\u2026\u2026\u305d\u306e\u305f\u3081\u306b\u3001\u3053\u3053\u306b\u3044\u308b"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/85/", "subtitle": "\u5b50\u7235\u4ee4\u5b22\u306e\u9a5a\u6115\u3002", "discourse": ["\u304a\u3044\u3001\u898b\u3048\u305f\u305e\uff01\u3082\u3046\u3059\u3050\u3060", "\u3082\u3046\u3059\u3050\u3060\u3063\u3066\u3001\u30af\u30e9\u30a6\u30b9", "\u9811\u5f35\u3063\u3066", "\u547d\u304c\u60dc\u3057\u3051\u308c\u3070\u3001\u5373\u523b\u7acb\u3061\u53bb\u308c", "\u753a\u306b\u5165\u308c\u3066\u304f\u308c\uff01\u602a\u6211\u4eba\u304c\u3044\u308b\u3093\u3060\uff01", "\u65ad\u308b\u3002\u602a\u3057\u3044\u8239\u3092\u5165\u308c\u308b\u3088\u3046\u306a\u99ac\u9e7f\u306a\u771f\u4f3c\u3001\u8ab0\u304c\u3059\u308b\u304b", "\u5165\u6e2f\u8a31\u53ef\u8a3c\u306a\u3089\u3042\u308b\uff01\u2026\u2026\u3053\u3053\u3067\u306f\u306a\u304f\u3001\u30d6\u30e9\u30aa\u306e\u3060\u304c\u3002\u6d77\u8cca\u306b\u8972\u308f\u308c\u3066\u3001\u602a\u6211\u4eba\u304c\u3044\u308b\u3002\u983c\u3080\u3001\u52a9\u3051\u3066\u304f\u308c", "\u5c1a\u66f4\u3060\u3002\u3068\u3063\u3068\u3068\u51fa\u3066\u884c\u3051\uff01\u6d77\u8cca\u304c\u304a\u524d\u3089\u3092\u8ffd\u3063\u3066\u6765\u305f\u3089\u3001\u3069\u3046\u8cac\u4efb\u3092\u53d6\u3063\u3066\u304f\u308c\u308b\u3093\u3060\uff01\uff1f", "\u304b\u3001\u6d77\u8cca\u306a\u3089\u7686\u6b7b\u3093\u3060\u308f\u3088\u2026\u2026\uff01", "\u8155\u306e\u7acb\u3064\u9a0e\u58eb\u304c\u5076\u7136\u4e57\u3063\u3066\u3044\u3066\u3001\u5168\u54e1\u5012\u3057\u3066\u304f\u308c\u305f\u308f\u3002\u8239\u3082\u71c3\u3048\u305f\u304b\u3089\u3001\u8ffd\u3063\u3066\u304f\u308b\u5fc3\u914d\u3082\u306a\u3044\u308f\u3088", "\u3060\u304b\u3089\u3001\u304a\u9858\u3044\u3002\u79c1\u9054\u3092\u53d7\u3051\u5165\u308c\u3066", "\u305d\u308c\u3092\u8a3c\u660e\u51fa\u6765\u308b\u306e\u304b", "\u305d\u308c\u306f\u2026\u2026", "\u3055\u3063\u3055\u3068\u5e30\u3093\u306a\u3002\u53ef\u611b\u3089\u3057\u3044\u304a\u5b22\u3061\u3083\u3093", "\u304b\u3001\u5e30\u3089\u306a\u3044\u308f\uff01", "\u308f\u305f\u3001\u308f\u305f\u304f\u3057\u306f\u3001\u30b0\u30e9\u30fc\u30c4\u7537\u7235\u5bb6\u306e\u9577\u5973\u3001\u30d5\u30ed\u30fc\u30e9\u30fb\u30d5\u30a9\u30f3\u30fb\u30b0\u30e9\u30fc\u30c4\u3067\u3059\u306e\u3088\uff01", "\u79c1\u3092\u62d2\u7d76\u3057\u3066\u3001\u8a31\u3055\u308c\u308b\u3068\u3067\u3082\u601d\u3063\u3066\u3044\u308b\u306e\uff1f", "\u2026\u2026\u3078\u3048\u3001\u826f\u3044\u8eab\u306a\u308a\u306e\u304a\u5b22\u3061\u3083\u3093\u3060\u3068\u601d\u3063\u305f\u304c\u3001\u304a\u8cb4\u65cf\u69d8\u304b\u3044", "\u3067\uff1f\u4ed6\u56fd\u306e\u304a\u8cb4\u65cf\u69d8\u304c\u3001\u306a\u3093\u3060\u3063\u3066\u3093\u3060\uff1f", "\u2026\u2026\u3063\u3001\u79c1\u306e\u5927\u53d4\u6bcd\u69d8\u306f\u3001\u30a2\u30a4\u30b2\u30eb\u4faf\u7235\u5bb6\u306b\u7e01\u306e\u3042\u308b\u65b9\u3067", "\u305d\u308a\u3083\u51c4\u3044\u3002\u3060\u304c\u3001\u305d\u308c\u3060\u3051\u3060", "\u30d5\u30e9\u30f3\u30e1\u306e\u8cb4\u65cf\u306a\u3089\u3001\u7121\u8996\u3059\u308c\u3070\u5f8c\u3005\u9762\u5012\u306a\u4e8b\u306b\u306a\u308b\u306e\u3082\u5206\u304b\u308b\u3002\u3060\u304c\u3001\u3042\u3093\u305f\u3089\u306f\u7570\u56fd\u306e\u6c11\u3060\u3002\u9060\u304f\u96e2\u308c\u305f\u56fd\u306b\u307e\u3067\u5e72\u6e09\u51fa\u6765\u308b\u307b\u3069\u306e\u529b\u304c\u3001\u3042\u3093\u305f\u306e\u5bb6\u306b\u306f\u3042\u308b\u306e\u304b\uff1f", "\u2026\u2026\u3063\u3001\u308f\u305f\u304f\u3057\u3001\u306f\u2026\u2026", "\u7537\u7235\u3060\u308d\u3046\u3068\u4faf\u7235\u3060\u308d\u3046\u3068\u3001\u77e5\u3063\u305f\u3053\u3068\u304b\u3002\u3053\u3063\u3061\u306f\u751f\u6d3b\u304c\u304b\u304b\u3063\u3066\u308b\u3093\u3060\u3002\u3069\u3046\u3057\u3066\u3082\u8a00\u3046\u3053\u3068\u3092\u805e\u304b\u305b\u305f\u3044\u3063\u3066\u3093\u306a\u3089\u3001\u305b\u3081\u3066\u738b\u65cf\u3067\u3082\u9023\u308c\u3066\u304f\u308b\u3093\u3060\u306a\uff01\u305d\u3046\u3057\u305f\u3089\u3001\u533b\u8005\u3067\u3082\u4f55\u3067\u3082\u547c\u3093\u3067\u3084\u308b\u3088\uff01", "\u305d\u306e\u8a00\u8449\u3001\u4e8c\u8a00\u306f\u3054\u3056\u3044\u307e\u305b\u3093\u306d", "\u2026\u2026\u306a\u3001", "\u738b\u65cf\u306e\u9858\u3044\u3067\u3042\u308c\u3070\u3001\u805e\u304d\u5c4a\u3051\u3066\u4e0b\u3055\u308b\u3068\u3001\u8cb4\u65b9\u306f\u305d\u3046\u4ef0\u3063\u305f\u3002\u9593\u9055\u3044\u3054\u3056\u3044\u307e\u305b\u3093\u304b", "\u305d\u3001\u305d\u308c\u304c\u3069\u3046\u3057\u305f!?", "\u9593\u9055\u3044\u3001\u3054\u3056\u3044\u307e\u305b\u3093\u304b", "\u3063\u3001\u2026\u2026\u8a00\u3063\u305f\u3002\u305d\u308c\u304c\u306a\u3093\u3060\u3063\u3066\u3093\u3060!?", "\u8a00\u8cea\u306f\u3068\u308a\u307e\u3057\u305f\u3088", "\u30cd\u30fc\u30d9\u30eb\u306e\u738b\u65cf\u306e\u7279\u5fb4\u3001\u3054\u5b58\u77e5\u3067\u3057\u3087\u3046\u304b\uff1f", "\u305d\u308c\u306f\u3001\u2026\u2026\u5f53\u305f\u308a\u524d\u3060\u308d", "\u7b2c\u4e00\u738b\u5973\u306b\u3064\u3044\u3066\u3082\uff1f", "\u305d\u308a\u3083\u305d\u3046\u3060\u308d\u3002\u5c06\u6765\u306f\u50be\u56fd\u306e\u7f8e\u59eb\u3001\u9593\u9055\u3044\u306a\u3057\u3068\u8a00\u308f\u308c\u3066\u3044\u308b\u65b9\u3060\u305e", "\u3069\u3093\u306a\u3063\u3066\u3001\u78ba\u304b\u2026\u2026\u767d\u3044\u808c\u306b", "\u9752\u3044\u77b3\u3067", "\u6ce2\u6253\u3064\u3001\u592a\u967d\u306e\u3088\u3046\u306a\u30d6\u30ed\u30f3\u30c9\u2026\u2026", "\u30cd\u30fc\u30d9\u30eb\u738b\u56fd\u7b2c\u4e00\u738b\u5973\u3001\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u30fb\u30d5\u30a9\u30f3\u30fb\u30f4\u30a7\u30eb\u30d5\u30a1\u30eb\u30c8\u3068\u7533\u3057\u307e\u3059", "\u3063\u3001\u30a2\u30f3\u30bf\u304c\u3001\u738b\u5973\u69d8\u3060\u3063\u3066\u8a3c\u62e0\u306f\u3042\u308b\u306e\u304b!?", "\u3060\u3001\u3060\u3063\u305f\u3089\uff01", "\u3067\u3059\u304c", "\u79c1\u304c\u672c\u7269\u3060\u3063\u305f\u5834\u5408\u3001\u8cb4\u65b9\u306f\u8cac\u4efb\u304c\u53d6\u308c\u308b\u306e\u3067\u3059\u304b\uff1f\u30ed\u30fc\u30bc\u30de\u30ea\u30fc\u30fb\u30d5\u30a9\u30f3\u30fb\u30f4\u30a7\u30eb\u30d5\u30a1\u30eb\u30c8\u306e\u5927\u5207\u306a\u4eba\u3092\u898b\u6bba\u3057\u306b\u3057\u305f\u3001\u91cd\u5927\u306a\u7f6a\u3092\u8d16\u3048\u308b\u3068\uff1f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/84/", "subtitle": "\u8ee2\u751f\u738b\u5973\u306e\u8ff7\u3044\u3002", "discourse": ["\u2026\u2026\u30af\u30e9\u3001\u30a6\u30b9", "\u2026\u2026\u30af\u30e9\u30a6\u30b9\uff1f", "\u30af\u30e9\u30a6\u30b9\u3001\u2026\u2026\u30af\u30e9\u30a6\u30b9\u30c3!!", "\u30de\u30ea\u30fc\uff01", "\u30f4\u30a9\u30eb\u30d5\u3001\u3055\u3093", "\u305d\u3046\u3088", "\u30de\u30ea\u30fc\u3001\u30a2\u30f3\u30bf\u306e\u304a\u5144\u3061\u3083\u3093\u306b\u4f55\u304b\u565b\u307e\u305b\u3066", "\u3048\u2026\u2026\uff1f", "\u3053\u308c\u3067\u3044\u3044\uff1f", "\u77e2\u3092\u5f15\u304d\u629c\u304f\u308f", "\u2026\u2026\u51fa\u8840\u304c\u9177\u304f\u306a\u308b\u308f\u3088\u3002\u6813\u4ee3\u308f\u308a\u306b\u3057\u3066\u304a\u304b\u306a\u304f\u3066\u3044\u3044\u306e\uff1f", "\u6bd2\u3088", "\u8ab0\u304b\u3001\u79c1\u306e\u90e8\u5c4b\u304b\u3089\u8377\u7269\u6301\u3063\u3066\u304d\u3066\uff01\u3042\u3068\u6c34\u3068\u6e05\u6f54\u306a\u5e03\u3001\u305d\u308c\u304b\u3089\u6e6f\u3082\u6cb8\u304b\u3057\u3066\u9802\u6234\uff01", "\u62bc\u3055\u3048\u3066\u3044\u3066\uff01", "\u3042\u3001\u3042\u2026\u2026", "\u308f\u305f\u3001\u308f\u305f\u3057\u306e\u305b\u3044\u3001\u2026\u2026\u79c1\u306e\u3001\u305b\u3044\u3067\u3063", "\u3054\u3081\u3093\u306a\u3055\u3001\u2026\u2026\u3054\u3081\u3093\u306a\u3055\u3044\u2026\u2026\u3063", "\u30de\u30ea\u30fc\uff01", "\u2026\u2026\u2026\u2026", "\u7d04\u675f\u3057\u305f\u306e\u306b\u3001\u30a2\u30f3\u30bf\u306e\u5927\u5207\u306a\u4eba\u3092\u8b77\u308a\u304d\u308c\u306a\u304f\u3066\u3054\u3081\u3093\u306a\u3055\u3044", "\u3067\u3082\u3001\u7d76\u5bfe\u306b\u6b7b\u306a\u305b\u306a\u3044\u3002\u2015\u2015\u30f4\u30a9\u30eb\u30d5\u30fbK\u30fb\u30ea\u30e5\u30c3\u30ab\u30fc\u306e\u540d\u306b\u304a\u3044\u3066\u8a93\u304a\u3046", "\u2026\u2026\u3057\u306a\u306a\u3044\uff1f", "\uff01\u3042\u3042\u3001\u4eca\u5ea6\u3053\u305d\u7d04\u675f\u306f\u5b88\u308b", "\u30af\u30e9\u30a6\u30b9\u2026\u2026", "\u304a\u3044\u5144\u3061\u3083\u3093\uff01\u8377\u7269\u3063\u3066\u3053\u308c\u304b!?", "\u305d\u3046\u3088\u3001\u3042\u308a\u304c\u3068\u3046\uff01", "\u624b\u5143\u3001\u7167\u3089\u3057\u3066\u304f\u308c\u308b\uff1f", "\u304a\u3044\uff01\u677e\u660e\u6301\u3063\u3066\u6765\u3044\uff01", "\u3053\u306e\u6d77\u57df\u306e\u6d77\u8cca\u306e\u4f7f\u3046\u6bd2\u306f\u3001\u304a\u305d\u3089\u304f\u9b5a\u3068\u690d\u7269\u306e\u6df7\u5408\u3002\u81ed\u3044\u3068\u5473\u304b\u3089\u3057\u3066\u2026\u2026", "\u6e6f\u304c\u6cb8\u3044\u305f\u305e\uff01", "\u5b22\u3061\u3083\u3093\u3001\u6ce3\u304b\u306a\u3044\u3067\u304f\u308c\u3002\u5927\u4e08\u592b\u3060\u3002\u30a2\u30f3\u30bf\u306e\u5144\u3061\u3083\u3093\u304c\u52a9\u304b\u308b\u3088\u3046\u306b\u3001\u7686\u9811\u5f35\u3063\u3066\u308b\u304b\u3089\u306a", "\u2026\u2026\u3069\u3001\u3057\u3066", "\u3093\uff1f", "\u3069\u3046\u3057\u3066\u3001\u52a9\u3051\u3066\u304f\u308c\u308b\u306e\uff1f", "\u30aa\u30ec\u9054\u304c\u5b22\u3061\u3083\u3093\u306b\u3001\u3069\u308c\u3060\u3051\u52a9\u3051\u3089\u308c\u305f\u3068\u601d\u3063\u3066\u3093\u3060\u3002\u4eca\u3001\u6069\u3092\u8fd4\u3055\u306a\u3044\u3067\u3044\u3064\u8fd4\u3059\uff1f", "\u3048\u2026\u2026", "\u305d\u308c\u306b\u306a\u3001\u30a2\u30f3\u30bf\u306e\u5144\u3061\u3083\u3093\u306f\u30aa\u30ec\u7b49\u3092\u52a9\u3051\u306a\u304c\u3089\u6226\u3063\u3066\u304f\u308c\u305f\u3002\u3042\u3093\u306a\u5207\u7fbd\u8a70\u307e\u3063\u305f\u72b6\u6cc1\u3067\u306a\u3002\u3053\u306e\u8239\u306b\u4e57\u3063\u3066\u308b\u5974\u7b49\u306f\u7686\u3001\u30a2\u30f3\u30bf\u9054\u5144\u59b9\u306b\u8fd4\u3057\u304d\u308c\u306a\u3044\u304f\u3089\u3044\u306e\u6069\u304c\u3042\u308b\u3093\u3060\u3088", "\u3042\u306e\uff01\u4f7f\u3063\u3066\u306a\u3044\u5e03\u3092\u6301\u3063\u3066\u6765\u307e\u3057\u305f\uff01", "\u304a\u5b22\u3055\u3093\u3001\u9854\u8272\u304c\u60aa\u3044\u305e\u3002\u4f53\u304c\u51b7\u3048\u305f\u3093\u3058\u3083\u306a\u3044\u304b\uff1f\u8ab0\u304b\u6bdb\u5e03\u3092\u6301\u3063\u3066\u6765\u3066\u304f\u308c\uff01", "\u2026\u2026\u3063\u3001", "\u30f4\u30a9\u30eb\u30d5\u3055\u3093\u3001\u624b\u4f1d\u3044\u307e\u3059", "\u30de\u30ea\u30fc\u2026\u2026\u30a2\u30f3\u30bf\u3001", "\u3082\u3046\u5927\u4e08\u592b\u3067\u3059\u304b\u3089", "\u306a\u3089\u3001\u6e6f\u3092\u5c11\u3057\u51b7\u307e\u3057\u3066\u50b7\u53e3\u3092\u6d17\u3063\u3066", "\u306f\u3044\uff01", "\u2026\u2026\u30d5\u30ed\u30fc\u30e9\u3055\u3093", "\u2026\u2026\u3048\u3001", "\u305d\u3053\u306e\u5305\u5e2f\u3001\u53d6\u3063\u3066\u4e0b\u3055\u3044", "\u2026\u2026\u308f\u305f\u3057\uff1f", "\u305d\u3046\u3001\u624b\u4f1d\u3063\u3066", "\u30af\u30e9\u30a6\u30b9\u3092\u52a9\u3051\u305f\u3044\u306e\u3002\u304a\u9858\u3044", "\uff01\u2026\u2026\u3063\u3001\u308f\u304b\u3063\u305f", "\u50b7\u53e3\u3092\u585e\u3044\u3060\u3089\u3001\u4f53\u3092\u51b7\u3084\u3055\u306a\u3044\u3088\u3046\u306b\u3057\u3066", "\u5206\u304b\u308a\u307e\u3057\u305f"]}
