\u3089\u306e\u8272\u5f69\u2026\u2026\u5144\u306e\u6587\u306b\u3042\u3063\u305f\u9b54\u5c0e\u5e2b\u306e\u5b50\u7b49\u3068\u540c\u3058", "\u2026\u2026", "\u3069\u3046\u3057\u3066\u5f7c\u7b49\u304c\u62d8\u675f\u3055\u308c\u3066\u3044\u308b\uff1f\u4f55\u6545\u304a\u524d\u306f\u3001\u8cca\u3068\u5171\u306b\u3044\u308b\u306e\u3060\uff1f\u7b54\u3048\u3088\u3001\u30cb\u30af\u30e9\u30b9\u30fb\u30d5\u30a9\u30f3\u30fb\u30d3\u30e5\u30fc\u30ed\u30fc\uff01", "\u2026\u2026\u3044", "\u2026\u2026\u58f2\u56fd\u5974\u306b\u6210\u308a\u4e0b\u304c\u3063\u305f\u304b\u3002\u7531\u7dd2\u6b63\u3057\u304d\u4f2f\u7235\u5bb6\u306e\u8de1\u53d6\u308a\u304c", "\u2026\u2026\u3063\u3001\u7169\u3044!!\u7169\u3044\u7169\u3044\u7169\u3044!!", "\uff01", "\u8cb4\u69d8\u2026\u2026!!", "\u52d5\u304f\u306a!!\u3053\u306e\u30ac\u30ad\u304c\u3069\u3046\u306a\u3063\u3066\u3082\u3044\u3044\u306e\u304b\uff01", "\u304a\u524d\u3082\u6765\u3044\uff01", "\u3053\u3044\u3064\u7b49\u306e\u547d\u304c\u60dc\u3057\u3051\u308c\u3070\u3001\u8fd1\u4ed8\u304f\u306a!!", "\u7169\u3044\u306a\u3041\u2026\u2026\u8033\u5143\u3067\u53eb\u3070\u306a\u3044\u3067\u3088", "\u2026\u2026\u304a\u524d\u3063!!", "\u3066\u3086\u3046\u304b\u30a2\u30f3\u30bf\u3001\u99ac\u9e7f\u306a\u306e\uff1f\u30aa\u30ec\u9054\u307b\u3069\u4eba\u8cea\u306b\u5411\u304b\u306a\u3044\u4eba\u9593\u3001\u305d\u3046\u3044\u306a\u3044\u3068\u601d\u3046\u3093\u3060\u3051\u3069", "\u306a\u3063!?", "\u4f55\u3067\u9b54\u6cd5\u304c\u2026\u2026\u3063!?\u5236\u5fa1\u88c5\u7f6e\u3092\u4ed8\u3051\u3089\u308c\u3066\u3044\u308b\u306e\u3067\u306f\u7121\u304b\u3063\u305f\u306e\u304b!?", "\u3042\u3042\u3001\u30b3\u30ec\uff1f", "\u898b\u3066\u306e\u901a\u308a\u3001\u507d\u7269", "\u3046\u308f\u3041\u3042\u3042\u3042\u3042\u3063!!", "\u4e00\u4eba\u3067\u5148\u306b\u66b4\u308c\u3093\u306a\u3088", "\u2026\u2026\u3072\u3043\u3063!!", "\u3053\u3001\u3053\u3044\u3064\u3089\u2026\u2026\u5316\u3051\u7269\u3060\u2026\u2026!!", "\u5316\u3051\u7269\uff1f\u4eca\u66f4\u3060\u306a", "\u305d\u306e\u5316\u3051\u7269\u3092\u3054\u6240\u671b\u3060\u3063\u305f\u3093\u3067\u3057\u3087\uff1f\u30a2\u30f3\u30bf\u9054\u306e\u3054\u4e3b\u4eba\u69d8\u306f"]}
{"title": "\u8056\u5973\u306e\u9b54\u529b\u306f\u4e07\u80fd\u3067\u3059", "url": "https://ncode.syosetu.com/n7995ce/23/", "subtitle": "\u9b54\u5c0e\u5e2b\u9054\u306e\u596e\u95d8\u3002", "discourse": ["\u2026\u2026\u6d3e\u624b\u306b\u3084\u3063\u3066\u3093\u306a\u3041", "\u2026\u2026\u6d3e\u624b\u306b\u3084\u3063\u3066\u3093\u306a\u3041", "\u30eb\u30c3\u30c4\u2026\u2026\u59eb\u69d8\u306b\u306f\u3001\u304a\u524d\u306e\u30b1\u30c4\u4e8b\u60c5\u306b\u3064\u3044\u3066\u306f\u3001\u6df1\u304f\u7a81\u3063\u8fbc\u307e\u306a\u3044\u3067\u3084\u3063\u3066\u304f\u308c\u3063\u3066\u8a00\u3063\u3068\u304f\u304b\u3089", "\u305d\u306e\u524d\u306b\u30aa\u30ec\u304c\u304a\u524d\u306e\u30b1\u30c4\u306b\u6c37\u67f1\u3092\u7a81\u3063\u8fbc\u3093\u3067\u3084\u308b\u3088", "\u7121\u99c4\u306a\u62b5\u6297\u3059\u308b\u304b\u3089\u3001\u75db\u3044\u76ee\u898b\u308b\u3093\u3060\u308d\u3002\u5927\u4eba\u3057\u304f\u3057\u3066\u308d\u3002\u3069\u3046\u305b\u9b54\u6cd5\u306e\u4f7f\u3048\u306a\u3044\u30aa\u30ec\u9054\u3058\u3083\u3001\u9003\u3052\u51fa\u3059\u4e8b\u306a\u3093\u3066\u51fa\u6765\u306d\u3048\u3093\u3060\u304b\u3089\u3055", "\u7169\u3044\u3002\u30aa\u30ec\u306b\u6307\u56f3\u3059\u308b\u306a", "\u4f59\u8a08\u306a\u624b\u9593\u3092\u304b\u3051\u3055\u305b\u308b\u306a", "\u3069\u3046\u305b\u4f55\u51e6\u306b\u3082\u3001\u304a\u524d\u3089\u306e\u5c45\u5834\u6240\u306f\u7121\u3044\u3093\u3060\u3002\u305b\u3044\u305c\u3044\u98fc\u3044\u4e3b\u306b\u5a9a\u3092\u58f2\u3063\u3066\u3001\u53ef\u611b\u304c\u3063\u3066\u3082\u3089\u3063\u305f\u65b9\u304c\u5f97\u3060\u308d\u3046", "\u2026\u2026\u305d\u30fc\u3063\u3059\u306d\u3002\u98fc\u3044\u72ac\u306f\u98fc\u3044\u72ac\u3089\u3057\u304f\u3001\u4e3b\u4eba\u306e\u70ba\u306b\u9811\u5f35\u3063\u3066\u50cd\u3053\u3046\u3068\u601d\u3044\u307e\u3059", "\u3044\u3044\u5fc3\u304c\u3051\u3060\u306a", "\u3058\u3083\u3042\u59eb\u306f\u2026\u2026\u305a\u3063\u3068\u30aa\u30ec\u9054\u3092\u5b88\u3063\u3066\u3044\u305f\u306e", "\u60c5\u3051\u306d\u3047\u2026\u2026", "\u4f55\u6545\u2026\u2026\u4f55\u6545\u3001\u59eb\u306b\u305d\u3093\u306a\u5f79\u76ee\u3092\u4efb\u305b\u305f\u3093\u3067\u3059\u304b\u2026\u2026\uff01\u8a00\u3063\u3066\u3044\u305f\u3060\u3051\u308c\u3070\u81ea\u5206\u306e\u8eab\u4f4d\u3001\u81ea\u5206\u3067\u5b88\u3063\u305f\u306e\u306b!!", "\u843d\u3061\u7740\u3051\u30eb\u30c3\u30c4\u3002\u305d\u3093\u306a\u7c21\u5358\u306a\u30e2\u30f3\u3058\u3083\u306d\u3048\u3063\u3066\u5206\u304b\u308b\u3060\u308d", "\u2026\u2026\u3063", "\u2026\u2026\u7d50\u679c\u7684\u306b\u59b9\u3092\u5229\u7528\u3057\u305f\u4e8b\u306b\u306a\u308b\u306e\u306f\u8a8d\u3081\u308b\u304c\u3001\u547d\u3058\u3066\u306f\u3044\u306a\u3044", "\u304a\u524d\u9054\u306e\u4e8b\u3092\u6c17\u306b\u304b\u3051\u3066\u3084\u308c\u3068\u306f\u8a00\u3063\u305f\u304c\u3001\u305d\u308c\u4ee5\u4e0a\u306e\u4e8b\u306f\u4f55\u3082\u8a00\u3063\u3066\u3044\u306a\u3044\u3002\u305d\u3082\u305d\u3082\u3001\u56fd\u5bb6\u898f\u6a21\u306e\u4e89\u3044\u306b\u767a\u5c55\u3057\u304b\u306d\u306a\u3044\u91cd\u5927\u306a\u60c5\u5831\u3092\u3001\u5e7c\u3044\u738b\u5973\u306b\u4f1d\u3048\u308b\u8a33\u304c\u7121\u3044\u3060\u308d\u3046", "\u2026\u2026", "\u3042\u308c\u306f\u3001\u8061\u3044\u3002\u305d\u3057\u3066\u884c\u52d5\u529b\u3082\u3042\u308b\u3002\u8ab0\u304b\u306b\u547d\u3058\u3089\u308c\u305a\u3068\u3082\u5df1\u306e\u982d\u3067\u5224\u65ad\u3057\u3001\u6700\u5584\u306e\u7d50\u679c\u3092\u51fa\u305b\u308b\u3088\u3046\u306b\u52d5\u304f\u4e8b\u304c\u51fa\u6765\u308b\u3002\u6642\u6298\u3001\u672a\u6765\u307e\u3067\u898b\u901a\u305b\u3066\u3044\u308b\u306e\u3067\u306f\u306a\u3044\u304b\u3068\u99ac\u9e7f\u99ac\u9e7f\u3057\u3044\u932f\u899a\u3092\u3057\u305d\u3046\u306b\u306a\u308b\u7a0b\u306b\u3001\u512a\u79c0\u306a\u59b9\u3060\u3002\u2026\u2026\u4eca\u56de\u306e\u4e8b\u306f\u305d\u306e\u512a\u79c0\u3055\u304c\u88cf\u76ee\u306b\u51fa\u3066\u3001\u5dfb\u304d\u8fbc\u307e\u308c\u306a\u304f\u3066\u3082\u3044\u3044\u4e89\u3044\u306b\u3001\u5dfb\u304d\u8fbc\u307e\u308c\u3066\u3057\u307e\u3063\u305f\u3093\u3060\u304c\u306a", "\u305d\u3057\u3066\u66f4\u306b\u9762\u5012\u306a\u4e8b\u306b\u3001\u56fd\u738b\u306b\u307e\u3067\u76ee\u3092\u4ed8\u3051\u3089\u308c\u305d\u3046\u306b\u306a\u3063\u3066\u3044\u308b", "\u56fd\u738b\u3063\u3066\u3001\u307e\u3055\u304b\u2026\u2026!?", "\u9055\u3046\u3002\u30b9\u30b1\u30eb\u30c4\u3067\u306f\u306a\u304f\u3001\u6211\u304c\u56fd\u306e\u738b\u3060", "\u6211\u304c\u56fd\u306e\u3001\u3068\u8a00\u3046\u4e8b\u306f\u3001\u8cb4\u65b9\u9054\u306e", "\u305d\u3046\u3060\u306a\u3002\u7236\u3060", "\u3060\u304c\u3042\u306e\u4eba\u306b\u3068\u3063\u3066\u79c1\u9054\u306f\u3001\u5b50\u4f9b\u3067\u306f\u306a\u304f\u3001\u8840\u304c\u7e4b\u304c\u3063\u305f\u90e8\u4e0b\u306b\u904e\u304e\u306a\u3044\u3002\u4f7f\u3048\u305d\u3046\u306a\u3089\u3070\u6d3b\u7528\u3057\u3001\u305d\u308c\u4ee5\u5916\u306f\u6368\u3066\u7f6e\u304f\u3002\u2026\u2026\u4f7f\u3048\u306a\u3044\u3068\u5224\u65ad\u3055\u308c\u3066\u3044\u308b\u4f4d\u306e\u65b9\u304c\u3001\u59b9\u306e\u70ba\u306b\u306f\u826f\u304b\u3063\u305f\u3093\u3060\u304c", "\u4f7f\u3048\u308b\u3063\u3066\u2026\u2026\u59eb\u306b\u4f55\u3092\u3055\u305b\u308b\u6c17\u306a\u3093\u3067\u3059\u304b", "\u990c\u3060", "\u2026\u2026\u306f!?", "\u6575\u5074\u306e\u72d9\u3044\u306f\u541b\u9054\u4e8c\u4eba\u3002\u3060\u304c\u541b\u9054\u3092\u610f\u306e\u307e\u307e\u306b\u64cd\u308b\u306b\u306f\u3001\u4eba\u8cea\u304c\u5fc5\u8981\u3060\u3002\u4eca\u306e\u3068\u3053\u308d\u79c1\u306e\u76ee\u306b\u3082\u3001\u59b9\u4ee5\u4e0a\u306e\u9069\u4efb\u306f\u3044\u306a\u3044\u3088\u3046\u306b\u898b\u3048\u308b", "\u306a\u3001\u3093\u3067\u3059\u304b\u3001\u305d\u308c", "\u2026\u2026\u3064\u307e\u308a\u59eb\u69d8\u3092\u6d5a\u308f\u305b\u3066\u3001\u738b\u5973\u596a\u9084\u306e\u5927\u7fa9\u540d\u5206\u306e\u5143\u306b\u4e00\u7db2\u6253\u5c3d\u306b\u3059\u308b\u3063\u3066\u4e8b\u3067\u3059\u304b", "\u2026\u2026\u843d\u3061\u7740\u304d\u306a\u3055\u3044\u3002\u99ac\u9e7f\u5f1f\u5b50", "\u2026\u2026\u3063!?", "\